(1369, 0, 0, 'THE EARGASM SILET! GIG...', 'Essai tentang sebuah perusahaan rekaman yang kini kian terlupakan, Lokananta.', '<p style=''text-align: justify;''>Seakan hilang ditelan zaman, begitulah sebuah namaÂ  Lokananta , semakin sedikit yang tahu, apalagi mengenal perusahaan rekaman musik pertama Indonesia milik negara yang terletak di Solo. </p><p style=''text-align: justify;''>Lokananta dirintis dua pegawai Radio Republik Indonesia (RRI) Surakarta, Oetojo Soemowidjojo dan Raden Ngabehi Soegoto Soerjodipoero tahun 1950. Namun, pabrik piringan hitam pertama ini baru resmi berdiri dengan nama Pabrik Piringan Hitam Lokananta, Jawatan Radio Kementrian Penerangan RI di Surakarta pada 29 Oktober 1956.Â  </p><p style=''text-align: justify;''>Sekitar empat puluh ribu keping piringan hitam kini tersimpan dalam rak-rak di salah satu ruang berukuran di kompleks Lokananta dari lagu daerah, lagu hiburan (pop), keroncong, wayang, gending Jawa, hingga pidato kenegaraan. Itu belum termasuk ribuan piringan hitam yang tak terdata dan tak terselamatkan.Â  Kini Lokananta kondisinya antara hidup dan mati. Banyaknya alat-alat yang rusak karena kurangnya sumber daya manusia, serta tak sedikit juga barang-barang yang hilang. Ditambah, Lokananta tak lagi mendapat dukungan dana yang memadai dari Pemerintah. Meski demikian, kegiatan recording, penggandaan kaset dan remastering (memindahkan isi rekaman dalam pita reel yang masih dalam bentuk analog ke digital di komputer) masih rutin dilakukan.</p><p style=''text-align: justify;''>Untuk bertahan hidup, karyawan hanya mengandalkan jasa rekam lagu-lagu lama, namun tentu saja tidak memadai hasilnya upaya lainnya pun terpaksa dilakukan seperti pemanfaatan sebagian properti untuk usaha futsal, studio band, dan disewakan sebagan ruangan untuk sebuah kantor asuransi. Ironis memang. Bahkan ketika saya bertanya kepada sekumpulan siswa SMA yang sedang main futsal, di mana letak studio recording, tak satupun dari mereka yang tahu. Oh, Lokananta, riwayatmu kini. Padahal, ditilik dari sejarahnya, Lokanantalah yang menjadi tempat seniman besar seperti Gesang dan Waldjinah merekam karyanya. Dan sudah selayaknya Lokananta memperoleh perhatian sebagai salah satu aset sejarah musik Indonesia yang patut dilestarikan. </p>', 'b9b4dbf3bf56305d116d04846524461e.jpg', '', '', 0, 1, '', '', '', '2012-12-05 00:00:00', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1370, 0, 0, 'Review: A Music Biz Bandung!', 'Berikut daftar pemenang dari berbagai nominator ICEMA 2012. ', 'Teks  &  Fotografi:  Agung Hartamurti  Malam puncak penghargaan Indonesia Cutting Edge Music Awards (ICEMA) 2012 yang bertajuk   Karnaval Musik Indonesia   telah sukses digelar pada Rabu (28/11) kemarin di Rolling Stone Live Stage, Ampera, Jakarta.  Pembacaan nominasi dari 15 kategori yang terdiri dari Best Indie Rock Song, Best Metal Song, Best Reggae/Ska/Rocksteady Song, Best Noise/Experimental Song, Best Rock/Hardrock Song, Best Indie Pop Song, Best Soul/R &B Soul, Best Punk/Hardcore/Post-Hardcore Song, Best Post Rock Song, Best Folk/Singer-songwriter Song, Best Hip Hop Song, Best Electronic Song, Best Jazz Song, Best World Music Song, Best Metal Song, Best Death Metal Song, pun telah sukses diumumkan, meski beberapa di antara nominator pemenang tidak dapat menghadiri anugerah musik bagi musisi  underrated  tersebut.  Selain itu, penampilan dari nominator-nominator ICEMA 2012 seperti Seringai, BRNDLS, Morfem, The Experience Brothers, Barry Likumahuwa Project, Komunal, Hightime Rebellion, Karinding Attack, Frigi Frigi, Saratus Persen dengan bintang tamu Ras Muhamad, DOM 65, Teman Sebangku, dan Sungsang Lebam Telak, juga turut memeriahkan anugerah musik yang diselenggarakan oleh MACS909 dan 7EVENOTES.  Berbeda dengan penyelenggaraan pertama dua tahun silam, ICEMA tahun ini dihiasi pembaharuan pada metode penjurian dengan lebih banyak karya terbaik dari tiap kategori yang dipilih langsung oleh Dewan Juri ICEMA 2012 melalui mekanisme voting tertutup dari tanggal 1 hingga 14 November lalu.  Tidak ketinggalan, pihak ICEMA 2012 juga memutuskan untuk memperbaiki penamaan dan pengelompokkan kategori berdasarkan tipe jenis musik demi mengikuti dan merespon perkembangan kancah musik yang ada di Indonesia.  Adapun anggota Dewan Juri ICEMA 2012 adalah Wendi Putranto dari Rolling Stone Indonesia, Sandra Asteria dari Trax FM, Eric Wirjanata dari Deathrockstar, Denny Sakrie selaku pengamat musik senior, dan David Tarigan yang dikenal sebagai pelaku sekaligus pengamat budaya kontemporer, serta tim penasihat yang terdiri dari Indra Ameng dari ruangrupa, Adib Hidayat selaku pemimpin redaksi Rolling Stone Indonesia, dan Harlan Boer yang merupakan pelaku dan penggiat kancah musik.  Selain nama-nama tersebut, ada pula penambahan tim anggota suara yang beranggotakan para penggiat dan pelaku kancah musik kota-kota seperti Jakarta, Bandung, Yogyakarta, Solo, Semarang, Surabaya, Malang, Bali, Makassar, Palembang, dan Medan. Tim tersebut menjadi bagian dari Dewan Juri ICEMA 2012.  Marie Elka Pangestu, selaku Menteri Pariwisata dan Ekonomi Kreatif RI yang mendukung penuh terselenggaranya ICEMA 2012, juga turut hadir dalam malam anugerah ini. Beliau menyatakan kegembiraan dan apresiasinya terhadap musisi-musisi  (let  s so called) Cutting Edge  yang menjadi nominator-nominator ICEMA 2012, serta menghaturkan ucapan selamat kepada para pemenang.  Beliau juga menyampaikan dukungan dari pihak pemerintah tersebut didapat karena misi dan program Kementerian tersebut sesuai dengan misi yang diemban ICEMA, yaitu mengangkat industri musik independen yang merupakan salah satu wujud kreativitas anak bangsa serta meningkatkan apresiasi serta wawasan terhadap keberagaman musik populer di Indonesia.  Kesamaan visi yang dimiliki ICEMA dan Kemenparekraf juga dianggap sebagai alasan utama hadirnya dukungan tersebut, yaitu sebagai Music Appreciation, mendukung Music Literacy dan juga untuk memajukan Music Bussiness.  Tanpa panjang lebar lagi, berikut adalah daftar pemenang dan foto-foto dari Malam Penghargaan ICEMA 2012   Karnaval Musik Indonesia  . Dan selayaknya Ibu Menteri, saya pun hendak mengucapkan selamat untuk para pemenang. http://i46.tinypic.com/fvcrrp.jpg  http://i48.tinypic.com/2u3zcjq.jpg ,  http://i47.tinypic.com/2qv5bpd.jpg  , Teman Sebangku   http://i49.tinypic.com/30i9nja.jpg  ,  http://i47.tinypic.com/20qlw9h.jpg  , http://i47.tinypic.com/wclekh.jpg  ,http://i50.tinypic.com/vnpaxd.jpg,   http://i49.tinypic.com/2rh5ieb.jpg  ,   http://i45.tinypic.com/2k1w88.jpg ,   http://i50.tinypic.com/npmj9v.jpg,   Daftar Pemenang ICEMA 2012:    Best World Music: Karinding Attack.  Best Death Metal: Deadsquad.  Best Hip Hop: Ki Jarot (Jogja Hip Hop Foundation).  Best Soul/R &B: Jemima.  Best Post Rock: Marche La Void.  Best Noise/Experimental: Sungsang Lebam Telak.  Best Electronic: Dubyouth.  Best Jazz: Tomorrow People Ensemble.  Best Metal Song: Rajasinga.  Best Punk/Hardcore/Post Hardcore: Milisi Kecoa.  Best Folk/Singer-Songwriter: Sir Dandy.  Best Reggae/SKA/Rocksteady: Ras Muhamad.  Best Rock/Hard Rock: Komunal.  Best Indie Rock: BRNDLS.  Best Indie Pop: White Shoes  & The Couples Company.  Favourite Newcomers: Fuentes, Bvrtan, Mooikite, Mesa Sinaga, A.F.F.E.N.  Favourite Solo Artist: Sir Dandy.  Favourite Group/Band or Duo: Sentimental Moods.  Favourite Song: Burgerkill - House of Greed.  Best New Comer: Payung Teduh.  Best Album: Komunal - Gemuruh Musik Pertiwi.  Lifetime Achievment: Harry Roesli.  \n\n', '884.jpg', '', '', 0, 1, '', '', '', '2012-12-04 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 3, 0, NULL),
(1371, 0, 0, 'Rumah Musik Indonesia, Aksi Kepedulian Musisi Indonesia akan Pelestarian Lokananta', '5 Cool Music Instrument Application for iPod Touch or iPhone', '\n Teks  & Fotografi:  Agung Hartamurti     Rumah Musik Indonesia   http://i46.tinypic.com/sfdm5s.jpg    Rumah Musik Indonesia       Anda sudah melihat sendiri pada artikel kami sebelumnya bukan, bagaimana sebuah perusahaan rekaman Lokananta yang sudah menyimpan berbagai arsip dari musisi-musisi legendaris Indonesia kian terkikis keberadaannya, bagaikan hidup segan mati pun tak mau.   Keadaan ini yang membuat banyak pelaku musik Indonesia berupaya untuk melestarikan keberadaan Lokananta ini. Beberapa di antaranya yang pernah turut andil dalam upaya pelestarian ini ialah White Shoes And The Couples Company yang merekam empat lagu untuk EP mereka yang rencananya akan dirilis awal tahun mendatang. Sekumpulan pemuda-pemudi bernama Sahabat Lokananta yang membuat konser amal untuk Lokananta di Lokananta dan Borneo Beerhouse Jakarta pada akhir Oktober lalu.  Tak luput, tentunya dengan skala yang lebih besar, musisi kenamaan Glenn Fredly yang juga tercatat pernah merekam lagu di Lokananta menunjukkan kepeduliannya dalam usaha melestarikan Lokananta. Dengan mengatasnamakan Rumah Musik Indonesia, Glenn menggelar konser yang disiarkan secara langsung melalui sebuah stasiun televisi swasta.  Konser ini melibatkan banyak musisi-musisi muda, serta musisi-musisi legendaris Indonesia. Diantaranya, musisi-musisi yang terlibat ialah White Shoes And The Couples Company, Tompi, Glenn Fredly, Lala Karmela, Barry Likumahuwa Project, RAN, Monita Tahalea, David Bayu dari NAIF, Saykoji, Endah   N Rhesa, Titiek Puspa, Bob Tutupoly, serta Setiawan Djody.   Hal ini ditujukan agar makin banyaknya orang-orang yang peduli akan keberadaan Lokananta. Dalam hal ini, Setiawan Djody pun turut menyertakan nama Presiden RI untuk turut memberikan bantuan demi keberlangsungan Lokananta di masa mendatang.  Semoga upaya ini dapat memulihkan kembali seperti awal masa kejayaannya dahulu. Di mana Lokananta menjadi tempat rekaman seluruh musisi-musisi legendaris. Dan siapapun yang turut berpartisipasi dalam melestarikan Lokananta, semoga kita semua melegenda! \n', '882.jpg', '', '', 0, 1, '', '', '', '2012-12-03 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 3, 0, NULL),
(1372, 0, 0, 'Lokananta Yang Terlupakan', 'Terlambat panas, tapi bermasadepan cerah', 'Ibarat mesin,  The Triangle   mungkin adalag mesin diesel yang terlambat panas. Mengecewakan sih tidak, tapi tiga nomor awal di album ini buat saya berlalu begitu saja tanpa kesan yang dalam. Untungnya, segalanya menjadi sedikit lebih baik begitu menginjak nomor-nomor setelahnya.   Should I?  menawarkan reffrain menarik di mana sang vokalis tengah meratap di antara dua pilihan dengan latar belakang suara bising gitar yang mengawang. Dramatis! Momen terbaik di album ini mungkin ada pada   How Could You    . Diawali dengan suara Cil sang vokalis yang muram plus atmosfer berkabut yang telah dibangun sejak awal, track nomor delapan ini secara konstan akan mampu membawa anda menuju titik terendah yang bahkan mungkin bisa melambatkan denyut nadi anda. Dan dengan derap snare drum plus seksi tiup yang mempesona,   How Could You   sukses berakhir dengan dramatis dan megah. Jika rasa getir dan duka harus diperingati dengan cara yang merah, sepertinya   How Could You   adalah satu lagu yang tepat untuk mengiringinya.  Selanjutnya,   Afternoon Bird   juga menjadi nomor menarik untuk disimak. Dimulai dengan muram di awal (seperti biasa), lagu ini mendadak menggelinjang memasuki tengah lagu, dan dengan lenguhan sang vokalis plus seksi tiup yang membahana, wujud lagu ini menjadi tidak sama lagi setelahnya. Ah, andai saja sejak awal sudah sekeren ini, mungkin album ini akan terdengar dua kali lipat lebih menarik.   The Triangle   sendiri adalah album perdana dari band bernama serupa, The Triangle. Kental dengan aroma indie-rock plus petikan gitar akustik di sana-sini, band ini diawaki oleh dua gitaris yang sudah terlebih dahulu dikenal lewat band lampau mereka, Fikri Hadiansyah (Vincent Vega) plus Riko Prayitno (Mocca, kali ini lebih dominan menggenggam instrumen bass). Bersama dua nama tersebut, band yang berdiri pada 2010 ini seperti tidak membutuhkan waktu lama dan langsung tancap gas menelurkan album perdana. Di luar kedua nama tadi, Cil Satria sang vokalis juga mampu membuktikan bahwa keberadaannya bukan sekedar sebagai pelengkap. Meski di awal album terdengar bagai penyanyi yang kebingungan dan tidak tahu harus bernyanyi seperti apa, setidaknya Cil mampu mengakhiri album dengan lumayan.   The Triangle  mungkin akan berlalu begitu saja di telinga anda tanpa meninggalkan kesan berlebihan. Tapi soal potensi, album ini bisa jadi adalah langkah awal dari sesuatu yang lebih besar di masa depan. Poin plus-nya, album ini hadir dalam kemasan yang sangat menarik. Setidaknya jika anda tidak suka materi lagunya, packaging album ini adalah yang membuatnya tetap layak dibeli, meski (mungkin) setelahnya tidak diputar sering-sering.  Teks:  Risyad Tabattala    ', '881.jpg', '', '', 0, 1, '', '', '', '2012-12-03 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 2, 3, 0, NULL),
(1373, 0, 0, 'PENGUMUMAN PEMENANG ICEMA 2012', 'Pemuda-pemudi yang tergabung dalam #SahabatLokananta, teruskan gelaran konser amal Sahabat Lokananta, demi pelestarian dan eksistensi Lokananta di masa depan.', '<p style=''text-align: justify;''>Meneruskan misi pelestarian sebuah perusahaan rekaman legendaris Indonesia, Lokananta, segenap pemuda-ppemudi yang tergabung dan mendeklarasikan diri mereka sebagai #SahabatLokananta, teruskan gelaran konser amal Sahabat Lokananta di Jakarta.</p><p style=''text-align: justify;''>Mengintip pada artikel kami sebelumnya, segenap pemuda-pemudi yang peduli akan pelestarian sebuah label rekaman legendaris Indonesia, Lokananta, telah sukses menggelar konser amal bertajukÂ  Sahabat LokanantaÂ  di Studio Lokananta, Solo, jawa Tengah, pada 28 Oktober lalu.</p><p style=''text-align: justify;''>Konser amal tersebut pun kembali dihadirkan sehari setelahnya di Jakarta, bertempat di Borneo Beerhouse dengan didukung oleh The Upstairs, Endah N Rhesa, tor, Gugun dan Bowie dari Gugun Blues Shelter, juga Karon N Roll. Penyelenggaraan konser yang ditujukan sebagai aksi penggalangan dana bagi label yang menjadi cikal bakal industri musik Tanah Air tersebut juga turut memutar film dokumenter singkat berjudulÂ Â  Lokananta Riwayatmu Kini.</p><p style=''text-align: justify;''>Konser amal ini diselenggarakan oleh pemuda-pemudi yang mendeklarasikan diri sebagai #SahabatLokananta. Pemuda-pemudi harapan bangsa yang peduli akan eksistensi Lokananta di masa depan. Gugun Blues Shelter Walaupun turut didukung dengan musisi-musisi kenamaan, konser amal ini terbilag sepi dikunjungi. Apakah ini pertanda sedikit pula yang masih peduli akan keberadaan Lokananta? Entahlah, mudah-mudahan saya hanya beropini negatif.</p>', '0a9bbf1d6b92def59276809a41a593e4.jpg', '', '', 0, 1, '', '', '', '2012-11-30 00:00:00', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 8, 1, 0, NULL),
(1374, 0, 0, 'AMN Local Album To Watch: The Triangle', 'Lantunan lagu keroncong Ayo Ngguyu, yang dibawakan oleh Endang Raras, Minggu, 28 Oktober lalu, menghangatkan studio Lokananta, Solo, Jawa Tengah. Ratusan pengunjung yang dating tertawa ngakak mengikut', 'White Shoes  & The Couples Company   http://i48.tinypic.com/288qbty.jpg  Lantunan lagu keroncong  Ayo Ngguyu , yang dibawakan oleh Endang Raras, Minggu, 28 Oktober lalu, menghangatkan studio Lokananta, Solo, Jawa Tengah. Ratusan pengunjung yang dating tertawa ngakak mengikuti irama lagu  Ayo Ngguyu  yang berarti mari tertawa.  Bukan sekedar tertawa memang, nyanyian Endah Raras, seniman Solo yang pertama rekaman di Lokananta setelah selesai dipugar pada  9 lalu itu mengandung banyak makna. Terutama misi untuk menyelematkan studio rekaman Lokananta yang sudah lama terbengkalai.  Malam itu, studio Lokananta memang ramai dikunjungi sejumlah  Go Ahead People  pecinta musik, yang mayoritas adalah anak muda. Ratusan pengunjung memenuhi studio musik yang merupakan studio pertama di Indonesia ini, bahkan hingga membeludak.  Sekitar empat jam, acara diramaikan dengan berbagai diskusi hingga pemutaran lagu seperti  Rasa Sayang Sayange  dan  Oh Ina Ni Keke .   Sejak 20 tahun lalu, baru kali ini Lokananta ramai dikunjungi orang-orang,   ucap Nugroho Andi Kusumo, Koordinator Studio Lokananta, Minggu (28/10), malam di ruang studio.   Go Ahead People  pecinta musik yang hadir ke Lokananta tersebut bukan hanya ingin menikmati pertunjukan musik yang turut pula menampilkan White Shoes and the Couples Company saja, mereka turut larut pula dalam sebuah diskusi yang bertajuk  Save Lokananta  yang diadakan oleh kelompok pergerakkan baru di dunia maya bernama  Sahabat Lokananta . Ya, Sahabat Lokananta adalah sebuah kelompok dengan misi penyelamatan Lokananta yang digerakkan lewat jejaring social  twitter  melalui  hashtag   #SahabatLokananta .  Sahabat Lokananta dibentuk oleh empat orang asal Jakarta, dua di antaranya adalah  Intan Anggita Pratiwi , seorang mahasiswi S2 Institut Musik Daya Indonesia (IMDI) dan  Wendi Putranto , redaktur eksekutif majalah Rolling Stone Indonesia.  Gerakan yang dimulai sejak 10 Oktober 2012 lalu lewat jejaring social itu membuahkan hasil. Hingga akhirnya pada Minggu malam diselenggarakan pertemuan perdana mereka di Lokananta.  Hingga saat ini, komunitas Sahabat Lokananta tersebar di 14 kota di Indonesia, seperti Jakarta, Yogyakarta, Bandung, Makassar, Ambon, Purwokerto, Magelang, Balikpapan, Pontianak, Medan, Semarang, dan Cirebon, yang bertujuan untuk menyelamatkan Lokananta yang terpuruk.  Inisiator Sahabat Lokananta, Intan, menjelaskan program penyelamatan Lokanana yang telah mereka jalankan adalah penggalangan dana, pameran, atau mengadakan acara di Lokananta setiap tiga bulan sekali, membantu digitalisasi berbagai dokumentasi di Lokananta, serta membantu perawatan arsip,   Sahabat Lokananta Solo tetap memiliki peran paling besar. Kalau Sahabat Lokananta luar kora lebih ke pemberian dukungan dan penggalangan dana,   tambahnya.  Setelah dari Solo, penggalangan dana dilanjutkan di Jakarta pada hari Senin (29/10), dilanjutkan ke sejumlah kota lainnya. Intan juga akan menggandeng musisi Ibukota untuk turut dalam misi penyelamatan Lokananta ini.  Sebagai tambahan informasi, acara ini digelar bertepatan dengan hari jadi Lokananta yang ke-56, dan sekaligus hari periingatan Sumpah Pemuda.    Teks: Agung Hartamurti | Foto: Agoes Rudianto   \n\n', '877.jpg', '', '', 0, 1, '', '', '', '2012-11-26 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL);
