(1375, 0, 0, 'Konser Amal Sahabat Lokananta', 'Dengan semangat memberikan penghargaan dan mendokumentasikan musisi underrated, Indonesia Cutting Edge Music Awards datang lagi', 'Indonesia Cutting Edge Music Awards (ICEMA) kembali bergulir di penghujung tahun 2012 ini. ICEMA 2012 adalah penghargaan yang diberikan sebagai apresiasi kepada musisi Indonesia yang memiliki semangat pembaharuan dalam menciptakan karya musik dengan bentuk-bentuk ekspresi baru, lewat penjelajahan musikal yang beraneka-ragam, sehingga menawarkan pilihan-pilihan baru akan karya musik berkualitas kepada publik di tengah dominasi musik mainstream (arus utama).  Pagelaran ini mendapatkan dukungan oleh Kementerian Pariwisata dan Ekonomi Kreatif Republik Indonesia (Kemenparekraf). ICEMA tahun ini membawa tema   Karnaval Musik Indonesia   sebagai perayaan atas kekayaan ragam musik Indonesia.  Yang unik, di ICEMA tahun ini adalah pemilihan nominasi yang benar benar tak terduga. Ada 15 nominasi khusus yang terpilih untuk diangkat dan kesemuanya benar benar menampilkan keberagaman music di Indonesia. Penonton musik awam (dalam hal ini, penonton acara musik di televisi pagi) dijamin akan sangat kebingungan dengan nominatornya yang benar benar datang dari bawah tanah. Nama nama seperti Pemandangan Band, Wukir, Milisi Kecoa dan banyak lagi lainnya yang tergolong susah untuk diputar di Radio mendapatkan tempat khusus. Penyerahan penghargaan yang direncanakan digelar tanggal 28 November 2012 juga akan menampilkan band dari berbagai macam genre, baik Free Jazz macam Sungsang Lebam Telak sampai elektronik seperti Frigi Frigi bakal tampil.  Yang menjadi catatan untuk pemilihan nominasi tahun ini adalah ketimpangan dalam jumlah nominator di setiap genre yang terasa cukup jomplang. Selain itu, proses seleksi juga kurang melibatkan pegiat musik di luar Jawa yang menjadikan ICEMA masih sama saja dengan ajang musik Indonesia lainnya yang Java-Sentris. Meski begitu, nama ((AUMAN)) atau Chicken Shit Flowers sudah bisa dibilang cukup mewakili kontingen luar Jawa. Lebih lagi, peraturan tentang rilisan yang kurang jelas menjadikan ada beberapa rilisan yang kurang update.  Terlepas dari beberapa kekurangan, ajang semacam ICEMA jelas dibutuhkan sebagai pengakuan eksistensi musisi underrated dan cutting edge yang selama ini kurang mendapat tempat. Nama nama yang termasuk dalam nominator jelas pantas didokumentasikan dan penikmat musik pun sangat layak untuk mendapatkan hak mendengarkan musik musik bagus yang kurang terdeteksi.  Info lebih lanjut: Follow @icema_official atau mampir ke situsnya http://www.icema.co.id ', '876.jpg', '', '', 0, 1, '', '', '', '2012-11-22 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1376, 0, 0, 'AMNGIGS 13 Berdisko Darurat', 'Persaingan Ketat 11 Band Finalis WANTED 2012 di Jakarta', 'oleh:  Agung Hartamurti  http://hartamurti.blogspot.com  Agung Hartamurti      Setelah melewati rangkaian kegiatan WANTED, mulai dari  CD Submission ,  CD Selection ,  Regional Selection , hingga  WANTED Camp , akhirnya  De Neno  terpilih sebagai pemenang WANTED 2012. Band asal Jakarta ini berhasil mengalahkan 10 band finalis lainnya saat WANTED Final Selection, yang digelar sehari jelang Soundrenaline 2012   Rhythm Revival   di Planet Hollywood, Jakarta.   De Neno   http://i45.tinypic.com/1zy9c1z.jpg    De Neno. (Foto: Rilis)   De Neno tampil impresif dan memukau para dewan juri dengan membawakan dua buah lagu andalan mereka,     Semaumu     dan     Bicaralah    . Atas prestasinya, mereka berhak untuk memenangkan hadiah pertama berupa uang tunai senilai Rp 30.000.000, sertifikat dan plakat serta akan mendapatkan kesempatan untuk rekaman 1 album dan pembuatan video klip.    Wanted Final Selection 2012   http://i47.tinypic.com/2m5gpk2.jpg      De Neno berfoto bersama Livia Yosetya, dan segenap tim dewan juri WANTED 2012. (Foto: Agung Hartamurti)    Livia Yosetya   selaku   Brand Manager A Mild PT HM Sampoerna Tbk.   mengatakan,   Kami puas dan bangga dengan hasil   Final Selection  , di mana dewan juri telah memilih band terbaik dari 11 band finalis WANTED 2012. Semua peserta telah memberikan hasil yang terbaik, namun kami harus memilih mana yang keluar sebagai pemenang. Dengan ini diharapkan konsistensi dan warna musik yang mereka hadirkan akan semakin memberi warna dan diterima di industri musik Indonesia.        Krishna Sadrach   selaku Ketua Dewan Juri WANTED 2012 mengatakan,   Secara keseluruhan, semua band finalis tadi tampil maksimal. Dengan ilmu, pelatihan dan pengalaman yang dibagikan selama mereka menjalani lima hari di   WANTED Camp   kemarin, para finalis terlihat ingin memberikan aksi panggung terbaiknya untuk menjadi juara. De Neno memiliki aransemen musik unik dan secara keseluruhan memenuhi kriteria penilaian para juri. Tentunya kami berharap melalui hasil penjurian kami di WANTED 2012, program ini dapat menghasilkan band-band berbakat dengan karya berkualitas.       Adamas,   vokalis De Neno  yang ditemui seusai pengumuman pemenang menyampaikan,   Kami sangat senang, terharu dan bangga dapat menjadi juara WANTED 2012. Hal ini tentunya merupakan pencapaian terbaik bagi band kami. Kami akan terus memacu dan mengasah kemampuan musikalitas kami sehingga bisa memberikan warna musik yang diterima di industri musik Indonesia. Kami berterima kasih dengan adanya program WANTED karena telah menjadi wadah bagi kami, para musisi baru berbakat, untuk mewujudkan impian kami dalam bermusik.          D Masiv   http://i49.tinypic.com/14c6s80.jpg     D Masiv. (Foto: Agung Hartamurti)    WANTED Final Selection tadi malam selain menghadirkan 11 band finalis, juga menghadirkan bintang tamu D  Masiv dan Slank. Kurang lebih 729 penikmat musik dewasa yang hadir malam itu ikut bernyanyi bersama D  Masiv yang membawakan beberapa lagu andalannya seperti   Natural  ,   Diam Tanpa Kata  , dan   Semakin  . Slank pun turut menyemarakan suasana dengan mempersembahkan lagu-lagu andalan mereka seperti   Kuil Cinta  ,   Orkes Sakit Hati  , dan   I Miss U  .    Slank   http://i49.tinypic.com/357jam9.jpg    Slank. (Foto: Agung Hartamurti)    Selain mendapat hadiah uang tunai serta rekaman album dan pembuatan video klip, De Neno akan mendapat kesempatan tampil pada Soundrenaline 2012 yang digelar sehari setelahnya, di Sunburst Extension BSD City.  \n\n', '875.jpg', '', '', 0, 1, '', '', '', '2012-11-22 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1377, 0, 0, 'ICEMA 2012: Ajang Pengakuan Eksistensi Musisi Underrated', '\nSuguhan Dari Bandung Yang Tak Rapi Namun Tetap Bergizi\n', 'Rentetan drum bengis bak brondongan senapan mesin milik gembong PKI yang tengah mengamuk, aura gelap gerinda gitar berlapis, hingga semprotan gemuruh tiada henti dari sang juru vokal. Haul, unit hardcore-punk termutakhir dari kota Bandung, datang membawa Rima Penghitam Cakrawala EP yang menyajikan enam lagu (jika lagu pertama tidak ikut dihitung) rancap penebar ranjau hardcore-punk yang bukan tidak mungkin akan mampu merubuhkan fondasi dinding telinga anda.  Dibuka dengan,   Madah   yang berisi gema suara bagai rapalan mantra para penganut sekte penyembah setan, Rima Penghitam Cakrawala langsung tancap gas penuh lewat   Abadian   dengan riff gitar bergulung plus gemuruh vokal menggugat alam semesta yang kemudian diakhiri dengan lolongan memohon ampun,   Wahai Abadi hellip;berkahi kami hellip;seribu naluri hellip;jutaan nyali hellip;!!!    Jika penghuni neraka butuh soundtrack untuk mengisi hari-hari mereka yang penuh siksaan,   Abadian   adalah lagu yang cocok untuk disodorkan.  Lanjut loncat ke track empat,   Elegi  . Nomor ini menawarkan pengalaman perjalan panjang menuju luar angkasa, sembari bermanuver menghindari hantaman meteor jatuh dengan pesawat ulang-alik bobrok penuh tambalan di sana sini. Atmosferik. Sebuah kompromi bijaksana saat Haul bermaksud untuk mulai mengintip wilayah post-rock namun dengan kampak gitar tetap menggerinda. Buat saya,   Elegi   adalah salah satu yang terbaik di EP ini.  Di track keenam,   Legiun Api  , saya sempat tertegun saat mendengar lirih suara berat-rendah-berteskstur kasar nan familiar di sana. Sempat penasaran, akhirnya saya melirik sampul album. Dari situ saya baru mahfum setelah mendapati nama Doddy Hamson tertera di sana sebagai pengisi vokal di lagu tersebut.  Satu keluhan album ini adalah kualitas rekaman yang tak tergarap rapi sehingga membuatnya seolah muncul begitu saja dari speaker radio berkualitas kacang goreng. Untungnya ini masih rilisan perdana, dan masih banyak waktu untuk mengasah diri sebelum rilisan selanjutnya dibuat. Akhirul kalam, jika anda bertanya kepada saya soal kualitas dari EP perdana dari Haul ini, maka saya akan sebut album ini sebagai album bergizi penuh nutrisi.  Teks: Risyad Tabattala Haul:  https://twitter.com/buanaHAUL @buanaHAUL  ', '873.jpg', '', '', 0, 1, '', '', '', '2012-11-13 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 4, 0, 0, NULL),
(1378, 0, 0, 'De Neno Jawara WANTED 2012', 'NOAH Menutup Perhelatan Soundrenaline 2012', 'oleh:   Agung Hartamurti   http://hartamurti.blogspot.com   Agung Hartamurti   | Foto:   Muhammad Asranur   http://flickr.com/photos/cantsaynotohope   Muhammad Asranur   NOAH   http://i50.tinypic.com/w8lv7p.jpg    NOAH        Tidak berlebihan memang jika dalam skala nasional, Soundrenaline disebut sebagai festival musik terbesar di Indonesia. Pasalnya, festival musik yang diselenggarakan oleh Sampoerna A ini bukan hanya menghadirkan 35 musisi dalam 3 panggung besar saja, melainkan berbagai kejutan pun marak diberikan di Soundrenaline.  Pada festival musik yang menggaungkan tema  Rhythm Revival  ini, para  Go Ahead People  mendapatkan kejutan meriah dengan hadirnya bintang tamu spesial, yakni Noah, yang menutup perhelatan Soundrenaline 2012, yang dilangsungkan di Sunburst Extension, BSD City, Tangerang, ini.  Sajian penutup dari NOAH seakan membuat kita lupa bahwa festival ini sempat ricuh oleh pihak-pihak tidak bertanggung jawab yang membakar tiga loket penjualan karcis. Para penonton lantas serempak untuk menyanyikan lagu   Separuh Aku    dan   Topeng  , yang merupakan lagu andalan dari Aril, cs.  Di festival yang aspirasional ini, Sampoerna A telah sukses mengajak pecinta musik dewasa untuk kembali menikmati musik berkualitas Indonesia. Brand Manager A Mild PT HM Sampoerna Tbk, Livia Yosetya, menyatakan sangat bangga dengan penyelenggaraan Soundrenaline  Rhythym Revival  dalam mendukung perkembangan industri musik Indonesia yang berkualitas.  Terima kasih, A Mild, sampai berjumpa lagi di tahun depan!     \n', '872.jpg', '', '', 0, 1, '', '', '', '2012-11-11 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1379, 0, 0, 'Gig Review: SHUTTERSOUND', '35 musisi dalam 3 panggung Soundrenaline 2012 Rhythm Revival Sukses Getarkan Sunburst Ext, BSD City, Tangerang.', 'Soundrenaline yang diberi tema  Rhythm Revival  tahun ini telah sukses digelar. Festival musik tahunan terbesar di Indonesia yang diselenggarakan di Sunburst Extension, BSD City, Sabtu (3/11) kemarin ini sukses menyedot banyak  Go Ahead People  yang cinta banget sama musik.  Berbagai band-band berkualitas dari berbagai genre musik, mulai dari musisi  mainstream  hingga  cutting edge ,  bergabung di tiga panggung berbeda, yakni A Stage, Go Ahead Stage, dan Community Stage.    Band-band seperti Hightime Rebellion, Marcel Thee, Sigmun, Stars and Rabbit, FSTVLST, ((AUMAN)), Shaggydog, Sheila on 7, The S.I.G.I.T, Naif, dan Seringai, tampil menghibur penonton di Community Stage. Sedangkan Gigi, Ungu, Iwan Fals, dan Kotak, dapat giliran untuk tampil di panggung utama A Stage. Sementara itu, The Changcuters, Superman Is Dead, Jamrud, dan Netral tampil di Go Ahead Stage. Selain nama-nama tersebut, terdapat pula band-band terkenal lainnya serta pemenang WANTED 2012, De Neno .    Meski ditengah acara sempat terjadi insiden kecil di luar area Soundrenaline, namun hal tersebut tidak menghambat jalannya festival musik tersebut.  Hal ini menunjukkan bahwa penonton yang berada di dalam pun tetap menikmati jalnnya festival tersebut tanpa terpengaruh dengan kericuhan yang disebabkan oleh orang-orang yang tak bertanggung jawab.  Satu yang menarik perhatian dalam Soundrenaline Rhythm Revival 2012 adalah bintang tamu misteri yang meman tidak disertakan dalam susunan acara. Bintang tamu misteri tersebut adalah Noah, band yang dimotori oleh Ariel, Uki, Lukman, Reza, dan David. Malam itu Noah menjadi penutup Soundrenaline 2012.  Berikut cuplikan galeri foto dari Soundrenaline 2012 Rhythm Revival.   Ungu   http://i1248.photobucket.com/albums/hh489/agunghartamurti/Ungu.jpg  Superman Is Dead   http://i1248.photobucket.com/albums/hh489/agunghartamurti/SupermanIsDead.jpg  GIGI   http://i45.tinypic.com/102np7l.jpg  Burgerkill   http://i49.tinypic.com/ilzxft.jpg  J-Rocks   http://i48.tinypic.com/e0msw.jpg  Naif   http://i48.tinypic.com/258s469.jpg  Netral   http://i46.tinypic.com/25utkzb.jpg  Seringai   http://i49.tinypic.com/2w7ejw3.jpg  Iwan Fals   http://i45.tinypic.com/15uis4.jpg  Teks:  Agung Hartamurti   http://hartamurti.blogspot.com   Agung Hartamurti  Foto:  IROCKUMENTARY.COM   http://irockumentary.com   IROCKUMENTARY.COM     ', '871.jpg', '', '', 0, 1, '', '', '', '2012-11-11 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1380, 0, 0, '#AMN Local Album To Watch: Rima Penghitam Cakrawala', 'Nama-nama yang kerap nongol di AMNGIGS, dihadirin dalam panggung Community Stage di Soundrenaline Rhythm Revival.', 'Teks  & Fotografi:   Agung Hartamurti     Beberapa nama seperti Hightime Rebellion, Marcel Thee, Stars  & Rabbit, dan Sigmun, adalah nama-nama yang pernah mengisi panggung di beberapa edisi AMNGIGS. Hightime Rebellion misalnya, telah sukses manggung dua kali.  AMNGIGS yang telah sukses membuktikan diri sebagai gig reguler paling keren di Jakarta ini membawa serta nama-nama band tersebut untuk hadir dalam Community Stage, di festival musik terbesar di Indonesia, Soundrenaline  Rhythm Revival .   Hightime Rebellion   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3553.jpg  Siang-siang saat matahari lagi kece-kecenya ngeceng di langit. Hightime Rebellion udah mulai membuka perhelatan Soundrenaline. Meski panas dan banyak penonton yang masih sibuk cari parkir dan   on the way , Hightime Rebellion tetep nampilin penampilan terbaiknya di panggung Community Stage. Dan kemudian, langsung dilanjut dan dibikin adem sama Marcel Thee, yang siang itu, turut membawa Ralmond Farly dari Dear Nancy sebagai pemain bass, dan fotografer kondang-marindang, Muhammad Asranur sebagai   keyboardis .  Marcel Thee   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3521.jpg   Nah, berikutnya saatnya buat   Go Ahead People     cuci mata   lewat penampilan Stars  & Rabbit. Band yang diimpor dari Daerah Istimewa Yogyakarta ini emang sukses menyita perhatian   Go Ahead People   yang khususnya berjenis kelamin pria tulen. Pasalnya, bukan cuma punya materi musik yang oke punya, tapi vokalis Elda punya karakter vokal dan tentunya penampilan yang aduhai. Uhuyyy, adem adem asoy deh jadinya.  Stars  & Rabbit   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3611.   Kelar penampilan Stars  & Rabbit, Tensi di Community Stage kian memanas lewat penampilan Sigmun. Band yang pernah ngisi   soundtrack   film fenomenal, The Raid, ini emang pecah banget, bikin kita nggak bisa berhenti buat headbang   terus.  Sigmun   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3683.jpg     Mengingat Soundrenaline adalah festival musik terbesar di Indonesia Tanah Air Beta ini, maka AMNGIGS mempersembahkan dua band yang belum pernah di bawa di edisi-edisi sebelumnya. Cuma di sini, AMNGIGS nampilin FSTVLST dari Yogyakarta dan ((AUMAN)) dari Palembang secara eksklusif.   FSTVLST   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3726.jpg     FSTVLST langsung ngelanjutin kemeriahan di Community Stage. Band yang sempet-sempetnya bagi-bagi salak cap FSTVLST ini sukses buat bikin   Go Ahead People   jingkrak-jingkrakan, nyanyi bareng, dan   stage diving   bareng-bareng di Community Stage.     ((AUMAN))   http://i1248.photobucket.com/albums/hh489/agunghartamurti/IMG_3938.jpg     Buat yang masih kurang puas buat nyanyi bareng FSTVLST, dan pengen tereak-tereakan lebih kenceng, penampilan dari gerombolan Harimau Bumi Sriwijaya, ((AUMAN)) ini cocok buat nge-geber semangat elo buat nyaksiin Soundrenaline sampe kelar. Yak, Rian Pelor cs. sukses nularin semangatnya buat para   Go Ahead People   yang nontonin Community Stage dari mulai Hightime Rebellion tampil. Dan karena udah jauh-jauh dari Palembang, tentunya band ini bawain penampilan yang gila-gilaan kerennya.  Kehadiran band-band ini menjadi magnet yang menarik banyak   Go Ahead People   rame-rame dateng ke Soundrenaline, di antaranya malah getol nggak pindah-pindah buat nontonin band-band keren ini.  Penampilan ((AUMAN)) adalah suguhan terakhir dari AMNGIGS di panggung Community Stage, sampe kemudian masih dilanjutin sampe kelar sama Komunal, Pee Wee Gaskins, Shaggydog, Seringai, dan masih banyak lagi.   \n\n', '870.jpg', '', '', 0, 1, '', '', '', '2012-11-10 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1381, 0, 0, 'NOAH MENUTUP PERHELATAN SOUNDRENALINE 2012', 'Para Go Ahead People mendapatkan kejutan meriah dengan hadirnya bintang tamu spesial, yakni Noah!', '<p style=''text-align: justify;''>Tidak berlebihan memang jika dalam skala nasional, Soundrenaline disebut sebagai festival musik terbesar di Indonesia. Pasalnya, festival musik yang diselenggarakan oleh Sampoerna ini bukan hanya menghadirkan 35 musisi dalam 3 panggung besar saja, melainkan berbagai kejutan pun marak diberikan di Soundrenaline.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Pada festival musik yang menggaungkan temaÂ  Rhythm RevivalÂ  ini, paraÂ  Go Ahead PeopleÂ  mendapatkan kejutan meriah dengan hadirnya bintang tamu spesial, yakni Noah, yang menutup perhelatan Soundrenaline 2012, yang dilangsungkan di Sunburst Extension, BSD City, Tangerang, ini.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Sajian penutup dari NOAH seakan membuat kita lupa bahwa festival ini sempat ricuh oleh pihak-pihak tidak bertanggung jawab yang membakar tiga loket penjualan karcis. Para penonton lantas serempak untuk menyanyikan lagu Separuh Aku dan Topeng, yang merupakan lagu andalan dari Ariel, cs.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Di festival yang aspirasional ini, Sampoerna telah sukses mengajak pecinta musik dewasa untuk kembali menikmati musik berkualitas Indonesia. Brand Manager A Mild PT HM Sampoerna Tbk, Livia Yosetya, menyatakan sangat bangga dengan penyelenggaraan Soundrenaline Rhythym Revival dalam mendukung perkembangan industri musik Indonesia yang berkualitas.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Terima kasih, A Mild, sampai berjumpa lagi di tahun depan!</p>', '29671439bf45b097db6b7b7fc32be5d3.jpg', '', '', 0, 3, '', '', '', '2012-11-06 00:00:00', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1382, 0, 0, 'SOUNDRENALINE 2012 RHYTHM REVIVAL SUKSES DIGELAR', 'Wujud apresiasi terhadap keberagaman genre dan generasi di bidang musik', '<p style=''text-align: justify;''>Sejak diadakan pertama kali padaÂ  9, konser Djakarta Artmosphere kembali akan berlangsung pada 10 November 2012, bertempat di Balai Sarbini, Jakarta.</p><p style=''text-align: justify;''>Pada perhelatan yang keempat kalinya ini, Djakarta Artmosphere masih meneruskan tradisinya untuk menawarkan pentas kolaborasi musisi/band Indonesia lintas generasi.Â  Ini adalah upaya G Production sebagai penyelenggara untuk memperkenalkan sekaligus memberikan pilihan pengalaman baru kepada publik, mendokumentasikan, juga wujud apresiasi terhadap keberagaman genre dan ekspresiÂ  musik-musik terbaik Indonesia yang terus berkembang dari berbagai dekade, masa ke masa.</p><p style=''text-align: justify;''>Pada acara-acara terdahulunya, Djakarta Artmosphere telah mempertemukan dalam satu pentas di antaranya Efek Rumah Kaca bermain bersama Doel Sumbang, Tika bersama Vina Panduwinata, Navicula bersama God Bless, Pure Saturday bersama Jockie Suryoprayogo, dan The Brandals bersama Koes Plus.</p><p style=''text-align: justify;''>Di tahun 2012 ini, Djakarta Artmosphere akan menampilkan aksi dari:Â  The Upstairs bersama Andy Ayunir, Shaggydog bersama Bob Tutupoly, The S.I.G.I.T. bersama Benny Soebardja, dan Zeke Khaseli bersama Ermy Kullit. Harga tiket konser Djakarta Artmosphere 2012 adalah Rp100 ribu untuk periode early bird. Tiket early bird dapat dibeli di kantor G Production, Heyfolks!, Ruru Shop (Jakarta), Omuniuum (Bandung), dan Gigsplay (pembelian secaraÂ  online). Sedangkan harga tiket pada hari H adalah Rp125 ribuÂ  dapat dibeli langsung di Balai Sarbini.</p>', '0e0bdada6e4fe36171a0f67514373a23.jpg', '61fffe168a870bcb5d26f4760078a7cf.jpg', '', 0, 1, '', '', '', '2012-11-06 00:00:00', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1383, 0, 0, 'AMNGIGS GOES TO SOUNDRENALINE RHYTEM REVIVAL', 'Medan disuguhi atraksi band band rock dari berbagai genre yang melebur dalam Road to Soundrenaline 2012', '<p style=''text-align: justify;''>Setelah hampir empat tahun Medan tak pernah lagi kedatangan festival musik bergengsi, Soundrenaline. Sabtu (27/10/2012), Medan disuguhi atraksi band band rock dari berbagai genre yang melebur dalam Road to Soundrenaline 2012. Dahaga pecinta musik rock di Medan pun terpuaskan.</p><p style=''text-align: justify;''>Cuaca Medan yang tak menentu belakangan ini cukup mengkhawatirkan, dari pagi hingga siang Medan diguyur hujan. Pihak penyelenggara bekerja keras untuk memastikan Go Ahead People Medan bisa menikmati ajang musik akbar ini. Untungnya, menjelang open gate Road to Soundrenaline 2012, hujan berhenti. Lapangan Benteng yang jadi venue Road To Soundrenaline 2012 masih menyisakan genangan air di beberapa area, terutama area Experience dan FoodÂ  &amp; Beverages. Meski begitu, antusiasme Go Ahead People Medan rasanya tak dapat dibendung, barisan Go Ahead People mulai menyemut untuk memasuki venue dan beberapa mulai mencoba activity seru yang disuguhkan oleh penyelenggara.</p><p style=''text-align: justify;''>Sekitar jam 16.00 WIB show pun dibuka. Jilly, pemenang A Mild Live Wanted Pekanbaru diberi kehormatan untuk memanaskan crowd. Lights to Follow, yang merupakan pemenang A Mild Live Wanted Medan tampil berikutnya dengan percaya diri. Sementara itu, pasukanmati, sebutan untuk penggemar DeadSquad mulai menyemut dengan penampilan yang khas, jam 17.00 WIB DeadSquad yang sudah ditunggu tunggu pun tampil menghibur. Sound yang maksimal, penampilan yang tanpa kompromi ditambah aksi stage yang seru menjadikan Supergroup Death Metal ini pantas mendapat perhatian lebih.</p><p style=''text-align: justify;''>Berikutnya, 18.00 WIB giliran band industrial rock gaek, Koil yang mendapat kesempatan untuk tampil. Dengan lembayung senja di langit, Koil membuka dengan Aku Lupa Aku Luka. Entah kenapa, sound mereka agak berantakan sore itu, membuat Go Ahead People Medan yang kritis kurang puas. Lagu yang ditampilkan pun tak banyak, mungkin karena acara yang molor dan waktu mereka dipotong oleh waktu Shalat Maghrib. Untuk membayar kekecewaan Go Ahead People, Koil tampil lagi di Binjai tanggal 28 Oktober 2012.Â  Sesudah Maghrib, Go Ahead People yang telah beristirahat langsung disuguhi satu lagi aksi rock, kali ini ada Seringai. Seperti band band sebelumnya, ini adalah kedatangan kedua Seringai di Medan. Seperti tahu apa yang Go Ahead People mau, Arian13 cs membuka dengan single ngebut Dilarang di Bandung. Yang bikin makin menarik, Arian13 mengkomando Serigala Militia (sebutan untuk fans Seringai) untuk melakukan Wall of Death. Sebuah momen dimana frontman band mengajak penonton untuk membagi barisan ke dua sisi dan ketika lagu dimainkan mereka pun mulai menabrakkan diri dan melakukan moshing liar. Lagu yang dipilih oleh Seringai adalah Akselerasi Maksimum untuk melakukan hal ini. Berikutnya, kejutan lain adalah tampilnya Stevie Item (Deadsquad, AndraÂ  &amp; the Backbone) sebagai additional gitar pada cover Motorhead - Ace of Spades. Penampilan yang memuaskan oleh Seringai langsung disambut oleh Kotak. Band rock jebolan sebuah ajang talent show dengan hits seperti Beraksi, Selalu Cinta. Yang unik, di Road to Soundrenaline 2012 mereka banyak membawakan cover songs seperti dari Guns N Roses - Sweet Child O Mine.</p><p style=''text-align: justify;''>Kini giliran Kerabat Kotak (sebutan untuk fans Kotak) yang ikut jejingkrakan mengikuti musik pop rock yang dimainkan.Â  Tiga penampil terakhir Road to Soundrenaline 2012 tentu saja menjadi penyedot utama ajang ini. AndraÂ  &amp; the Backbone, yang meski belum punya album atau single baru setahun belakangan tetap saja menghadirkan singalong buat Go Ahead People Medan. Band dengan frontman Andra Ramadhan ini membawakan hits hits alternative rock yang enak dinyanyikan buat bergalau ria.</p><p style=''text-align: justify;''>Armand Maulana, Thomas Ramdhan, Dewa Budjana dan Gusti Hendy hadir ke publik Medan, ini penampilan ke empat mereka di Medan, tapi GIGIKITA (sebutan untuk fans GIGI) dan juga Go Ahead People tak kebosanan dengan single single GIGI yang tak pernah lekang usia, tambah lagi GIGI juga membawakan beberapa lagu baru yang makin memanjakan Go Ahead People Medan.</p><p style=''text-align: justify;''>Slank, menutup Road to Soundrenaline 2012. Rasanya, band yang satu ini memang pantas disebut band terbesar Indonesia. Dengan produksi sound yang mumpuni dan penampilan yang tiada cela. Slank banyak membawakan lagu lagu barunya. Mungkin bagi yang cuma tahu album album lamanya kurang puas malam itu. Tentu hal itu tidak berlaku buat Slankers yang sejak dari sore sudah menunggu penampilan band kesayangan mereka. Tambahan, Kaka Slank memanggil Tantri Kotak untuk bernyanyi Kupu Kupu Biru. Makinlah lengkap magis Road to Soundrenaline 2012 yang selalu membebaskan pecinta musik rock untuk memuaskan diri.</p><p style=''text-align: justify;''>Sampai jumpa di Soundrenaline 2012 - 3 November! Semoga Road to Soundrenaline datang lagi tahun depan!</p><p>Â </p>', '170e66090406d6ef564bcd5755b770e9.jpg', '', '', 0, 1, '', '', '', '2012-11-05 00:00:00', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 8, 1, 0, NULL),
(1384, 0, 0, 'AMNGIGS Goes to Soundrenaline Rhythm Revival', 'Setelah hampir empat tahun Medan tak pernah lagi kedatangan festival musik bergengsi, Soundrenaline. Sabtu (27/10/2012), Medan disuguhi atraksi band band rock dari berbagai genre yang melebur dalam Ro', 'Setelah hampir empat tahun Medan tak pernah lagi kedatangan festival musik bergengsi, Soundrenaline. Sabtu (27/10/2012), Medan disuguhi atraksi band band rock dari berbagai genre yang melebur dalam Road to Soundrenaline 2012. Dahaga pecinta musik rock di Medan pun terpuaskan.  Cuaca Medan yang tak menentu belakangan ini cukup mengkhawatirkan, dari pagi hingga siang Medan diguyur hujan. Pihak penyelenggara bekerja keras untuk memastikan Go Ahead People Medan bisa menikmati ajang musik akbar ini. Untungnya, menjelang open gate Road to Soundrenaline 2012, hujan berhenti. Lapangan Benteng yang jadi venue Road To Soundrenaline 2012 masih menyisakan genangan air di beberapa area, terutama area Experience dan Food  & Beverages. Meski begitu, antusiasme Go Ahead People Medan rasanya tak dapat dibendung, barisan Go Ahead People mulai menyemut untuk memasuki venue dan beberapa mulai mencoba activity seru yang disuguhkan oleh penyelenggara.  Sekitar jam 16.00 WIB show pun dibuka. Jilly, pemenang A Mild Live Wanted Pekanbaru diberi kehormatan untuk memanaskan crowd. Lights to Follow, yang merupakan pemenang A Mild Live Wanted Medan tampil berikutnya dengan percaya diri. Sementara itu, pasukanmati, sebutan untuk penggemar DeadSquad mulai menyemut dengan penampilan yang khas, jam 17.00 WIB DeadSquad yang sudah ditunggu tunggu pun tampil menghibur. Sound yang maksimal, penampilan yang tanpa kompromi ditambah aksi stage yang seru menjadikan Supergroup Death Metal ini pantas mendapat perhatian lebih.  Berikutnya, 18.00 WIB giliran band industrial rock gaek, Koil yang mendapat kesempatan untuk tampil. Dengan lembayung senja di langit, Koil membuka dengan Aku Lupa Aku Luka. Entah kenapa, sound mereka agak berantakan sore itu, membuat Go Ahead People Medan yang kritis kurang puas. Lagu yang ditampilkan pun tak banyak, mungkin karena acara yang molor dan waktu mereka dipotong oleh waktu Shalat Maghrib. Untuk membayar kekecewaan Go Ahead People, Koil tampil lagi di Binjai tanggal 28 Oktober 2012.  Sesudah Maghrib, Go Ahead People yang telah beristirahat langsung disuguhi satu lagi aksi rock, kali ini ada Seringai. Seperti band band sebelumnya, ini adalah kedatangan kedua Seringai di Medan. Seperti tahu apa yang Go Ahead People mau, Arian13 cs membuka dengan single ngebut Dilarang di Bandung. Yang bikin makin menarik, Arian13 mengkomando Serigala Militia (sebutan untuk fans Seringai) untuk melakukan Wall of Death. Sebuah momen dimana frontman band mengajak penonton untuk membagi barisan ke dua sisi dan ketika lagu dimainkan mereka pun mulai menabrakkan diri dan melakukan moshing liar. Lagu yang dipilih oleh Seringai adalah Akselerasi Maksimum untuk melakukan hal ini. Berikutnya, kejutan lain adalah tampilnya Stevie Item (Deadsquad, Andra  & the Backbone) sebagai additional gitar pada cover Motorhead - Ace of Spades. Penampilan yang memuaskan oleh Seringai langsung disambut oleh Kotak. Band rock jebolan sebuah ajang talent show dengan hits seperti Beraksi, Selalu Cinta. Yang unik, di Road to Soundrenaline 2012 mereka banyak membawakan cover songs seperti dari Guns N Roses - Sweet Child O Mine. Kini giliran Kerabat Kotak (sebutan untuk fans Kotak) yang ikut jejingkrakan mengikuti musik pop rock yang dimainkan.  Tiga penampil terakhir Road to Soundrenaline 2012 tentu saja menjadi penyedot utama ajang ini. Andra  & the Backbone, yang meski belum punya album atau single baru setahun belakangan tetap saja menghadirkan singalong buat Go Ahead People Medan. Band dengan frontman Andra Ramadhan ini membawakan hits hits alternative rock yang enak dinyanyikan buat bergalau ria.  Armand Maulana, Thomas Ramdhan, Dewa Budjana dan Gusti Hendy hadir ke publik Medan, ini penampilan ke empat mereka di Medan, tapi GIGIKITA (sebutan untuk fans GIGI) dan juga Go Ahead People tak kebosanan dengan single single GIGI yang tak pernah lekang usia, tambah lagi GIGI juga membawakan beberapa lagu baru yang makin memanjakan Go Ahead People Medan.  Slank, menutup Road to Soundrenaline 2012. Rasanya, band yang satu ini memang pantas disebut band terbesar Indonesia. Dengan produksi sound yang mumpuni dan penampilan yang tiada cela. Slank banyak membawakan lagu lagu barunya. Mungkin bagi yang cuma tahu album album lamanya kurang puas malam itu. Tentu hal itu tidak berlaku buat Slankers yang sejak dari sore sudah menunggu penampilan band kesayangan mereka. Tambahan, Kaka Slank memanggil Tantri Kotak untuk bernyanyi Kupu Kupu Biru. Makinlah lengkap magis Road to Soundrenaline 2012 yang selalu membebaskan pecinta musik rock untuk memuaskan diri.  Sampai jumpa di Soundrenaline 2012 - 3 November! Semoga Road to Soundrenaline datang lagi tahun depan \n\n', '865.jpg', '', '', 0, 16, '', '', '', '2012-11-05 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1385, 0, 0, 'Dream Factory X Asymmetry: Future10 17th Anniversary in Conjunction with Danjyo Hiyoji SS13 Launch', 'Last weekend, Fairgrounds Side Hall was packed with people who longed to reminisce the golden days of Jakarta? club scene.  Future10 celebrated their 17th anniversary with classic club tunes and vinyl', '<p>Last weekend, Fairgrounds Side Hall was packed with people who longed to reminisce the golden days of Jakarta s club scene. Future10 celebrated their 17th anniversary with classic club tunes and vinyl records, in conjunction with DanjyoHiyoji s Spring Summer 2013 collection launch and various installations by Rated A KOLs and catalysts, the lobby of Fairgrounds was packed with people queuing to enter Dream Factory X Asymmetry. Once entering the venue, you will be greeted by shadow a mapping installation on your left, designed by Rated A Catalyst, Ricky Janitra (also known as Babay). With a huge eye as the background, whoever stands in front of the screen can see their shadow projected onto the wall. Right next to the shadow installation is Rated A KOL Anton Ismaelcinemagraph installation. Using 3 different screens, Anton Ismael made graphic images using his photos, creating a visually stunning video for the guests. A little to the right you can find a photo box where you can have your picture taken with your friends. The photo booth was packed; some had to wait for 15 minutes just to get in. On the end of the venue, there was a lounge area with artificial clouds hanging from the ceilings. Guests who were tired of dancing could take a break and lounge around in that area. Or if you were feeling creative, you could also write your dreams on the Dream Wall. Some people really took their time while writing and posting on the wall. After the METAMORFORWARD Online 4 Competition winner s 4 presentation and DanjyoHiyoji s Spring Summer 2013 4 show, the crowd blended in together accompanied with great tunes from Rated A KOL Anton Wirjono, Dipha, Adit, AP, Downey and Agrikulture, the crowd definitely had a great time at Dream Factory X Asymmetry by Avolution Rated A. It s almost like a flashback to the great era of Jakarta s club scene, brought to you by the talented people behind Future10. Stay tuned here for more groundbreaking events powered by Avolution Rated A.</p>', '8f8ceaf66254343729ea031a6ba8029c.jpg', '', '', 0, 7, '', '', '', '2012-11-26 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 2, NULL),
(1386, 0, 0, 'Jakarta 32?C Exhibit', 'The biennial university student exhibition is now back and even more powerful than before. Showcasing visual works from various university students, Jakarta is well-known as the perfect platform for s', '<p>The biennial university student exhibition is now back and even more powerful than before. Showcasing visual works from various university students, Jakarta is well-known as the perfect platform for students to present their artworks and talents to the world. Since 2004, events are made to ignite critical dialogues in between students while presenting their works to a much wider audience. With many programs such as exhibition, discussion, workshop, film screening, music performance and bazaar, the event will surely reap many visitors and new art appreciators. The exhibition will take place in GaleriNasional Indonesia, C Building (Jl. Medan MerdekaTimur No.14 - Jakarta Pusat), from September 23rd til October 8th 2012. Spot an artwork specially made for Rated A by Kiswinar from KomunitasPecintaKertas (KPK). For more information, go to Jakarta official website; www.jakarta32c.org</p>', '', '', '', 0, 10, '', '', '', '2012-09-24 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 2, NULL),
(1387, 0, 0, 'Metamorforward Online Competition Finalists', 'Now that voting has ended, the Rated A team is having a hard time choosing the best designs from so many great designers!', '<p>Now that voting has ended, the Rated A team is having a hard time choosing the best designs from so many great designers! Its a great thing to see that there are so many young and talented 4 designers out there, ready to pour their creative minds into a product, an actual form of design. After spending some time, here are 8 finalists of METAMORFORWAD Online 4 Competition by Rated A: 1. Motley Bag by DietaChaesar 2.Ananta Clutch by TantriArihta 3. Neon Dress by VaniaGunarti 4.Utility Neon Hook by EduardusAdityo 5.See-Through Case by Budi Ramadhan 6.Mr. Africa Laptop Sleeve by Mega Saffira 7.Neon Shoes by YeviYunita 8. Neon Eyes by VinnaHalim Congratulations for all 8 talented semifinalists! But the fight is not over yet. We are currently on sampling phase, and all four final winners of METAMORFORWARD Online 4 Competition will be announced on the Rated A website on August 30th 2012. Can&#039;t wait to find out who are the winners!</p>', '67ae759d8e79661e65156f00739fc93c.jpg', '', '', 0, 8, '', '', '', '2012-08-09 00:00:00', '0000-00-00 00:00:00', '2013-03-06 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1388, 0, 0, 'Top Collection #3 at Ruang Rupa', 'Supported by artists such as AganHarahap (Jakarta), NissalNurAfryansah (Jakarta), Reza Afisina (Jakarta), Reza Mustar (Jakarta) ', '<p>Supported by artists such as AganHarahap (Jakarta), NissalNurAfryansah (Jakarta), Reza Afisina (Jakarta), Reza Mustar (Jakarta) and The House is Black (Jakarta), Top Collection #3 5 exhibition at RuangRupa is packed with interesting works for sure. Curated by Julia Sarisetiati, the project is made to see how the society use 5 in daily life, to see what kind of messages it conveys, and to see the meaning behind a photo and it s correlation with the development of visual culture, modernity and rapid changes within the society. In this third volume of Top Collection, RuangRupa invited a young photographer named Julia Sarisetiati as the curator. She s involved in various art projects in RuangRupa and have worked intensely with 5 medium. She invited 6 young artists to observe the positioning and usage of 5 as a medium in this digital era. Its interesting to see how these artists translated their ideas into another form. AganHarahapphotoshopped himself into the same frame with notable actress, athlete, and politicians, while Reza Afisina hang photos of his own extraordinary journey. Reza Mustar compiled photos of ghosts and the scary phenomenon among modern society, while NissalNurAfryansah decipher why young girls like to pose in front of the camera with their friends or even alone. As for The House is Black s installation, you have to see it for yourself. The exhibition lasts from July 21st August 4th 2012 (except on Sunday) from 11AM 9PM and it s a free event. Make sure to  by if you have the chance.</p>', '006ad6317e653982f4bfc46c4e4f9d95.jpg', '', '', 0, 10, '', '', '', '2012-07-25 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1389, 0, 0, 'The GOODS Diner Grand Opening', '27th of June 2012, it was supposed to be just an ordinary Wednesday. But at The GOODS Diner, it certainly isn\\''t. The date marked', '<p>27th of June 2012, it was supposed to be just an ordinary Wednesday. But at The GOODS Diner, it certainly isnâ€™t. The date marked a night of rockin music and rollin dance-moves in the event entitled All Shook Up. Being held to mark the grand opening of this 50â€™s inspired diner, Rock&amp;Roll and all of itattributes once again became King. Right at the entrance, guests are greeted with a parked slick black hot-rod truck and two sexy hosts clad in naughty 50â€™s waitress dresses. Inside the venue, classic Americana cocktails are served with rainbow stripes straws while classic old-school finger foods are passed around. The definite winners of the night are the guests though. Not like the usual Jakartans habit of paying no attention to dress-codes,this time people are dressing up accordingly. Showing up in black leather jackets, James Dean hairs, polka-dot summer dress, thick red lipsticks, and all of the required paraphernalia; they made the Diner travel back 60 years in time that night. With music courtesy of Future10 usual suspects and Rated A KOL Anton Wirjono, Adith, Hogi with Ms.Sari and Mr.Ale of White Shoes &amp; The Couples Company fame joining in, the place was burned up with classic hits and obscure gems from the 50â€™s all the way to the, Elvis, Chuck Berry, Bo Diddley, Ray Charles, The Beatles, and other rock &amp;roll staples have successfully made the crowddo their outfit proud. Swing, Be-bop, duck-walks, floor- gyration, twists and other signature 50â€™s dance moves are alive and kicking. Not only looking the part, people are awesomelygot in character too. Kudos to The GOODS Diner and Avolution for organizing a party that manages to tear down the usual too-cool-to-dance persona of Jakarta young crowds. Drinks are plenty, foods are tasty, and everybody was merry. Congrats</p>', '9b515c6fb84558cca33086f1f1e2a101.jpg', '', '', 0, 7, '', '', '', '2012-07-04 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1390, 0, 0, 'DRIFT: Multimedia Exhibition at RURU', 'Multimedia art is an outcome of technology that artists use in making art, to showcase mixed mediums such as sound, video', '<p>Multimedia art is an outcome of technology that artists use in making art, to showcase mixed mediums such as sound, video, performance and interactivity. Through DRIFT multimedia exhibition, RURU Gallery successfully introduced this type of art to Jakarta s art scene in particular. It resembles new explorations of art forms, one issue that many art enthusiasts have been eager to find. The vast development of technology surely impacts most of our aspects of life, and this multimedia exhibition proves that we can gain more through multimedia. The term DRIFT itself means a driving movement, to be carried along. This represents how societies way of living is much more easier now with the existence of technology. The Internet determines most of our communication nowadays. The social media phenomenon has taken over our society in a way that it penetrates to a whole way of communication. People choose to congratulate over social media rather than a letter or postcard. It saves the environment and makes things done much easier and faster. This kind of movement helps us understand the characteristics and traits of our city and it?s people. DRIFT multimedia exhibition maps out these characteristics through geographical mapping using technology. All 3 artists that are involved in this exhibition present their digital mapping from two different cities. Prilla Tania lives and works in Bandung, while BagasworoAryaningtyas and Ricky Janitra lives and works in Jakarta. Through case studies, videos, image, sound and text, these 3 talented artists has deciphered the true meaning of multimedia and technology for us humans. The exhibition is until June 16th (except on Sunday) from 11AM 9PM. For more information go to www.ruangrupa.org</p>', '6a9deb23f96d2c211be291a1f20020f4.jpg', '', '', 0, 10, '', '', '', '2012-06-11 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1391, 0, 0, 'DRIFT: Multimedia Exhibition at RURU', 'Yesterday marked the opening of DRIFT, a Multimedia Exhibition at Ruang Rupa (Tebet Timur Dalam Raya #6).', '<p>Yesterday marked the opening of DRIFT, a Multimedia Exhibition at Ruang Rupa (Tebet Timur Dalam Raya #6). Exhibiting interesting work by Prilla Tania, Bagasworo Aryaningtyas and Ricky Janitras, RURU invited Mahardika Yudha; a young multimedia artist, to be the guest curator. In most of his work, he uses archives, text, pictures, audio-visual, and intense work with video as well. This time, he determined the theme of the exhibition and determined which artists should be exhibited. Multimedia has taken over our life in many forms. The multimedia theme emphasises on technology-usage to deliver the artist s work. These 3 artists are chosen for their proximity level with multimedia, and you will be blown away by their interpretations of multimedia art. We cannot wait to spare the details! In the mean time, come over to DRIFT: A Multimedia Exhibition at RURU Gallery. The Exhibition is from June 8th 16th (except on Sunday) from 11AM 9PM. For more information go to www.ruangrupa.org</p>', '6a9deb23f96d2c211be291a1f20020f4.jpg', '', '', 0, 10, '', '', '', '2012-06-07 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1392, 0, 0, 'Ruang Per Ruang: Kelas Pagi Exhibition', 'One of Rated A contributors, Anton Ismael, started a 5 class in 2006 that focuses in developing new and young photographers ', '<p>One of Rated A contributors, Anton Ismael, started a 5 class in 2006 that focuses in developing new and young photographers to explore their talents. Put boring techniques aside, KelasPagi is unlike any other 5 class. It allows you to be you by breaking all barriers in 5. By far, KelasPagi successfully graduated 5 classes (1 class each year), and by the end of the course, KelasPagi students will held an exhibition as the pinnacle of their graduation. This time, the exhibition is titled Ruang Per Ruang (Space by Space) starts from April 14th til 20th at PanglimaPolim V (the street where Guddang take place). The title was chosen simply because in this exhibition, all KelasPagi students will exhibit their artwork by responding to their designated space to display it. This way, the artworks are becoming one with the space. In other words, the space inspire the artist while the artwork speak about the space. Curious? Wait, theres more. The theme is #katanyaindonesia, a phrase that has so many different meanings depends on how you say it. From April 14th til 20th, there are lots of different events and things to do for everyone. On the opening day, there will be garage sale, exhibition tour during day and night, band performances, DJ set and BBQ. From April 16th 18th there will be 4 Photo Competition where 30 KelasPagi students are allowed to shoot models wearing Dana Maulana s creation that was displayed at Beatfest a while ago. The photoshoot will be on both indoor and outdoor with Anton Ismael himself as the jury. Check out the prizes! First winner will get an iPhone 4, second and third winner will receive photo taken by Anton Ismael. But that s not all. On the closing day there will be announcement of the photo competition winner and performances by Kaka Slank and The Brandals. With so many great things to do and to look forward to in Ruang Per Ruang, we cannot think of a reason for you not to go there. Save the date now and join the celebration exhibition with Rated A!</p>', 'b67efbe81759e94def1d5f3ebed8f4b9.jpg', '', '', 0, 10, '', '', '', '2012-04-10 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1393, 0, 0, 'Metamorphic Beatfest', 'Here we go, the day that you?ve been waiting for is just around the corner! Beatfest is coming this March 17th at Fairgrounds', 'Here we go, the day that you?ve been waiting for is just around the corner! Beatfest is coming this March 17th at Fairgrounds, and we can t wait to see all of the high tech installations and music performances! The theme for this Beatfest is Metamorphic, chosen simply because technology and culture constantly evolves. That is why we are bringing 4, movies, visual art, 5 and music into one spot this March 17th. Its our own celebration of the spirit of change!  Rooting back to the very beginning era of technology which is pixel and 8 bit, the upcoming Beatfest will implements their interpretations of metamorphic in daily lives using these roots. Anton Wirjono for example, will showcase his 8 bit Surround sound experiment. Vintage sound with a modern feeling, we know you re curious! Dana Maulana from the 4 division will bring his own interpretation of Metamorphic through mixed patterns; visually connecting his 4 taste to Teknoart.  \nAde Darmawan from the visual art community will also showcase his work titled & City Scan, in collaboration with Om Leo. Om Leo is famous for his pixelatedartworks, we cannot wait to see the wicked collaboration! We are pretty sure it has something to do with city and it s transformation, but you re gonna have to come to see it for yourself. Besides that, two young talented artist from the same circle with Anton Ismael; Rebellionik and Acong, will also showcase their artworks. Rebellionik wants to multiply you, and Acong will become a Pixelerator. Judging from the name alone, it must be an awesome installation!  That s not all, the main guest star of the night would be Friendly Fires and The Magician! Friendly Fires is an English band from St Albans   England who consider German techno label Kompakt, Carl Craig and Prince to be their greatest influences; which is clearly shown through their music. Their video already gained millions of hits and it s a quite rare opportunity to see them perform live in Jakarta! As for The Magician, you may heard their song called & I Don t Know What To Do feat. Jeppe. Remember their famous 80 s piano beat? Hear it live, only at Beatfest this March 17th at Fairgrounds!  With this much fun in one place, we can t find a single reason why you shouldn t come. Jot down the date and get your tickets now! See you on the 17th!\n', '8d222961d8e0c60fb1d6e0b2a9a8d4a3.jpg', '', '', 0, 7, '', '', '', '2012-03-10 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL);
