(1394, 0, 0, 'Dream Factory X Asymmetry: 5 Minutes with Hogi Wirjono', 'As one of Future10?s initiators, HogiWirjono is a Disc Jockey that has tasted the club scene since the 90s. Rated A had a chat with him about his vision, accomplishments and plans for the upcoming Fut', 'As one of Future10''s initiators, HogiWirjono is a Disc Jockey that has tasted the club scene since the 90s. Rated A had a chat with him about his vision, accomplishments and plans for the upcoming Future10 17th anniversary this November 24th titled Dream Factory X Asymmetry. Congratulations! Future10 is already 17 years old! Can you tell us a bit about the dance and club music scene this whole 17 years; we are sure you went through a few transitions.  Thank you! Yes of course, dance music used to be alien music here, but now it is a huge scene for everyone. Back then Future10 was still Future, something that started from a belief. Our mission was for future generations to come; that was the big picture. It s not just about main stream versus underground; in fact, nowadays they don t use the term underground any longer. Back in the days, if you are looking for a certain vinyl or song, you find out about it by asking other people and digging in store. The information is one on one. Nowadays, everything is easier because of the internet. Back then, Future was an alternative, something different that people crave for. Have you ever had to sacrifice your own personal taste of music to entertain the crowd? It?s always a struggle but its all about finding balance. DJing is like give and take. We can play all the songs that we think are the best songs for us, but it may not be the best for everyone else in the club. By combining our personal taste with new songs, we try to reach out to people so we don t seem that alien to them. Back then, every event had two venues; main room and chill room. In the chill room, anything goes; from ambience, psychedelic rock or even old school Indonesian music.   How was the music scene back in the 90?s? Back then we used to play in ParkirTimurSenayanalson known as Parkit. Our friends from the US made us UV art, an installation that we placed there and it changes every week. It was really raw back then, if you want to make a flyer, you have to find a graphic designer, but there were no graphic designers that could do what we had in mind, so in the end we had to design it ourselves. We designed it, we printed it, and we distributed it. We took our event flyers to the mall to give it out to people, and the security asked us, &Is this your name card?  It was that  new  for us. What do you have behind your sleeves for Future 10 17th anniversary; Dream Factory X Asymmetry? This November 24th we will go back to basic; taking up an empty space and transforming it into a place where we can all meet and have a great time. Everyone from Future10 will be playing; me, Rated A KOL Anton Wirjono, Dipha, Adit, AP, Downey and Agrikulture; its Future10 s showcase from old generation to younger generation. Come and experience a magical night of music at Fairgrounds!', 'd5d01e5c52fb91f265aea37339f4d82b.jpg', '', '', 0, 3, '', '', '', '2012-11-23 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:2:{i:0;s:5:"music";i:1;s:3:"amn";}', 1, 0, 0, NULL),
(1395, 0, 0, 'Anton Wirjono?s Top 3 Club Tracks', 'Anton Wirjono has sipped the glorious days of any music genre in Indonesia. We presume out of all those tracks he played, he must have his own personal favorite club tracks that he secretly loves. ', 'Anton Wirjono has sipped the glorious days of any music genre in Indonesia. We presume out of all those tracks he played, he must have his own personal favorite club tracks that he secretly loves. Rated A asked Anton about his top 3 tunes of all time, and here s the hot list if you want to pick up his brain.   Phuture - We Are Phuture    We Are Phuture is a powerful acid house track from 1988 by a group named Phuture from Chicago. The importance of Acid House to current electronic music and culture in general has been well documented. This though is not a track that is often mentioned, but is probably my favorite Acid House record. I recently played this at the R:EVOLUTION Future10 Anniversary party this last new years   it still gave me the chills. \nI remember hearing this in 1990 for the first time in a dark warehouse in the San Francisco Bay Area and the lyrics might have been one of the reasons why I call my collective Future10.    Gaucho - Dance Forever   A disco record from Italy made back in 1983. It has a really crazy reverbed drum break and a kind of calypso feel to it that is totally psychedelic and has been picked up by the underground house   disco scene of the last few years. Some of my friends said they can picture people doing aerobics to this back then. One man''s cheese is another man''s record that has stayed in the box forever (or more recently hard disk). Donna Summer - I Feel Love   The Giorgio Moroder-produced track from 1977 was a prototype for house/techno/trance music going forth. With it''s trippy soaring vocals   arpeggio synth baseline it was ahead of it''s time. Brian Eno commented about this record in 1977: ''This is it, look no further. This single is going to change the sound of club music for the next 15 years''. It''s one of those records, while overplayed recently still would cause a pandemonium on the dance floor, well into the future. This also makes Donna Summer (who co-wrote the song), one of the most influential people in electronic music along with people like Moroder, Kraftwerk others. Interesting. \n', '', '', '', 0, 3, '', '', '', '2012-02-09 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:2:{i:0;s:5:"music";i:1;s:3:"amn";}', 1, 0, 0, NULL),
(1396, 0, 0, 'The Rise of Indonesian Films', 'With rapid development of technology, good stories to tell and talented actresses and actors, the Indonesian film industry is on a rise as we speak. Rated A has picked a few worthy to watch Indonesian', '<p style=''text-align: justify;''>Modus Anomali,Another twisted plot and a seemingly disturbing film by Joko Anwar, the blood-lusting thriller featuring Rio Dewanto is exactly the kind of movie that will leave an impression. Starting with a dragging pace, the film quickly transforms into a slasher flick and drama rolled into one. It certainly makes you question who to trust and what to believe, because everything that looks real will later be foggy and uncertain. <br /><br />From dead people inside a cabin, buried 6 feet under in the middle of the woods, terrorized by an unknown person in the dark; everything about Modus Anomali is what we ve been longing to see from the genius mind of Joko Anwar. Negeri 5 Menara, Affandi Abdul Rachman directed a drama that revolves around a young man that trusts fully in his parent s decision, but later develops a mind of his own when it comes to life and mindset. It tells a story about people and their expectations from life; how we acknowledge them, transform them, accept them and revise them when needed. From a strict school to new-found belief and point of view, Negeri 5 Menara is a humble and refreshing film from an Indonesian film director that is worthy to watch and weep for. <br /><br />Atambua 39C Directed by RiriRiza and produced by Mira Lesmana, the legendary duo filmed a heart-warming tale about Ronaldo Bautista in Atambua, Timor Timur. With his troublesome dad and rock-bottom love story, Ronaldo struggles through many obstacles and stumbling blocks that shift his views in life until he finds a tape that changes his heart. While struggling with his old wounds, he still has to save his future. Filmed in the Tetun language (Timor Timur&#039;s mother tongue), Atambua sort of opens our view on how diverse and rich of culture Indonesia is.</p>', 'a8546b1ce40a90595cb294b798dd03d3.jpg', '', 'dd7fe933b27638f9edb3782360ca1e8f.jpg', 0, 6, '', '', '', '2012-12-04 00:00:00', '0000-00-00 00:00:00', '2013-03-04 00:00:00', 0, 0, 0, 'a:2:{i:0;s:6:"visual";i:1;s:3:"art";}', 1, 1, 0, NULL),
(1397, 0, 0, '90 Minutes of Laughter', 'Psychological studies show that laughter can take a burden off someone ?  back because it relaxes your muscles and releases endorphins that make you less stressed. Rated A picked the 3 best comedy mov', '<p style=''text-align: justify;''>Psychological studies show that laughter can take a burden off someone s back because it relaxes your muscles and releases endorphines that make you less stressed. Rated A picked the 3 best comedy movies that will guarantee you 90 minutes of laughter. That s My Boy Just like any other Adam Sandler movie, this one is produced under Happy Madison production company and offers you a twisted plot that will surely make you laugh. The story revolves around Donny Berger (played by Adam Sandler himself) as Donny Berger. In his teens, Donny fathered a son named Todd and raised him as a single parent up until Todd&#039;s 18th birthday. <br /><br />Since then, Todd has gone to determine his own path in life, because he doesn?t want to end up being a 42-year-old slacker like his dad. The plot continues when they reunited because Donny needs something from Todd. The Five-Year Engagement This romantic comedy film is starring Jason Segel (from How I Met Your Mother TV series) and Emily Blunt, as a couple whose madly in love. One day Tom Solomon (Jason Segel) proposed to Violet Barnes (Emily Blunt) and she accepted. But the fairytale love story doesn t end there, in fact, their journey just started. <br /><br />They didn t get married for the next 5 years because of work, new neighborhood, and a fling or two. The turmoil between the two was highly humorous and you can t guess the ending until you watch it yourself. Wanderlust Starring Jennifer Aniston and Paul Rudd as a married couple whose fed up with metropolitan lifestyle and it s suffocating consumerism, the film tells the story about the couple trying to escape modern society by finding themselves on a commune in Georgia, after the economy crashes down on their dreams in Manhattan, New York. In the gipsy commune, both learn how to take life less seriously and add more laughter and joy to their mindset of a great life. But free love isn t the ticket to get out of their frustrations. Many more is coming and adding up until the end of the movie.</p>', 'fc59a9479c0c2ddd9ba5a5c7d8112089.jpg', '', '', 0, 6, '', '', '', '2012-10-22 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:2:{i:0;s:6:"visual";i:1;s:3:"art";}', 1, 1, 0, NULL),
(1398, 0, 0, 'History In Motion', 'The movies have provide us with some of the greatest moment in our life. Scenery and images that is beyond our wildest imagination.', '<p style=''text-align: justify;''>The movies have provide us with some of the greatest moment in our life. Scenery and images that is beyond our wildest imagination.A chance to escape, a chance to be free from constraint of reality. But cinema also invite us to take a peek into real living souls. Extraordinary stories about the rise and fall of mankind. Recently, more and more biopics are being made. A two hour journey into the lives of humanity greatest personalities. Also sublime are the actors and actresses portraying them. Through dedication that is unmatched, they go through tremendous effort to honor the people the played. <br /><br />Here is some of the greatests movies about the greatests figure that have walked the earth. Invictus This movie is about The Rugby World Cup that is held right after Nelson Mandela took office as the President of South Africa. He saw that this event is a great chance to bring his country together. This is no small matters given the history of his country. At that time, revenge is on everybody s mind after years of apartheid rules. Nobody experienced this more than mr. Mandela himself. He have spent 27 years in prison because of his skin tone. Played by no other than the great Morgan Freeman, this movie showed us how to forgive a nation gracefully. Always with a smile on his face, Mandela build his beloved nation through compassion, love, and a ball. All Mandela want is peace and Morgan Freeman showed that to us with flawless acting. <br /><br />La Vien Rose Our generation have a right to know nothing about Edith Piaf. She came from a time where music is appreciated through old battered radio. World War II to be precise. La Vien Rose chronicles this legendary singer journey throughout her life. Marion Cottilard, in a career changing role, played Piaf with almost terrifying likeness all the way into the small gestures miss Piaf did when she sing. A triumphant performance well deserved of the awards she received. Born into poverty, Edith Piaf rise to fame is a real life fairytale. She literally comes from the streets, making her way into posh hotels and glamour with her beautiful haunting voice. Alas, her life didn t end up happily ever after. Her fame consume and eventually drowned her in a sea of alcohol and drugs. A rollercoaster life with a sweet poignant end. <br /><br />The Iron Lady MargarethThacther is the first ever femalebritish prime minister. A position he achieved through years of dedication and hardwork. In a world of men, this give her the nickname of &amp; Iron Lady . Apparently, beneath her thick armor she s just a woman in need of love and joy. MerrylStreep showcased this brilliantly, interchanging between a powerful woman look upon by men and a fragile housewive heartbroken by her absent of time. Accordingly this is the kind of role that MerrylStreep born into, the ability to be strong and fragile in a snap of a finger. All in all, The Iron Lady is a testament of women s struggle to be independent. Furthermore this is a prime example of what a person can achieve with a strong will and perseverance. Goes beyond gender, The Iron Lady is a worthy lesson of how to achieve your dream.</p>', 'b730e021d4acef32f879a6133aa29d7d.jpg', '', '', 0, 6, '', '', '', '2012-02-14 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:2:{i:0;s:6:"visual";i:1;s:3:"art";}', 1, 1, 0, NULL),
(1399, 0, 0, 'Kopi Keliling', 'A while ago, Kopi Keliling held a charity exhibition at 1-15 Coffee?  Gandaria entitled? ACT?  (act through art), featuring 100 artworks ', '<p>A while ago, Kopi Keliling held a charity exhibition at 1-15 Coffee Gandaria entitled &amp; ACT (act through art), featuring 100 artworks by 100 talented artists. The ACT Charity Exhibition event is the first charity exhibition by Kopi Keliling in which each guest, who has already purchase the entry ticket in advance, can enjoy coffee, snacks, and bring one painting back home. The charity event itself received many support, therefore, Kopi Keliling charity exhibition is extended the exhibition. So if you missed the actual event, you can come to 1-15 Coffee at Gandaria 1 #63 South Jakarta, because now the exhibition is open for public (no ticket needed to enter the exhibition). Go to Kopi Keliling official website, kopikeliling.com to check out their upcoming exhibition. Support local artists!</p>', '36f2a05a28489dc2045ba306a6f59924.jpg', '', '', 0, 10, '', '', '', '2012-08-15 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 0, 0, NULL),
(1400, 0, 0, 'Skatedeck Evolution', 'Skateboarding will always be that one sport and lifestyle that will never grow old; it represents youth and freedom of expression. It all started in the 1950s, where young people were greatly influenc', 'Skateboarding will always be that one sport and lifestyle that will never grow old; it represents youth and freedom of expression. It all started in the 1950s, where young people were greatly influenced by surfing, particularly those who lived near the beach. They wanted to experience surfing on land, and that was the beginning of homemade skateboards made of wooden planks and roller skates.\nChristian Hosoi, one of the legendary skaters, stated in his biography that his dad helped him make his very first skatedeck, which is an amalgamation of a wooden board and wheels, but his dad added tails so he could tap on them and fly while skating. In the 1960s, commercial manufacturers started producing skateboards such as the Roller Derby Number 10 Skateboard, Zipee''s Sidewalk Surfer and the Nash Sidewalk Surfer.\nAt that time, one manufacturer called Sokol Surf Skate burnt their designs into skate decks and crafted those decks to look more like surfboards. You can still purchase some of these vintage boards online. Then Larry Stevenson of Makaha Skateboards came out with the first professional model skateboard in 1963. He is also credited with creating the first kicktail and double kicktail boards, which he received patents for in 1971.\nA year after, decks made of maple wood and fiberglass reinforced epoxy emerged; which is the very first laminated skateboard deck. This will soon be followed by boards with clay wheels, and the polyurethane wheels (invented by Richard Nasworthy). The urethane wheel was tough and resilient, with good traction and better shock absorption. Lets just say that the 1970s were an experimental time for skateboard deck manufacturers .Up until now, skateboard decks have evolved to many kinds of varieties; long boards, cruisers, banana boards, trick skateboard decks and many more. With different prints and self-customized decks, many professional riders continue to create innovative changes that will keep the sport alive.\n', 'ded7a524eb3a3eef9fa9ce681a9e8d02.jpg', '', '', 0, 4, '', '', '', '2012-08-24 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 0, 0, NULL),
(1401, 0, 0, 'Lawless', 'There?  a new shop located in South Kemang that has instantly attracted many people. It goes by the name Lawless', '<p style=''text-align: justify;''>Lawless There s a new shop located in South Kemang that has instantly attracted many people. It goes by the name Lawless, the shop is basically all things good rolled into one joint. Rated A talked to Sammy Bramantyo; one of its founders, about what Lawless is all about. When did you start Lawless and what triggered you and friends to make it? Lawless first opened in August 2011. <br /><br />It s a mix of Howling Wolf music shop, Pistone merchandise shop and Goodwill tattoo parlor. We started these shops on our own, but then we decided to form one concept store that brings it all together and called it Lawless. The concept is obviously anything related with music, motorbikes and tattoos, and we strictly sell 6 that relate to those things. In a way, that s what differentiates us from other shops (or distros). We sell music merchandise, motorbike-influenced clothing, we also have a motorbike customization service and tattoo parlor on the side. So it s not just the things we like, but we do as well. <br /><br />For music merchandise, do you sell merchandise from specific genres or any genres in general? Our music merchandise comes from a variety of genres, but mostly its rock. Not that we plan to do so, it s just that rock bands are usually fond of releasing new merchandises. We have tees, jackets, hats, CDs, DVDs, vinyl records and many more. How many tattoo artists are under Lawless? So far we have 3 tattoo artists and 1 guest artist. Goodwill tattoo parlor was started by Unbound and Aca, but Arian (Seringai s vocalist) and I asked them to join Lawless tattoo division. <br /><br />They were interested in the concept and got on board. It s no longer Goodwill; but it s not called Lawless Tattoo. As for the custom motorbikes, which style usually identifies as Lawless custom style? So far, most of the customized motorbikes revolve around traditional styles. Bobbers, flat trackers, jap style, caf racers and the like. We try to minimize chopping as possible to maintain the original shape, but it s up to the client s will as well. <br /><br />Our signature style would be the tags. For example, we make custom military dog tags to be placed in certain motorbike parts, or custom stickers, airbrushing Lawless logos or stupid quotes like &amp;Speedos are for pussies insidea broken speedometer; things like that. How much money people are willing to spend to modify their motorbikes? Unlimited. Depends on how far and how fancy you would like to go. It also depends on the brand and difficulty level. Harley Davidson spare parts surely drain your wallet faster than Honda CB spare parts. So far, people will spend around IDR 10 million to IDR 50 million to modify theirs. But I m sure some people are willing to spend hundreds of millions out there.</p>', 'd7be86551d315881652668edc42188db.jpg', '', '9f484dbeefa77a092bf81ebb711aabbe.jpg', 0, 4, 'Kemang, Lawless, shop, motorbike', '', '', '2012-02-09 00:00:00', '0000-00-00 00:00:00', '2013-03-04 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 1, 0, NULL),
(1402, 0, 0, 'Zero Hour of Imagination? 4 Design Workshop', 'Last weekend Rated A held a 4 design workshop proudly presented to you by Rated A KOL; Dana Maulana. As an integrated part of the Online 4 Competition, the 4 Design Workshop was meant to embrace young', '<p style=''text-align: justify;''>Last weekend Rated A held a 4 design workshop proudly presented to you by Rated A KOL; Dana Maulana. As an integrated part of the Online 4 Competition, the 4 Design Workshop was meant to embrace young emerging talents to design with perspective in mind. Held at UMBRA Kemang, the workshop started at 11AM sharp with testimonials, tips and tricks from notable 4 practitioners. Anton Wirjono, also of Rated A KOL, shared his vision and mission for The GOODS Dept and Brightspot Market. The GOODS Dept started with 25 vendors and later flourished to more than 125 vendors, featuring some of the most cutting edge Indonesian 4 labels and designers. <br /><br />As for Brightspot Market, the curated market has gained many interests from both local and the international market. With such success, Anton shared his tips and tricks on his most successful endeavor. Besides that, Olaf Djanuismadi (4 Buyer), Agra Yesy (GHOST JuellerieJVSTIFY 4 Label) and Dina Vahada (Vahada 4 Label) also shared their inside scoop of the 4 industry. Each speaker had interesting points when it came to designing, labeling, marketing, purchasing and promoting. These factors correlate with one another in order to make a cutting edge and sellable product. After the speakers shared their point of views and testimonials, the workshop participants were asked to design their own on the spot. <br /><br />Within 2 hours, workshop attendants submitted outstanding designs that ranged from dresses, necklaces, shoes, and many more 4 items. Each design embodied the METAMORFORWARD spirit with a dash of neon colors. The workshop participants could also submit their design to the Rated A Online 4 Competition on the same day. If you missed Rated A &amp; Zero Hour of Imagination 4 Design Workshop, you clearly missed out on a lot. But worry not, you can still participate in the Online 4 Competition.Â </p>', '', '', '', 0, 6, '', '', '', '2012-06-26 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:2:{i:0;s:6:"visual";i:1;s:3:"art";}', 1, 1, 0, NULL),
(1403, 0, 0, 'Danjyo Hiyoji SS13 Asymmetry', 'If you missed DanjyoHiyoji SS13 launch last weekend at Fairgrounds, then you definitely missed a lot. The visually stunning and conceptual 4 show yielded a lot of great comments from 4able individuals', '<p>Held in Fairgrounds Side Hall, the presentation for DanjyoHiyoji SS13 Asymmetry Collection is nothing like you ve seen before. As a final acknowledgment for Rated A KOL s Dana Maulana s 4 community, Dream Factory X Asymmetry aims to serve as an empowerment for Rated A members who possess interest and talent in 4. Continuing past programs such as 4 Workshop; where Rated A invited influential and experienced 4 experts to share their insight and knowledge for young and emerging 4 enthusiasts, and METAMORFORWARD Online 4 Competition; where Rated A held an inspiring 4 design competition, Rated A has provided platforms for creative and talented individuals. A ll guests we re given a gold bangle from Rated A X Danjyo wrapped nicely in a canvas case. Engraved with both Rated A and DanjyoHiyoji, the golden bangle is a memorable gimmick that the guests can take home and wear anytime. Before the show began, the catwalk was packed with 4 practitioners. 4 Designers, 4 Writers, Editors, Photographers; you name it, they re all there to witness the show. First, all 4 METAMORFORWARD Online 4 Competition winners showcased their designs on stage. Each model came out wearing their 6, followed by the proud designers;VaniaGunartiAldoraGunawan (BIUT), Catherine Soepadhi, DietaChaesar and Mega Saffira. Their designs are now for sale at The GOODS Dept. Pacific Place until the end of year 2012, and then these 4 winners will start their internship program at DanjyoHiyoji and Janeville as designers. This will certainly be a kick start for the winners 4 career because they will experience a real work zone and deal with real 4 matters. Shortly after winners presentation, a 4able video mapping project is shown to the guests, where models posed with white tops and video images are projected onto their clothes, using DanjyoHiyoji s SS13 patterns. Right after, the 4 presentation begun and took all of the guests to another level of appreciation. RenataKusmanto opened the first look of the collection with a black stoned embellishment blazer, sheer robe and fuchsia pants. In total, 30 models came out with unique pieces from their Spring Summer 2013 collection complete with footwear provided by 707 and Pvblic Affair and all could instantly tell that it was designed by the talented people behind DanjyoHiyoji. From the silhouettes, layering, asymmetrical cutting, and metal ear-pieces; everything breathed DanjyoHiyoji s signature styles. The surprise didn t end there. A group of models entered the venue with DanjyoHiyoji s SS13 collection in a black palette. Another twist here in there, using silhouettes, layering, multiple fabrics in one piece of clothing; everything from this collection definitely took DanjyoHiyoji to another level. Among many emerging local brands nowadays, the black palette collection is a resemblance of maturity through 4 design. Ready-to-wear has never looked this good before, but then again; DanjyoHiyoji is one of the pioneers in Indonesian local 4 and has been around for so long. Congratulations for the SS13 launch, we cannot wait to see more creative 4 designs from DanjyoHiyoji.</p>', '862452adf975895dcdce004e085f8434.jpg', '', '', 0, 4, '', '', '', '2012-11-26 00:00:00', '0000-00-00 00:00:00', '2013-03-04 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 3, 0, NULL),
(1404, 0, 0, 'OTOKO Menswear Store', 'We are at the time when the Indonesian 4 industry is rapidly developing. Dozens of local designers compete against each other in creating? groundbreaking? designs from apparels, shoes to accessories.', 'We are at the time when the Indonesian 4 industry is rapidly developing. Dozens of local designers compete against each other in creatinggroundbreaking  designs from apparels, shoes to accessories. 4 retails are also blooming, from selling local to imported goods. Indonesian shoppers are indeed becoming more and more consumptive in the past few years, yet most of them still go overseas to go shopping. Satrio, Sonny, Zainal, Bonardy and Ditho, the founders of OTOKO menswear multi-brand store shared the same passion for menswear since long, and they found a big gap in Indonesia s 4 market, the lack of a proper men s store in Jakarta.\nOTOKO means  man  in Japanese, and the store is truly dedicated for men who don t want to go far from home to find brands they?ve discovered in the pages of magazines. All the carefully selected and beautifully curated 6 are a representation of a common principle all of the brands have: commitment to hard work and respect to intricate details, strength, functionality, quiet luxury, unintimidating exclusivity, high quality and elegant designs. All of these are expressed and integrated in the desire to give a solution for the high demands of Jakarta s lifestyle for men. In three words, OTOKO store could be summed up as preppy, chic and cultured.\nThe design of the store itself is inspired by nature, old Americana and monochromes. Keeping that chic, preppy and cultured look in the physical environment with all its five senses, OTOKO store  uses a combination of natural wood, iron, carpet and bricks, and design a store that feels minimalist, light, earthy, exclusive but not intimidating. Apparels, footwear and accessories is arranged stylistically, matching one with another. The smell of cedar wood will welcome customers as they enter the shop.\nCheck out OTOKO at Jl. Cipete Raya no. 55H Sunday Thursday: 12 noon 9 PM Friday-Saturday: 12 noon 10 PM\n', '675b0d6ccb2b9b8e9604fd7c116db16b.jpg', '', '', 0, 4, '', '', '', '2012-11-13 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 0, 0, NULL),
(1405, 0, 0, 'Deus Kemang', 'The name Deus has already gained a huge number of followers, be it surfers, bike enthusiasts, and even art and fixed gear enthusiasts. The brand itself started abroad a few years ago, then invaded Bal', '<p style=''text-align: justify;''>The name Deus has already gained a huge number of followers, be it surfers, bike enthusiasts, and even art and fixed gear enthusiasts. The brand itself started abroad a few years ago, then invaded Bali Indonesia with their first store and headquarters in the Canggu area. Not long after, they opened the second store in Seminyak Bali; a mixture of a shop and caf. This year, Deus spread their wings and invaded the capital city Jakarta. <br /><br />Located in Kemang Raya #14, the Deus shop is relatively small but is definitely packed with great goodies. A designated space for art welcomes you when you enter the shop, and the rest of the area is filled with motorbikes, t-shirts, shirts, pants, prints posters, surfboards and accessories by Deus. <br /><br />They also stock Le Specs, Henry Holland and CAST Eyewear sunnies (good news for both boys and girls). Make sure to  by and see what the hype is all about when you re in Kemang area.</p>', 'ca940c4998673c0178399ccdf00b6975.jpg', '', '', 0, 4, '', '', '', '2012-07-19 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 1, 0, NULL),
(1406, 0, 0, 'Inside The Thoughts of Dana Maulana', 'The very first stage is not designing, but to find inspirations first. It is not a simple process because inspirations can come in the most unexpected moments. As an example, Danjyo-Hiyoji once made ', '<p style=''text-align: justify;''>The METAMORFORWARD 4 Competition which is ongoing now has gained much support from 4 enthusiasts and emerging 4 designers. A few of them asked me personally about my own system in designing a collection. To answer those questions, I decided to write a bit about my own experience in 4 design. To create a collection is almost the same like writing a story; there s a lot of process and stages that we have to go through. <br /><br />The factor that determines whether it will be successful or not is the packaging. There are 3 crucial stages in my opinion: concepting, choosing the right material and execution. The very first stage is not designing, but to find inspirations first. It is not a simple process because inspirations can come in the most unexpected moments. As an example, Danjyo-Hiyoji once made a collection titled &amp; Escape , the concept is derived from the Palestinian refugees that we saw on the news. Then the next stage is concepting. This is a very important stage because all designs have to embody one similarity in concept, something that breathes the same main concept, main idea. Choosing the right material is also crucial in designing a collection. Sometimes, even without designing a complicated pattern, one right motif can also create and speak a lot about the collection. <br /><br />Quality and production control is the third important stage, this covers the pattern-making process to sampling. I think sketches will only show a visual of what we have in mind, but a technical drawing is able to interpret the sketch further. The technical drawing is a manual for all the designs we make as a 4 designer. It is not a simple task to control this whole process because it will not be perfect over one sample only. Remember that if someone critizes you, you should take that as a compliment, because it means someone is paying attention to your designs. You know what s worst? If someone doesn t comment at all. When there s no comment whatsoever, you ll never know whether you re developing or underdeveloping. What you make or design is not always the best for others, so stick your ears out and listen to those critics. <br /><br />One thing that I always find inspirational in designing is the spirit to always create something different and not to do the same thing over and over again. This enables us to read the situation and understand current conditions. Danjyo-Hiyoji for example, always moving from time to time, our designs are dynamically evolve from time to time. This will always be a challenge when we start a concept for new designs. Keep this in mind and you are more than ready for METAMORFORWARD 4 Competition.Â </p>', '604e133beb1123b31db5175713408ab4.jpg', '', '', 0, 4, '', '', '', '2012-05-29 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'a:1:{i:0;s:7:"fashion";}', 1, 1, 0, NULL),
(1407, 0, 0, 'Travelling Photography Tricks', 'Rated A had a chat with one of Indonesian senior photographer;KristupaSaragih. If youâ€™re fond of travelling and love to preserve your memory with photography, check out the tips and trick of travelling photography here.', '<p style=''text-align: justify;''>Rated A had a chat with one of Indonesian senior photographer;KristupaSaragih. If you re fond of travelling and love to preserve your memory with photography, check out the tips and trick of travelling photography here.<br /><br />Rated A (R): What&#039;s your favorite destination for a holiday and why? KristupaSaragih (KS): Bali. Everything is there for photography. People, landscape, culture. As a traveler, I like everything I see, hear, taste and feel when I&#039;m in Bali. R: What&#039;s your most favorite object to shoot during travelling? KS: People. They are unique, their characteristic differs from places to places.<br /><br />R: A lot of people out there loves travelling and would like to preserve their memory through pictures, but they&#039;re clueless about how to get a great shot. Any suggestions what/where to start? KS: Start from what attracts you and start from simple things. Make sure that you love what you shoot and you do what you love. Everything will be easy if you do what you love. Simple things for you might be great story for others who see your pictures.<br /><br />R: Technique-wise, exactly what is it that travellers need in hands to start taking photos in various places? KS: Simple shooters might start with a medium level pocket camera. A bit serious shooter would consider a start level DSLR with wide-to-tele zoom lens. There&#039;s an option today: an ILC interchangeable lens compact alias micro-four-third camera. It offers both compromise of compactness and option to shoot with various lens<br /><br />R: What made you fall for photography at first, and how do you expand your creativity within the realm of photography? KS: I was a reporter for Hai Magazine back to 1992. As a reporter to the most-happening youngsters magazine at that moment, I used to be assigned for both writings and making pictures. The magazine brought me to many places for assignments, from the muddy motocross track to the glamourous showbiz life. It made me learn many kinds of photography. After 8 years in Hai, I worked overseas as a field-engineer in oilfield services. Then back to Indonesia 2002, I made a move to be a full-time photographer. I meet people and build community. From there, I see, hear and then learn to update my photo works<br /><br />R: What do you think about new and emerging Indonesian photographers; are they constantly evolving creatively or have a tendency to be stagnant with their particular photography style? KS: There are promising talents. A lot of young photographers with a great ideas. But I believe only a few stay in the business with updated style of works. I also believe, to be a leader in photography, to be updated is not enough. You have to be a trend-setter to stand out of the crowd R: Do you prefer a manual or automatic cameras nowadays?KS: Anything that supports me in professional kind of work. Anything that is reliable at anytime in any condition. To see more of Kristupas photos, log on to <a href=''http://www.kristupa.comInterviewed''>www.kristupa.comInterviewed<br /><br /></a>By Nadia Rachel, photos by KristupaSaragih</p>', '70763ec2df83b409e2f861165e8b760c.jpg', '', 'f0c93193e7cb52afa931552911882e43.jpg', 0, 5, '', '', '', '2013-03-05 16:35:14', '0000-00-00 00:00:00', '2013-03-05 00:00:00', 0, 0, 0, 'a:2:{i:0;s:5:"photo";i:1;s:6:"graphy";}', 1, 1, 0, NULL),
(1408, 0, 0, 'AMN Local Album To Watch: Taring â€“ Seringai', 'NATIVE NARRATIVE - LAZYROOM 1st album showcase ', '<p style=''text-align: justify;''>Tiga tahun lebih bukan waktu yang singkat untuk sebuah band mencapai titik konsistensinya dalam bermusik. Band yang terbentuk di awal tahunÂ  9 dengan nama awal Willy Wonka ini akhirnya mencetak sejarah di scene musik Yogyakarta, menjadi band Nugaze pertama yang merilis full album, dengan merangkum ke-sepuluh tracknya dalam kepingan CD yang mereka sebut Native Narative.Â  Tepat di tanggal 22 juni 2012 di Langgeng Art Fondation (LAF), Yogyakarta, Lazyroom mengadakan showcase Native Narative nya. Dibuka dengan trio Belkastrelka yang membawakan lagu-lagu dari album pertama merekaÂ Â  Penyusup MisteriusÂ  .Â  Setelah trio Belkasterlka selesai menyanyikan lagu trakhirnya, lampu lighting di venue pun meredup, terpampang jelas pada visual back hitungan mundur dengan backsound track Narrative dalam bentuk looping. Dan satu-persatu para personil Lazyroom mengisi tempatnya masing-masing diatas stage. <br /><br />Lazyroom pun membuka penampilannya, diawali dengan gesekan biola, tanda track Native dimulai.Â  Kemudian dilanjut dengan Narative yang dimana pada saat track ini, cahaya lighting bergerak absurd, kelap-kelip yang tidak beraturan, sebuah pembuka yang manis. Di sambung tracknya Waiting Upon a Pillow. Kemudian dilanjut dengan My Eyes, video visual pada track ini adalah mata dari ke-empat personil yang berkedip seperti mengikuti alunan lagu, dan kedipan matanya semakin cepat ketika lagu mencapai klimaks.Â  Lagu terakhir yang dibawakan adalah Take Me Home, lagu ini sempat populer ditahunÂ  9, dan pernah masuk album kompilasi Sound of Jogja (lockstock). Di lagu ini, mereka berkolaborasi dengan Wafiq Giotama (Answer Sheet). <br /><br />Pada menit-menit terakhir menjelang outro lagu, terjadi kolaborasi unik antara ketukan drum Derry sang drummer dengan petikan ukulele Wafiq, disambut lagi dengan tepuk tangan personil lain yang saling mengisi jeda, dan pada seketika itu juga diatas stage sudah penuh dengan para panitia dan juga MC yang ikut ber-sing along.Â  Penutupan yang cukup meriah dan mencapai klimaks. Beberapa saat setelah stage kosong dan showcase berakhir, para penonton masih belum beranjak dari tempatnya masing-masing, seakan masih menanti adanya encore, tetapi apa daya setlist sudah habis dibawakan.Â Â Â Â Â Â Â Â Â Â Â Â Â Â </p>', '04bc36b708644398505b73c3d98d0383.jpg', '', 'ea3ffc84c41fed13080b168ef06cd566.jpg', 0, 3, '', '', '', '2013-03-05 16:46:07', '0000-00-00 00:00:00', '2013-03-05 00:00:00', 0, 0, 0, 'a:2:{i:0;s:5:"music";i:1;s:3:"amn";}', 1, 1, 2, NULL),
