(1428, 0, 0, 'REVIEW: AMN GIGS 10', 'Cari tahu seperti apa pola konsumsi musik di tiap generasi', '<p style=''text-align: justify;''>Sudah tidak diragukan lagi bahwasannya musik adalah sesuatu yang universal, dan saya sependapat dengan pertanyaan tersebut. Sejak kecil, bahkan ketika Ibu saya tengah mengandung saya, saya sudah diperkenalkan dengan irama-irama lagu klasik, yang dipercaya oleh para ahli dapat membantu tingkat intelejensi si bayi. Sejak balita, saya pun sudah diperdengarkan dengan lagu-lagu anak-anak. Hingga sekarang pun, sampai saat saya menulis tulisan ini, saya masih mendengarkan musik.</p><p style=''text-align: justify;''>Musik adalah sesuatu yang mendarah-daging buat saya, meski saya bukanlah seorangÂ  music snoob , saya percaya bahwasannya musik merupakan salah satu bagian dari hidup saya.Â  Seperti studi yang pernah di garap oleh http://blog.lab42.com/Lab 42, yang menyebutkan bahwasannya musik adalah bagian dari kehidupan tiap orang, dengan kenyataan bahwa ada 45% orang yang mereka survei mendengarkan musik lebih dari 10 jam setiap minggunya. Artinya, banyak orang masih menyukai musik dan menjadikan musik bagian dari hidupnya.</p><p style=''text-align: justify;''>Wall Street Journal http://online.wsj.com/article/SB10000872396390444042704577587570410556212.html. Wall Street Journal melansirkan ringkasan temuan badan risetÂ  Nielsen Music 360Â  yang berkesimpulan kepada perbedaan usia menyebabkan perbedaan dalam mengkonsumsi musik. Survei yang melibarkan 3.000 orang di Amerika Serikat menemukan bahwa orang dewasa mendengarkan musik mereka melalui Radio (67%), CDs (61%), dan YouTube (44%). Sedangkan usia 13-17 tahun mendengarkan musik melalui YouTube (64%), Radio (56%), dan iTunes (53%). Hasil ini dapat dijadikan referensi untuk mempermudah memetakan target market musik yang ditawarkan agar strategi marketing menjadi lebih efektif dan efisien.</p><p style=''text-align: justify;''>Studi ini juga menemukan bahwa ada 36% remaja yang masih membeli CD dalam kurun waktu setahun lalu dan 51% membeli musik secara digital. Sedangkan orang dewasa mengurangi pembelanjaan musik, terutama untuk membeli CDnya tahun lalu akibat resesi ekonomi. Keputusan untuk membeli musik seperti didorong oleh lagu apa yang diputarkan di radio. Ada 48% dari seluruh responden survei yang mengaku menemukan musik dari media radio, dan media internet, salah satunya A Music Network ini yang selalu mengamplifikasi ragam musik kegemaran Anda. Rekomendasi dari teman juga mendorong faktor pembelian musik dengan musik rock yang paling umum dibeli oleh para lelaku dan musik Top 40 yang kebanyakan dibeli oleh para wanita.</p><p style=''text-align: justify;''>Aksesibilitas pada musik telah memunculkan perluasan dan difersivikasi yang besar pada konsumsi musik,Â  ujarÂ  David Bakula , SVP Clienr Development Nielse. Kehadiran internet ikut berperan pada difersivikasi ini. Google juga memprediksikan penetrasi perangkat bergerak termasuk ponsel dan tablet akan menggusur dominasi penggunaan komputerÂ  dekstopÂ  dan laptop untuk mengakses internet. Penggunaan aplikasiÂ  mobileÂ  terutama untuk mencari dan menikmati musik berangsur diterima oleh para remaja.Â  Tren seperti ini setidaknya perlu dicermati, baik para musisi, produser, atau seluruh pelaku industri musik Tanah Air, guna mempertajam strategi pemasaran musik. Pada artikel selanjutnya, saya akan mencoba untuk mengupas lebih lanjut tentang hal-hal yang berkenaan dengan pola konsumsi musik saat ini.</p>', '4d85f8051f0f73cd4adf8bf9f41066c6.jpg', '', '', 0, 3, '', '', '', '2013-03-14 05:12:39', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL);
