(1429, 0, 0, 'PESTA RILIS ALBUM KOALISI SURI', 'Setelah Sukses di Palembang, Road to Soundrenaline 2012 akan Segera Hadir di Kotamu', '<p style=''text-align: justify;''>Go Ahead People Palembang tentunya sudah merasakan serunya menikmati sajian musik berkualitas asal negeri sendiri melalui Road To Soundrenaline 2012, yang menjadi titik awal digelarnya Road To Soundrenaline 2012, pada hari Sabtu 15 September lalu, di Lapangan Palembang Trade Center (PTC).</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Pada Road To Soundrenaline di Palembang lalu, Sampoerna A Mild telah sukses menampilkan nama-nama besar seperti Slank, AndraÂ  &amp; The Backbone, J-Rock, Burgerkill, Dead Squad, dan Seringai. Road to Soundrenaline 2012 di Palembang juga turut menampilkan finalis Wanted asal Palembang, Vairis, dan De Neno, finalis Wanted dari Jakarta. A Music Network juga turut mendukung program Road To Soundrenaline 2012 ini. Terbukti, A Music Network Palembang telah sukses menggelarÂ  pre-showÂ  Road To Soundrenaline: Rhythm Revival, di Studi A Cafe, yang menampilkan Delaware s, For Tomorrow, 2nd Episode, Aliaa, dan The.ICU.Â Â  Brand ManagerÂ  A Mild PT HM Sampoerna, Tbk, Hartawan Adi Kusuma mengatakan, Soundrenaline 2012 kali ini merupakan penyelenggaraan yang ke-10 sejak pertama kali diadakan pada tahun Â 2. Di tahun ini, Soundrenaline akan menjadi festival yang aspirasional, karena melibatkan musisi nasional dengan penampilan spektakuler di atas panggung, dan tentunya didukung oleh mutu, sound system serta tata cahaya kelas dunia. Soundrenaline konsisten menjadi simbol festival musik yang mengapresiasi musisi nasional.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Soundrenaline juga turut menjadi kesempatan bagi para musisi papan atas serta band-band baru berbakat untuk memberikan aksi panggung terbaik mereka, ujar Hartawan. Hartawan menambahkan, Road To Soundrenaline juga menjadi ajang pengalaman musik yang inspiratif dengan mengajak penikmat musik Indonesia mengikuti berbagai kegiatan pendukung. TerdapatÂ  Music ProductionÂ  yang mengangkat proses produksi musik yang mengedepankan gaya hidup seputar musik, danÂ  Soundrenaline JourneyÂ  yang membawa pecinta musik melalui evolusi genre musik. Sampoerna A selalu berkomitmen mendukung berkembangnya musik yang berkualitas di Indonesia melalui program musik kami seperti Soundrenaline, Wanted, AMNGIGS, dan acara-acara musik lainnya yang terintegrasi, serta wadah dari para pecinta musik di Indonesia. Kami berharap ini dapat menginspirasi perokok dewasa Palembang dan beberapa kota lainnya untuk memberikan apresiasi kepada musik Indonesia sesuai dengan semangat Go Ahead dari Sampoerna, tutup Hartawan.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Rangkaian Road to Soundrenaline 2012 Rhythm Revival berikutnya akan segera hadir di kotamu. 29 September 2012 di Kenjeran Park, Surabaya. 13 Oktober di Lapangan Parkir Trans Studio, Makassar.27 Oktober di Lapangan Benteng, Medan. Dan berakhir di Jakarta pada 3 November mendatang.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Jangan sampai kelewatan!Â Â </p>', '518ec73b2c5c5d005cded6473878fbc8.JPG', '', '', 0, 3, '', '', '', '2013-03-14 05:27:52', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1430, 0, 0, 'wedding', '', 'my best friend wedding', '91f2fb5d00079fa03020ee1dda243e0b.jpeg', '', '', 0, 5, '', '', '', '2013-03-14 05:43:35', '0000-00-00 00:00:00', '2013-03-14 05:43:35', 1, 0, 0, 'a:2:{i:0;s:15:"black and white";i:1;s:8:" wedding";}', 8994, 1, 0, NULL),
(1431, 0, 0, 'PESTA RILIS PIRINGAN HITAM ALBUM VAKANSI WHITE SHOES AND THE COUPLES COMPANY', 'THE.ICU adalah Sriwijaya New Breed Rock n Roll Machine!', '<p style=''text-align: justify;''>Rock n roll tidak pernah lekang dimakan jaman, energi dan afeksinya berdenyut dalam tiap generasi yang menjadikannya medium pemberontakan secara simbolik maupun musik. Semangat itu pula yang jadi bahan bakar dari terbentuknya band yang diberi nama THE.ICU pada tahun 7 di Palembang, yang kini diperkuat oleh Hendy Kurniansyah (vokal/gitar), Mardho Tilla (gitar), Abdul Bais (bass), dan Adib Ramadhan (drums), yang masih berusia diawal dua puluhan. Menyuntikkan rock n roll dan blues dalam musiknya, THE.ICU coba menjadi opsi dalam langgam musik rock yang telah dirintis oleh para pendahulunya dalam skena musik tanah air.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Tapi tidak seperti para sesepuh rock n roll-nya di negeri seberang samudera yang menjadikan hard drugs sebagai gaya hidup, para pemuda THE.ICU memilih energi kreatif sebagai drugsÂ  pilihan mereka. Dan sebagai wujud eksistensi kreatifnya, THE.ICU masuk studio bulan Desember 2010 merekam tujuh lagu dengan Farid Amriansyah a.k.a Riann Pelor [Dagger Stab/(AUMAN)] dan Panji Mustaqiem (MEV/Equals) sebagai produser dan mixing/masteringÂ  oleh David Hersya (Castranada/Semak Belukar).</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Dibawah label mandiri, Ruang.ICU Records, pada 11/11/2011 mereka merilisnya sebagai mini album bertajuk LABILISMA yang maknanya terekam dalam single Pribadi Labil, kisah akan paramuda yang terhisap dalam tren sesaat tanpa makna hingga hanyut dalam arus budaya konsumtif ketika Palembang perlahan berkembang menjadi sebuah kota metropolitan. Mengajak berdansa dengan tempo upbeat Fell the Beat, Come on Jacob, suntikan blues kasar Late Night Conversation, dan nomer anthemik Hilang Arah dan Sampah Bernyawa. Membawa tongkat estafet penjaga api semangat band rock n roll legendaris Palembang, Golden Wing dan The Martils, THE.ICU akan merawatmu dengan substansi musikal nan bersahabat namun berbahaya dari.. Sriwijaya&#039;s new breed rock n roll machine!!</p>', 'd1d0dfe2d61f879da6ab7c9e4ed708df.jpg', '', '', 0, 3, '', '', '', '2013-03-14 06:50:09', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1432, 0, 0, 'HOUSE OF JEALOUXY - THE KNIGHTS, THE WITCHES AND THE LOVERS', 'House of Jealoux yadalah sebuah brand asesoris wanita yang basisnya di Jakarta namun designnya sudah mendunia', '<p style=''text-align: justify;''>A Exchange mendapatkan kesempatan berbincang-bincang sejenak dengan designer di balik House of Jealouxy bernama Andi Yulianti yang kerap dipanggil Uli. Simak perbincangannya di bawah ini.</p><p style=''text-align: justify;''><strong><br /></strong></p><p style=''text-align: justify;''><strong>Apa yang menginspirasi koleksi The Knights, The Witches and The Lovers?</strong><strong></strong></p><p style=''text-align: justify;''>Inspirasi dari The Knights, The Witches, and The Lovers adalah jaman-jaman British medieval pada era Camelot, the ego, the passion, the curse all entwined to one. I fell in love with their chain links idea untuk membuat baju zirah dan berusaha untuk menerapkannya jadi jewelries yang lebih modern dengan campuran spikes, chains, and ropes. Di koleksi ini juga untuk pertama kalinya House of Jealouxy launched its head jewelries yang seneng banget ternyata di Brightspot Market kemarin di Grand Indonesia dapet feedback yang sangat baik.Â </p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''><strong>Apa pendapat Uli mengenai banyaknya desainer asesoris baru di Indonesia?</strong><strong></strong></p><p style=''text-align: justify;''>Kalo saya pribadi sih seneng banget ya, jadi lebih banyak pilihan dan kita bisa saling berkompetisi dalam kreatifitas dan saling support. Ini juga udah menunjukkan kalau aksesoris adalah hal yang patut dilirik untuk pilihan bisnis dikarenakan modal yang tidak terlalu besar. Palingan satu pesan dari saya, untuk menjadi seorang designer yang original banget itu emang susah, karena internet udah membantu untuk kita cari inspirasi. Mungkin akan ada benang merahnya dikarenakan what&#039;s hot this season dan faktor lainnya. Tapi kalau soal sama ya ngga akan sama, karena nafas dan taste akan jatuhnya beda dalam hasil akhirnya. Tapi yang menurut ku kurang adalah kalo designer lokal jiplak lokal lagi just because barangnya jualan. They won&#039;t go far. If you wanna be acknowledged, you just have to take the guts and be different.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''><strong>Kalau dilihat dari daya belinya, apakah market anak muda sekarang sudah siap untuk couture jewelry?</strong><strong></strong></p><p style=''text-align: justify;''>Menurut saya sekarang konsumennya sudah lebih teredukasi walaupun belum semua lapisan. Kalau niche market akan langsung bisa dapet what we&#039;re aiming to deliver to them. House of Jealouxy sendiri selalu mengedukasi pasar baru disaat mereka komplain soal harga untuk beberapa items yang dianggap terlalu mahal, bahwa kami melakukan semua secara hand-made dan limited. Made with love and you will be one special person having this collection cause you will be the only one in the world having it. Karena memang for HOJ selain dari koleksi yang memiliki tema, kita juga suka bikin custom dan one-off items. Biasanya abis itu mereka beli.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''><strong>Apa rencana House of Jealouxy untuk ke depannya?</strong><strong></strong></p><p style=''text-align: justify;''>Rencana kedepan, go international. Saya baru sekitar 7 bulan lalu berhenti kerja kantoran. I left my comfort zone to reach my dream. During that seven months, saya baru bisa konsentrasi dan akhirnya bisa bikin 2 koleksi baru dan buka dua toko, satu Project One di eX Plaza Indonesia dan satunya lagi di The Foundry no.8 SCBD. Produk House of Jealouxyjugatersedia di D&#039;Space Debenhams Kemang Village, Happy Go Lucky BandungdanOre Premium Store Surabaya.Singapore will be my first step. Kemarin udah di contact juga oleh salah satu toko disana dan mereka tertarik dengan koleksi baru kita. Let&#039;s hope for the best!</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Untuk kamu yang ingin tahu lebih lanjut mengenai House of Jealouxy ,silahkan kunjungi websitenya di <em><a href=''http://www.houseofjealouxy.blogspot.com''>www.houseofjealouxy.blogspot.com</a></em></p>', '2967f94a993a475b559c6656acc9fe1d.jpg', '', '', 0, 4, '', '', '', '2013-03-14 09:44:37', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1433, 0, 0, 'AMBLE 30', 'Salah satu brand sepatu lokal yang berhasil menarik perhatian banyak orang adalah AMBLE', '<p style=''text-align: justify;''>Ada banyak brand sepatu lokal baru yang designnya original dan gimmicknya one of a kind, tapi tidak banyak yang dapat bertahan lama di antara ketatnya persaingan industry fashion Indonesia. Salah satu brand sepatu lokal yang berhasil menarik perhatian banyak orang adalah AMBLE, yang tidak terasa sudah berumur 3 tahun. Untuk merayakan ulang tahunnya yang ke-3, AMBLE mendirikan sub-divisi premium dalam brand nya bernama AMBLE 30.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Sub-divisi ini akan memproduksi sepatu-sepatu dengan bahan kulit terbaik, menggunakan teknik dan teknologi yang canggih. Dengan bahan kulit domba dan sol micro-cell yang ringan, produk AMBLE 30 dapat dipastikan akan menua dengan baik dan ringan dipakai kemana saja. Konstruksi dasarnya tetap menggunakan konstruksi Goodyear yang kokoh tapi tetapnya mandi pakai. Untuk kamu yang penasaran dengan koleksi terbaru dariÂ  AMBLE 30, silahkan email ke <a href=''mailto:order@amblefootwear.com''>order@amblefootwear.com</a> atau cek websitenya di <a href=''http://www.amblefootwear.com''>www.amblefootwear.com</a></p><p style=''text-align: justify;''>Â </p>', '0ad9bb7ccd71890985987a1991d7ba92.jpg', '', '', 0, 4, '', '', '', '2013-03-14 09:53:09', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1434, 0, 0, 'MONSTORE ILLUSION', 'Monstore yang belum lama ini membuka toko pertamanya di bilangan Kemang, Jakarta Selatan beberapa waktu lalu, kini kembali lagi dengan koleksi terbarunya, â€œIllusion.â€', '<p style=''text-align: justify;''>Monstore yang belum lama ini membuka toko pertamanya di bilangan Kemang, Jakarta Selatan beberapa waktu lalu, kini kembali lagi dengan koleksi terbarunya, â€œIllusion.â€</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Monstore memang selalu diasosiasikan dengan desain yang casual dan cocok untuk hari yang santai, tapi kali ini beberapa dari koleksinya mulai terlihat â€œseriusâ€ dan sedikit misterius.</p><p style=''text-align: justify;''>Terlihat juga beberapa dress dengan grafik yang menarik perhatian seperti mata, print detail kuda di bagian belakang, serta print bunga hitam putih yang saru dengan warna keseluruhan dressnya. Favorit A Exchange adalah sweater hitam dengan print harimau di bagian depannya cara yang mudah untuk bergaya sesuai trend gambar binatang saat ini.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Selain read-to-wear, termasuk di dalam koleksi Illusion beberapa bantal dengan tulisan yang menarik serta plush toys dengan karakter misterius khas Monstore. Dengan harga yang terjangkau, koleksi Monstore kaliÂ  ini merupakan koleksi yang casually stylish. Bingung cari kado? Segera melesat ketoko Monstore dan browse koleksi terbaru mereka di sana! Lihat koleksi selengkapnya di <a href=''http://www.heymonstore.com''>www.heymonstore.com</a></p><p style=''text-align: justify;''><em><br /></em></p>', '45c534fe2da79eb90d86f1295f053efc.jpg', '', '', 0, 4, '', '', '', '2013-03-14 10:01:04', '0000-00-00 00:00:00', '2013-03-14 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
(1435, 0, 0, 'THE SWEET & SOUR STORY OF SUGAR', 'Beberapa waktu yang lalu RUANG RUPA mengadakan sebuah pameran koleksi arsip foto dan karya seri fotografi berjudul The Sweet and Sour Story of Sugar. Pameran fotografi tersebut menampilkan sejarah yang panjang dan rumit di balik gula, dalam konteks globalisasi yang terus berlangsung', '<p style=''text-align: justify;''>Beberapa waktu yang lalu RUANG RUPA mengadakan sebuah pameran koleksi arsip foto dan karya seri fotografi berjudul The Sweet and Sour Story of Sugar. Pameran fotografi tersebut menampilkan sejarah yang panjang dan rumit di balik gula, dalam konteks globalisasi yang terus berlangsung. Institusi fotografi asal Belanda bernama Noorderlichta dalah dalang di balik pameran investigasi fotografi yang membandingkan proses globalisasi yang terjadi melalui komodifikasi gula. Daerah yang termasuk dalam pameran ini adalah Belanda, Brasil, Indonesia dan Suriname.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Negara-negara yang erat kaitannya dengan kolonialisme. Foto-foto yang ditampilkan merupakan karya fotografer Tomasz Tomaszewski (Polandia), Alejandro Chaskielberg (Argentina), Ed Kashi (Amerika Serikat), Francesco Zizola (Italia), James Whitlow Delano (Amerika Serikat/Jepang), dan Carl de Keyzer (Belgia), yang dimeriahkan dengan kolaborasi bersama WZM-Platforma Brasil Holanda di Sao Paolo, Brasil dan dengan Tembe Art Studio di Paramaribo, Suriname.</p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Di Indonesia sendiri Noorderlicht bekerjasama dengan RUANG RUPA di Jakarta, dan Langgeng Art Foundation di Yogyakarta. Dalam pameran di Jakarta, RUANG RUPA juga menampilkan karya seniman ibu kota seperti Aprilia Apsari, Henry Foundation, Marishka Soekarna, M.G. Pringgotono, oomleo, Rio Farabidan Saleh Husein, juga menampilkan video hasil workshop karya Ajeng Nurul Aini, Dian Komala, Jayu Julie, Mira Febri Mellya, Nastasha Abigail Koetindan Raslena. </p><p style=''text-align: justify;''>Â </p><p style=''text-align: justify;''>Jika Anda melewatkan pameran yang bersejarah tersebut, silahkan tengok foto-fotonya di bawah ini.</p><p style=''text-align: justify;''>Untuk informasi lebih lanjut kungjungi www.ruangrupa.org</p>', '6d7f3464b9762aa5cc67eaf7553513ae.jpg', '', '', 0, 5, '', '', '', '2013-03-14 10:14:40', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, '', 1, 1, 0, NULL),
