(2, 258, 'Chickenz Flafour', 'Chickenz Flafour was all started in october 2006 \r\nOur first line up are Ebeth (voc/guitar), Tear (guitar/voc), Drep (bass), Sidick (Drums). The name of Chickenz Flafour our Choose because we hope many people can easy to remember. \r\n \r\nIf most punk band sing song theme of violence, rebellion or social protest. Our young people prefer to North Jakarta home life with a young, female, having fun, and schools. be so if the lyrics the song lyrics we take more of daily life, which bring in quickly, the spirit, and depending on the energetic atmosphere. \r\n \r\nMany things do we have to consider, then we change the formation. \r\nAnd now we are Ebeth (vocal), Tear (guitar / vocal), Renda (bass), Sidick (Drums). \r\nhttp://www.facebook.com/page.chickenzflafour \r\nâ˜ºCHICKENZ FLAFOURâ˜º \r\nFor BOOKING and CONTACT \r\n(â˜Ž):+622192849439 \r\n(â˜Ž): +6285711087171  \r\n(âœ‰):chickenzflafourmanagement@yahoo.com \r\n(âœ‰):jack.au@chickenzflafourmusic.au (asia)', 1, 'small_61084c03629eec6dfbc382fdadab9ec9.jpg', 0, 184, '2011-04-18 23:31:46', '0000-00-00 00:00:00', 1),
(3, 108, 'BROWN', 'Brown terbentuk di Makassar 03 maret 2007, yang beranggotakan 6 orang, Tama (Vocal), ARdhy (Guitar), Ewhin (Guitar), Abhy ( Bass ), Ichal ( Keyboard ), Thakdir ( Drum ) yang mengusung aliran Poprock.BROWN pernah dipercayakan mengisi Acara GUINNESS ARTHUR DAY di Jakarta 4 Desember 2010 kemarin.Brown telah memiliki beberapa materi lagu diantaranya : PERANG CINTA, DILEMA, SESAL, TAK BISA MENCINTAIMU (TBM), DIAM, BUDAK CINTA, TAUBAT, dan masih banyak lgi.', 1, 'small_94384a16a3506738a3303c29271a65d2.jpg', 0, 387, '2011-04-19 07:12:02', '0000-00-00 00:00:00', 1),
(4, 222, 'MARIO', 'Mario Adalah Band Bandung Bergenre Modern Rock Dan Terbentuk Pada Bulan September 9 - 2009.\r\nNama Mario Diambil Dari Nama Sebuah Icon Game Besar Dunia Yang Sangat Digemari Yaitu \\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\" Super Mario Bros \\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\", Dan Kami Berharap Musik Kami Dapat Digemari Dan Diterima Khalayak Luas nseperti halnya Super Mario Bros.\r\n\r\nMario Sendiri Diperkuat 3 Personil Yaitu :\r\nDewa On Vocal\r\nArifin On Guitar\r\nDonz On Drum, & ( 2 Additional Player ).\r\n\r\nCONTACT : Dewa ( 085724522020 )', 1, 'small_ec5458592874b9adf4bff425809c5ba2.jpg', 0, 174, '2011-04-19 08:14:29', '0000-00-00 00:00:00', 1),
(5, 289, 'TRYGA', 'Terdiri Dari 4 Personili\r\n\r\nLitch As Vocal\r\nJ-Ro As Leader Guitar\r\nNano As Rithem\r\nLumbank As Basis\r\nDewa As Aditional Drum\r\n\r\nTRYGA Berasal Dari Kota BULELENG - BALI dengan Mengawali Musik Dengan Lagu berBahasa BALI Pada tahun 2002. Namun Dengan Seiringnya waktu Kami Pun Bermetafora dengan memadukan lagu bahasa BALI & bahasa INDONESIA pada Lagu/Musik Kami.\r\nBagi Yang Ingin Mendengar Musik/Lagu kami Silakan Denganrkan Pada Situs \r\nhttp://www.box.net/tryga-album-menggapaiawan\r\nTerimakasih...\r\nPeace Love & Funky...', 1, 'small_e8c79a1c4313f279b098023b6f5b5eb5.jpg', 0, 274, '2011-04-19 11:08:35', '0000-00-00 00:00:00', 1),
(6, 132, 'SHURIKEN', 'Shuriken adalah band beraliran alternative rock emo asal Jakarta yang terdiri atas Irwan (vokal), Leo (gitar), Dika (bass), Rori (gitar) dan Mr.E (Drum). Musik Shuriken banyak dipengaruhi oleh Dir En Grey, Luna Sea hingga Linkin Park, Avenged Sevenfold dan Bullet For My Valentine. Band yang didirikan pada tahun 2005 ini memiliki fanbase yang kuat di scene komunitas penggemar musik Jepang, sehingga seringkali menjadi penampil utama dalam event yang bertemakan musik Jepang baik di Jakarta maupun di Bandung.\r\n\r\nDengan bekal atraksi panggung yang eksplosif dan atraktif, band ini kemudian merilis sendiri sebuah EP berisi lima lagu yang menghentak layaknya penampilan mereka. Menggunakan lirik berbahasa Indonesia dan Inggris, Shuriken mengemas karya musiknya dengan variasi tema dan warna serta memasukkan teknik permainan yang tidak baku. Mini album ini dibuka dengan lagu \\''Tanpamu\\'' yang dipenuhi oleh gempuran distorsi gitar yang saling bersahutan dan ketukan drum yang cepat serta ekspresi vokal yang enerjik. \\''Hilang\\'' dan \\''Ladder To Heaven\\'' kemudian menyambung emosi yang terasa meluap-luap dalam mini album ini sambil bereksperimen dengan drum-loop namun memiliki benang merah yang sama. Satu-satunya lagu yang memiliki tempo medium adalah Eclipse, yang digarap dalam komposisi easy listening dan memberikan waktu \\''cooling down\\'' setelah mendengarkan 3 track yang keras.\r\n\r\nBerkat jaringan Myspace, lagu \\''Angel Loves The Devil\\'', lagu kelima dan terakhir dalam EP Shuriken, bahkan sudah dirilis oleh sebuah label indie asal Amerika Serikat bernama Take 5 Records dalam bentuk kompilasi yang diberi judul \\''Alone In The Dark\\''.\r\n\r\nReview :\r\nBand ini cukup kreatif, menggabungkan synthetizer, pop, sedikit distorsi dan tambahan progresifitas chord. Awalnya saya berpikir mereka mendapat pengaruh dari Linkin Park, Avenged Sevenfold dan band-band cadas yang ngetop banget dan terkenal di ranah mainstream. Tetapi rupanya mereka fans dari Japanese Rocks, seperti Dir n grey, Luna Sea. dan berbagai band metal. dan petunjuk tersebut cukup menjelaskan seperti apa musik mereka. (Eric Wirjanata - deathrockstar webzine).\r\n\r\nlagu Angel Loves The Devil udah lumayan asyik progresi beat-nya, trus pengaturan part2 lagunya jg udah asik dan ga monoton, sementara masih cukup catchy dan cukup ramah buat telinga pasar. kalo didengar secara keseluruhan, pertama kali denger lagu ini langsung teringat dengan bullet for my valentine (di jaman album poison) dan reffrain yg melodius-nya mengingatkan eik sama avenged sevenfold (jaman2 album city of evil dan self-titled) yg udah agak ngepop dan catchy. (Krishna - music enthusiast)\r\n\r\nDiskografi\r\nLadder To Heaven, EP (2008)\r\n- single Ladder To Heaven\r\nAlone In The Dark (2008)\r\n- single Angel Loves The Devil\r\nPopmaya Download Festival (2010)\r\n- single Eclipse (remix)', 1, 'small_e2a9bb380520e27047cb155cfe27d5a3.jpg', 0, 0, '2011-04-20 05:29:56', '0000-00-00 00:00:00', 1),
(7, 324, 'Lost Contact', 'LOST CONTACT was born in Jogjakarta, Indonesia[2008].Play alternative rock as they genre.Present music filled with the sound of loud distortion, and energetic performances on stage. LOST CONTACT name taken from the life of the personnel who feel their life is very monotonous, so that they feel lost contact with the outside world. and eventually lost contact name into their band\\''s name until today. LET\\''S DESTROY THE DIFFERENCE..... ', 1, 'small_548c8460b66df75391dc9c8253fe0042.jpg', 0, 0, '2011-04-20 08:44:58', '0000-00-00 00:00:00', 1),
(8, 333, 'THE STRIKE', 'Berawal dari band sekolah, yang bernama LITTLE CREEP terbentuk tahun 2002 terdiri dari 7 personil, mulanya band ini beraliran HIP METAL yang mengambil influence dari grup band sejenis seperti LP, EVANESENCE, LimpBizkit dan lain-lainya. Ditahun 2006 band ini vacum karena perpecahan personil. Dan baru di tahun 2008 setelah hampir 2 tahun vacum, tiga personil (abenk, vay, fuad) kembali berkumpul dan sepakat membentuk band baru yang mereka beri nama theSTRIKE, dan untuk melengkapi mereka menambah satu personil baru untuk melengkapi. Dan sampai saat ini Vay (vocal), Abenk (guitar), Fuad (drums), Putra (bass) masih solid untuk TERUS BERMUSIK.', 1, 'small_4145c1630f7f783cfd855ed22d7c6210.jpg', 0, 0, '2011-04-20 13:03:20', '0000-00-00 00:00:00', 1),
