(11, 117, 'x', '========================================  \r\n========================================  \r\n*THE RESIGN Terdiri Dari*  \r\n- Vocal : Arief  \r\n- Guitar : Thiyarz  \r\n- Bass : Kakan  \r\n- Drum : Ardhan   \r\n*Contak Person*  \r\n085210330079  \r\n========================================  \r\n========================================  \r\n  \r\n  \r\n*PERMEND Terdiri Dari*  \r\n- Vocal : Ihkman  \r\n- Guitar 1 : Thiyarz  \r\n- Guitar 2 : Ehka  \r\n- Bass : Kakan  \r\n- Keyboard : Aldino  \r\n- Drum : Ardhan   \r\n  \r\n*Terbentuk*  \r\nBandung, 07 Januari 2008  \r\n  \r\n*GENDRE*  \r\nPop Alternatif Heroik  \r\n  \r\n*BIOGRAFI*  \r\n*PERMEND di ambil Berdasarkan:  \r\n-Kalimatnya Simple, Mudah diingat, dan mempunyai banyak warna seperti makna permen sesungguhnya yang diminati semua kalangan mulai dari anak-anak sampai orang dewasa. Maka dari itu nama permen kita gunakan sebagai nama band kami, agar hasil karya(lagu) kami dapat terima.  \r\n  \r\n- Kita menambahkan huruf - d - diakhir kata permen, menjadi permend untuk memberi perbedaan nama band kami dengan kalimat permen yang sebenarnya  \r\n  \r\n*MY VIDEO*  \r\nhttp://www.youtube.com/user/permend  \r\n  \r\n*MY MUSIC*  \r\nhttp://www.mediafire.com/thiyarz  \r\n  \r\n*About PERMEND*  \r\nwww.Thiyarz.blogspot.com  \r\n  \r\n*Contak Person*  \r\n085210330079', 1, 'small_cbcfe7e76e8b5a6db297e93aec941ac8.jpg', 0, 356, '2011-04-22 01:23:35', '0000-00-00 00:00:00', 1),
(12, 219, 'THE NEW BAND', '          THE NEW BAND berdi pada tanggal 17 juli 2000 pada awalnya nama band kami adalah VARIOUS yang beranggotakan, PANCA(Gitar),SANDI(Gitar)DANANG(Bass),SYAM(Drum),WIJI(Vocal) karna Sandi memutuskan untuk meneruskan kuliah, maka dia memutuskan nutuk keluar dari band, maka kekosongan sandi digantikan oleh ULID(Gitar) pada awalnya kami latihan berjalan lancar, tetapi tidak ada kecocokan diantara PANCA dan ULID, disitulah WIJI sang vokalis mengundurkan diri, kami sempat vakum, maka untuk mempertahankan band kami merombak para personil, yang diisi oleh syam(Drum),panca(Gitar),edi(vocal),malay(Gitar)danang(Bass) disitulah kami merubah nama menjadi THE NEW BAND, disinilah kami mencoba bermusik dengan lagu hasil karya kami sendiri, dan menghasilkan 7 lagu, diantaranya :    \r\n    \r\n1, TAKAN ADA MA\\''AF    \r\n    \r\n2, SAYANGKU    \r\n    \r\n3, INDAH    \r\n    \r\n4, BERKIBARLAH BENDERAKU    \r\n    \r\n5, MOHON AMPUNANMU. (RELIGI)    \r\n    \r\n6, KEMBALI MERINDU    \r\n    \r\n7, ????? BELUM ADA JUDUL.    \r\n \r\nFB band :https://www.facebook.com/pages/THE-NEW-BAND/149987988354012 \r\nMy Space :http://www.myspace.com/syam.new \r\nReverbNation Profile: www.reverbnation.com/thenewband2 \r\nyoutube : https://www.youtube.com/watch?v=ufJuoB77gtU&list=LLRG68ku3hky5w-Kc8ofTQhw&index=3&feature=plpp_video \r\n', 1, 'small_4a38a7db49c5f3de5b8fa6544948de05.jpg', 0, 159, '2011-04-22 04:26:40', '0000-00-00 00:00:00', 1),
(13, 257, 'Black Forest', '	 \r\nBand ini terbentuk dari pecahan beberapa band yang akhirnya berkolaborasi menjadi satu grup musik beraliran POP & Alternatif Rock dengan nama \\\\\\"BLACK FOREST\\\\\\" \r\n \r\nBLACK FOREST??? \r\nKebanyakan orang pasti sudah bisa menebak kalo ini adalah salah satu jenis Cake yang hitam diluar nya dengan taburan pernak-pernik ceri & keju.. \r\ntapi setelah dimakan rasa nya hmmm...\\\\\\"Delicious\\\\\\".. \r\nItu juga yang menjadi niat kami untuk memberi nama band ini BLACK FOREST. \r\n \r\nSupaya Setiap orang yang baru mengenal nya bisa tertarik & dan tidak terkecoh dengan penampilan semata.. tapi yang terpenting isi didalam nya.. \r\nyang ga lain adalah hasil karya kita \\\\\\"LAGU-LAGU YANG MENGALUN INDAH\\\\\\".. \r\n \r\n \r\n \r\n\\\\\\"Sukses adalah sebuah perjalanan, bukan tujuan akhir\\\\\\" \r\n \r\n\\\\\\"Dunia menjadi lebih baik karena orang-orang yang sukses selalu melihat potensi terbaik dalam diri semua manusia di sekitar mereka, dan mereka selalu memberikan yang terbaik pula yang mereka punya kepada dunia \\\\\\" \r\n \r\n\\\\\\" kita harus selalu memasukkan rasa hormat, rasa syukur, pengabdian dan rasa cinta kita kepada ALLAH SWT yang telah memberi kita kesempatan melakukan pekerjaan\\\\\\" \r\n \r\n\\\\\\"Pekerjaan itu kita lakukan untuk menunjukkan semua perasaan tersebut kepada Sang Pencipta ALLAH SWT, dan pekerjaan tersebut pada hakikatnya adalah sebuah bentuk ibadah kita kepada-Nya, maka kita pasti akan melakukannya dengan segenap kemampuan kita, sebaik dan sesempurna mungkin \\\\\\" \r\n \r\njadi,,,, \r\n \r\n\\\\\\"Apa pun yang kita tanam dengan sungguh-sungguh, pasti akan berbuah manis di kemudian hari..\\\\\\" \r\n \r\nhttp://www.facebook.com/pages/Black-Forest-Band/147982088578038 \r\nhttp://www.reverbnation.com/blackforestindonesia', 1, 'small_113ff587b281cd5e67bc835611c3e0b8.jpg', 0, 101, '2011-04-22 21:57:03', '0000-00-00 00:00:00', 1),
(14, 399, 'J4LU', 'J4LU terbentuk pada awal tahun 2009 tepatnya dikota bandungyang terdiri dari lima personil diantaranya : \r\nwisnu ( vokal ), randy brexz ( bass ), mukhlas ( keyboard ), vendra ( drums ), dan ega ( guitar melody ).\r\nJ4LU diambil dari nama sunda yang berarti laki - laki. aliran musik J4LU sendiri adalah FREE POP yang mempunya benang merah POP yang diberi nuansa dari berbagai jenis musik seperti : pop, rock, melayu modern, dll.\r\n', 1, 'small_937d03876bac6340b25629feb7cf4b59.jpg', 0, 0, '2011-04-23 14:07:14', '0000-00-00 00:00:00', 1),
(15, 455, 'First Rain', 'First Rain merupakan suatu band indie yang berasal dari pulau Bali yang mengusung aliran Rock Alternatif, band ini sendiri merupakan penyatuan skuad dari beberapa pecahan band-band sebelumnya, berdiri dengan modal nekad, dan percaya diri, band inipun perlahan-lahan mulai menunjukan aksinya, dari kampus ke kampus melantunkan lagu-lagunya tidak meluputkan semangatnya untuk menjadi lebih baik lagi, First Rain berdiri pada tanggal 10 Agustus 2010, dimana nama band yang ditranslete ke bahasa Indonesia yang berarti hujan pertama, ingin membuat suatu image bahwa saat hujan pertama saat awal dan akhir kisah manusia, baik dalam mulai menjalani kehidupan baru dan akhir dari segala kisah kehidupan yang terjalin. Sebelumnya nama band ini yaitu SMALL OUT,namun karena ketidak cocokan nama bagi beberapa personil, maka keputusan mengganti nama menjadi First Rain, adalah awal untuk mencoba berkarir lebih baik lagi. Band yang digawangi oleh Zems (Vocal), Gustut (Gitar), GungWach(Bass) ,Dwix (drumer) dan Mankbudi(auditional Gitar yang masih kelas 6 SD tapi sudah cukup mahir memainkan kunci\\" gitar). Band ini memiliki 5 lagu, namun yang cukup maksimal recordingnya adalah lagu yang berjudul Bebas dan Gadis Pujaanku, yang masih bernuansa realita kisah kehidupan. Beberapa singlenya baru direkam dengan rekaman Live Recording dan aqustik, karena masih kurangnya modal di dalam meloncat lebih tinggi di dunia musik. ', 1, 'small_12e48bc400cba5cc775dad984364cff0.jpg', 0, 0, '2011-04-24 12:08:17', '0000-00-00 00:00:00', 1),
(17, 471, 'Ruzzel Music ', 'profilenya masih entar aja :p ', 1, 'small_6c929623c6e9cf671949a799cdf87533.jpg', 0, 1, '2011-04-24 18:53:01', '0000-00-00 00:00:00', 1),
(19, 308, 'REBELLION START', 'rebellion start terbentuk disamarinda pada 13 april 2009 dengan satu misi dan tujuan yaitu mendukung kemajuan musik indie disamarinda khususx yg pengen nyari duit,ckckckckc.walaupun skrg blm bisa mencetak duit sndiri mgkn ntar deh kami yakin kok duitx bakalan datang sendiri,hohohoho.Walaupun tergolong msh sgt muda tapi para personilx uda lama bgt berkecimpung didunia musik sampe sampe senar gitarx pada karatan,jiah...genre musikx sie yah ga jauh jauh dari rock agak melo dikit,dikit aj sie g byk...pokoke easy listening dah,hahahaha', 1, '', 0, 358, '2011-04-25 07:25:05', '0000-00-00 00:00:00', 1),
(20, 371, 'BANDEAT', 'Berdiri pada pertengahan 2010, band yang terdiri dari 3 personil (drum, bass, dan gitar) awalnya berasal dari band berbeda-beda.. namun karena kebetulan mereka terdaftar dalam suatu organisasi di kampus mereka dan mempunyai kegemaran akan musik yang sama, mereka akhirnya mencoba untuk membentuk sebuah band yang bergenre Pop Punk, dan terbentuklah BANDEAT\r\n\r\nFormers:\r\nJoe (guitar, mic)\r\nEssy (bass, mic)\r\nKristo (drum)\r\n\r\nspace: myspace.com/bandeat\r\nreverbnation: reverbnation.com/bandeat\r\ntwitter: twitter.com/BandEatOfficial\r\nfacebook: BandEat\r\n\r\nBooking Contact: Joe (087771010635)', 1, 'small_7eadcc08ffe3dc6ddf8b94a8754d6dfd.jpg', 0, 186, '2011-04-25 08:44:50', '0000-00-00 00:00:00', 1),
(21, 355, 'denina', 'Denina terbentuk di Jakarta pada tahun 2007. band yang beraliran pop rock dengan sentuhan blues ini digawangi oleh Bango (vokal), Iwank (keyboardis) dan diaz (drummer). Band ini memulai karir bermusiknya dari panggung festival hingga cafe ke cafe. Lalu pada tahun 2008, denina memantapkan diri untuk menjadi salah satu band profesional di tanah air. Dengan bantuan beberapa teman musisi seperti Andi bayou, Wawaz, Ipang BIP, Tafa Alakazam, Yobie Alakazam, Martin Alakazam, Ryan Bintang dan lainnya maka pada pertengahan tahun 2009 denina mempersembahkan album perdana mereka yang bertajuk \\\\\\"1,000,000copy\\\\\\" dengan single andalan mereka \\\\\\''Siapa Bilang\\\\\\''. Single pertama mereka cukup menggebrak musik di tanah air, dengan berbagai keunikan didalam lagu tersebut dapat membuat masyarakat tertarik, terbukti dengan penampilan denina di stasiun-stasiun TV swasta di indonesia, permintaan airplay di radio dan panggung untuk mengisi berbagai acara. Melihat respon dari para pecinta dan penikmat musik tanah air akan karya denina, maka pada pertengahan tahun 2010 denina kembali mengeluarkan single kedua mereka yang berjudul \\\\\\''menangis\\\\\\''.\r\nAda keunikan juga keanehan dalam karya mereka, namun usaha untuk mempersembahkan musik terbaik dengan pengemasan yang menarik terus dilakukan oleh denina untuk masyarakat.\r\nDengan segala kesederhanaan, inilah kami.......\\\\\\"denina, from music and soul of spirit\\\\\\".....', 1, 'small_0ed7ca72b95a9e99c0156a75f071c3b8.jpg', 0, 0, '2011-04-26 07:32:39', '0000-00-00 00:00:00', 1),
(23, 435, 'koma', '14 februari 2003', 1, 'small_37cd2342c6fa7612f20166873739949e.jpg', 0, 0, '2011-04-27 08:20:45', '0000-00-00 00:00:00', 1),
(25, 576, 'HARRU', 'HARRU adalah Band beraliran Glamorous Rock asal Jakarta. HARRU digawangi oleh Tyo (Vocal + Guitar), Adhen (Guitar), Nala (Bass), & Ega (Drum). Hingga saat ini HARRU sudah tampil di berbagai event di berbagai kota, mulai dari Jakarta, Bogor, Sukabumi, Banjar, Banten, & banyak lagi. HARRU sudah menghasilkan beberapa single. Untuk info lengkapnya silahkan mengunjungi facebook HARRU di harru_band@yahoo.com dan www.reverbnation.com/harru. Contact person HARRU 085714562599 atau 087889488447', 1, 'small_d3518c2365e5b709682beca77da68ff4.jpg', 0, 0, '2011-04-28 13:02:55', '0000-00-00 00:00:00', 1),
(26, 695, 'INSOMANIACS CONSPIRE', 'Well, Insomaniacs Conspire formed in late of 2008 started with five men who often finish nighttime in the coffee shop with smokes that never stopped going out from their mouth, and came up with moment where them try to conspirate through media of music. although each personnel had different music background, they tried to play together and after passing through battle argument process and long scrapped of idealist, they succeed composing their own song with exploration of their soul which was channelled within each of their instrument and finally, BAM !! They are INSOMANIACS CONSPIRE. At that moment, singke (bass), wawong (guitar), rizal (guitar) and embonk (drum) collaborated each other to create some tones and completed by hymn from Ali as vocalist. However, the formation did not take a long time. Rizal (guitar) could not continue his contribution because of certain matter and finally his position was replaced by Prabu who was representing lead guitar of The Wallscope before he joined in.but prabu(guitar) and agil(drum) not take long time wit I.C. and embonk replaced by Armando, until Armando replaced by Nobi. And the formation stands until now. Songs of I.C. have contents about social issues, their lyrics related to destiny of Godness, hateness and rebellion and all of that are brought instrumentally ala garage rock and played with harsh distortion and emotion explosions of grunge which are mixed with a nuance of blues rock and theyâ€™re packaged with style which we conceive of \\\\\\" evil rock n\\\\\\'' roll\\\\\\". Insomaniacs Conspire joins with group of BROTHERZ STAIRWAY which is also including ; MOOIKITE and START ME UP !', 1, 'small_62a60432cfdd8239d9a2db2f2e7872a8.jpg', 0, 0, '2011-04-28 14:05:52', '0000-00-00 00:00:00', 1),
(27, 713, 'P.S.Y.C.H', '	\r\nThe story so far, were the people who like to dance whenever the music playin\\''. The real story is, we are making the story now, and we glad to invite all of the people dance with the story with us. P.S.Y.C.H is an abridgment of POLYPHONIC SYNDICATE OF YOUNG CREATURE HABITS, the meaning of we are sick people who told to all of you about the sounds of nowaday people with their habits, what they do, think and stuff.\r\n\r\nThis band wont be a band without the dude behind it, start with ZidahnoerWenda or you can call wenda or zid or whatever, a young attractive talented college girl who fulfill this band with a beautiful voice like Karen O did (oh i adore Karen O like so damn much-bay)\r\nBayurengga ( i cant describe myself,gosh..) just a dude which is great with his own way, i guess.\r\nRizkyParada or you can call Iqy a talented long haired guitarist with his weird behavior but still an enthusisasm rock dude.\r\nAdyatamaTyo or you can call Tyo, a young skinny boy who had a really weird behavior more than iqy, great guitarist also\r\nLast, Dwi Putra the brisk drummer. Have a gutsy power of hitting the drum, a boy in fire.\r\nAnd the man who backed up our story Alby Rachman, manage our journey to became what we want to be.', 1, 'small_6ea51368271ec6c3fd4cb9309bef96e6.jpg', 0, 0, '2011-04-28 18:10:25', '0000-00-00 00:00:00', 1),
