(31, 529, 'Be-leeV d\\''band', 'Band yang dibentuk pada akhir thn 2010 berdasarkan sebuah alasan dimana alasan tersebut pada akhirnya menjadi motivasi, visi dan misi kami dalam usaha untuk dapat mewujudkan cita2 kami yaitu menjadi bagian dari dunia entertaint khususnya di industri musik Indonesiaâ€¦.\r\nAdapun  alasan yang menjadi landasan terbentuknya â€œbe-leeVâ€ dâ€™band adalah arti dari sebuah rasa â€œpercayaâ€ atau yakinâ€ (believe) â€¦â€¦â€¦. Kami â€œpercayaâ€ bahwa apa yg kami cita2kan akan menjadi kenyataan jika kami berusaha (profesional) dan sabar (tekun) dalam menjalaninya, dan yg terutama kami â€œpercayaâ€ bahwa agar dapat menjalani kesemuanya itu harus ada â€œkepercayaanâ€ atau â€œkeyakinanâ€ akan adanya TUHAN dan CINTA â€¦ \r\nDalam artian sebagai seorang manusia kami sadar Di setiap sisi kehidupan kita harus menjalani hubungan dan komunikasi yang baik secara VERTIKAL dan HORIZONTAL dan dengan menjaga kedua komunikasi itu dengan baik dan dilandasi rasa saling percaya maka kesemuanya itu dapat tercapai â€¦. \\"Just believe\\"â€¦ be-leeVâ€¦\r\n', 1, '', 0, 0, '2011-04-29 10:26:58', '0000-00-00 00:00:00', 1),
(32, 615, 'Ice Cream Attack', 'ICE CREAM ATTACK! adalah sebuah band yang beraliran DANCE ROCK. Berawal dari Momow yang awalnya mempunyai project electronica yang dia konsep dan kembangkan sendiri, bernama Chocolate Milksex. Namun selama 1 tahun konsep tersebut tak kunjung menghasilkan sesuatu seperti yang dia inginkan, sampai akhirnya ia mengubah nama band tersebut menjadi Ice Cream Attack! (ICA). ICA mulai berjalan perlahan dengan konsep baru, Momow mengajak Rika untuk bergabung dalam formasi untuk menjadi vokalis, dan Partanx (ex PARTY! LIKE DINOSAURS / THE KIDS) sebagai Bassis. Akhirnya pada tanggal 22 Agustus 2009 band ini resmi terbentuk dengan formasi awal Momow (Beat sampling / guitar / back vocal). Rika (vocal) dan Partanx (Bass / Back vocal). :) \r\nSelama setahun ICA wara-wiri di dunia permusikan indie, akhirnya ICA memutuskan untuk mengajak Teguh untuk mengisi posisi drum dengan pertimbangan agar musik ICA dapat terasa lebih bersemangat sesuai konsep awal terbentuknya band ini. Akhirnya, inilah formasi lengkap ICA : Rika (Vocal), Momow (Beat sampling / guitar / back vocal), Partanx (Bass / Back Vocal) dan Teguh (Drums). :) \r\nNama Ice Cream Attack! dipilih berdasarkan filosofi ice cream (es krim) yang disukai oleh setiap kalangan (dari anak-anak sampai yang tua) dan bikin ketagihan ^_^, sedangkan attack! yang berarti serang dalam bahasa Indonesia, jika digabung menjadi serangan es krim (ice cream attack!) yang dimaksudkan agar musik ICA dapat menyerang semua orang dan bikin ketagihan bagi siapapun yang mendengarnya sehingga nantinya dapat disukai dan diterima oleh setiap orang. (amiiiinnnnâ€¦. ^_^) \r\nIce Cream Attack! memiliki warna musik yang sangat unik, musik ICA adalah perpaduan dari musik pop punk, electronica, pop, rock, dan juga soundtrack-soundtrack masa kecil para personel, serta sound-sound dari console game favorit masing-masing personel. Musik ICA banyak Terinfluence oleh : The Title, Blink 182, Unicorn Kid, Metro Station, Forever The Sickest Kids, dan console game NINTENDO. \r\n', 1, 'small_1053db7cf533e00320b7ec06b43a98d4.jpg', 0, 274, '2011-04-29 13:48:20', '0000-00-00 00:00:00', 1),
