(37, 397, 'RiTMCASE', 'RITMCASE terbentuk pada tanggal 15 februari 2005, terdiri dari 4 personil yang mempunyai visi dan misi yang sama, serta memiliki karakter musik berbeda yang terdapat pada diri masing-masing personil. Ada unsur Rock, Pop, dan Rock â€˜n Roll. Dengan perbedaan karakter musik tersebut RITMCASE mencoba untuk memberikan rasa atau warna musik yang berbeda tetapi masih tetap dalam satu benang merah yaitu â€˜Pop Rockâ€™ \r\nCinta dan pengalaman pribadi adalah sumber inspirasi terbesar dan tak akan pernah terpisahkan dalam pembuatan karya musik kami. \r\nRITMCASE mempunyai arti, yaitu tempat atau wadah dimana kami dapat menuangkan segala kreativitas bermusik kami sehingga menjadi satu pemikiran dalam membuat karya musik. \r\nRITMCASE adalah: Temmy (Vocal), Mauri (Bass), Arief (guitar), dan Fahri (Drum).', 1, 'small_5390592a0869026e4d92403d9dc2267f.jpg', 0, 184, '2011-04-30 20:08:40', '0000-00-00 00:00:00', 1),
