(43, 578, 'Mars 18', '18th March 2007 adalah awal terbentuknya grup kami,berawal dari hobi yang sama dalam bermusik 4 (empat) anak muda : Gee (Vocal/Guitar),Dwie(Guitar),Tanto(Bass),Diwa(Drumm).adalah formasi awal grup ini.Kuningan West java menjadi base camp dimana mereka tumbuh dan berkembang dalam bermusik.terbukti beberapa gigs kecil sempat mereka rasakan dan 2 (dua) Single bisa mereka keluarkan dalam bentuk semi trak.bahkan single ANDAI sempat nongkrong di posisi 1 (satu) di salah satu radio dalam program music indie top chat selama 3 pekan.Setelah mereka selasai sekolah kesibukanpun mulai bertambah dan salah satu dari mereka memutuskan untuk keluar dari formasi awal.hingga akhirnya mereka harus vacum kurang lebih selama 2 (dua) tahun.\r\n     Awal 2009 Tuhan mungkin mempunyai rencana lain untuk grup kami,hingga akhirnya mengutus As-syief (guitar/becking vocal)untuk mengisi kekosongan yang di tinggal salah satu personil.As-syief sendiri adalah kakak kandung dari basis grup kami tanto,yang selama ini bekerja merantau di Bandung West java.berbekal ilmu yang di dapat selama 3 (tiga) tahun bekerja,menjadi modal yang kuat untuk melanjutkan grup ini .dan terbukti 6 (enam) materi lagu yang di buat semi trak berhasil di keluarkan dengan mempunyai ciri labih fress,yang mendapat dukungan financial penuh dari bpk.Enda juanda yang menjadi producer tunggal mempasilitasi semua komponen grup kami mulai dari Sechter guitar,Stephalen guitar up down,Cort Activ Bass,Attack Drumm set,hingga 2(dua) Efect ZOOM G 1 X sries dan Cora Amplifire combo headcabinet.dengan dukungan yang begitu penuh membuat mereka bersemangat dalam bermusik,1 (satu) piagam penghargaan 10 besar mereka dapatkan dari ajang LA Light Soun of Indiependet yang di adakan di kota cirebon.\r\n     Baru saja kami berbahagia dengan prestasi yang kami dapat,lagi-lagi cobaan itu datang menerpa band kami dengan keputusan mundurnya basis kami tanto yang di karenakan kesehatan fisik yang melanda tubuhnya terkena Down Syndrome.tuhan mungkin menyayangi grup kami dengan bersedianya Dyean dan Andre mengisi kekosongan yang kali ini tidak membuat kami vacum,2 (dua) orang ini lah yang terakhir menjadi personil tetap grup kami yang menjadikan musik kami lebih punya ciri khas sendiri.Andre sendiri adalah kaka kandung dari vocalis kami Gee.dan Dyean adalah adik kelas dari gee,diwa sewaktu mereka masih sekolah,maka formasi  jilid 3 (tiga) terbentuk Gee(vocal),As-syief(guitar/becking vocal),Dyean(Guitar skill),Andre(Bass),Diwa(drum).dengan formasi inilah mereka kini siap meramaikan industri musik Indonesia yang saat ini sedang menjadi tuan rumah di negrinya.\r\n     Akhir kata dari kamiâ€¦â€¦â€¦â€¦Welcom to marâ€™s 18â€¦â€¦â€¦go to futureâ€¦â€¦â€¦â€¦.Bravo music Indonesiaâ€¦â€¦â€¦!!!!!!!\r\n     \r\n\r\n\r\n', 1, 'small_67fd8e4779673b662839e0572daa669f.jpg', 0, 0, '2011-05-04 18:20:10', '0000-00-00 00:00:00', 1),
