(49, 1010, 'Simpleday', 'â€œHELLO MY LOVEâ€rnâ€œHello my Loveâ€¦ apa kabar dirimu? Itulah sepenggal lyrik dari single album Simpledayâ€¦ begiturnmudah dicerna, enak didengar dan menghibur tentunya. Sesuai dengan namanya Simpleday ingin\r\nmemberikan nuansa baru musik pop yang easy listening dengan balutan distorsi dan synthesizer.\r\nPada 06 Juni 2008 merupakan awal perjalanan Simpleday, band yang beraliran modern electric\r\ndimana musiknya penuh dengan intrumen digital. Pada masa ini lahir â€œRed Albumâ€. Telah banyakrnevent pagelaran musik, acara pensi sekolah, charity concert, interview serta perform di salahrnsatu stasiun tv lokal, diliput majalah musik dan pernah terlibat dalam penggarapan sound track\r\nKAMBING JANTAN THE MOVIE dengan judul â€œinilah Akuâ€.\r\nDalam perjalanannya Simpleday mengalami perubahan personil yaitu pada vocalistnya, dengan\r\nmeminang Ray Thomson (mantan vocalist Gashka). Pergantian vocalist tentunya juga mengalami\r\nperubahan pada musikalitas Simpleday karena perbedaan karakter, visi serta perkembangan\r\nmusik Indonesia yang begitu pesat. Mereka menamakan jenis POPROCKATIVE dimana musiknya\r\nlebih simple, tegas dan memberikan kenyamanan.\r\nDengan Formasi barunya yang beranggotakan Ray Thompson â€“ Vocal, Nopexu â€“ Guitar , Erin â€“\r\nBass dan Reza â€“ Drum, Simpleday kembali mewarnai belantika musik Indonesia dengan melahirkan\r\nsingle album â€œMY LOVEâ€. Komposisi musik yang disuguhkan terdengar fresh dan easy listening.\r\nLagu-lagu lainnya juga memiliki lirik dan musik yang berkarakter, tegas, sederhana tapi bermakna.\r\nSelain itu kematangan dan pengalaman seluruh personil Simpleday dalam bermusik membuat\r\nSimpleday yakin dapat memiliki tempat di belantika musik tanah air, bukan sekedar menjadi bandrnyang mengikuti trend pasar tapi juga bisa memberikan warna lain musik Indonesia.\r\nSemoga single â€œMY LOVEâ€ dapat diterima oleh penikmat musik di Indonesia serta menjadi\r\npemicu Simpleday dalam berkarya dan melahirkan Album-Album berikutnya...\r\n\r\nBooking Contact : 087877277078 ( Botzky )\r\nemail : rizki.permana@live.com', 1, 'small_627046264952c499364bafd895bd93c3.jpg', 0, 1, '2011-05-13 10:31:11', '0000-00-00 00:00:00', 1),
(50, 1045, 'KEI', 'Just Ordinary People who believe can make Extraordinary Music,Kei yg berarti nama Laki2 (dlm bahasa Jepang) Berdiri tahun 2010,yang berawal dari teman sesama komunitas dan sepakat memilih jalur musik sebagai jalan hidup,kami selalu belajar dan belajar untuk menyempurnakan musik kami dan kami percaya bahwa bahasa musik adalah bahasa dari hati.i\\\\\\\\\\\\\\''ts time to Learn.. from your Heart... -KEI- ', 1, 'small_4c017e4638997efcd81400f2d8b3e1fa.jpg', 0, 0, '2011-05-13 15:49:08', '0000-00-00 00:00:00', 1),
(51, 1013, 'D\\\\\\''Natus', '	Genre : Britpop mix \r\nEdol : Vocal \r\nYuda : Guitar \r\nAlit : Guitar \r\nMundo : Bass \r\nWira : Drum \r\nJoscha : add keyboaRd \r\nManajer : Nety Emilda \r\n \r\ncontact person : \r\n08174761035 \r\n \r\nLabel : A2S Musikindo \r\n \r\nPada pertengahan juni 2008 ....tanpa disengaja seorang laki-laki bernama yuda bertemu dengan sosok laki-laki yang sangat amat katro ndeso yg bernama paul...kbetulan pada saat itu si paul sedang bernyayi-nyanyi riang seperti tante girang^^...lumayan juga nih suarana(gumam yuda).akhirnya yuda mengajak paul untuk membentuk suatu band...seiring berjalannya waktu,kemudian yuda bertemu dian di tempat kerjanya..kebetulaan saat itu si yuda sedang bermain-main gitar sambil melepas letih akan segala pekerjaan yang ada..kemudian dian berkata\\"aku bisa main bass lo...ajak aku di bandmu y?^^\\"begitu kata dian tentunya sambil menunjukkan tampang memelas kepada yuda.karena yuda merasa iba,akhirnya diajaklah dian...kmudian \r\nsosok wira yg kebetulan kaka dari yuda,yg pada saat itu sedang susah mncri krja(pengangguran)di ajak bergabung sebagai penggebuk drum D\\''NATUS', 1, 'small_f9ca9b1dc26a5fc490b9c2b0cff0e637.jpg', 0, 274, '2011-05-15 02:25:55', '0000-00-00 00:00:00', 1),
(52, 1125, 'GEOMETRI BAND', 'Geometri Band terbentuk pd tgl. 14 Maret 2007 dgn personil tetap 4 orang dan 1 additional player. \r\nAnggota band: \r\n1. Agus alias Kentang : Vocal \r\n2. Hadi : Guitar \r\n3. Wiry : Bass \r\n4. Hary : Drum \r\n5. Reza (additional player) : Keyboard. \r\n \r\nGeometri Band mengambil aliran Pop Melayu', 1, 'small_60a845dbe1d1941555187abd1bc9e18a.jpg', 0, 1, '2011-05-16 12:24:34', '0000-00-00 00:00:00', 1),
