(54, 1240, 'SINGLE', '\r\nBerawal dari pertemanan di bangku sekolah, Togi, Nanda dan Yoga membentuk sebuah band dengan nama SINGLE pada tahun 2005. Sebelumnya band ini sudah beberapa kali berganti personil dan inilah formasi terakhir dari SINGLE  Togi (vocal dan guitar), Richad (guitar), Nanda (bass), Yoga (drums). Sebagian lagu â€“ lagu yang kami ciptakan terinspirasi dari semua aliran musik baik dari dalam negeri maupun luar negeri dan aliran musik pop dipilih menjadi aliran musik kami. Saat ini sudah banyak event dan penghargaan yang SINGLE raih, mulai dari memenangkan juara tingkat kota sampai lanjut mengikuti kejuaraan di tingkat nasional. \r\n', 1, 'small_b137752330fb9cb05d86f3266a2c8846.jpg', 0, 1, '2011-05-19 14:24:08', '0000-00-00 00:00:00', 1),
