(56, 1283, 'Devika', 'Devika  \r\nLahir di Tanjungpinang, Kepulauan Riau \r\nSoloist \r\nYogyakarta \r\n \r\nInilah dukungan, dan dukungan itu tidak berarti harus materi, yang terpenting mental. Satu hal yang aku rasakan bahwa ternyata dukungan orangtua, keluarga, sahabat serta teman-teman itu sangat berarti. Semoga suatu saat aku bisa menapaki dunia profesionalku. Keep Spirit ! Insya Allah.', 1, 'small_71efe04de4aab32d4e11a91bdf7205ce.jpg', 0, 265, '2011-05-24 16:19:58', '0000-00-00 00:00:00', 1),
