(58, 1015, 'saratuspersen', '	\\\\\\"\\\\\\''saratuspersen\\\\\\" formed in the beginning of september 2001. we combine a tradiotional music instruments : balinesse gamelan such as pamade & kantil, sundanesse such as kendang & suling, african djembe with a modern music instruments : drum, electric bass, violin, bongo, rotothom & percussion.. http://saratuspersen.com .. http://youtube.com/saratuspersen ', 1, 'small_2d556459caa6680293c197a9e3db056f.jpg', 0, 174, '2011-05-26 01:32:52', '0000-00-00 00:00:00', 1),
(59, 1335, 'PIECES BAND', 'PIECES BAND \r\n	\r\nVocals : BIAN ANGGARA PUTRA\r\nhttp://www.facebook.com/profile.php?id=100000373231353\r\n\r\nGuitar Lead : IVAN STYA RAMADHAN\r\nhttp://www.facebook.com/vanznaged?ref=ffl\r\nhttp://twitter.com/#!/vanznaged\r\n\r\nBass : YUDANSYAH UTAMA PUTRA\r\nhttp://www.facebook.com/yudansyah?sk=info\r\nhttp://twitter.com/#!/Yudansyah\r\n\r\n\r\nGuitar rytem : RIKY BUDIMAN WIBOWO\r\nhttp://www.facebook.com/Vodkanex?ref=ffl\r\nhttp://twitter.com/#!/rikybudimanwibo\r\n\r\nDrumer : RIZPAN ZULKIFLY\r\nhttp://www.facebook.com/profile.php?id=1830326141\r\n\r\nCp : 081298642823', 1, 'small_1fab167dd802769c951c5b1b0c2c7b88.jpg', 0, 171, '2011-05-26 05:57:43', '0000-00-00 00:00:00', 1),
(60, 705, 'CRASH BATTLE', 'Bermula dari persahabatan, terbentuklah formasi awal dalam band ini yang diisi oleh Rian(Guitar/Vocal), Reza(Bass+Vocal), serta Dika(Drum). Berdiri sendiri di kota Semarang indah dan damai. Kami memulai debut dan teror dari awal bulan mei 2007 dan hampir di setiap setiap gigs/show seringkali kami ledakan dengan music punk rock yang kami geluti saat itu. \r\n \r\nNamun seiring berjalannya waktu, setelah 2 tahun kami mengalami banyak perubahan. Perubahan nama pada awal 2010 pun kami lakukan, dari Potelotz Rock berganti Crash Battle . Banyaknya pengalaman dan pemikiran yang baru, membuat kami ingin menggeser genre punk rock Crash Battle yang bertempo cepat menjadi melodic punk/pop punk. Ya, seperti kata Crash Battle yang kita ambil kami tetap berdentam, keras, bertempur dan berpacu itulah musik kami. Crash Battle pun banyak terinfluence dari band-band luar negeri seperti New Found Glory, Blink 182, Melody Fall, Rufio, MXPX, serta band-band pop punk lainnya. Mungkin kami merasa genre inilah yang cocok untuk Crash Battle mainkan, tetap ngebit dan easy listening. \r\n \r\nKarena suatu hal bongkar pasang player pun terjadi pada saat itu, Reza meninggalkan posisinya di bass. Kami pun mengalami pasang surut karena kehilangan player di posisi tersebut. Namun keadaan tersebut tak berlangsung lama, berselang 2 bulan kekosongan tersebut dapat diisi oleh Coki. \r\n \r\nline up : \r\nRian a.k.a Boy ( Guitar/Vocal ) \r\nRifky a.k.a Coki ( Bass/Vocal ) \r\nAdhika a.k.a Sondong ( Drum ) \r\n \r\nDengan 3 player saja kami rasa tetap asik, untuk mengusung genre pop punk/melodic punk di Indonesia ini. we are rawk', 1, '', 0, 220, '2011-05-30 09:22:02', '0000-00-00 00:00:00', 1),
(61, 1247, 'BLACKSUNSET', 'Band Yang Mencari Jati Diri Lewat Bermusik dan Memaknai Sakralnya Matahari Terbenam . . . .', 1, '', 0, 451, '2011-05-31 05:25:52', '0000-00-00 00:00:00', 1),
(62, 1455, 'Veho', 'SAGA-vokal,   \r\nFAHMI-keyboard,   \r\nSOULYA-bass,   \r\nTEGAR-gitar,   \r\nDELA-drum.   \r\n   \r\nVEHO mulai diproklamasikan pada 27 Mei 2005, di Kudus, Jawa Tengah. Berangkat dari suasana duka bangsa, karena bencana alam dan tragedi terjadi dimana-mana. Kami menyaksikan semua itu, dari tanah longsor, banjir, tsunami, gempa bumi hingga ancaman dari pembangunan pembangkit listrik tenaga nuklir di Semenanjung Muria. Semua itu menggelisahkan kami.    \r\n     \r\nDidirikan pertama kali oleh Asa bersama Saga. Lalu kami melewati jalan setapak yang sepi di rimba raya musik Indonesia, dengan membekali diri dengan persiapan skill, mental dan kepekaan sosial. Pelahan-lahan kami berhasil rekaman secara swadaya, sampai menghasilkan 20 lagu saat ini.     \r\n     \r\nVeho merupakan akronim dari filosofi vertikal horizontal. Yang bisa diartikan selalu ingin ingat Tuhan dan peduli dengan lingkungan dan sesama. Dinamis dan universal. Mengusung aliran tanpa batas, seluas dan sekaya proses kreatif yang dijalani. Namun, melihat karya yang ada, barangkali dapat dimasukkan (untuk sementara ini) ke dalam aliran pop-rock alternatif.    \r\nTahun 2010, melalui perjuangan yang panjang dan berat, VEHO berhasil memasukkan dua lagunya ke dalam dua album sekaligus. Antara lain:     \r\nâ€¢	Lagu Salam Terbaik masuk dalam album kompilasi ENAK DI KUPING, Produksi Nadamusic Records.    \r\nâ€¢	Lagu Daya masuk dalam album kompilasi ROCK-GROUND, Produksi Trinalarsmusic.    \r\nCP: 087882796690 - 085740571929 (asa)   \r\n-salamduajari-', 1, '', 0, 1, '2011-06-03 10:34:29', '0000-00-00 00:00:00', 1),
(63, 1472, 'CipikaCipiki', 'KITA MASIH ADA karena kita tertuntut dengan KEBERADAAN KITA..  \r\n\r\nSemangat kawan hari esok makin menyempit,.', 1, 'small_586d6600b35b806137f8d3baac8b48ca.jpg', 0, 182, '2011-06-05 18:50:56', '0000-00-00 00:00:00', 1),
(64, 1527, 'NAERA', 'NAERA, band asal Jogjakarta yang memulai eksistensinya sejak 1 july 2007.Setelah mengalami pasang surut di industri musik dan di barengi dengan perubahan Formasi , maka di tahun 2011 ini Naera kembali hadir dengan Konsep musik yang telah disempurnakan, masih perpaduan dari beberapa genre musik populer seperti ; pop, rock n roll, Brit pop/rock, Japanese pop/rock, reggae, dan masih banyak lg yang akan kami explore untuk menciptakan suatu karya musik yang cerdas namun tetap dikemas dalam nuansa yang easy listening, sangat Khas NAERA.', 1, 'small_42af5463743796c361e8c3dfe0ce70fb.jpg', 0, 265, '2011-06-06 19:39:21', '0000-00-00 00:00:00', 1),
