(69, 156, 'instant band', 'Sebuah band indie pekanbaru yang berdiri pada tanggal 12 juli 2005, yang beranggotakan 5 orang personeels yaitu :\r\n\r\nfaisal pada vocal + rithym\r\nOki pada Guitar 1\r\nNike pada gitar 2\r\nLukman pada bass, dan\r\nQQ pada Drum\r\n\r\nband yang terbentuk 7 tahun yang lalu ini telah menuai beberapa prestasi yang cukup menggembirakan, diantaranya Lolos audisi 10 band local dalam ciptaan lagu terbaik yang ada dipekanbaru dan menyandang juara pertama pada indie 5 persada radio dengan single hits pertama mereka yang berjudul Terbang.\r\n', 1, '', 0, 85, '2011-06-18 03:45:30', '0000-00-00 00:00:00', 1);
