(70, 1604, 'Electrik Rancu', 'ER are an Indonesia alternative rock band from Bandung, West Java, formed 2006. ER consists of school friends Afrinanda (Voice, Lead guitar, Techno), Dwi Aditya Nugraha (Bass, back vocal), and Imam Muhammad Abdurohman (Drum, Backing vocal, Percussion). ER have released Mini Album in 2009 by ER Management (own record). They released one hits single (Luka Serdadu). This album was very much figure their music genre (especially on Luka Serdadu song). Luka serdadu self has played in several radio stations in Bandung and Jakarta. Luka serdadu was 3rd championship win in LALIGTS video contest. After that they released LET\\''S RISE TOGETHER(now the name is 1 MIMPI) song in the 2010. But it was not success like Luka Serdadu song. HISTORY This is started when they were Senior High School in the middle 2004. They often participated in their school music event. But at the time they played music in separate band. The formation of ER began when Afree suggested Aditya to join with his band as bassist. Afree\\''s first named band was Inspire band and he played guitar at the time. But Inspire had problem inside. Only Afree and Aditya who made it survive. After graduate school in 2006, Afree and Aditya started taking themselves seriously. At that moment, Imam decided to join with them. Imam was aditya\\''s vocalist before. But he has become Afree\\''s drummer too. Unfortunately, the name band Inspire was already used by other people. So they decided to change the name band become Electrik Rancu in 2008. Electrik Rancu have performed in many place and took home many of certificates. They also released their Mini Album with hits single Luka Serdadu in 2009 and then they released their hits single 1 Mimpi in 2010. The name of Electrik Rancu have a problem in the spelling and writing. Sometimes, Host called us Electronik Rancu. Beside it, Electrik Rancu\\''s friends didn\\''t call them Electrik Rancu but they called them ER. So, they decided to use ER as their name of group', 1, 'small_630e021100b47cdf513233b8a7dee842.jpg', 0, 174, '2011-06-20 08:24:57', '0000-00-00 00:00:00', 1),
(73, 2060, 'Artca', 'ARTCA adalah grup musik yang beranggotakan Doni ( vocal / gitar ), Menet (bass / vocal), Yasir (drum) Habib ( gitar), Jey Syahrin ( keyboard / violin ). Sampai tahun 2011 mereka telah menghasilkan 5 lagu karya sendiri yang telah direcord dibeberapa studio recording di Kota Pekanbaru. Artca terbentuk tahun 2004. Motif pembentuknya ketika lima orang yang memiliki minat serta misi yang sama untuk terjun kedunia musik, membentuk sebuah grup band yang bernama ARTCA band.   \r\nSeiring dengan perjalanan waktu, ARTCA mengalami beberapa kali pergantian personil.. Awal tahun 2007, Doni yang awalnya sebagai drummer ingin kembali mengibarkan kiprah ARTCA. Dengan mengubah kiblat musik menjadi rock alternative yang dinaungi oleh Dony (vocal), Andy (gitar), Agie (bass), Levi (keyboard), Arief (drummer). Pada bulan Juli 2007 Artca mulai merecord lagu pertamanya berjudul Berharap. Artca mulai aktif mengikuti event-event dan parade di kota Pekanbaru. Namun dengan beberapa alasan, ARTCA kembali kehilangan personil, ketika Arief (drummer), Agie (bass), dan Levi (keyboard) menyatakan mengundurkan diri. Tahun 2008 Artca band kembali membuat formasi baru dengan Doni (vocal), Andy (Gitar), Ira (Gitar 2), Welly (Bass), dan Indra (Drummer).  \r\n Kemudian berhasil merecord dua lagu yang berjudul Semua Rasa dan Perpisahan Yang Indah. Pada pertengahan tahun, Ira yang diposisi gitar 2 mengundurkan diri dengan alasan kesehatan. Yang kemudian di gantikan oleh Menet, sedangkan keyboard diisi oleh Andika. Yang kemudian melakukan record atas lagu ke empat dan lima yaitu, Di Sini dan Sendiri. Pada Juni 2009, sang drummer (Indra) dan gitar 2 (menet) mengundurkan diri dikarenakan kesibukan pekerjaan.  \r\n Di tahun 2011 Artca terjadi beberapa kali  perubahan pertama posisi diisi Doni (vocal), Andy (gitar), Hary (keyboard), dan Chay (drum) dan Agie (add-bass).  Kedua, beranggotakan Citra ( vocal ), Doni (gitar), Menet (gitar / vocal), Yasir (drum) dan Habib ( bass). Ketiga demi keeksisan didalam bermusik kembali berubah dimana Doni ( vocal ), Menet (bass / vocal), Yasir (drum), Habib ( gitar), Jey Syahrin ( keyboard / violin ), Yasir ( drum) . \r\n  \r\n', 1, 'small_387b294aaff0ff030d3e22f0a22d5b94.jpg', 0, 85, '2011-07-11 10:43:57', '0000-00-00 00:00:00', 1),
(76, 2412, 'Tikus God', 'Kami terbentuk dari rekan2 kampus. Beda angkatan. Beda usia. Sama visi. Sama aliran musik.\r\ningredient asal kami adalah Grunge..(sampai saat ini masih berusaha utk nge-Grunge).\r\nSaat ini kami sedang ekplorasi untuk mencipta lagu semacam Tool dan A Perfect Circle yang sangat deep emotional (setidak menurut kami).\r\n\r\nKami terdiri dari:\r\n1. Is Harjatno a.k.a is (Vokal)\r\n2. Andriy Firdaus a.k.a dauz (lead guitar)\r\n-both of them replaced by Dimas Catur a.k.a bim-bim (vokal & lead guitar)-\r\n3. Akbar Nugroho a.k.a qotot (guitar)\r\n4. Faris Septian a.k.a muci (bass)\r\n5. Dana Fatardha a.k.a kukang (drummer)\r\n\r\nSo, here we are...keep rockin in the free world!!!', 1, '', 0, 260, '2011-07-22 01:25:46', '0000-00-00 00:00:00', 1),
(77, 98, 'Sisi Selatan', 'Punk Rock', 1, 'small_803cfc9c671718541409aa5eeb3cc2c0.jpg', 0, 215, '2011-08-04 06:36:19', '0000-00-00 00:00:00', 1),
(85, 2292, '100%', 'koko and ozi 100%', 1, '', 0, 219, '2011-08-13 08:45:03', '0000-00-00 00:00:00', 1),
(87, 2493, 'VANDITA', 'VANDITA mulai terbentuk pada tanggal 10 Mei 2007,beranggotakan 6 orang personil yaituâ€¢Yugie sebagai vokalisâ€¢Faisal sebagai lead guitarâ€¢Egi sebagai rythem guitarâ€¢Yudi sebagai bassistâ€¢ Eef sebagai keybordistâ€¢Indra sebagai drummer Nama VANDITA itu sendiri terinspirasi dari salah satu istilah dalam sejarah kebudayaan Indonesia, yaitu Pandita yang berarti orang yang berilmu,sangatlah relevan dengan pencitraan jatidiri kami yang selalu ingin mencari wawasan dan pengetahuan khususnya dalam bidang musik,maka dari itu kami sepakat memberi nama VANDITA agar disetiap moment dalam perjalanan kami menggeluti bidang ini,kami akan selalu mendapatkan ilmu yang bisa dijadikan pembelajaran sebagai bekal untuk menghadapi persaingan yang sangat ketat di blantika musik tanah air ini.', 1, '', 0, 174, '2011-08-19 12:38:10', '0000-00-00 00:00:00', 1),
(89, 122, 'HEY STEREO', 'Hey Stereo was established in 2010. the band is Gilang Maulana , Beth and Adit . We\\''re called our genre is electronic. So just shut your mouth , sit tight and behold the new form of the audio !! Cheerss !  \r\n', 1, 'small_0621dba9546c23393fc7bd76cf6186af.jpg', 0, 174, '2011-08-22 17:46:15', '0000-00-00 00:00:00', 1),
