(91, 2551, 'SuperWonderland', 'Formed sometimes in 2007, started by common interest of Kings of Convenience and some old jazz records, we began to make smooth, acoustic, modern, and relaxing sound..\r\n\r\nRangga Danusa along with his mate Didit Trisunu (Cherrycola) came up with the idea of making an elctronic-acoustic band (inspired by Royksopp vs Kings of Convenience album) and began to make song together.. However they found some difficulties of making that kind of music, so they asked Abram a.k.a The Abrams, Jimmy Silitonga, and DJ Rendi to join the band.. After played on a few gigs, Didit left the band to get more serious in Cherrycola, followed by DJ Rendi who also left the band to concentrate on his 9 to 5 work..\r\n\r\nThe three member left felt that they didn\\''t need to recruit new members so they decided to move on a solid formation:\r\nRangga Danusa - vocal / beat / strings\r\nAbram Pranata Ginting - guitar / beat / vocal / bass / strings\r\nJimmy Silitonga - guitar / vocal\r\n\r\n..and now we are ready to welcome everyone to our wonderland..\r\n', 1, 'small_1461e0801077177eff570e4946e25dc8.jpg', 0, 51, '2011-08-27 10:34:53', '0000-00-00 00:00:00', 1),
(92, 2502, 'Chicken Shit Flower', 'Sebuah band yang dimotori oleh paramuda sriwijaya tulen.       \r\n@bulekasanova  : vox       \r\n@maritoalbi      : bass       \r\n@cheppy_54     : gitar       \r\n@davi_dag        : gitar       \r\n@abimblacksheep             : drum       \r\n       \r\ncp : @diazantoni +62 856 69 4104 47 atau @davi-dag +62 819 94 92 4100       \r\n       \r\nhttp://www.myspace.com/chickenshitflowers       \r\nhttp://www.facebook.com/chickenshitflower       \r\nhttp://www.purevolume.com/chickenshitflo...       \r\nhttp://www.youtube.com/cheppyaditya     \r\nhttps://twitter.com/#!/CSF_riends', 1, 'small_74236aae6f0172d55825932fd6e55996.jpg', 0, 120, '2011-08-28 16:21:13', '0000-00-00 00:00:00', 1),
(94, 2622, 'ROGER A', 'TERBENTUK PADA AKHIR TAHUN 2008 DI PUSAT IBUKOTA, REGIE, GERI, AGUNG, AGUS. MENCOBA UNTUK BEREKSPRESI TANPA BATAS,, YAITU DENGAN CARA MEMBUAT BAND. TERACUNI BERBAGAI JENIS MUSIk, ROGER A MENCOBA MENCIPTAKAN SEBUAH KARYA YANG BUKAN HANYA DILIHAT DAN DIDENGAR DARI EMOSI HATI TAPI JUGA PIKIRAN DAN LOGIKA. MENGGAMBARKAN DUNIA YANG RUMIT INI BUKAN HANYA DARI RASA DANGKAL SIFAT MANUSIA TAPI JUGA PERHITUNGAN MATANG MANUSIA BERADAB, MANUSIA YANG BERPIKIR, MANUSIA YANG KRITIS.\r\nSTONE ROSES, KASABIAN, THE STROKES, SERINGAI DAN THE BRANDALS HANYA SEDIKIT BAND DARI BANYAKNYA INFLUENCE YANG TURUT MEMBANGUN CIRI KHAS MUSIK ROGER A.\r\nTAHUN 2010, MUSIK ROGER A MENJADI LEBIH DINAMIS DENGAN BERGABUNGNYA CIBE MENGGANTIKAN AGUS. HINGGA KINI, ROGER A SEMAKIN TIDAK TERBENDUNG. PANGGUNG DEMI PANGGUNG, KOMPILASI DEMI KOMPILASI DIJAJAKI GUNA MENYEBARLUASKAN SUARA â€“ SUARA KEGELISAHAN DAN KEMARAHAN KAUM URBAN YANG MENGINGINKAN KEHIDUPAN YANG LEBIH LAYAK DI IBUKOTA.\r\n\\"Roger A\\"\r\n', 1, 'small_88ba3123d0aa4c20eb81942792a35afb.jpg', 0, 184, '2011-09-06 15:11:15', '0000-00-00 00:00:00', 1),
(96, 2578, 'Nagakid', 'NAGAKID BAND\r\nVOCAL: adjie\r\nGUITAR: iip\r\nBASS: Shendy\r\nDRUM: Qboth\r\nContact Person: 08816182603, 081355717949,\r\ntwitter @ NagaKidband\r\nFB: https://www.facebook.com/nagakidband\r\n\r\nBand rock, Nagakid terdiri dari 4 personil, *Adjie* sebagai vokalis, *iip* sebagai gitaris, *Shendy* sebagai bassist, dan *Q-Both* sebagai drummer. Nagakid sendiri berasal dari kata Naga (Indonesia) / dragon (Inggris), tokoh fantasi yang memiliki karakter  hewan yang kuat, tidak takut semua hambatan dan rintangan, sementara Kid yang berarti orang muda yang memiliki jutaan mimpi. Jadi kita menggabungkan dua kata pada nama sebuah band. Kami membentuk band pada tahun 2010, tepatnya pada tanggal 11 Maret 2010. Pada awalnya band ini memiliki personil yang berbeda dan kami dengan formasi yang sekarang akan berusaha tetap optimis demi menggapai sebuah impian masa depan.', 1, 'small_83657aeab90ded717d289f10eae71660.jpg', 0, 184, '2011-09-06 21:28:46', '0000-00-00 00:00:00', 1),
(97, 752, 'Darryl Wezy', '   \r\n \r\nÂ   \r\n  \r\nDarryl Wezy, born in Jakarta, July 5th 1989 and grew up musically exposed since he was kid, influenced by his parents addiction towards 70s music. He found his passion in music after watching MTV in the 90s and he starts to collect cassettes ever since.  His stage name, Darryl Wezy, is a pseudonym name that he got when he was daydreaming at high school during recess time.  â€œThereâ€™s no reason why I chose Darryl Wezy, but I would like to use this name when I become a musician someday.â€ said this 22 years old musician. He stated that his music has been influenced mostly by The Beatles, The Beach Boys, The Mamas and The Papas, The Free Design, Pulp, Ash, The Cardigans, Weezer, The Concretes, The Lightning Seeds, The High Llamas, Sondre Lerche, Sufjan Stevens, SORE, and White Shoes And The Couples Company. Darryl Wezy has just released his first single â€œAutomatic Highâ€ on January 1st 2012 through site A Music Network and exclusively free download through http://bit.ly/automatichigh. â€œAutomatic Highâ€ tells about how a person is facing a fake friendship and should be able to survive and find a new spirit in any way. The lyrics tend to be satire, because Darryl was trying to emphasize the disappointment without having to be over dramatic. He announced the date release of his debut album might be around Spring 2012. The album will be titled â€œMaze of Fearsâ€. â€œMaze of Fears consists of 11 songs telling about how to encounter your fears in relationships, family, friendships, cultural issues, and how to gain self empowerment and motivation for ourselves.â€ explained Darryl.  The album was successfully realized after Darryl participated in A Music Network, music audition program, in which five acoustic songs offered by him successfully set aside tens of other participants. And now the five acoustic tracks have expanded to 11 songs arranged with producer Aghi Narottama (Janji Joni, KALA, The Forbidden Door, ONROP! Musikal, Negeri 5 Menara) and a string section assisted by Alvin Witarsa. In his live performances, Darryl Wezy will be performing in a full band consisted of Ganesha Pratama (Guitar), Ridwan Yuniardhika (Lead Guitar), Anzarra Djahran (Keyboard), Efra Pratama Harya (Bass), and Aidil Akbar (Drum).  Among the other bands and singers that have sprung up in the music industry Indonesia, Darryl Wezy is one of the soloists who dares to explore more in each arrangements in his songs. To describe the album may be described with the phrase: â€œThe big dreams of a person arranged with Chamber Pop and a little touch of cinematic.â€  \r\n  \r\nÂ   \r\n  For further information, please contact:Â   \r\nÂ   \r\nÂ   \r\n  \r\nCanti Widyadhari  \r\nPersonal Manager  \r\nMobile: +628999047513  \r\nEmail: darrylwezymusic@gmail.com  \r\nÂ   \r\nGyanda Agtyani  \r\nPublicist  \r\nMobile: +628568577475  \r\nEmail: darrylwezymusic@gmail.com', 1, 'small_cacee60e8b83cf988695d79e80acfc8a.jpg', 0, 184, '2011-09-07 07:32:07', '0000-00-00 00:00:00', 1),
(98, 2615, 'Trendkill Cowboys Rebellion', '	\r\nis a band that was formed from a mini-jam session in 2005 by four pals curiously loud music lovers and fans of Pantera and Philip Anselmo.\r\nThe material of this band is not as complicated as you think about the loud music, the band\\''s musical material is still very little can be enjoyed in common.\r\n\r\nIn 2007 we released a single for indie compilation entitled \\"The Liberation Of Ego\\" followed the single to the two titled \\"Hello Cowboy\\" made with \\"Tiga Setia Gara\\" a vocalist of hardcore punk band \\"Silly Riot\\".\r\nCommencing from the year 2010 we wrote some new material which also later will become our first full album release under the \\"Strive Records\\"\r\n\r\nIn the year 2011 was our third single, entitled \\"Menolak Tunduk\\" is also included in a compilation of indie \\''Show Your Attitude \\"by Strive Records.\r\nOur full album to be completed by mid August 2011 and will be circulated in the market around the end of August via the on line store or a local record store.', 1, '', 0, 187, '2011-09-08 11:05:26', '0000-00-00 00:00:00', 1),
(99, 1806, 'el\\''Cappucino', 'berdiri pada tanggal 07 Maret 2008, dengan mengusung music bergenre Rn\\''D ( Rock n Disco ). Perihal kehidupan jadi tema lirik yang dikemas dengan musik asik berirama disco yang dibalut dengan sound guitars berdistorsi tebal dan rock. \r\nCP : 087 835 622 922	  \r\n', 1, 'small_ed46c33ebcec38099ff062454778b669.jpg', 0, 221, '2011-09-12 09:24:14', '0000-00-00 00:00:00', 1),
(100, 2636, 'The Object of Addictive', 'Genre	: Garage rock, Indie rock, Alternative.\r\nMembers	: Rocky Guntaras (Voc), Bima Andhika (Guitar), Septian Joharis (Guitar), M Taufik Tarigan (Bass), Ishar Alamsyah (Drum)\r\nHometown	: Medan\r\nAbout	: Garage rock band from Medan, Indonesia. Since 2007, and still addictive.\r\nCurrent Location	 : Medan, Indonesia\r\nGeneral Manager	 : Risyad Arif Zulhamzah (085760928384) (06176256048)\r\nPress Contact	: Fandi Abdullah (0856 6238 505)', 1, '', 0, 51, '2011-09-15 09:35:11', '0000-00-00 00:00:00', 1),
(101, 2629, 'Hairdresser on Fire', 'WE ARE HAIRDRESSER ON FIRE! \r\n \r\nformed in august 2006. Inspired by many sounds, cause every member of this band is from different ego and influences. we like to called our music Art Punk. . Cunin (guitar) and Andre (drum) was influenced by britpop and madchester sounds, Ican (guitar) was influenced by metal and also experimental post rock, Embun (voc) adore lydia lunch and debbie harry she\\''s truly inspired by them, Reza (bass) is playing \\"the first thing that pop out in his mind\\" \r\n \r\nfor now we already have 10 tracks, One track to another track has many different sounds. from punk, disco, metal, psychedelic, post-punk. we just have to compromised with 5 different sounds, 5 different ego of us and mixed it into one, and...we made it! \r\n \r\nthis is just only a very new beginning for us \r\n \r\n\\"Hairdresser On Fire are spitting snarling punk-rock done to perfection. It recalls the brutality and swagger of \\''Live Through This\\'' era Hole.\\" -Chris Martin, NME RADIO UK Announcer \r\n \r\n\\"Akhirnya Pretty Girls Make Grave menemukan rivalnya\\" - TRAX Magz \r\n \r\n\\" ........meski dancerock dan frontwoman tidak terlalu ngetren lagi tetapi mereka tetap darah segar di scene medan yang membosankan ini setidaknya.\\" - WAVEZINE E-Magz Vol 2 (www.wavezine.co.cc) \r\n \r\n\\"seperti percampuran antara YYY\\''s dan Young and restless \\" - Rian pelor@ Riot On Air Prambors', 1, '', 0, 51, '2011-09-15 10:15:26', '0000-00-00 00:00:00', 1),
(102, 2599, 'Black Star', 'Berawal dari scene musik indie di Jakarta yang sedang terasuki aliran rock Britania yang sarat pengaruh band semacam Radiohead, Muse atau Coldplay di awal era tahun 2000an. Sekelompok pemuda dari kawasan Lebak Bulus mulai merambah dari panggung ke panggung membawakan lagu-lagu dari band-band tersebut. \r\n \r\nKematangan di panggung mereka peroleh melalui pengalaman bertahun-tahun itu dituangkan dalam sebuah album perdana yang dikerjakan dengan penuh totalitas, memadukan pengalaman dan kreatifitas untuk menghasilkan karya-karya yang memiliki ciri khas tersendiri di kancah musik Indonesia yang didominasi lagu-lagu pop monoton. Karena itulah, `Black Star` berupaya memberikan sesuatu yang lain dalam sentuhan musik alternatif beraroma Britania. \r\n \r\nDengan formasi terakhir, yaitu: Emir (vokal), Alul (gitar), Yudi (gitar), Q-nos (bas), Ine (kibor) dan Roby (drum), mereka merilis album bekerja sama dengan Fiasco Records. Proses rekaman album perdana mereka sendiri membutuhkan waktu sekitar 3 tahun, mulai dari menyiapkan materi, meramu aransemen dan komposisi hingga ke penataan proses rekaman. Hasilnya, sebuah album dengan nuansa gelap dengan ciri khas warna suara dan gaya bernyanyi Emir yang unik dan berbeda dari vokalis band Indonesia pada umumnya. \r\n \r\nAlbum `Black Star` sendiri berkisar seputar penyakit yang berjangkit di masyarakat. Entah itu penyakit biologis, psikologis ataupun sosial. \\"Kami ingin mengangkat tema-tema yang jarang disentuh oleh band-band lain,â€ tutur Emir. Singel pertama dari album ini berjudul â€œAbnormal Akuâ€ mendapat sambutan cukup baik di kalangan pecinta musik indie Indonesia. Single yang menceritakan seorang penderita disleksia ini mengalun sendu dengan nuansa gelap namun terdengar manis di telinga berkat balutan pop yang diusung `Black Star`. Seacara tidak langsung kita diingatkan untuk membangun empati terhadap sesama, bahwa manusia tak luput dari â€˜kekuranganâ€™. â€œSebenarnya di dunia ini tidak ada orang yang normal, karena setiap manusia berbeda. Setiap orang punya keunikan tersendiri.â€ kata Alul, gitaris `Black Star`. Album yang tidak familiar, topik yang tidak familiar, musik yang tidak familiar, tapi mereka yakin dengan album ini. Black Star! Dan biarlah Sang Bintang Hitam ini berteriak lantang tentang semua penyakit dan kesakitan mereka! \r\n \r\nSaat ini, mereka kembali berkutat di dapur rekaman dalam rangka mempersiapkan album ke-2 yang rencananya bakal dirilis pada pertengahan tahun 2012 ini. \\"Dari sekian banyak materi, kami akan memilih 12 trek untuk album ke-2 ini,\\" tutur Alul lagi. Sejauh ini, single awal dari album tersebut, \\"Penuh Diksi\\", yang benuansa akustik telah berhasil menembus chart di beberapa radio. Yang pasti, mereka menjanjikan perubahan di album baru ini. Seperti apa albumnya? Yang jelas pasti masih eksperimental. \r\n', 1, '', 0, 186, '2011-09-16 15:40:05', '0000-00-00 00:00:00', 1),
(103, 2647, 'Giffarie Ownie & The Moonlight Horse', 'just loking for some soul', 1, '', 0, 51, '2011-09-18 06:28:37', '0000-00-00 00:00:00', 1),
(105, 2738, 'D\\''RAFTER', 'd\\''Rafter atau duo rafter adalah dua orang vokalis band yang mempunyai visi misi dan aliran musik yang sama.   \r\n   \r\nkarena kesamaan itulah mereka memutuskan untuk membentuk sebuah group duo vokal yang mengusung aliran pop alternatif.   \r\n   \r\nd\\''Rafter sendiri terbentuk pada tanggal 10 Oktober 2010.   \r\n   \r\nNama d\\''rafter sendiri diambil dari spesialisasi bidang kepencintaalaman mereka yaitu arung jeram atau biasa disebut rafting, yang pada penggiat raftingnya disebut rafter.   \r\n   \r\nUntuk didalam musik sendiri d\\''Rafter memiliki filosofi seperti rafting pada umumnya, yaitu akan terus mengikuti aliran musik kemanapun arahnya dan tak akan pernah berhenti mengalir.   \r\n   \r\nNamun tetap pada umumnya, musik mereka menceritakan kisah percintaan sehari-hari yang mudah dicerna dan tetap dapat dinikmati dengan hati.   \r\n   \r\nDalam albumnya pun d\\''Rafter sudah memiliki single andalan mereka \\"Be My Girl\\" dan \\"Lupakanlah\\".   \r\n   \r\nd\\''Rafter \\"melody of soul\\", musik dengan melodi dari dalam jiwa.   \r\n   \r\nNamun untuk performance atau aksi panggung mereka, d\\''Rafter sendiri selalu lengkap dengan player additional mereka baik format full band maupun unplugged accoustic.   \r\n   \r\nd\\''Rafter sendiri juga suka membawakan lagu-lagu Top 40 disetiap performance mereka, dengan kemasan musik yang segar dan asyik untuk dinikmati.   \r\n   \r\n   \r\nContact person d\\''Rafter :   \r\n   \r\n- Ryan	: 085697736343 / 021-93858187   \r\n   \r\n- Nono	: 087881117226 / 021-93003351   \r\n   \r\n   \r\nLink page about d\\''Rafter :   \r\n   \r\n-facebook 		: d\\''Rafter Rafternizer (http://www.facebook.com/#!/profile.php?id=100002141324375)   \r\n   \r\n-fans page facebook 	: d\\''Rafter (http://www.facebook.com/#!/pages/dRafter/113298915426417)   \r\n   \r\n-Twitter		: @drafternizer (http://twitter.com/#!/drafternizer)   \r\n   \r\n-Reverbnation		: d\\''Rafter Rafternizer (http://www.reverbnation.com/drafterrafternizer)   \r\n   \r\n-You Tube		: Video Clip d\\''Rafter \\"Be My Girl\\" (http://www.youtube.com/watch?v=21_hnqaGBQ4)   \r\n', 1, '', 0, 184, '2011-09-22 18:03:08', '0000-00-00 00:00:00', 1),
(107, 2639, 'Several Bad Puns Later', 'Several Bad Puns Later terbentuk pada tahun 2004 hingga kini tanpa ada batasan apapun. Bukan sekedar sebuah band tetapi sebuah keluarga. Mungkin terlalu panjang dan kompleks untuk diceritakan. Entah pula dari mana harus dijabarkan. Several Bad Puns Later adalah sebuah gambaran tentang kekuatan dan kelemahan hati manusia. Banyak hal yang terjadi didalamnya. Bertahan di atas nilai persahabatan  dan kepercayaan yang lumrah dimiliki berjuta-juta penduduk di dunia.  \r\nSingkat saja, sejak 2004 Several Bad Puns Later mengalami banyak perubahan line up pemain. Kesibukan dan prioritas selalu jadi alasan mengapa itu terjadi. Tetapi hingga kini kita tidak pernah terurai, satu sama lain selalu memberikan dukungan dan semangat. Several Bad Puns Later terangkum oleh Vira sebagai vokalis, Daris dan Fikri sebagai gitaris, Deddy sebagai bassis, terakhir Geo sebagai drummer. Sebuah band yang mengemas musik dari beberapa pengaruh genre yang dimiliki setiap pemainnya. Rock adalah garis bawahnya dan tidak perduli jaman mempermainkannya. \r\nDitahun 2011 ini kita akan meluncurkan sebuah album perdana yang berisi perjalanan hidup singkat Several Bad Puns Later. Walau terlambat, setidaknya kita berusaha mewujudkan apa yang menjadi kewajiban dari setiap band. Sekali lagi, kita bukan pemenang tetapi kita bahagia. Biar waktu yang menentukan mimpi kita semua dan semoga ini bukan sia-sia. Amin.  \r\n \r\nWeb links: \r\nhttp://www.purevolume.com/severalband (please check for free download our songs) \r\nhttp://www.twitter.com/SBPL_band \r\nhttp://www.myspace.com/severalband \r\nhttp://www.reverbnation.com/severalband \r\nhttp://www.sixteenhole.com/profile/severalband \r\n \r\nFor more info and booking: \r\nRamses 0819-32814128 / 021-99876093 \r\nDipta 0818-400860 / 021-99111448 \r\n', 1, '', 0, 186, '2011-10-04 19:36:21', '0000-00-00 00:00:00', 1),
(108, 2521, 'CLOVER', 'â€¢	Secara filosofi nama Clover pada dasarnya berasal dari pertemuan lima arah jalur semanggi .atau yang klita kenal daun semanggi dan memiliki aliran Pop Rock.  \r\nâ€¢	Beberapa alasan mengapa memutuskan untuk menggunakan Clover sebagai nama band karena lagu-lagunya memiliki karakteristik Pop Rock dan juga memiliki lirik lagu yang bertemakan kehidupan cinta yang romantis. Kemudian secara bahasa nama Clover juga mudah untuk diingat . \r\nâ€¢	Di sisi lain, lagu-lagu Clover masih berpedoman dengan nilai-nilai komersial karena sesuai Visi dan Misi adalah mempunyai banyak pertunjukan atau panggung, penggemar dan bergabung dengan major label, dan siap untuk berjuang masuk industri pasar Indonesia, bahkan impian untuk Go Internasional. Jadi, harapannya dengan musikalitas dan setiap karya ini semua penikmat musik dapat merasakan keindahan dari musik Clover.\r\nâ€¢	Clover band berdiri sejak tanggal 10 Januari 2009 & berasal dari Jakarta. Nama Clover dipilih karena band terdiri dari 5 anggota yang berasal dari 5 arah yang berbeda (secara musik maupun geografi) sehingga berbentuk seperti daun Clover. Band ini Beranggotakan : Aji (Vokal), Rino (Drum), Giwe (Gitar Lead), Hendy (Bass) & Ary (Gitar Rhythm).\r\n', 1, '', 0, 186, '2011-10-07 04:07:52', '0000-00-00 00:00:00', 1),
