(111, 2621, 'dzeek', 'dzeek (formerly known as d\\''zeek) are an alternative rock band from Jakarta , Indonesia . The band is composed of Hersubkhan Erdien (drums), Faeruz Putranta (bass guitar, backing vocals), Ichsan Tirtana (guitar), Amirudin (lead guitar), and Imam Ghazali (lead vocals, guitar). Since 2003, dzeek have released an album and a mini album.\r\n\r\nThey first release, \\"Terang\\" (in english : \\"Bright\\") in 2003 with the single \\"Terang\\" and drawn attentions from the country\\''s music scene.\r\n\r\nThe band underwent a long hiatus before returning in 2007 with a mini album \\"The Oslo Report\\", they continued to play in several shows until mid 2008, when they found Imam through a friend to replace JD.\r\n\r\nThe year 2009 sees the rebirth of the band as they released only their self-titled second full-length album. It contains 13 new songs both in Bahasa and English. The first single \\"Terlihat\\" receives warm and comfortable reception thus resulting heavy rotations in the country\\''s top radio stations.\r\n\r\nThe band now are enduring non-stop promotion around Jakarta which soon followed by promotions in other cities across Indonesia. South Asia tour dates also included in the plan.\r\n\r\n\r\n\r\n\r\nhttp://www.facebook.com/dzeek\r\nhttp://www.myspace.com/dzeekmusic\r\nhttp://www.youtube.com/dzeektube\r\nhttp://www.imeem.com/dzeek\r\nhttp://twitter.com/dzeeknow\r\nhttp://amp.channelv.com/dzeek\r\n\r\n', 1, '', 0, 184, '2011-10-19 08:18:59', '0000-00-00 00:00:00', 1),
