(125, 2912, 'Stars and Rabbit', 'Stars and Rabbit are Indonesian folk music duo, formed in early 2011 in Yogyakarta. The group consisted of singer-songwriter Elda Suryani (born May 29, 1983) and musician Adi Widodo (born July 31, 1983). Their single â€˜Worth Itâ€™ drew them attention from a small variety of communities in Indonesia and the United Kingdom, as part of the indie pop/folk scene. Stars and Rabbit engages a do-it-yourself approach to writing and recording. Their music is a melding of pop and folk influences with raw simplicity of composition, arrangement, and performance.', 1, 'small_d1b4a02b03e4eec8040717373af4aea0.jpg', 0, 186, '2011-11-22 11:36:12', '0000-00-00 00:00:00', 1),
(127, 3251, 'Heyya', 'Kami beridiri di Timur Jakarta pada tahun 2011, kami bermusik untuk memuaskan kebebasan dalam berkarya, nama \\"Heyya\\" kami pilih karena kami ingin selalu disapa dengan hey...dan kami akan menjawab ya!!, konsep musik kami mengusung genre garage rock, blues, and grunge. ', 1, 'small_6320e99e2930721d43d9570d79b15ed6.jpg', 0, 184, '2011-12-06 11:31:01', '0000-00-00 00:00:00', 1),
