(132, 3224, 'dailypost', 'PROFILE DAILY POST\r\nK\r\n\r\nami adalah lima orang remaja yang memiliki mimpi dan kami selimuti dengan sebuah ambisi,visi dan misi. Dan semua itu kita curahkan dalam sebuah musik.\r\n\r\nDari berbagai perbedaan yang kami miliki kita berkomitmen dengan dewasa untuk mewujudkan mimpi kita dalam sebuah band yang kita sebut DAILY POST.\r\n\r\nAliran musik yang kita anut adalah Drama Pop yang melantunkan lirik-lirik nyata, di iringi dengan melodi yang easy listening dan semua itu terbungkus dengan hentakan drum yang statis.\r\n\r\nDAILY POST terbentuk pada bulan september tahun 2009 lalu, meskipun kita masih terbilang muda dalam industri musik, tapi kami yakin harapan kami untuk bisa bersaing dan membesarkan industri musik di Indonesia suatu saat nanti akan terwujud.\r\n\r\nDATA PERSONIL\r\nâ€¢ Badarudin Iqbal (Vokal)\r\nTempat,tanggal lahir : 28 Maret 1989\r\nHoby : jalan-jalan,cari inspirasi\r\nInfluence : armand maulana\r\nâ€¢ Salman Arief Lubis (Lead guitar)\r\nTempat,tanggal lahir : 16 desember 1987\r\nHoby : makan,jalan-jalan,main game\r\nInfluence : Paramore, andra and the backbond\r\nâ€¢ Taufik Akbar (Bass)\r\nTempat,tanggal lahir : 21 may 1987\r\nHoby : bikin sesuatu,makan,olahraga\r\nInfluence : sugarcult\r\nâ€¢ Nanda Desi Saputra (Drum)\r\nTempat,tanggal lahir : 10 Desember 1986\r\nHoby : makan,internetan\r\nInfluence : travis barker\r\n\r\nLIST SONG\r\nâ€¢ Bosan di Jakarta\r\nâ€¢ Sahabat\r\nâ€¢ Hitam\r\n\r\nExperiences\r\n\r\nâ€¢ Guest stars in Jantra Cafe seturan at 1 Mei 2010\r\nâ€¢ Juara 1 (Best of the best ) in unsigned IM3 Hugos Cafe at 8 Mei 2010\r\nâ€¢ Unplug Ultah Dixie Cafe\r\nâ€¢ 50 besar LA indiefest 2010\r\n\r\n\r\nContact Person\r\nïƒ˜ Addres\r\njl larasati no 529 umbulharjo yogyakarta\r\n\r\nïƒ˜ Mobile\r\n\r\n08985114162,08985173995\r\n\r\n\r\n\r\nïƒ˜ E-Mail, Facebook and My space\r\n\r\n\r\ndaily_post@rocketmail.com\r\n', 1, 'small_b13dfe602c65dd406e97bb81fe795c65.jpg', 0, 265, '2011-12-07 20:34:26', '0000-00-00 00:00:00', 1),
(133, 3260, 'Plug & Play', 'Mereka menyebut aliran musik ini â€œU N I V E R N A T I V Eâ€  \r\n  \r\nFebruari tahun 2005 Vody (lead vokal), Rizky (lead gitar), Dicki (bass) dan Yovi (drum) bertemu.  \r\nSetahun lebih berlalu tepatnya Maret 2006 Rizky merasa Band ini harus dikonsep kembali, pada saat itulah Rizky mengajak Heri dari Bandnya yang dulu \\''GLOVER\\'' untuk bergabung dan Rizky pulalah yang memberi nama \\''PLUG & PLAY\\'' dikarenakan dia membaca Iklan Printer di Koran yang bertuliskan (support â€œPlug & Playâ€)  \r\n*WOW padahal Kata \\''PLUG & PLAY\\'' adalah hal Lumrah yang sering kita temui dan sering disebut di komputer.  \r\nTapi malah ketemunya dikoran :D  \r\n  \r\nAwalnya mereka membawakan lagu pertama mereka yang berjudul \\"Comin Back?\\" dalam Festival Kampus.  \r\nSetelah mendapat tanggapan yang cukup bagus, mereka mulai memberanikan diri lewat Festival Indie Nasional untuk membawakan Lagu ke Tiga Mereka berjudul \\"Thatâ€™s It!!\\"  \r\nDi Tahun 2007 - 2008, dan pada tahun 2009 mereka mengikuti Festival Indie Nasional dengan single \\''Stop Accusing\\''.  \r\n  \r\nPada bulan Maret 2009 juga mereka akhirnya meluncurkan album mini (EP) berjudul \\''SYNDROMIZE\\'' dan mendapat tanggapan yang sangat bagus pula.  \r\n  \r\nListnya :  \r\n  \r\n1. Stop Accusing  \r\n2. Betina VS Jantan  \r\n3. That\\''s it  \r\n4. Automatic Worried  \r\n  \r\nTapi... pada tahun 2010 tepatnya bulan Oktober, Plug & Play transformasi untuk ketiga kalinya, Rizky dan Yovi mengundurkan diri dan rizky menitipkan amanat ke Edwin Pangestu (ex-Arcoirish) dan Yayau Fernals untuk menggantikan posisi Lead guitar dan Dodi untuk posisi Drum. Tahun 2011 ini mereka juga mengeluarkan single berjudul \\''Tak Baik\\'' yang sampe saat ini terpilih oleh Indo single Club dan 9 Web zine dan Radio Online serta Radio Jakarta untuk menjadi jagoan tahun ini.  \r\n  \r\nSampe saat ini merka masih mempersiapkan album semoga bisa terealisasi pada 2012 mendatang :)  \r\n  \r\n>>silahkan di cek di album foto untuk lebih mengenal kami dan panggung2 yang telah kami lewati  \r\n>>silahkan mendengarkan page musik untuk mendengarkan lagu dari Album mini (EP)  \r\n>>silahkan untuk mengunduh lagu kami \\''Tak Baik\\'' dengan cara meng GOOGLING, dengan kata \\" PLUG & PLAY TAK BAIK \\"  \r\n  \r\nRespect  \r\nPLUG & PLAY \r\n \r\nHAVE A NICE DAY :)', 1, 'small_30269532f71ab6932f2f8227df495ac8.jpg', 0, 155, '2011-12-10 12:27:03', '0000-00-00 00:00:00', 1),
(134, 3300, 'SKYONEYE', 'we\\''re teenagers like you all \\"know\\", and we\\''re human like you all (of course) then blah blah blah the hell with it. well,   \r\nbegan from 2008 this band start to jiggle in front of everyone and made them dance with heavy-rock or whatever it sounds, judge with your own ears.   \r\nso here we are, the ground keeper, the skywalker, the hash slinging slasher, the cohort which are READY TO ROCK YOU BADLY!  \r\n  \r\nPersonnel :  \r\n 	  \r\nIbrahim Aziz Sutansyah (Vocal)  \r\nEky Habara (Gitar)   \r\nTira Gantina (Gitar)  \r\nAgustianto (Bass)  \r\nAdnan Liansyah Putra (Drum)  \r\n\r\n\r\n\r\n\r\nINFO : \r\n	\r\nPlease Call 081287774315 for booked, buy our CD, and more info. Keep ROCK! \\\\soe/', 1, '', 0, 159, '2011-12-13 11:57:13', '0000-00-00 00:00:00', 1),
(135, 3110, 'MARAZHU', 'Band kami terbentuk pada waktu SMA sekitar tahun 2007-an namun di resmikannya pada saat pelulusan Juni 2008. Setelah beberapa kali ganti personil kini 2012 kita tinggal bertiga,.dengan personil :\r\nAbock (Vocal/Lead Guitar)\r\nOlickz (Bass)\r\nMulya (Drum)   \r\n\r\nPengalaman bermusik kami baru pernah tampil hanya sekitar sukabumi dan ingin sekali untuk go luar sukabumi.\r\nBanyak lagu yang kami ciptakan namun cuma beberapa yang bisa kami demokan..\r\n\r\nkami punya MIMPI untuk bisa berjajar dengan band-band papan atas nasional,.\r\nSemoga Allah memudahkan jalan kami,. Amiinn ', 1, 'small_52830945db42b9a482ce8513bdf0d60b.jpg', 0, 171, '2011-12-14 00:45:52', '0000-00-00 00:00:00', 1),
(136, 3303, 'L\\\\\\''espoir', 'L\\''espoir berasal dari bahasa Prancis yang berarti harapan, nama itu adalah nama yang selalu menjadi bayangan atas terbentuknya L\\''espoir, kita berangkat dari pribadi,karakter dan influence musik yang berbeda-beda,tetapi pemikiran kita berbanding lurus dengan visi misi dan tujuan para personelnya ', 1, 'small_c607099db0595ada67ed322bfeac1bb0.jpg', 0, 265, '2011-12-14 09:07:22', '0000-00-00 00:00:00', 1),
(137, 684, 'FADE', 'FADE adalah band asal yogyakarta yang mengusung genre alternative pop, namun band ini memiliki musik yang cukup khas dan berbeda dengan genre musik band indonesia pada umumnya,,,', 1, '', 0, 265, '2011-12-15 17:34:32', '0000-00-00 00:00:00', 1),
(138, 3101, 'ARCILLA', 'ARCILLA di ambil dari bahasa spanyol, yang artinya \\"Tanah Liat\\".  Tanah Liat adalah tanah dimana awal manusia dibentuk oleh Sang Pencipta dan akan kembali lagi menjadi seperti awal mula manusia itu diciptakan. Tanah Liat adalah tanah yang dapat dibentuk menjadi suatu karya yang indah apabila tanah tersebut masih dalam keadaan basah, dan akan sukar dibentuk jikalau tanah tesebut telah kering.. filosofinya adalah ( \\"berkarya selagi masih muda, berkarya salagi masih bisa bernafas, berkarya sebelum kembali menjadi tanah ).  ARCILLA band Terbentuk di Jakarta  pada Desember 2010 dengan mengusung genre Pop rock Alternative. beranggotakan 5 personil dan sempat mengganti Gitaris (andrie) dan sekarang formasi telah berubah menjadi 6 personil dengan tambahan pemain keyboard. (deco-vocal) (benito-bass) (eza-drum) (ragil-gitar ritm) (ghidoy-lead gitar) (vicko-keyboard).   \r\n  \r\nBasecamp: bendungan Hilir Jakarta Pusat  \r\ncontact us : 081298559958    \r\nemail: squashwear@gmail.com  / deco_katchunk@yahoo.com  \r\ntwitter : @Arcilla_band  @decosquash  \r\nfacebook group : ARCILLA BAND   \r\n ', 1, 'small_d8f6eceb5da1749cc774813bedcd3b76.jpg', 0, 185, '2011-12-15 19:53:45', '0000-00-00 00:00:00', 1),
(139, 3072, 'HILITE BAND', 'For booking call us : 089695001646 / 085656324656 or invite blackberry messanger : 22e0a078\r\nHILITE BAND Member : - Nahla ( vocal ) - Nirwan ( Guitars ) - Mario ( Guitars ) -Kiki ( Bass ) -Kikim ( Drum )\r\n\r\nHILITE is an alternative rock exponent in Makassar will bring you alternative sound to your ears!!!! stay tune for our new songs!!!! \r\nIt\\''s a cliche in everything.but we must started everything from zero again. in late August,the guitarist,Nirwan,want to make some rock band with female vocal.so he contact the vocalist,Nahla for some audition and begin contact the other personel.Nahla agreed but he doesn\\''t sure for her voice for a while cause never meet each other for a long time. Mario(guitar),Nirwan old friend,just agreed and said\\"why we don\\''t try this for some experience?\\".and Nirwan met Ajrul Hakim(drum) and Rizky AP(bass) in his faculty in Sept 2008,and asked to join the band.Both agreed.and the first rehearsal begin and the rest is history.all of members impressed by Nahla\\''s voice cause her pronounciation in vocal is awesome. The element of every person in this band,have a great potential,so we must explore each other to make some great music for all rocking people !', 1, '', 0, 387, '2011-12-16 16:45:26', '0000-00-00 00:00:00', 1),
(140, 3294, 'Muchos Libre', 'Muchos Libre terbentuk pada tanggal 12 Juli 2010 dengan formasi awal Dilla Bagongtempur (vox), Dally Korongmentah (vox), Iky Kunjay (gitar), Adi Emo (bass), Kiki Behel (gitar), dan Maul (drum). Dan pergantian player dalam band adalah hukum rimba adanya, maka gitar pernah di isi oleh Cantyka Makibao dan sekarang di isi oleh Nos Cikiwiw, drum di ganti oleh Hilman Hakimimasa sampai sekarang. Dengan format Dilla Bagongtempur (vox), Dally Korongmentah (vox), Iky Kunjay (gitar), Nos Cikiwiw (gitar), Adie Emo (bass), dan Hilman Hakimimasa (drum) maka band pergulatan tidak takut guru olahraga senam SKJ ini mulai menancapkan semangat berkobar pergadisan dalam hatinya masing-masing.   \r\n   \r\nBand yang ingin di sebut alay core ini terbentuk dari sebuah komunitas youth independent movement bernama SUPER C.U.T.S, yang awalnya di bentuk karena ketertarikan kepada sebuah band di Bandung bernama C.U.T.S (Caustics Ultraist Totally Slice). dan seiring waktu berubah komunitas ini menjadi satu wadah kreatif anak muda yang menggunakan ruang publik sebagai tempat berkumpulnya. Band ini hasil perbincangan kosong dari 3 manusia yaitu Dilla Bagongtempur, Dally Korongmentah, dan Barlie Ve yang mengkonsepkan satu band ber-aroma gulat hiburan murahan WCW di tahun 90an, dan hasil dari kesukaan kami terhadap satu film bernama Nacho Libre yang di bintangi Jack Black. Awalnya band ini akan di bentuk untuk proyekan duo Double D (Dilla, Dally) yang di iringi player additional di belakangnya, tetapi karena Double D merasa tidak terikat dengan band manapun (baru resign dari band dulu dengan alasan ingin solo seperti Ari Lasso) maka diputuskan untuk menjadi 1 band kesatuan alay dan makmur ini.   \r\n   \r\nJika ditelusuri nama Muchos Libre ini berasal dari bahasa spanyol yang berartikan â€œbanyak gratisâ€. Nama ini terinspirasi dari film Nacho Libre yang di ganti Nacho nya menjadi Muchos, dan nama ini di ulik oleh Barlie Ve dan Bagongtempur. Tidak ada arti yang begitu keren dalam â€œbanyak gratisâ€ namun band ini merasa bahwa banyak gratis telah mewakili jiwa-jiwa nafsu gejolak binatangisme Indonesia, dimana pembagian sembako gratis dapat mengantarkan nyawa lebih cepat ke tempat asalnya di Indonesia. Sebuah pemandangan kengerian yang terkontaminasikan hawa nafsu kepemilikan harta berlebih, atau tepatnya kemiskinan yang haus akan ketidak adilan di negara ini. Bahasa intelek di atas bukan hasil rekayasa, kami tidak berpendidikan namun suka membaca novel Harry Potter, dan Twilight supaya sedikit romansa dalam band.   \r\n   \r\nDi atas panggung band ini tidak terkontrol, liar, berenerji binatang, ending gulat, dan tidak hati-hati untuk menggenggam mic dengan baik. Pembicaraan yang seenaknya, terbutakan oleh senang-senang di atas panggung, ketidak skillan makmur, ketelanjangan dada, susu rayud dan kemolekan perut bersingkayo juga kesuburan garing bermain dengan suara clean adalah ciri khas Muchos Libre. Band ini mungkin tidak akan spesial jika di dengar saja, namun ketika live perform mereka akan memberikan kebinatangannya untuk kalian!   \r\n   \r\nThis is it! Muchos Libre! Minim skill, maximal senang-senang. Give em one show, so they will give you the beast!', 1, 'small_46dae14522505a9853f4385b54416b6c.jpg', 0, 174, '2011-12-18 13:44:26', '0000-00-00 00:00:00', 1),
(141, 3299, 'Burst Like Rockets', 'Formasi terakhir burst like rockets :  \r\nGinanjar Yudi as lead vocal  \r\nRinaldy Aditya as synthesizer,keys and loop  \r\nDwii as drum  \r\nIan Fajri as bass  \r\nIgun as guitar  \r\nCaesar as guitar \r\n \r\nfollow us on twitter: @BLRofficial\r\ncontact person: 085724416180', 1, '', 0, 174, '2011-12-18 17:45:43', '0000-00-00 00:00:00', 1),
(142, 2564, 'The Simple Sample', 'The Simple Sample adalah band britpop asal Jakarta Selatan yang terbentuk sejak tahun 2008, bermula dari tongkrongan ekskul band semasa SMA. The Simple Sample adalah evolusi dari sebuah proyek band sekolah. \r\n \r\nMemainkan musik yang mencampurkan unsur britpop, new wave, folk, dan vintage rock, kami menyebut musik kami sebagai \\"British Vintage-pop\\". Single pertama kami, Reach the sky, sempat masuk chart international di Myspace, dan sempat ditawari kontrak dengan Mercedez-Benz Mixtape di Jerman. \r\n \r\nInfo lebih lengkap, kunjungi kami di : \r\nwww.thesimplesample.com \r\nmyspace.com/thesimplesample \r\nLast.fm/thesimplesample \r\n \r\nFollow twitter kami di : \r\n@thesimplesample \r\n \r\nBoking Contact : \r\nAnca - 082123424183 / pin bb : 214BA269', 1, '', 0, 186, '2011-12-19 04:38:34', '0000-00-00 00:00:00', 1),
(143, 3359, 'Puti Chitara', 'Puti Chitara, a songwriter who loves to sing out her feelings through her simple music  \r\n  \r\nSince childhood, Puti has been playing classical piano for many years and has passion in singing. When she continued her study in Japan, she started to gain confidence in singing while playing the piano on her University concerts, singing on stages and charity events. Then she begin to write and compose her own songs, inspired by her daily life about simple things such as friends and love, in addi...tion with her passion in writing poems and stories, she also writes her own lyrics in order to express about what she feels and hope that people around the world can also feel and get the message she\\''s trying to deliver through her music.  \r\n  \r\nReturning from Japan in 2010, Puti and her friends established a band and has been performing in various events and festivals, also the band has recorded most of her songs and selected as one of the best performance in a festival held in Cibubur. Unfortunately, the band has disbanded in March 2011, but Puti decided not to give up on fighting for her music. With the support from her family and friends, she continues to record her songs in her bedroom and pursue her music as a solo performer with the help of many of her talented friends.  \r\n  \r\nIt has been her biggest dream to spread her music to the whole world, hopes that people can enjoy her music and feel them, life is always about love, music and freedom. So, sit down, relax and enjoy! \r\n \r\ncheckout:  \r\n \r\nwww.putichitara.com \r\nwww.facebook.com/putichitara \r\nwww.soundcloud.com/putichitara', 1, '', 0, 186, '2011-12-19 11:21:49', '0000-00-00 00:00:00', 1);
