(144, 3365, 'Eastern Traffic', 'Embrio :\r\nKami adalah percampuran gen seorang gitaris yang memetik gitar bersuara majemuk, basist pembetot kesederhanaan, drummer yang dinamis, gitaris yang sentripugal, dan vokalist pelamun.\r\n\r\nKelahiran :\r\nAntara passion dan patient, kami berkarya dalam jalan hidup yang kami pilih, yaitu musik. \r\nEastern Traffic adalah koloni laki-laki yang memainkan musik brit thematic (alternatif) secara sukarela. Lahir di kota Yogyakarta tanggal 10-10-2010, awalnya kita membentuk band ini langsung serius demi tujuan memadukan ide-ide parsial yang kita miliki, dan lepas dari kungkungan background permainan musik yang biasa kami mainkan. \r\nDengan adanya basic musik yang berbeda tersebut akhirnya memunculkan karya pertama dengan lirik bahasa indonesia yang bersifat phsychopop berjudul â€œDimensi Sepiâ€. Dan hampir serentak dengan itu kita juga berhasil menemukan karakter band secara unik yang tergambar pada lagu â€œLuck in Crimeâ€ dan â€œOptimist Loveâ€. Alhasil dari tiga lagu tersebut akhirnya kami menemukan jati diri musik yang kami mainkan. Kita juga mengembangkan warna musik pada lagu yang akan menjadi single yang berjudul â€œIâ€™m Notâ€ serta lagu â€œDance Around The Fireâ€. \r\nSecara subjektif musik Eastern Traffic adalah music yang kami munculkan, bukan kami populerkan dari yang telah ada. Musik yang kami tawarkan â€œberbedaâ€ dan punya sisi magis tersendiri dari hagemoni yang ada. \r\nUntuk keunikan musik, kami mempertahankan kesederhanaan progresi tatanan lagu, disela-sela warna Guitar Synth yang memberikan therapy dan membentuk dinamika dan harmonis. Sense dan essensi, itu yang selalu kami pertahankan dalam menciptakan lagu. \r\n      \r\nPemberkatan Nama :\r\nEastern Traffic terinspirasi dari nama dan istilah jalur lalu lintas di Indonesia, yaitu lintas timur. Namun warna dari kata tersebut tak seperti pengejaannya.\r\nTema lalu lintas yang kami hisap intisarinya adalah sebuah pigura yang lukisan didalamnya adalah bagaimana manusia memaknai waktu yang diberikan saat dia bernyawa. Dalam lalu lintas orang berusaha mengejar waktu untuk menjalani waktu. \r\nDalam substansial kami adalah ruang untuk waktu dan arti ruang waktu dimana jiwa dan terlahir bebas untuk memilih dunia seperti apa dalam ruang dan waktu.\r\nSedangkan Eastern diambil dari kata east yang ditafsirkan letak geografis nama kami diberkati, dimana dunia menyebutnya dunia timur.\r\n\r\nContact Persons for Booking: \r\n\r\nLocal (Jogja) : 085643514222 (Gangga) 085743917774 (Galih)\r\nJakarta : 081809809188 (Lempay)', 1, 'small_00a072c264d04ac53f8e28b45be5795b.jpg', 0, 265, '2011-12-19 18:39:28', '0000-00-00 00:00:00', 1),
(145, 3358, 'Fluorescent Adolescent', 'Band Fluorescent Adolescent di bentuk pada pertengahan tahun 2009 yang terdiri dari 5 personil yang memiliki aliran musik yang berbeda-beda. Pertama didirikan Fluorescent Adolescent pada waktu itu adalah untuk menyalurkan hobby bermusik dari masing-masing personil dan keinginan untuk membuat sebuah band yang solid dan konsisten pada jalur musik.\r\n	Kami mencoba menambah ketrampilan dan pengalaman melalui panggung pementasan musik. Pada awal tahun 2010 kami memutuskan bahwa aliran musik yang akan kami bawakan adalah Rock Alternative. Awal 2010 kami mencoba membuat beberapa lagu yang disitu menggambarkan jenis aliran musik dan bakat yang kami miliki. Dan Formasi band kami adalah : \r\nPius Ario Wicaksono		: Drumer\r\nNovy Linasari			: Vokalist\r\nThommas Arnold 	F.        	: Guitarist\r\nBagus Perwira L.   		: Bassist\r\nMaria Maya Aristya		: Keyboardist\r\n', 1, '', 0, 265, '2011-12-20 01:54:59', '0000-00-00 00:00:00', 1),
