(222, 2679, 'Chapcha Terror', 'Into grind/crust/metal etc for a long time. Got into crazy breaky stuff (jungle, dnb, idm, breakcore, Dubstep etc) around 2008,2010.\r\nStarted to work on computer music around 2007 a tiny bit while playing in the screamo band. Got more into working on it when that band broke up in 2007.\r\nI have a lot of songs played in European countries.Including several tracks that are made with several european breakcore artist.\r\n\r\n# Fuck Noise Compilation on Germany 2009\r\n# TrashTrashTrash Music Compilation on Netherland 2009\r\n# Free To Be Me ( chapter 6 ) & Mission For One Compilation Medan Indonesia\r\n# Aisle, Compilation from Hujan Records Bogor Indonesia\r\n# Music beyond no borders Vol. 3 (Indonesian Netlabel Union), from yes no wave music 2011\r\n\r\n#Release The first Album \\"Fate Has Failed Us\\" 2012', 1, 'small_6ab616af18e52f20691118809dcaa1a8.jpg', 0, 51, '2011-12-20 08:23:28', '0000-00-00 00:00:00', 1),
