(256, 3176, 'My ViolainÃ© Morning', 'euphoria, illusions, delusions, paranioa\r\n\r\nAn Indonesian experimental shoegaze band which formed in Bandung, Indonesia in 2004, The original lineup is Roni Tresnawan, Rikip Bagja Utama, Muamar Doddy Nugraha and Risky Fahmi Sukandar.\r\n\r\nTheir sounds is comprising indie sound scape influenced by experimental shoegaze and post-rock with an ambient dominated and exclusion of delaying guitar in almost their songs, It taking every single common in...See More\r\n\r\nmy violainÃ© morning is an expression driven by saturation, isolated, sadness, madness, hope and wishes in the human life which represented by nuance of delaying clean guitar and heavy distortion fused in gloomy ambient. Deliver you an unexpected imagination and vision from another side of this world.', 1, 'small_8bf8cfda737e4167d9e42d0a22230801.jpg', 0, 174, '2011-12-20 09:23:49', '0000-00-00 00:00:00', 1),
