(310, 3559, 'Gloria', 'Berawal pada Desember 2007. Suci Sukma a.k.a Chunk (ex.vokal), Erfan nurahman(gitar), Harry Rahman (bass), Andrian Panji (gitar), Mahardhika Utama (drum) adalah lima anak muda yang mencoba menyalurkan hobby bermusik mereka dengan membentuk sebuah band bernama GLORIA. Didasari oleh hubungan pertemanan yang sangat erat antara masing-masing personil, mereka coba menyalurkan hasrat mereka dengan memadukan beberapa warna musik yang berbeda dari banyak influence musik yang berbeda pula.  \r\nTema lirik di materi mini album GLORIA lebih condong pada lirik-lirik motivasi dan pertemanan, terdapat pula lirik tentang cinta namun tidak melulu cinta antara lelaki dan perempuan dan dikemas dengan gaya tersendiri. Berbicara tentang genre dari band ini, para personil tampak enggan membatasi di satu sub titik tertentu dan mereka lebih senang menyebutkan dengan simple bahwa roots mereka adalah rock. Selebihnya silakan dinilai sendiri oleh para pendengar.   \r\nâ€œBangkitâ€ menjadi anthem favorit crowd di tiap gigs. Lagu berjudul Bangkit menjadi salah satu soundtrack dari film â€œThe Sexy Cityâ€ arahan sutradara Helfi Kardit yang telah rilis di bioskop-bioskop mulai tanggal 25 Maret 2010 lalu.         \r\n   \r\nSo, if you are producer, records label, event organizer or else and you are really appreciate for our sound, what the hell are you waiting for, just call our manager on duty : Opik on 022-70525295 or   \r\nmail to: gloriaofficial@gmail.com.   \r\nAnd visit our page on www.myspace.com/gloriafrombandung or   \r\nfollow us on twitter: www.twitter.com/gloriofficial. Cheers!   \r\n', 1, 'small_2ca6b023e4fd09915783e47415dfe289.jpg', 0, 174, '2011-12-20 10:40:48', '0000-00-00 00:00:00', 1),
