(336, 3594, 'Just Like Yesterday', 'Salah satu harimau Selatan Sumatera yang mulai mengaum, mengawali tahun 2011 dengan serbuan sporadis EP album mereka yang bertajuk Human Being. Just Like Yesterday akan menghantui t...elinga kalian dengan 4 track yang disertakan dalam EP album ini. Dengan sound gitar berat dan drum yang super agresif ini merupakan bukti penancapan kuku eksistensi mereka, Dimas (Vocal), Ricky(Gitar), Ninoy(Gitar), Pani(Bass) dan Fahri(Drum). Choir sound bersahut-sahutan khas hardcore pada track Sadly Mistake Ironically Different, sound gitar yang luar biasa berat pada intro Even Blind Can See menunjukkan karakter yang kuat. Slander, sebuah laras yang sudah familiar di telinga-telinga scenester bumi Sriwijaya dan diakhiri dengan Accolade, mengajak untuk ber-head banging tanpa henti dengan groove part pada pertengahan lagu. Sebuah referensi yang pas buat kalian yang mencari balutan sound-sound Metalcore yang berhasil disajikan dengan full energy dari bumi Sriwijaya ', 1, 'small_77c7bf729abda218e8b4012975a7085f.jpg', 0, 120, '2011-12-20 11:19:10', '0000-00-00 00:00:00', 1),
