(359, 3256, 'Over8think', 'Berkumpul dan sepakat untuk membentuk sebuah band bulan Agustus 2009, 4 anak muda yang memiliki kesamaan suka bertindak berlebihan (overacting, red) , OVER8THINK dipilih sebagai nama untuk bisa berjalan lebih pasti. Atau mungkin bisa juga diasumsikan ke sebuah kondisi ketika kamu terlalu berlebihan berpikir, overthinking. Tapi ini lah OVER8THINK teman, ayo \\"bersenang-senang dengan punk\\" ! \r\n \r\nHAPPY POP PUNK ll CONTACT : 08994439271', 1, 'small_a4bd587007a07a1ac9bbdba1938275d1.jpg', 0, 120, '2011-12-20 11:43:16', '0000-00-00 00:00:00', 1),
