(365, 3628, '[C54] SEEFIFTYFOUR', '[C54] (baca: seefiftyfour) adalah Cheppy Aditya, skateboarder sekaligus dikenal sebagai gitaris band punkrock Chicken Shit Flower yang memiliki proyek solo dengan konsep one man-one guitar. \r\n \r\n[C54] tercatat sebagai proyek solo indie pertama yang merilis album di kota palembang, dilakukan secara independent dengan tekhnik vokal dan skill gitar yang pas-pasan tidak mengurungkan niatnya melampiaskan karya demi karya dengan format apa adanya. \r\n \r\nIde proyek solo diakui Cheppy muncul secara iseng sejak single GOODBYEREDWINE [GBR] dijadikan sebuah bonus track dalam album glory of spirit besutan Chicken Rock Record di tahun 2009. \r\n \r\nSebagai singer-songwriter, Cheppy telah merilis 200 pieces debut EP album bertajuk â€œOrdinary Wannabeâ€ yang dibagikan secara gratis dari tangannya sendiri di tahun 2010. Single ANGEL tercatat yang paling fenomenal diiringi dengan rilisnya 3 video klip CARE, ANGEL dan RIVAL yang diproduksi oleh OVM Studio. \r\n \r\nDi dalam proyek solo ini, Cheppy mengerjakan semuanya secara semaunya dan tidak peduli bagaimana efeknya. â€œBermusik itu (harus) gampangâ€ cetusnya akan 3 single susulan garapan Castranada mix & Mastering pasca 2011 yakni STAY, HARI ISTIMEWA dan MATAHARI MALAM yang hingga kini hits download telah mencapai angka 5000. \r\n \r\nDi tahun 2012 Cheppy melempar single SESAK yang merupakan bagian dari 9 lagu LP album bertajuk â€œA Present For My Oldmanâ€ yang akan dirilis dalam waktu dekat ini diakui merupakan album persembahan untuk almarhum sang ayah. \r\n \r\nMasih tetap menarik influensi dari musisi idolanya Kurt cobain, john lennon dan ken yokoyama. Kini di album ke-2 Cheppy mengajak 2 musisi pendukung untuk mengisi track bass dan drum. â€œAlbum ini masih tetap biasa saja, cuma agak serius karena ini album persembahanâ€ tukasnya akan bocoran album ke-2 yang bermutasi dalam format full band. \r\n \r\nHal yang menarik tentunya dirasakan, melalui single SESAK yang dilempar melalui twitter pribadinya yang notabene berbeda dari album pertama. Apa yang terjadi dengan musik [C54] di album ke-2 ini? Bagaimana lagu [C54] dimainkan secara fullband? Siapa saja musisi pendukung yang terlibat? \r\n \r\nâ€œSaya tidak terpikir membuat lagu untuk lebih baik dari orang lain, saya membuatnya untuk dinikmatiâ€ tutupnya.', 1, 'small_47636938d472a25f9614b784611cb690.jpg', 0, 120, '2011-12-20 11:51:27', '0000-00-00 00:00:00', 1),
