(386, 3093, 'LIDI', '	 \r\nLidi merupakan sebuah group band yang berdiri pada tanggal 7 Juli 2007 dan berdomisili di Singaparna Kabupaten Tasikmalaya Jawa Barat. Berawal dari masing-masing personil yang sudah lama eksis di bidang seni musik dan berasal dari beberapa group band yang sudah bermain di beberapa festival, cafÃ©-cafÃ©, dan kontes di dalam kota maupun luar kota.  \r\n \r\nDidorong oleh keinginan dan kemauan dari para personil untuk meningkatkan permainan bermusik serta ingin adanya kemajuan dari hasil yang telah dicapai oleh masing-masing personil, maka bersepakat untuk bersepakat untuk membuat sebuah group band bernama â€œLIDIâ€. \r\n \r\nKata LIDI sengaja kami ambil untuk nama group band kami, LIDI merupakan akronim dari; \r\n \r\nLEADER (pemipin)  \r\nLIDI ingin menjadi sosok pemimpin yang bisa menjadi acuan bagi penikmat musik. \r\n \r\nIMPROVISE(perubahan)  \r\nMenjadi suatu unsur yang menjadi perubah dalam industri musik, yang tentunya membawa ke arah perubahan yang lebih baik. \r\n \r\nDIFFERENT(berbeda)  \r\nMemiliki ciri khas dalam diri, yang membuat LIDI berbeda dengan band-band lain di industri musik negeri ini. \r\n \r\nIDOL(idola)  \r\nMenjadi idola di mata penikmat musik adalah hal terbesar yang kami ingin raih.\r\n\r\nPRESTASI \r\nâ€¢ Opening Act Pas Band (Sound Of Indie-Pendence I&II) di Tasikmalaya \r\nâ€¢ Opening Act NAIF (Sound Of Indie-Pendence I 2007) di Tasikmalaya\r\nâ€¢ Opening Act The Panas Dalam (Sound Of Indie-Pendence I 2007) \r\nâ€¢ Opening Act The Siggit (Sound Of Indie-Pendence I 2007) di Tasikmalaya \r\nâ€¢ Opening Act 7 Kurcaci (Sound Of Indie-Pendence II 2008) di Tasikmalaya \r\nâ€¢ Opening Act 9 Ball (Sound Of Indie-Pendence II 2008) di Tasikmalaya \r\nâ€¢ Opening Act Kapten (Pentas Merdeka) 2006 \r\nâ€¢ Opening Act Rock Star\\''s Conspyracy (Sound Of Indi-Penence 2009) \r\nâ€¢ Opening Act /Riff (Pentas Merdeka 2006) \r\nâ€¢ Opening Act Kuburan Band (Sound Of Indie-Pendence III)\r\nâ€¢ L.A Indiefest 2009 (RRI Bandung)\r\nâ€¢ Opening Act GIGI (Sprite De Plong 2010)\r\nâ€¢ Opening Act Hello (Sprite De Plong 2010)\r\nâ€¢ Juara 3 Sprite De Plong 2010\r\nâ€¢ Juara 2 WANTED 2010 Area Cirebon \r\nâ€¢ Gitaris LIDI feat. Kotak (Guitar Heroes 2010) \r\nâ€¢ Vocalis LIDI feat. Kotak (Rock Harmony 2010)\r\nâ€¢ Opening Act Geisha (WANTED 2010) \r\nâ€¢ Opening Act Kotak & Five Minnutes (Rock Harmony 2010)\r\nâ€¢ Opening Act Numata (L.A Star Up Rockie stage 2011)\r\nâ€¢ Opening Act Yovi & Nuno (L.A Star Up Big Stage 2011)\r\nâ€¢ Opening Act Sheila On 7 (L.A Star Up Big Stage 2011)\r\nâ€¢ Opening Act Ada Band (Cardinal Award Ciwalk Bandung 2011)\r\nâ€¢ Opening Act Supergelis (Cardinal Award Ciwalk Bandung 2011)', 1, '', 0, 182, '2012-01-01 15:49:56', '0000-00-00 00:00:00', 1),
