(484, 3834, 'Lemon SLice', 'LEMON SLICE BAND.\r\nSemarang 7 juli 2010 terbentuknya lemon slice yang ber awakan Adit (Bass), Ari (Vocal), Argga (Drumm), Shandy (Guitar), Tutut (Guitar).\r\nLemon slice sendiri bergenre Pop yang mengusung tema-tema tentang keseharian yang terjadi di kehidupan seperti biasa.\r\nnamun penciptaan materi konflik yang diangkat untuk dijadikan sebuah karya (Lagu) oleh lemon slice menjadi arti tersendiri untuk lemon slice.\r\n\r\n\r\nKenapa memilih nama Lemon slice??\r\n\r\nLemon slice mengartikan sebuah kehidupan yang yang semua orang punya yang harusnya disyukuri keberadaannya.\r\nDan keceriaan yang terdapat pada kata Lemon slice sendiri seakan mengajak, dan mudah di kenali, dan diingat.\r\n\r\nsingkat Deskripsi tentang Lemon slice.\r\n\r\nNB : Foto personilnya kurang lengkap soalnya pas photo season pada gak dateng :D\r\n      Musiku Hidupku karna hidupku itu Musiku.\r\n      Salam LEMON SLICE', 1, 'small_8fd782eee810f0afa2dfb87e6bfa6222.jpg', 0, 220, '2012-01-16 06:50:24', '0000-00-00 00:00:00', 1),
