(493, 998, 'VARPA', 'VARPAâ€¦begitulah panggilan band ini. VARPA adalah band asal kota tebing tinggi SUMUT, yang berdiri pada tanggal 7 juli 2007 yang terdiri dari  vtra (Vocal) , Bembenk (gitar) ,Panji (gitar) , Okang (bass) , Ryan (Drum) ,setelah melalui proses tahun ke tahun inilah formasi terbaru VARPA, Genre music yang di bawakan oleh VARPA adalah pop alternative. VARPA memulai karirnya berawal dari event-event band yang ada di sekitar sumatera utara, dan mengawali karirnya mulai dari januari 2008 kemudian mengikuti berbagai macam even seperti festival band, pensi sekolah, opening artis, DLL . termaksud lolos seleksi cd regional medan a mild live wanted 2008, final region sumatera bagian 1, 2009.2010, n 2012 a mild live wanted  \r\nhingga sekarang ingin trus berkarya buat industri musik indonesia  \r\n  \r\nCP : 0852 7555 0077 - 0819 9049 6333 VARPA BAND', 1, 'small_7363be4d4e49102cf6124033d7954a00.jpg', 0, 108, '2012-02-21 15:57:27', '0000-00-00 00:00:00', 1),
(494, 4059, 'The Fix', 'Awal mula terbentuknya band ini ,bermula dari iseng-iseng ngejam bareng di Studio Redrock. Dimana sering diadakannya Open Live Perfomance Band di Studio Redrock setiap dua minggu sekali.Kemudian Fadly (pemilik studio) mencetuskan sebuah ide untuk membuat project band yang ingin meramaikan acara tersebut.Yang akhirnya tawaran ini diterima baik oleh Awing dan Gitag yang dulunya bermain dengan Bâ€™Seven Band di Zodiak Pub & Bistro, Barcelona ,Hermes Palace-Banda Aceh dan lain-lain.Dan disetujui juga oleh Eza sang penggebuk drum ,yang dulunya bermain dengan Skutermatik.\r\n\r\nSetelah berpikir panjang ,terbentuklah band ini pada 1 Desember 2011, terbilang baru memang, tetapi 4 (empat) anak Medan ini bukan terbilang baru dikancah musik lokal kota Medan, masing â€“ masing dari mereka pernah bergabung di band yang sudah punya jam terbang yang terbilang lumayan. Akhirnya, gitag memberikan ide untuk nama band project band ini yakni THE FIX. Dan diterima dengan baik oleh Fadly ,Awing dan Eza.\r\n\r\nDengan formasi Awing (vocal-gitar), Gitag (gitar-keyboard), Fadly (bass), Eza (drum) telah sepakat membentuk band ini dengan genre musik Britpop. Dengan visi awal yang sederhana, yang tak lain adalah ingin ikut meramaikan belantika musik lokal kota Medan dan ingin menembus pasar industri di Ibukota dengan kreatifitas musik kami berempat.\r\n\r\nThe Fix band juga akan menjanjikan sebuah hiburan yang menarik dalam setiap pertunjukan nantinya. Jadi tidak hanya ngeband dan diam terpaku saat performance di panggung/stage.', 1, 'small_7453bb42c8136c9b23e7fd81f0061e54.jpg', 0, 51, '2012-02-24 19:45:07', '0000-00-00 00:00:00', 1),
