(503, 2862, 'THE.ICU', 'Virus rockâ€™nâ€™roll di ranah sriwijaya sepertinya mulai tervaksin. Tidak bergemingnya bunyi distorsi dengan balutan melodi-melodi berbau blues membuat 4 remaja, Mardho (Muhammad Mardhotilla), Farid (Muhammad Farid), Hendi (Hendi Kurniansyah) dan Adib (Adib Aramadhan) ingin kembali menyebarkan dan menginfeksikan virus tersebut. Sehingga, pada tanggal 27 April 2007, diraciklah sebuah virus rockâ€™nâ€™roll ampuh bernama THE.ICU. Hijrahnya Farid diambil oleh M.Abdul Bais. Yang mana sampai sekarang komposisi dari THE.ICU adalah Hendi, Mardho, Adib, dan Bais.', 1, '', 0, 120, '2012-03-05 09:26:25', '0000-00-00 00:00:00', 1),
(504, 4269, 'bhigonia', 'Genre Musik  yang dimiliki setiap personel Bhigonia umumnya berbeda, namun setelah berkolaborasi sekian lama, mereka menyatukannya dalam aliran Universal Rock, begitulah mereka menyebutnya.', 1, '', 0, 265, '2012-03-05 15:23:42', '0000-00-00 00:00:00', 1),
(505, 4323, 'Crickets Chirping', '	  \r\nHey Fellas!!  \r\n  \r\nYeah here we are CRICKETS CHIRPING, Or you can call our little name \\"CCP\\". We Started our carrier on July 17th,2007.  \r\n  \r\nThe members are:  \r\nR.Ikhsan Abdillah (Ican) - Vocal/Guitar  \r\nAditya.P.K (Adit) - Lead Guitar/Vocal  \r\nSyahril Ramadhan (Ariel) - Bass Guitar  \r\nIrwandra Septiady (Andra) - Drum  \r\n  \r\nWe Play ROCK/MELODIC ROCK especially. FAST and TIGHT!!. For more info you can visit our other site on:  \r\n \r\nwww.myspace.com/happywithpunk  \r\nTwitter: @Crickets_CCP \r\nFacebook: www.facebook.com/CricketsChirping  \r\n \r\nThanks a lot and Regards!', 1, 'small_7934694bdb708116204508b1646228be.jpg', 0, 120, '2012-03-06 09:47:07', '0000-00-00 00:00:00', 1),
