(508, 4416, 'VLINE', 'Vline yang mempunyai karakter musik POP ROCK ALTERNATIF dengan dibumbui sentuhan musik orchestra berupa biola yang bisa membuat musik vline lebih enak di dengar dan lebih mudah di kenal, di tambah lagi karakter suara vokal yang bisa memberikan soul dalam lagu mereka.\r\nDan akhirnya kami bisa mempersembahkan sebuah karya musik yang insya allah bisa menambah warna musik yang berbeda dalam belantika musik indonesia, semoga lagu-lagu vline yang sederhana dan mempunyai makna ini bisa di nikmati oleh pecinta musik di indonesia.\r\n\r\nâ€œFollow your passion, dan teruslah berharap untuk sesuatu yang kita impikan dan berusahalah untuk menggapainya walaupun itu sulitâ€\r\n', 1, 'small_539ac06123db6ae3d1c16e924d0aec89.jpg', 0, 265, '2012-03-07 17:11:14', '0000-00-00 00:00:00', 1),
(509, 4437, 'Matter Halo', 'Matter Halo is an Indonesian alternative rock band, formed in Jakarta, Indonesia in 2008. The band comprises vocalist Ibnu Dian, lead guitarist Satria Chandra Hutama, and bassist Ganidra Rai. Having released first EP, Matter Halo have also achieved great success with their single, Pure Affection, which brings them to be played at Java Rockin\\'' Land Festival in 2010. \r\n \r\n \r\ncheck our site for more updates: \r\nhttp://www.facebook.com/MatterHalo \r\nhttps://twitter.com/#!/matterhalo \r\nEmail:matterhalo@yahoo.com', 1, '', 0, 155, '2012-03-08 06:50:06', '0000-00-00 00:00:00', 1),
(510, 4369, 'Depresi Demon', 'Di mulai ketika Aga masih duduk di kelas 3 bangku sekolah menengah pertama. sering mendengarkan lagu dari deep purple,led zeppelin,dan nirvana membuat aga ingin membentuk sebuah band.bingung untuk mencari partner dalam bermusik,dengan bermodalkan akord gitar seadanya dan sedikit uang,aga yang saat itu tidak mempunyai instrument pribadi dan partner bermusik, memasuki rental studio dan memainkan gitar elektrik untuk pertama kalinya. 2 bulan bermain sendiri,Aga berjumpa Rajab(yang masih tetanggaan dengan Aga) yang pada waktu itu sudah mempunyai band dengan nama lakers. kecocokan selera musik,Aga dan Rajab mencoba jaming dengan formasi Aga/Vokal,Gitar dan Rajab/Drum. \\''\\''Smells like teen spirit\\''\\'' dari nirvana adalah lagu yang pertama coba kita mainkan. selang beberapa bulan konflik internal pada band lakers membuat band itu bubar. dan beberapa hari setelah itu Aga mengajak Rajab untuk membentuk band baru dengan formasi Aga/Vokal,Gitar.Rajab/Drum dan kekosongan bass di isi oleh Dani yang merupakan vokalis dari lakers sendiri. setelah gonta-ganti nama band pada ahir tahun 2007 nama Depresi Demon menjadi pilihan nama terahir yang masih di pakai hingga sekarang.', 1, 'small_072ca72b329b846175698674b233aa3e.jpg', 0, 51, '2012-03-08 10:17:59', '0000-00-00 00:00:00', 1),
