(514, 4490, 'Cherry Blossoms', 'Band indie beraliran Alternative dengan sentuhan Rock, Japanese Music, Borneo\\''s Traditional, Jazz, dan Blues.  \r\nDigawangi oleh Nita a.k.a Yuki(Vokal), Jim(Keyboard), Andi(Gitar), Ade(Bass), dan Edy(Drum), band yang lahir pada 29 Januari 2012 hadir untuk melengkapi keluarga musisi Indonesia.', 1, '', 0, 330, '2012-03-09 13:13:22', '0000-00-00 00:00:00', 1),
(515, 4502, 'RHEIA !', 'The band was formed from fragments of several members of the band that happened to one my friends hang out. Early this band formed no more than just a project band that was built by Andika (guitars), Yogha (Keys), Bintang (drums). But at that time we havenâ€™t set a band name or genre of music that we will specify.               \r\n               \r\nNot long after we invited Faruq to join as bass player. While lookinâ€™ for other personnel such as vocals or other instruments players, we often do the jamminâ€™ session in the studio to covering some of the songs and different genres too.               \r\n               \r\nSome time later, Andika resigned from the band â€˜cause he was having internal problems are quite complicated. After Andika out from the band, weâ€™re lookinâ€™ for a guitarist to replace him. The three of us have an idea to recruit Yusheri (Ei) as a guitarist.               \r\n               \r\nThe four of us began to make the material created by Yusheri songs and arrangements by us. Thus was born a song called \\"Tak Pantas Untukku\\". Some band names we\\''ve thought, finally, we assign the name called \\''RHEIA\\'' which is of the pieces of its personnel\\''s initials.               \r\n               \r\nOnce the material is complete and the arrangement weâ€™re tried to record. At that time, Faruk as a vocalist as well as bassist. Produced after the song finished, we started again to lookinâ€™ for female vocals by holding small audition at Bintang home. Advice of friends highly recommended to help us.               \r\n               \r\nInitially we recruited Panni as vocals. When we\\''ve found a singer, we started lookinâ€™ for music events around the area of Jakarta. RHEIA first appeared on the show in one of the University of Culture in the Pondok Labu with the acoustic formed. About a month later RHEIA comeback at a CafÃ© in Tebet - South Jakarta.               \r\n               \r\nNot long after, Panni (vocals) resign because she wanted to focus on her studies. At that time we started back to look for female vocals. Incidentally Yogha invited Erica to jamminâ€™ several times with RHEIA. Then, Erica joined with us.               \r\n               \r\nRHEIA re-appeared in several musical events such as Community and Acoustic Night events. Over RHEIA from stage to stage, we invited Hendra as an auxiliary guitarist. However, since we fit with Hendra, we recruited him to be the second guitarist of RHEIA.               \r\n               \r\nâ€œSo.. HERE WE ARE.. RHEIA!â€ ', 1, 'small_f6d0d13057f9f3e3e10a1837a645d41d.jpg', 0, 186, '2012-03-11 02:47:28', '0000-00-00 00:00:00', 1),
(516, 3669, 'KATAKU', 'KATAKU is an Indonesian Fresh Pop Rock Band from Pontianak, West Borneo. Started Chandra and Acol playing music together in senior high school. A few players came and went, until finnaly we scored Oji Mahfuzhi as our guitarist and Yudo as our Bass. After the formation of this new formation, our tastes change, because they have a variety of different flavors, and we enter the phase of large, obsessive, culminating in some erroneous matching suit and big, bright pop songs with loud guitars. Now, all we could focus on was our excitement about recording new songs. Of course, all our energies are focused on our next activity and anticipation of returning to the road.', 1, '', 0, 317, '2012-03-12 03:36:16', '0000-00-00 00:00:00', 1),
