(522, 4724, 'Sri Plecit', 'Formed in about February 2009, begin from high school mates, Sri Plecit was founded by Pay (guitar, vocal), Awang (guitar), Joyo (bass), Ferly (percussion, keyboard), and Iqbal (drum).  A madness syndrome when high school and cheerfull of ska make us walk on ska in our music.  Because we love it, we think that ska was the right language to express our mind. For us, Ska is universal language, slow but sure, cheerfull but threating.\r\n\r\n   \r\nAfter going through several months, and we graduating from high school, by internal financial problems, labor, and Pay the decision to continue study to Jakarta, we decided to reform the Sri Plecit, and Galih a.k.a Grameh, Wipti, and Hasan (Oversight) and the sudden appearance Mohammad Fahmi a.k.a mamec for enliven and harmonize our musicfinally join us, and in Sri Plecit finnaly was formed by Grameh (vocals), Eta Wipti (vocals), Awang (guitar, vocals), Mamek (guitar), Joyo (keyboards), Hasan (bass), Eightball (drums), and Ferly (percussion). A new starting line-ups that survive long enough to finally turn Joyo must say goodbye to continue study in Semarang. After the vacancy on the keyboard player at last we were helped by mas Keyor (Wake Up Tomorrow) and also mas Dien (Jogjamming) who volunteered to help us fill in the instruments left by Joyo, Sengsu very much brother :D . In the end we feel that the brass section sound will add color in our music, and eventually we find it helpful again in the same mr. Margie from Oversight (add.trumphet) and mr. Fajar of the Boil Casava (add.saxophone).   \r\n   \r\nIn music, we learned a lot from everythings, especially a lot of bands that inspired us, such as Iwan Fals, Hepcat, The Slackers, The toots and the maytals, dr.ring-ding, the Specials, Rancid, Kemuri, Tokyo ska paradise, Slank, Operation Ivy, USCB Allstars, Alpha Boy School and many more. Yes, a lot of us who inspired us to pour it in a song like everyday when we hang out and making a discussion in angkringan MSD, come to the Brontokusuman Punk Scene, dinner on â€œPunkalan oi!â€ toast and pancake. Our songs represent about everyday life, reality and social issues, and also an invitation from our friends all for vibrant and optimistic in life, do not complain and easy to despair because the word pak Kyai â€œgod will change the fate of a nation when people were trying â€œand we think itâ€™s right, no one can determine the bitter sweetness of our life except our own future.   \r\n', 1, 'small_c3eb48bd0a3c5c25c5584641e2fefc9c.jpg', 0, 265, '2012-03-15 01:50:44', '0000-00-00 00:00:00', 1),
