(524, 4761, 'Sky Overhead', 'Dibentuk pada bulan Januari 2009 oleh Airi (vokal) dan Rian (gitar) dengan nama Sora Aoi. Setelah beberapa kali berganti personil akhirnya terbentuklah formasi yang solid yang terdiri dari Airi (vokal), Rian (gitar), Ky (drum) dan P-man (bass). Keempat pemuda ini bersatu dan memulai bermain musik benar-benar dari nol lalu menyatukan visi dan misi hingga akhirnya memutuskan untuk merubah nama menjadi Sky Overhead. Seperti langit biru di atas sana, keempat pemuda ini memiliki angan-angan dan semangat tanpa batas.', 1, '', 0, 174, '2012-03-15 11:47:05', '0000-00-00 00:00:00', 1),
(525, 4693, 'Lingga', 'LINGGA dalam cina kuno berarti Naga Jantan (anak muda yg energik)    \r\n\r\nKita terbentuk pada awal Oktober 2011 dari sebuah persahabatan yg terjalin setahun lamanya,yang pada akirnya sepakat untuk mengembangkan hobi yang sejalan dengan ikatan dalam band LINGGA .    \r\n', 1, '', 0, 148, '2012-03-16 03:01:53', '0000-00-00 00:00:00', 1),
