(527, 4799, 'SAVIOR', 'SAVIOR resmi berdiri pada tanggal 11 November 2006 di Yogyakarta, kesamaan ide, perbedaan unsur musik yang mempengaruhi tiap personal, dan kenginan membuat SAVIOR menjadi solid, unik, dan menghasilkan karya-karya sendiri adalah misi awal dari SAVIOR.\r\n\r\nSAVIOR memiliki arti yang sederhana. Kami hadir dengan format yang terdiri dari 5 personil. Inilah yang membuat karakter kami lebih kuat, disamping jenis musik yang condong ke GARAGE ROCK. \r\n\r\nMusikalitas SAVIOR terpengaruh dari berbagai unsur musik seperti blues, rock â€™70-â€™80, brit rock. Penampilan yang enerjik, bersemangat, fashionable, dan komunikatif adalah yang akan kami tampilkan di setiap stage kepada audience.\r\n\r\nTahun 2010 adalah sebuah harapan dirilisnya sebuah album, yang diharapkan mampu menunjukan eksistensi dan keinginan memberikan warna musik di Indonesia, melalui Album dengan title â€œ O YEAH â€ akan mencoba berdiri tegak di industri musik Indonesia.', 1, 'small_f929b64df5eb529d27a3ad32f5a279fc.jpg', 0, 265, '2012-03-16 06:31:59', '0000-00-00 00:00:00', 1),
