(530, 4808, 'Firefly', 'FIREFLY merupakan sebuah band yang terbentuk pada tahun 2009. Berawal dari nama Dâ€™PRINCE yang terdiri dari Ovan sebagai Vocalis, Farid sebagai Guitarist 1, Patra Windu Aji sebagai Guitarist 2, Agung sebagai Bassist dan Holey sebagai Drummer. Dengan berjalanya waktu, Farid menciptakan sebuah lagu duet dan akhirnya Dâ€™PRINCE meminta tolong Desty Adelina sebagai partner duet Ovan dalam lagu tersebut. Setelah beberapa bulan, Ovan pun menghilang tanpa kabar dan tiba-tiba ia datang untuk mengundurkan diri dengan alasan orang tua. Akhirnya kami pun memutuskan Desty sebagai Additional Vocal karna ada acara yang kami isi. Dan akhirnya kami pun memutuskan Desty sebagai Vocalist dari Dâ€™PRINCE. Dengan datang nya Desty sebagai Vocalist wanita akhirnya kami pun berganti nama menjadi FIREFLY. Setelah lama berjalan, diantara kami ada yang sudah bekerja yaitu Agung sebagai BASSIST. Karna alasan bekerja itu pula ia mengundurkan diri. Sehingga kami pun harus mencari pengganti Agung, lalu direkrut lah Fuad Farega sebagai Additional Bassist. Seiring berjalanya waktu ,Fuad pun memutuskan bergabung bersama FIREFLY dan menjadi personel tetap.namun perubahan personil FIREFY pun belom berakhir, seiring berjalannya waktu holey (drumer) memutuskan untuk keluar karena dia ingin melanjutkan kuliah dan ingin fokus di kuliah, kemudian di gantikanlah oleh achiel (drumer) yang bernama asli Muhamad Lukman. kedatangannya achiel membuat perubahan di FIREFLY, tak lama holey (drumer) keluar Fuad (bassis) juga ikut keluar karena dia ingin bekerja. Lalu di gantikan oleh lutfie (bassis) dia adalah sahabat kecil dari achiel. Lengkaplah sudah personil FIREFLY dan semakin berwarna. Hingga saat ini FIREFLY masih berdiri, dan masih berusaha untuk menjadi lebih profesional.\r\n\r\nkenapa harus di beri nama FIREFLY karena menurut mereka Kunang-Kunang adalah sebuah hewan yang menerangi sebuah kegelapan malam, yang kami harapkan kami ingin seperti FIREFLY yang dapat menerangi hati-hati insan manusia yang sedang gelap atau sedang gelisah melalui lagu-lagu kami. Nama FIREFLY di berikan oleh Vivi Vita pada tanggal 11 Agustus 2009. â€œWE MAKE DIFFERENCE WE ARE FIREFLYâ€ adalah suatu moto untuk FIREFLY.\r\n', 1, '', 0, 188, '2012-03-16 09:04:47', '0000-00-00 00:00:00', 1),
