(539, 4978, 'LARS', 'LARS merupakan band yang diisi oleh Febby (vocal), Jati (guitar), Tedy (guitar), DwA (bass), dan Allan (drum) dipengaruhi oleh band asal Amerika dan Britania seperti AlterBridge, Creed, Angels and Airwaves, dan U2. \r\n \r\nPada awalnya band ini didirikan khusus untuk mengikuti festival. Namun seiring berjalannya waktu dan pengalaman manggung akhirnya karya LARS mendapat kesempatan masuk ke Industri melalui single \\"CINTA SUDAH MATI\\" dan \\"1/2JIWA\\" yang merupakan OST dari film \\"Perempuan-perempuan Liar\\". \r\n \r\nLagu \\"CINTA SUDAH MATI\\" ciptaan Febby Alandino, Edy Kurniawan, dan Taqwa Sejati, merefleksi sebuah kata hati dari LARS adalah sebuah band pop-rock yang didirikan pada tanggal 1 Januari 2009, dengan gabungan personilnya berasal dari pecahan band Polipo, Felix dan Larva. LARS merefleksikan kekuatan menginjak bumi dan terus melangkah maju untuk berkarya. \r\n \r\nDalam bermusik, band yang lubuk yang paling dalam. Sebuah kejadian tidak hanya membuang perasaan kasih sayang tapi juga mencederai rasa cinta seseorang. Disadari kejadian itu hanyalah akhir dan awal sebuah cerita manusia dari kehidupan yang terus berjalan.', 1, '', 0, 184, '2012-03-20 01:56:28', '0000-00-00 00:00:00', 1),
(540, 4949, 'EKA PRAMUDIA SAPUTRA', 'A Eka Pramudia Saputra atau lebih dikenal dengan nama Eka Pramudia Saputra ini lahir di Bandung , 22 Februari 1990. Eka yang memang sudah menyukai seni musik sejak Duduk di bangku SD, Akhirnya Mulai menekuni Hobinya Semenjak Lulus Dari Bangku SMA.\r\n\r\nSetelah beberapa Saat lama Nya Bermusik di Kota Kelahirannya, Eka Pun meninggalkan Kota Kembang itu Untuk Mencoba Menambah pengalaman MusikNya Di Kota Bogor, Jawa Barat.\r\nMelalui perjuangan panjang, akhirnya Eka berhasil membuat Album kompilasi nya Yang Pertama yaitu \\" KOMPILASI ENAK DI KUPING Produksi TRINALARS RECORD Pada tahun 2010 bersama LIMA SENJA BAND, LIMA SENJA BAND adalah band Perdananya Yang ia Bentuk Semasa Di Bogor. Di Susul kembali Dengan Almbum Kompilasi Kedua Nya yang Berjudul \\"ROMANTIC IN BALI\\" Produksi SMTV INDONESIA Pada Tahun Yang sama.\r\nDikarenakan Terlalu seringnya Bongkar pasang Dalam Band yang ia bentuk, Akhirnya Eka memutuskan memilih jalan Untuk bersolo karir Saja.\r\nDi Dalam Setiap Karya yang Eka Buat, Eka Tidak terpaku Pada Satu Aliran Musik, Dari beberapa Karya Yang ia Buat ada yang Beraliran Pop , Pop rock Dan melayu. Karena ia mencoba Untuk terus memberikan karya yang easy listening dan mudah dihafal oleh Penikmat musik tanah air.', 1, '', 0, 177, '2012-03-20 07:44:52', '0000-00-00 00:00:00', 1),
