(543, 4068, 'PARISUDE', 'we begin in early 2009, with Yudhistira Mirza as composer and Amanda Chitara in vocal. Although we have quite a different taste in music, however the same interest in World/Ethnic music drew us together. We makes a distinction in music by fusing general electronica music with feel of ethnicity we call it \\''Unic\\'' : universal-ethnic. The name Parisude (Pa-ri-su-de) taken from sanskrit. Combination of deep electronica sound and dreamy vocal taken us to a journey of mind-trip, and surely, we shall take you all to.', 1, '', 0, 184, '2012-03-22 04:40:34', '0000-00-00 00:00:00', 1),
(544, 5042, 'Four Beaten', 'Four Beaten adalah Band asal Jakarta yang mengusung musik Pop Sweet Rock, Eki (Guitar) adalah salah satu founder dari band ini. Bersama Angga & Brian (Bass & Vocal (founder)) membentuk band ini, dan memperkaya blantika musik Indonesia.', 1, '', 0, 1, '2012-03-22 07:48:30', '0000-00-00 00:00:00', 1),
(545, 5177, 'BROKER', 'Berawal dari kompetisi Band LA LIGHTS INDIE FEST 2006, dengan nama Gerbang, kini mencoba kembali eksis dengan nama, semangat dan penampilan baru yang diharapkan akan menjadi salah satu penyempurna keberagaman musik di Tanah Air...Broker, saat ini hanya memiliki satu personil saja dengan auditional player sebagai pendukung...lahir di Samarinda pada 21 Maret 2011...dengan genre Pop Alternative, mencoba menawarkan suatu konsep unik, lagu cinta yang tidak mendayu dayu...lets support our band....', 1, 'small_7001453505f0ce71acc87980e6e6a3e9.jpg', 0, 358, '2012-03-22 15:43:36', '0000-00-00 00:00:00', 1),
(546, 4366, 'Nami-Q\\\\\\\\\\\\\\''ta', 'Q\\''ta sekumpulan 4 insan yg tdk sempurna. Tp q\\''ta brusaha untk buat org2 sktr q\\''ta menjadi sempurna lewat karya,syair,nada,dan alunan instrumen yg sederhana.    \r\nQ\\''ta adalah:    \r\n1. Octa joel: lead guitar    \r\n2. Ongky : drums    \r\n3. Opiq : vocal    \r\n4. Tria : bass Q\\''ta    \r\nterbentuk baru2 aja thn kmarn 06 Okt 2008 Q\\''ta berkarya di aliran ...pop a...lternativ.    \r\nNama NAMI-Q\\''TA mempunyai arti sebnarnya dari bhsa JAWA-INDONESIA yaitu \\" NAMA KAMI \\"', 1, 'small_bf213aadc9c2c9800606f8dacf3dac4f.jpg', 0, 231, '2012-03-23 04:57:10', '0000-00-00 00:00:00', 1),
