(552, 4916, 'THE SANGAJI', 'Sangaji terbentuk tanggal 9 bulan Januari tahun 2008, dengan formasi 5 orang personel. Seiring berjalannya waktu, kami beberapa kali mengalami perubahan personel, dari Vocal sampai Drummer. Sampai saat ini kami berjalan dengan 5 orang personel, yaitu: Imam (Vocalist), Dika (Guitarist), Shandy (Bassist), Abi (Keyboardist) dan Zaid (Drummer). Konsep musik yang kami usung adalah Alternative Pop Love (APOLO), musik Pop Industri yang bernuansa Cinta tanpa kesan kacangan, karena dibalut dengan aransemen unsur Alternative. Dengan kekuatan dari komposisi lagu yang pas & seimbang baik dari sisi Vokal, Lirik, maupun Aransemen musiknya, serta ditunjang oleh pengalaman bermusik dari para personilnya, SANGAJI mencoba untuk ikut tampil kepermukaan membawa semangat baru, warna baru & berbagi kisah-kisah hidup yg penuh cinta & kasih sayang dengan para pencinta musik di Indonesia. Nama Sangaji diambil dari bahasa Jawa yang berarti, Sanga (Songo) yang arti angka Sembilan (9) dan Sidji yang artinya angka Satu (1), Angka Sembilan dan Satu merupakan tanggal terbentuknya Sangaji, yaitu tanggal 9 bulan 1 (Januari), pengambilan nama ini ditujukan agar kita selalu ingat akan awal kita dalam berkarir, kerja keras yang telah kita lakukan, serta orang-orang yang selalu mendukung Sangaji dalam bermusik.', 1, 'small_de549aff105614f8125f4d0a1af6a05c.jpg', 0, 187, '2012-03-25 16:37:14', '0000-00-00 00:00:00', 1),
