(555, 5344, 'Sunday Market District', 'Terbentuk pada Februari 2011, berawal dari keinginan bermusik dengan referensi lagu yang masih sejenis. Dua prempuan dan dua laki-laki ini, akhirnya membentuk satu band untuk mengekspresikan emosi personal dan pengalaman hidup di ruang perkotaan. ', 1, 'small_6f9e340d6cad0d388eaa6c736f656655.jpg', 0, 186, '2012-03-26 14:14:35', '0000-00-00 00:00:00', 1),
(556, 5345, 'The Frankenstone', 'The Frankenstone terbentuk baru-baru ini. Kami lupa dan malas mengingat-ingatnya. Awalnya band ini terdiri dari Putro (gitar, vocal) dan Gisa (bass). Kami belum punya drummer tapi sudah punya beberapa lagu. Akhirnya kami mencari drummer seadanya, dan ternyata dapatnya drummer yang influencenya hanya Travis Baker saja. Tapi karena kita males nyari yang lain lagi, akhirnya kami pakai dia. Sampai akhirnya kami muak lalu diapun kami pecat. Tapi sebelumnya, kami kerjai dia buat bantuin kami bikin demo dulu.\r\nBlablablabla . . . . setelah gonta-ganti drummer sampai lima kali, akhirnya The Frankenstone merekrut Jeje sebagai drummer tetapnya. Selain pinter ngedram, anaknya gampang diajak ngeband dan menyenangkan. Karenanya, dia langsung diterima sebagai drummer tanpa seleksi.\r\nThe Frankenstone mendefinisikan dirinya sebagai sekumpulan plagiat yang menyerupai band. Kami memainkan musik dengan keras, ugal-ugalan, sebisanya, dan kasar. Soundnya analog dan penuh distorsi, sehingga lagu-lagunya jadi lebih mantap walaupun minim lirik. Entahlah, mungkin cuma kitanya yang imbisil dan gak bisa bikin lirik.\r\nYang jelas, pedoman kami dalam bermusik adalah kebebasan. Asal enak didengar telinga kami. Buat kami rock â€˜n roll itu adalah kebebasan dalam segala hal, dan yang kami inginkan saat ini adalah gaya hidup yang biasa aja. Slogan sex, drugs, and rock â€˜n roll itu udah basi, karena ini bukan tahun 70an lagi di mana semua musisi harus gondrong, kurus, dan bertampang pemabuk.\r\nKami lebih suka berada di rumah, denger musik-musik yang bagus, daripada nongkrong dan mabuk-mabukan. Makanya kami gak punya temen, dan jangan harap ada banyak grupis datang waktu kami manggung. Kami juga gak ngerti kenapa untuk jadi rocker kita harus punya masa kecil gak bahagia dan keluarga berantakan karena masa kecil kami bahagia dan keluarga kami tidaklah berantakan. Ya dikit lahâ€¦\r\nSori kalo cerita kita gak sesuai dengan harapan kalian, tapi paling tidak kami jujur,heheâ€¦', 1, '', 0, 265, '2012-03-26 14:16:51', '0000-00-00 00:00:00', 1),
(557, 5366, 'Jossie ', 'Yes We Are : \r\nAngga AKA Gembel : Guitar - Vox\r\nRendy : Bass - Vox\r\nRezha : Drum -Sex Machine\r\n\r\nThis is asshole pop punk band from yogyakarta , indonesia\r\nlet\\''s pop dancing with a chaotic rhythm, that is pop punk!!\r\nwant to know more about this trio of fvcking assholes?\r\nwhether you want us to come to your event?\r\njust contact us --> : 085643747403\r\n\r\nkick ass greetings :D', 1, '', 0, 265, '2012-03-27 03:16:23', '0000-00-00 00:00:00', 1),
(558, 4326, 'Link', 'satu hal yang pasti... kami pasti menggebrak muisk indonesia', 1, '', 0, 174, '2012-03-27 10:54:23', '0000-00-00 00:00:00', 1),
(559, 5097, 'Vaksin', 'Terlahir pada Agustus 2008, pada awalnya Vaksin terbentuk oleh 3 personil, Dimas (Vocal & Guitar), Vey (Drum), dan Fandy (Bass). Dimana masing-masing memiliki tekad yang kuat dalam bermusik sehingga tergambar dalam sebuah simbol segitiga dengan tiga buah sisi yang sama, memiliki arti bahwa tidak ada perbedaan diantara kami, tetapi justru kita menyatukannya sehingga terbentuk sebuah musik yang solid dengan berbagai kisah.\r\n\r\nWarna musik yang penuh makna, identik dengan warna merah yang mempunyai begitu banyak arti, melambangkan kuat, berani, percaya diri, aktif, agresif, semangat. Bagi kami, warna merah termasuk warna yang hangat, identik dengan cinta dan kasih sayang, dan akan membuat musik yang kami bawakan mampu diterima dan memberikan sebuah perhatian.\r\n\r\nSejak berdiri pada bulan Agustus 2008 sampai saat ini (April 2012), Vaksin telah menyelesaikan 7 album, dengan komposisi 4 album utama, 1 album The Best (kumpulan lagu-lagu terbaik dari album ke-1 sampai ke-3), dan 2 album extra berupa Radio Album dan album The Greatest (kumpulan lagu-lagu terbaik dari album ke-1 sampai ke-5).\r\n\r\nJumlah keseluruhan lagu yang telah dirilis hingga saat ini adalah 39 lagu, dengan komposisi berupa 37 lagu baru (yang terdapat pada 4 album utama) dan 2 lagu yang di-remix. \r\n\r\nDi masa depan, Vaksin akan merilis 2 album baru, yaitu 1 album Religi yang akan di konsep dalam sebuah mini album (yang merupakan album ke-6), dan 1 album utama (yang merupakan album ke-7). Sampai saat ini, 1 lagu religi dan 4 lagu untuk album utama telah tercipta. Beberapa lagu lainnya masih dalam proses. Vaksin berencana akan merilis album baru tersebut pada bulan Juli 2012 (untuk album Religi) dan pada pertengahan tahun 2013 nanti (untuk album utama).\r\n', 1, '', 0, 229, '2012-03-27 10:56:13', '0000-00-00 00:00:00', 1),
