(565, 5472, 'Made For Fans', 'Made For Fans Terbentuk September 2011.\r\ndari Kota Bekasi. :)\r\n\r\nKami mengusung musik kontemporer (perpaduan genre) / kesukaan genre dari setiap masing2 personil kami yang dijadikan satu; yaitu SOUND ELITE POP ROCK.\r\nSound Elite Pop Rock adalah perpaduan antara musik POP ROCK yang di latar belakangi oleh Looping (musik digital). dimana genre kami sangat berDominan Genre POP ROCK ALTERNATIF.', 1, '', 0, 159, '2012-03-28 11:38:21', '0000-00-00 00:00:00', 1),
