(567, 5515, 'Dream Visual', 'Dream Visual terbentuk pada tahun 2011 di bulan juni pada tanggal 6, tepatnya di Palembang.\r\nnamun setelah berlangsung lama berjalan, sang vocalist ari keluar , akhirnya ozie, robby, piek, dan titok mencoba mencari vocalist yg tidak jauh masih satu tongkrongan yg bernama awal utk mengisi posisi vocal. Dan kita tak pernah berhenti bersusah payah berkreasi mengucurkan keringat bah darah demi mengha...silkan karya yang diterima oleh dunia khusunya negeri kita yang tercinta.\r\n\r\nFORMASI DREAM VISUAL\r\n\r\nVocal : AWAL\r\nGuitar left : OZIE\r\nGuitar right : ROBBY\r\nBass : TITOK\r\nDrum : PIEK\r\n\r\n\\"Dream Visual\\" sendiri punya filosofi yaitu mimpi itu selalu ada dan akan nyata bila kita terus berusaha mengejar semua mimpi mimpi indah kita.\r\n', 1, '', 0, 120, '2012-03-29 06:43:22', '0000-00-00 00:00:00', 1),
(568, 5260, 'Dusky Month', 'Saat itu adalah masa-masa dimana hari-hari terasa sulit, keadaan yang sangat memuakkan, dalam menghadapi perbedaan dan menghadapi masalah-masalah yang tak kunjung reda. Berawal pada jam 12.00 pm, tanggal 1 juli 2011, sebuah band dengan genre melodic pun terbangun tanpa direncana. â€œDusky Monthâ€ nama yang saat itu muncul dari buah pikiran kami yang dirasa sesuai dengan keadaan saat itu.   \r\nSempat beberapa kali mengalami kemunduran dan kini kami kembali untuk bangkit, kembali berdiri dengan formasi yang baru untuk memulihkan semangat berkarya dengan melodic. Menghibur dan berharap dapat memberikan rasa, untuk kalian orang-orang yang merasa disisihkan. Kami bertekad memberikan warna dalam music kami, dengan kemasan drum yang ngebeat, petikan gitar yang renyah, dan lebih easycore sehingga bersemangat dan ringan didengarkan. Bercerita bagaimana kita bertahan dari segala krikil terjal yang membentang, juga tentang realita kehidupan.   \r\nDUSKY MONTH adalah jalan kita, 3 pemuda (thejo:bass+voc, azam:guitar+ bck voc, athonk:drum) yang kini menjadi lbih berarti dan lebih mengerti bagaimana cara memaknai hidup. Bahwa hidup ini akan indah pada saatnya, tergantung bagaimana kita menentukan arah dan kita melangkahkan kaki dijalan yang semakin gersang di bulan yang kelam ini!!!!!!!! THE DUSKY MONTH ALWAYS MAKE U SMILE,â€¦â€¦ \r\n \r\nfor booking: azam (08995187303); thejo (087838873385)', 1, '', 0, 265, '2012-03-29 09:40:55', '0000-00-00 00:00:00', 1),
(569, 4074, 'Visual Shock', '	\r\nDulu band ini bernama Einstein Get Drunk yang terbentuk pada pertengahan 2009 lalu dan di personili oleh Alek (Voc), Rey (Guitar), Agung (Guitar), Aldy (Bass), dan Aji (Drum).\r\nKarna memiliki cukup banyak kesibukan pribadi sang Vocal mengundurkan diri dan di gantikan oleh Tias.\r\nSedikit mengubah formasi Tias (Voc), Rey (Guitar), Agung (Guitar), Aldy (Voc n Bass), Aji (Drum), lalu berganti nama menjadi \\"Visual Shock\\" pada tanggal 21 Mei 2010 !\r\nSemoga musik kami di nikmati setiap orang dan setiap kalangan !\r\n\r\nyeah... VISUAL SHOCK !', 1, '', 0, 120, '2012-03-29 12:28:25', '0000-00-00 00:00:00', 1),
(570, 5499, '46th Block', 'Terbentuk di awal 2008. Bermula dari pertemanan semasa SMP, lalu berniat untuk membuat suatu band alhamdulillah bertahan sekarang.sempat berganti personil di posisi gitar dari pojan beralih ke Irvan. 46th Block beranggotakan Agil Zihni (guitar vokal), Tryas Kancut (drum), Tri Dom ( Bass), Irvan Ramli (guitar). Lirik-lirik lagu kebanyakan berkisah tentang keseharian di masa-masa SMA yang bengal dan menyenangkan. Sekarng 46th Block sudah menciptakan empat lagu.', 1, 'small_aac69941a26e46b732cbd9051c062489.jpg', 0, 120, '2012-03-29 17:21:36', '0000-00-00 00:00:00', 1),
