(572, 4459, 'Spank Thru', 'Starting from the character created when we were gathered while eating fried foods, named Jack who loved â€œtopsy-turvyâ€ his ass when he is too happy\r\nwe finally decided we were a band called the Jackass.\r\nThen the unthinkable that we should do something to re-invigorating the original purpose of our musical steps.\r\nAt that time we were listening to Nirvana - Spank Thru, created a naughty thought that ...the Jack character we have our \\"hit / spank\\" especially on the â€œtopsy-turvyâ€ his ass liked it. To stop these stupid habit and be more mature.\r\nFinally we agreed to change our name to Spank Thru, which means beating continuously.\r\nHope hopefully change our name makes us more mature in our attitude and musicality.\r\nthis is the way we are..\r\nplease coming in..\r\n\r\nEmail : spankthrutheband@yahoo.com\r\n\r\nSpank Thru Management\r\nWarungboto UH IV/ 1011\r\nYogyakarta 55164\r\nIndonesia', 1, '', 0, 265, '2012-03-30 12:06:38', '0000-00-00 00:00:00', 1);
