(573, 5575, 'Delaware\\''s ', 'Formed at the end of 2011, exactly on December 9, Delaware\\''s is a band with an acoustic format, which gives a touch of music with easylistening concept, as well as material that is easy and simple songs. spearheaded by Fharadea Mareta as vocals, Arief Nugroho as vocal / guitar, lead guitar as Anindya Ramadan, R Gusti Prima Dyora as bass and percussion as Adelwin Pratama. Delaware\\''s has released their first single, entitled \\"Then I Feel Better\\". The single tell about  women, she told about a confused person, while he has never felt a sense of love, and then he felt better after getting to know the meaning of a love and affection. The single can be heard and downloaded on http://www.reverbnation.com/delawares', 1, 'small_c392189a4f92d00c189acf9dbc34704b.jpg', 0, 120, '2012-03-30 12:30:18', '0000-00-00 00:00:00', 1),
