(575, 4261, '[ M.O.C.O ]', 'Berawal dari Fajrin (vocalist) yang mengundurkan diri dari band nya terdaluhu dikarenakan ketidakseriusan band tersebut dalam bermusik, lalu ia berencana membuat sebuah project band yang kali ini ia ingin mengkonsep lebih matang dari band sebelum nya.   \r\nsaat itu ia bertemu dengan Arya (guitarist) yang kebetulan baru saja menyelesaikan sekolah nya di salah satu institut musik di bandung.   \r\nsetelah beberapa waktu berlalu, Fajrin & Arya bertemu dengan ichwan (drummer) dan rangga (bassist).  yang memang mereka ber empat ini adalah teman sejak kecil, namun sebelum nya ada di Band dan tempat tinggal yang berbeda. \r\nDari pertemuan itulah kami mencoba membentuk sebuah Band yang kami beri nama [ M.O.C.O ] pada 1 februari 2012. \r\nnama [ M.O.C.O ] adalah singkatan dari [ Music - Organization - Community - Original ].    \r\ndengan harapan kami bisa menjadi band sekaligus adalah sebuah organisasi & komunitas yang bisa bermanfaat untuk semua orang. dengan berisikan hal2 yang original di dalamnya. tidak plagiat & tidak bajakan.   \r\nkami sangat berharap mampu menjadi musisi musisi yang di banggakan. amin   \r\nmohon support & doa nya dari teman teman semua.  \r\n \r\nContact M.O.C.O : 085788217380 \r\nDomisili               : Bandar Lampung', 1, '', 0, 134, '2012-03-31 06:08:59', '0000-00-00 00:00:00', 1),
(576, 5627, 'dhamster', 'Band dâ€™hamsTer resmi terbentuk pada bulan juli 2006, berawal dari kesamaan visi dan misi tiap-tiap personel untuk membentuk sebuah group band yang bisa dijadikan sebagai wadah penyaluran ekspresi tiap-tiap personel dalam bermusik, yang diharapkan bisa menjadi sumbangan yang berarti bagi perkembangan musik tanah air dan pada dunia kreasi seni di Indonesia. Nama dâ€™hamsTer sengaja kami pilih karena salah satu personil kami senang sekali dengan binatang hamster, maka dari itu kami sepakat untuk memberi nama band ini dengan nama dâ€™hamsTer. Kami akan terus berusaha dan berdoa agar hasil karya kami bisa dirasakan oleh penikmat musik di seluruh tanah air, tanpa terkecuali.', 1, '', 0, 1, '2012-03-31 15:55:29', '0000-00-00 00:00:00', 1),
(577, 5311, 'The Maio', 'The Maio adalah band mengusung aliran POP ROCK.\r\nKami terdiri dari 3 cewek yang mempelajari musik secara otodidak, dengan formasi : Olin - Vocal + Gitar, Vina - Gitar, Yufan - Bass + Back. Voc.\r\nKami membawakan lagu2 ciptaan kami sendiri.\r\n\r\nKeseharian kami adalah wanita karier, namun karna rasa cinta kami pada musik, kami selalu menyempatkan diri berkumpul pada hari sabtu - minggu untuk bermusik :)\r\n\r\nSemoga kalian menyukai musik kami.... ^^', 1, '', 0, 187, '2012-03-31 16:48:16', '0000-00-00 00:00:00', 1),
