(582, 5682, 'Ninedigitz', 'Pada awalnya Ninedigitz adalah sebuah group band khayalan, yang dibuat oleh seorang musisi kamar untuk terus bisa berekspresi dengan karya yang dibuatnya. Melalui proses yang cukup lama, akhirnya ada juga teman2 yang mau jadi personil band berarliran Grunge Rock Alternative Ini....', 1, '', 0, 161, '2012-04-02 04:30:17', '0000-00-00 00:00:00', 1),
(583, 5585, 'PHIton Band', 'Life Begin 4 Year Ago\r\n\r\nDepok, Thursday, 15 February\r\nSore itu adalah sore yang selalu gue inget. Sore di mana awal band ini berdiri. Di sebuah pendopo yang nyaman dengan riak air danau dan teriakan ikan-ikan di dalamnya. Kisah pertemuan antara gue dengan dua orang pria yang membantu mewujudkan mimpi-mimpi gue. â€œNdri, coba kamu nyanyiin dua penggal bait lagu ini,â€ kata Mr. Joe ke gue. Akhirnya, mereka nyuruh gue untuk membentuk sebuah band.\r\n\r\n#Sigh\r\n\r\nSingkat cerita, gue berhasil membentuk sebuah band dibantu dengan adek gue. Di sinilah babak baru PHI-tone dimulai. Konflik, persahabatan, kesedihan, tragedi, luka, intrik, semuaÂ­nya berkumpul menjadi satu. Membumbui kisah perjalanan PHI-tone in the world.\r\n\r\nTapi sekarang setelah melewati perjuangan yang gak ringan, sebuah langkah besar telah menanti kita, INDUSTRI MUSIK. Gue dan para member PHI-tone  yang lain sedang mempersiapkan seluruhnya dari apa yang kita miliki, demi 2 buah kata, JADI TERKENAL. \r\n#THIS IS SHOW TIME#\r\n\r\nAndri: Vocalist, Arif: Guitar 1, Heri: Guitar 2, Bowo: Bassist, Uno: Keyboardist, Irvan: Drummer\r\n\r\nENGLISH:\r\nThat evening was the evening that I always remember. The early afternoon where the band stand. In a comfortable hall with ripples of the lake and the cries of the fish in it. The story of my meeting with two men who helped make my dreams. \\"Ndri, try to cut you sing two verses of this song,\\" said Mr. Joe to me. Finally, they nyuruh me to form a band.\r\n\r\n# Sigh\r\n\r\nLong story short, I managed to form a band with adek helped me. This is where a new round of PHI-tone begins. Conflict, friendship, sadness, tragedy, injury, intrigue, all gathered into one. Spice up the journey of PHI-tone in the world.\r\n\r\nBut now that the struggle is not over light, a major step has been waiting for us, MUSIC INDUSTRY. I-PHI and its members are preparing for another tone entirely from what we have, for 2 pieces of words, SO FAMOUS.\r\n#THIS IS SHOW TIME\r\n\r\nAndri: Vocalist, Arif: Guitar 1, Heri: Guitar 2, Bowo: Bassist, Uno: Keyboardist, Irvan: Drummer', 1, '', 0, 180, '2012-04-02 06:48:34', '0000-00-00 00:00:00', 1),
