(586, 4380, 'd\\''unknown', 'Berawal dari sebuah mimpi kami mencoba menuangkan kesederhanaan dalam musik kami, dan dengan kesederhanaan itu pula lah karya-karya kami terlahir dengan tulus . . . \r\nPada bulan april 2008 dâ€™unknown terbentuk di bandung dengan jumlah personil 5 orang yang terdiri dari Hendra (Vocal), Roi (Guitar), Iwan (Bass),  Anggi (Rhytm/Keyboard),  Irham (Drum) yang Insya Allah ini menjadi formasi terakhir kami.  \r\nMusik kami tidak terbatas genre, namun mengalir begitu saja tanpa ada batasan. \r\nâ€œListen our music, and you will understandâ€ \r\n', 1, 'small_4bf5dde40170233a0f489bb5ee116fe6.jpg', 0, 174, '2012-04-02 14:46:05', '0000-00-00 00:00:00', 1),
(587, 5709, 'BUTTERFLY EFFECTS', 'Indie band from Jakarta, Indonesia this genre Rock began in 2004, right at the beginning of the year stood a band called Tear Shoes, this band stands on 4 people think teenagers are Keny (guitar), Zaky (guitar), Berry (bass) and Fattah (drums). The name change became torn Shoes BUTTERFLY EFFECTS, over time we began to overhaul the player, Beny and Fattah out the reasons that make no sense after they left us, Zaky started looking for players remain, the Adhi and Sinyo that replaces Beny and Fattah. 2 years later, in 2006 Sinyo (drums) finally came out as well and finally we invite Ryan to fill the position left by Sinyo drums.         \r\n         \r\nâ€¢ BUTTERFLY EFFECTS (2006):         \r\nZaky (guitar), Keny (guitar & vocals), Adhi (bass), Ryan (drummer). In 2007 mid Ryan resigned for reasons you want to focus together (first band) since that\\''s when Zaky became a drummer and guitarist has since also become Adhi, a few months without a bassist, and eventually Tonda offers himself as a bassist.         \r\n         \r\nâ€¢ BUTTERFLY EFFECTS (2007 - 2008):         \r\nZaky (drummer) Keny (guitar and vocals) Adhi (guitar 2) Tonda (bass). in 2008 we again lost personnel ie Adhi him out for various reasons, after a year we exercise without Adhi but we are assisted by Stevy for several months.         \r\n         \r\nâ€¢ BUTTERFLY EFFECTS (2009 - June 2011):         \r\nZaky (drummer) Keny (vocals and guitar) Tonda (bass and vocals) in 2010 we have released our first album entitled HOPE & CHANGE. After releasing the first album we held a tour to several cities in Indonesia, namely Jakarta, Depok, Tangerang, Bali, Lumajang, Kediri, Malang, Solo and Blitar. After holding the tour Tonda resign, he wants the focus to college.         \r\n         \r\nâ€¢ BUTTERFLY EFFECTS (2011):         \r\nWe now have three permanent personnel of Keny (Guitars and Vocals), Zaky (Drum), Topik (Bass), Pala (Guitars). Thank you for your support to us, we stand by you.        \r\n        \r\n(Follow us on Twitter : @BE_bandJKT)', 1, '', 0, 184, '2012-04-02 15:06:11', '0000-00-00 00:00:00', 1),
