(597, 617, 'No Sk!lL', 'Sebuah Band yang diwariskan oleh (Alm) Yan Felix Srg sebagai Pendiri, leader, vokalis dan bassis Band No SkilL.\r\nAwalnya No SkilL terbentuk pada akhir tahun 2004\r\nKemudian terhenti selama 2 Tahun dikarenakan Meninggalnya Alm. Felix dan hengkangnya David (drummer) dari No SkilL setelah Kepergian Alm. Felix di Tahun 2006.\r\n\r\nDan No SkilL bangkit dari Kubur untuk bermusik kembali pada tahun 2008, dengan bergabungnya dua orang yg mengisi posisi Bass dan Drum.\r\n\r\nNo SkilL kembali melanjutkan Impian Bermusik dengan Membawakan beberapa Lagu Karya Almarhum Felix dan beberapa Lagu Karya Para Personil No SkilL sekarang yang disatukan ke dalam satu Album Perdana Karya No SkilL yang sedang Dalam Proses.', 1, '', 0, 51, '2012-04-05 14:28:48', '0000-00-00 00:00:00', 1),
