(606, 5837, 'Devanada', 'Band ini mempunyai nama resmi sejak 19 Desember 2011. Kami terbentuk di kota kecil yang indah di tengah jawa, kesamaan visi bermusik merupakan alasan kami untuk membentuk band ini. Semoga musik kami bisa di terima masyarakat luas di Indonesia maupun Internasional, karena kami menyuguhkan sesuatu yang berbeda.   \r\n  \r\nAnggota kami :  \r\n  \r\n- Arif Widagdo : Lead Vocal / Rhytm  \r\n- Fergy Romadhany : Bass / Electronic Stuff  \r\n- Fa\\''ano Hia : Guitar / Backing Vocal.   \r\n  \r\nMusik kami tidak terbatas, aliran kamipun tak bisa di tentukan, karena kami berkarya sesuka hati dan ingin menampilkan musik ciri khas sendiri, nikmati musik kami dan silahkan menilai apapun tentang karya kami. Salah satu  harapan kami adalah untuk menyegarkan kembali industri musik tanah air yang sedang berjalan monoton tanpa banyak pilihan lain.   \r\n  \r\nMAJU TERUS MUSIK TANAH AIR !!!', 1, '', 0, 220, '2012-04-08 13:56:02', '0000-00-00 00:00:00', 1),
