(612, 5998, 'CHILD OUT', 'Oktober, 2008  \r\nMengawali perjalanan kami membentuk sebuah format band dengan beranggotakan 5 anak remaja. Band beraliran Pop/Alternative dan berjiwa muda dengan nama CHILD OUT, yang memiliki arti tersendiri bagi kami. Adalah sekumpulan anak-anak yang bergabung untuk keluar mencari arti kebebasan, kebebasan untuk mengeluarkan kemampuan dan karya yang dimilikinya. Kami pernah mengalami banyak transisi personil, jatuh, dan harus tetap berdiri.  \r\n \r\nSaat ini, CHILD OUT berdiri dengan Genre Pop/Alternative, dengan formasi Nana (Vocal), Rizqi (Guitar/Vocal), Adhitya (Bass), Irdham (Guitar), dan Dika (Drum). \r\n \r\nthat\\''s a little part of us.. \r\nfacebook      : Child out \r\ntwitter         : CHILDOUTjkt10 \r\nReverbnation : www.reverbnation.com/childout', 1, '', 0, 180, '2012-04-10 00:23:50', '0000-00-00 00:00:00', 1),
