(617, 6086, 'annabeth band', 'Annabeth terbentuk pada tanggal 8 September 2010. Kami beranggotakan lima orang dengan nama-nama personil sebagai berikut:\r\nStella â€“ Vocalist\r\nTifanny â€“ Bassist\r\nThomas â€“ Guitarist\r\nBobby â€“ Drummer\r\nDeo â€“  guitarist\r\nNama â€œAnnabethâ€ dalam bahasa Inggris memiliki makna â€œGod has favored meâ€, yang berarti Tuhan berbelas kasih dan memberikan pertolongannya kepada kami . Kami sepakat menggunakan nama â€œAnnabethâ€ karena kami masing-masing telah merasakan pertolongan dari Tuhan dalam segala hal. Kami berharap suatu hari nanti lagu-lagu yang kami ciptakan dapat diterima serta membawa kebahagiaan bagi para pendengar.\r\nLagu yang kami ciptakan bertemakan kehidupan dan realita dari anak muda zaman sekarang. Lagu kami ber-genre Pop Rock karena musik ini menunjukkan semangat yang selalu baru.\r\nSaat ini beberapa lagu kami seperti, Aku Takkan Memilih, Sampai Nanti Sampai Mati (SNSM), dan Sumpah sudah terdaftar sebagai nada sambung (RBT) di semua operator seluruh Indonesia. Untuk lagu Aku Takkan Memilih sudah diputar dan dapat di-request di radio - radio Bandung.\r\n\r\n\r\n\r\nAtas perhatian dan waktunya kami ucapkan terima kasih.\r\n\r\nRegards,					\r\nAnnabeth & Management\r\n          \r\n    CP : 087882202000\r\n', 1, 'small_899a8945ab540071620479baf7491cc2.jpg', 0, 174, '2012-04-12 16:45:05', '0000-00-00 00:00:00', 1),
