(620, 6081, 'ZICA BAND', 'Zica Band The Next Rising Star \r\n \r\nAwal terbentuknya Zica Band \r\n \r\nZica Band yang berdiri pada 14 Februari 2010 ini yang terbentuk oleh Tian (Vokal &Guitar) Agunk ( Lead Guitar) Rendy ( Bass) & Fakta pada Drum. dan Music yang mereka Ambil yaitu Pop Rock yang sangat melekat dengan khas suara sang vocalis. \r\n... Arti dari sebuah nama Zica yaitu sederhana yang memenuhi imajinasi ketiga musisi muda ini adalah menjadi bagian dari musisi-musisi lainnya dalam memperkaya khasanah musik tanah air. mereka jalani dengan penuh perjuangan. Sejak berdiri pada 14 Februari 2010 di Bandung,meskipun Zica Band belum lama berdiri tapi ketiga personil ingin menjadi musisi yang diakui, membuat mereka selalu giat berlatih. \r\n \r\nKisah perjalanan karir mereka dituangkan oleh Tian dalam lirik-lirik yang menyentuh. Misalkan pada lagu â€Yang Telah Memilihnya â€ yang sangat memiliki nilai khusus bagi penciptanya karena didedikasikan buat Kekasihnya yang pergi untuk selamanya disaat Zica memulai Terbentuk. Kisah cintapun tak lepas dari pengamatan Tian.. Berselang beberapa bulan Zica band pun mulai mengeluarkan Hist Single yaitu \\"By The Way\\" yang diciptakan oleh Tian & Agunk. ..dan lagu by the way ini ter inspirasi oleh hal kecil yang sering mereka ucapkan disaat mereka bercanda. akhirnya keluarlah By The Way \r\n \r\nMimpi untuk menjdi superstar sangat sulit. tapi bagi mereka mimpi harus ditaklukan. dan harus terus dikejar. semoga karya - karya Zica Band  kedepan bisa di terima di Seluruh masyarakat Indonesia dan bisa lebih Go Ahead.......', 1, '', 0, 174, '2012-04-13 07:03:44', '0000-00-00 00:00:00', 1),
