(628, 6153, 'VAHALLA', 'VAHALLA, band yang di gawangi oleh Ekky(gitar, vokal), Dicky(gitar), Deny(Bas), Al-Bockhori(Drum), berdiri pada tanggal 19 Maret 2009. Musik yang mereka usung lebih ke POP KREATIF, dimana didalam musik mereka terdapat unsur ROCK dengan balutan yang bernuansa BRITISH, tapi yang jelas, apa yang meraka buat benar-benar hasil karya yang penuh dengan pemikiran. Musik yang mereka buat merupakan musik yang elegan dan tidak asal-asalan. Berbobot tapi tetap enak didengar, karena itu merupakan hal yang terpenting agar musik mereka bisa diterima di semua kalangan masyarakat. \r\nMungkin tidak banyak event panggung yang pernah mereka ikuti, tapi dengan pengalaman pribadi masing-masing mereka yakin mereka bisa memberikan yang terbaik, dan siap untuk benar-benar terjun ke industry musik Indonesia. \r\nâ€œMemberikan yang terbaikâ€yaâ€¦itulah keinginan mereka. Untuk orang-orang terdekat mereka, orang-orang yang menyayangi mereka, orang-orang yang selalu mendukung dan mendoâ€™akan mereka, untuk semua penikmat musik Indonesia, dan untuk Bangsa dan Negara tercinta Indonesia. \r\nâ€œBravo Musik Indonesia..!!!â€ ', 1, 'small_09b6f02640d3368e87e16cfc31642173.jpg', 0, 174, '2012-04-14 12:50:17', '0000-00-00 00:00:00', 1),
