(646, 5296, 'The Viper X', 'Nama the Viper X terinspirasi dari kata Viper.\r\n\r\nDimana kata Viper itu sendiri melekat pada sosok ular mematikan dan mobil cepat yang gila.\r\n\r\ndari dua filosofi itu kami mengambil sebuah benang merah dan mengartikan The Viper X sebagai\r\n...\r\n\\"Sebuah gerakan cepat yang menyentuh dan berharap orang bs cepat bersahabat dg karya karya kami\\"\r\ndan huruf X sndri kita artikan sebagai simbol pertemanan antara kami dan teman teman Viper\r\n\r\n\r\nBErmain musik bersama diawal tahun 2008, dengan formasi awal pjink (gitar-lead vocal) dan Nanang(drum).\r\nnekat dg 2 personil pada awalnya kami perform di salah satu parade band di acara malam tahun baru ,dirasa kurang menutup instrumen ,akhirnya kami menggandeng\r\nteman bassis kami yg bernama pipid untuk additional bass kami.\r\nBeberapa kali bongkar pasang posisi bassis, tak menyurutkan mereka untuk tetap melangkah.\r\ndan pada akhirnya kami menemukan format personel 4 orang dan kami merasa nyaman disini.\r\nJatuh bangun dari setiap perjalanan membuat mental kami cukup terasah dengan baik.\r\n\r\n\r\nkami menamakan music kami sebagai \\''music for fun\\''... dengan harapan siapapun yang mendengarkan lagu kami,mereka lbh bisa tersentuh dengan realita disekitar\r\ndan kita juga berharap mereka bisa merasakan fun untuk menyemangati hidupnya .\r\n\r\n\r\nhere we are The Viper X\r\n\r\nPjink - gitar&lead vocal\r\nKucing - Lead gitar\r\nUcay - bass&back vocal\r\nEbo - Drum', 1, 'small_5b93e318350b9c2c01110a79a031c02b.jpg', 0, 265, '2012-04-18 16:04:31', '0000-00-00 00:00:00', 1),
