(652, 6404, 'WAITING DEATH', '\\"WAITING DEATH\\" akan membombardir pendengaran Anda dengan kombinasi antara harmoni, melodi dan kebrutalan dalam setiap lagu, membawa hati Anda untuk tetap bergulir di pemutar musik Anda dengan non-stop headbanging.  \r\n  \r\nBand ini terbentuk pada akhir tahun 2011 tepat ny pada tanggal 13 Desember 2011, dimana ketika ingar-bingar â€œMETALâ€ masih ada,ke empat personil (BondThenk, MAN(cheekâ€™s), Adtz, & Dâ€™Coky) berkumpul untuk membuat sebuah band baru untuk memuaskan keinginan mereka. keempatnya berjuang bersama-sama untuk membangkitkan Langkah Maju. Untuk melengkapi personil, Firman (ex-pemain dari VICTORIA) diundang untuk bergabung. Tujuan pertama dari band ini adalah bermain musik untuk sesi jamming, Slayer, Hatebreed, BMTH, lamb of god,dll adalah musik yang kami pilih untuk bermain.  \r\n  \r\nDengan formasi ini kami menguatkan diri kami sebagai WaitingDeath (WD). Nama tersebut kami pilih secara kebetulan dan bagus menurut kami. Sejak awal tahun 2012 kami mulai menulis musik kami,setelah beberapa waktu penyesuaian diri terhadap personil,dan kami juga telah membentuk sirkuit manggung pada gigs,dan nama kami sudah mulai sibuk di mana-mana, dan juga dengan adanya property â€œTRASH BOXâ€ yang selalu kami bawa ketika kami memulai teror di setiap event kami,dan juga â€œTRASH BOXâ€ ini membawa gairah tersendiri pada aksi panggung kami. â€œWaitingDeathâ€sendiri dipengaruhi dari band luar negeri seperti: lamb of God, Dying Fetus, Slayer, Naplm Death, band metalcore lain ,dan beberapa band Indonesia lain nya..  \r\n  \r\nPada tahun yang sama(2012). Setelah berdiri di beberapa panggung gigs, sekarang â€ WaitingDeathâ€ berencana untuk menyebarluaskan teror nya lewat sebuah single lagu. Danâ€¦ kami bekerja sama dengan Hamsi Home Records (Indonesia, Palembang, South Sumatera), kami merilis single pertama kami.  \r\nSingle tersebut di release,dengan judul â€œEGOISASIâ€. Dengan mengambil lirik dengan sisi gelap, lagu tersebut mengatur untuk komposisi disiplin; konsep Death Metal dan Metal Core yang membombardir para pecinta musik metal downstroke kinerja parade di gitar dengan lead melodi akan menjadi sorot untuk single ini. Dan pasti dikombinasikan dengan hyperblasting-grinding drum menjarah dan juga menggeram dan scream growl pada vokal.  \r\n  \r\nSiapkan telinga Anda, luaskan pandangan Anda, lepaskan pikiran Anda. the all stars death metal squad will be change your judgment about metal !!!', 1, 'small_4c2a375cb9908a889a72cc623560e206.jpg', 0, 120, '2012-04-21 06:39:41', '0000-00-00 00:00:00', 1),
(653, 6442, 'Spekta Band', 'Spekta Band merupakan salah satu band yang beraliran Pop Rock. Nama Spekta sendiri diambil dari kata \\"spektakuler\\" yang artinya menarik perhatian. Spekta berharap dari nama tersebut bisa menarik perhatian para penikmat musik Indonesia. Pada tanggal 16 November 2008 merupakan hari kelahiran Spekta Band. Band ini awalnya terdiri dari Anto sebagai Keyboardis, Agri sebagai Vokal, Benny sebagai Bass, Deni sebagai Drum, dan Topan sebagai Gitar. Tapi seiring jalannya Spekta personilnya yaitu Topan, dan Benny keluar dari Spekta dan menyisakan Anto, Agri dan Deni. Dalam perjalanannya mereka mencari gitaris lagi. Dan akhirnya Daniel mantan personil Xeno  (merupakan mantan band Anto & Deni yang personilnya terdiri dari Anto, Danil, Stefan & Deni) ditarik untuk bergabung bersama Spekta bersamaan dengan Amy sebagai Bass.', 1, '', 0, 184, '2012-04-21 08:00:07', '0000-00-00 00:00:00', 1),
