(655, 6436, 'ALPHA MIRACLE', 'Alpha Miracle adalah sebuah group band asal Sukabumi â€“ Jawa barat, yang terbentuk pada tanggal 20 April 2008. dengan anggota: \r\n \r\nÎ¬  	Nopi Ihyadin â€œ Vie â€œ 		Pada Vocal \r\nÎ¬	Anjar Abdul Manan â€œ Azayâ€	Pada Guitar \r\nÎ¬ 	Aries Winandar â€œ Rielâ€™sâ€	Pada Bass \r\nÎ¬ 	Choerul Mahbub â€œ Chumb â€	Pada Drum \r\n \r\nKami terkumpul dan membentuk band ini merupakan sebuah keajaiban, sehingga kami memiliki semboyan : â€œDengan Keajaiban Kami Jadikan Karyaâ€œ. \r\n \r\n	Adapun aliran musik dari Alpha Miracle ialah Pop Rock karena disesuaikan dengan lirik-lirik lagu yang mendalam dari pengalaman pribadi yang dicurahkan melalui lagu agar lebih bermakna, ditambah lagi dengan alunan musik yang harmonis jadi bisa menyayat hati para pendengar lagu Alpha Miracle Band yang akan kami sebut â€žMiracleâ€œlistâ€ž serta agar mudah diterima dan dapat tempat tersendiri dihati  para pendengar khususnya pada Industri Musik Indonesia. \r\n \r\n	Saat ini kami masih merintis band ini, kami pun mengharapkan dukungan dari para apresiator musik terhadap karya-karya yang telah kami buat. dan bisa bergabung untuk meramaikan blantika musik indonesia.', 1, 'small_584d3b5556e8b33557f185ee19470b64.jpg', 0, 171, '2012-04-22 07:37:11', '0000-00-00 00:00:00', 1),
