(669, 2964, 'Rawa Bebek Berantakan', 'RAWABEBEKBERANTAKAN started out in 2007, with Frisky (Bass,Vocal), Momox(Lead Guitar), Arma (Rhythm Guitar,Vocal) and Satrio(Drums). After a couple of years of playing music, there were some changes of personnel, so Feby (LeadGuitar, Vocal) took over from Momox and Arma, and new addition, Amien joined on (Rhythm Guitar,Vocal) , 2010 frisky has out from band and ekal joined took over frisky to playing bass and backing vocal  \r\n  \r\nand now formation of rawabebek is feby ( lead gitar and vocal ) satrio ( drums ) ekal ( bass and backing vocal ) and amin ( rhytm guitar and backing vocal )  \r\n  \r\nThese changes of personnel were followed by name changes from RBCK25 , DUCKSWAMP , and finaly RAWABEBEKBERANTAKAN . The band was set up from a desire to express themselves and experiment with genre punk rock .. \r\n  \r\nBig Love & Hope,  \r\nRAWABEBEKBERANTAKAN', 1, 'small_926a517e41ee67a7d6776a8105228f35.jpg', 0, 120, '2012-04-25 17:22:54', '0000-00-00 00:00:00', 1),
