(672, 4259, 'CHIKAI', '     \r\n     \r\nChikai Band dari Yogyakarta, Indonesia.     \r\n     \r\nChikai terbentuk tanggal 26 februari 2012. Nama CHIKAI yang diambil dari bahasa Jepang yang artinya Keluarga (dekat). Filosofinya yaitu kami ingin menjadi suatu Band yang ber asaskan kekeluargaan, yang utuh dan saling melengkapi satu sama lain walaupun latar belakang kami yang berbeda-beda.     \r\n     \r\nBerbicara mengenai Aliran Musik Chikai yaitu kami membebaskan setiap orang untuk menilai apa warna musik kami, tetapi kami mengusungkan \\"Pop Rockestra\\", Perpaduan antara Musik Pop dan Musik Rock ditambah Perpaduan Orchestra.     \r\n     \r\nBerawal dari Tantra (bass) dan Wecax (drum) yang menginginkan membentuk suatu band yang tidak hanya sekedar \\"main-main\\" dengan kata lain ingin membentuk band dengan planing yang panjang dan tidak ingin menjadi band yang biasa saja dan berharap band ini bisa memberikan warna musik yang berbeda dari band-band lokal Indonesia lainnya, yang enak di nikmati dan menginspirasikan siapa saja. Warna musik baru yang Chikai bawakan adalah berbeda dari band-band lainnya, karena dengan pembawaan karakter kami masing-masing tetapi benang merahnya tetap pop dan rock, karena kami menginginkan agar setiap orang, setiap kalangan dan siapa saja bisa menikmati musik dan lagu kami.     \r\n     \r\nSetiap lirik yang di buat Di Chikai bisa menceritakan tentang apa saja, ada yang bercerita tentang Percintaan, tentang semangat hidup, tentang harapan, tentang kritik sosial, dan tentang apa saja yang pernah dialami si pencipta lagunya (setiap semua player di Chikai). Tapi kami ada pengecualian yaitu tidak membuat lirik yang putus asa,putus harapan, patah hati, dan lirik2 yang berbau negatif, karena bagi kami lirik merupakan do\\''a, ajakan positif, perasaan senang,perasaan kecewa mau menjadi lebih baik lagi dan lebih ingin agar lirik yang di buat adalah lirik yg optimis bukan lirik yang pesimis.     \r\n     \r\nChikai beranggotakan 4 orang personil, yaitu :     \r\n     \r\n     \r\nRachel (Vokal)     \r\n     \r\nAya (gitar)     \r\n     \r\nWecax (drum)     \r\n     \r\nTantra (bass)     \r\n     \r\n    \r\nDengan latar belakang yang berbeda-beda Chikai menyajikan nuansa musik yang berbeda tetapi tetap komit pada musik yang chikai buat yaitu Pop Rockestra.', 1, '', 0, 265, '2012-04-26 12:25:08', '0000-00-00 00:00:00', 1),
