(678, 6679, 'HAZELNUTS', 'Groove,Colourfull & Open Minded merupakan tiga kata yg menggambarkan band ini. Mengusung aliran Groovy Wave kami mencoba menawarkan warna baru di dunia musik. Penggabungan musik jazz ceria dengan efek\\" modern dan dikemas dalam penampilan yg menarik, membuat band ini berhasil menyabet berbagai penghargaan. Nama Hazelnuts sendiri diambil karena hazelnuts itu pada dasarnya merupakan salah satu jenis kacang yang berkualitas, yang biasa dibuat untuk campuran makanan maupun minuman yang disukai orang banyak. Layaknya kami yang ingin menciptakan musik yang berkualitas dan disukai orang banyak ..\r\n \r\n \r\n \r\n \r\nachievement : \r\n-3rd winner of Cocacola Soundburst National \r\n-1st winner IM:port regional sumatera utara \r\n-1st winner Shinzui Band Competition regional sumatera utara \r\n-1st winner Alpenliebe Band Search Regional Medan \r\n-1st winner Amild Sound Versity Regional Medan \r\n-2nd winner Free Your Soul Regional Medan \r\n-2nd winner best perform @ Miracle of Music With Ran \r\n-3rd winner road to java jazz 2010 regional medan \r\n-3rd winner road speedytrek 2010 regional medan \r\n-3rd winner Karya Cipta Lagu PAPPRI regional Sumatera Utara \r\n', 1, '', 0, 51, '2012-04-27 11:20:50', '0000-00-00 00:00:00', 1),
(679, 4945, 'Percia', 'Percia merupakan singkatan. Banyak orang bilang percia itu nama kucing. tapi menurut kami percia dalam artian yaitu PErcayalah Rasa Cinta Ini Abadi.. Percia terbentuk pada tanggal 19 maret 2010. Personil dari percia yaitu Yuzz sebagai (Vocalis), Kiki sebagai (Bassist), Ridho sebagai (Guitaris), Hady Sebagai (Drummer).\r\nCP : 085669970808', 1, 'small_a9b986f185a7a329a76f5ee128729bdf.jpg', 0, 120, '2012-04-27 15:27:48', '0000-00-00 00:00:00', 1),
