(705, 6598, 'NADSA', 'Awal Terbentuknya & Cerita Tentang â€œNADSAâ€\r\n\r\n      Nadsa adalah Band asal kota Lamongan, yang beraliran Pop & Rock, yang mengandalkan lagu-lagu yang romantis dan menyentuh hati .\r\n\r\n\r\n        Awal terbentuknya Band ini pada awal Juni 2007, Band ini terbentuk karena pertemanan yang erat di antara kita, karena semua personil Band ini adalah teman satu kelas saat duduk di kelas satu SMA,\r\nAkhirnya kami pun membentuk band ini karena kami mempunyai cita-cita yang sama yaitu menjadi band yang sukses.\r\n\r\n\r\n	Kami bermain musik tanpa adanya paksaan dari siapapun dan dimanapun, kami bermain musik murni dari hatikami sendiri, karena bagi  kami musik adalah teman hidup, tanpa musik hidup kami seakan kurang berwarna.Kami memberi  nama â€œNADSAâ€ untuk band kami karena terinspirasi oleh Agensi Pemerintahan  Amerika Serikat yang Bertanggung Jawab Atas Program Angkasa AS yaitu NASA, karena kami ingin band kami terbang ke angkasa seperti para awak NASA, kemudian kami menambahkan huruf â€œDâ€ \r\ndi tengah kata NASA agar tidak di kira terlalu menjiplak nama untuk band kami, dan jadilah nama â€œNADSAâ€.\r\n\r\n\r\n\r\n\r\n          Kami bukanlah tipe Band yang Beraliran Rock yang brutal, berlirik kasar, ataupun menyuguhkan aksi panggung yang anarkis atau memberontak.\r\n\r\nKami adalah Band yang menyampaikan isi hati dengan musik  dan lirik yang menyentuh perasaan, seperti lagu â€œ Swjak Ibu Berpisah ,Saat Ku Rindu, Malam Milik Kita, Janji Tak Berujung â€ ataupun â€œ Cinta Selamanyaâ€ yang ada dalam salah satu lagu kami.\r\n', 1, 'small_d935e3c4fb543d41a82d93199bf1c20a.jpg', 0, 232, '2012-04-30 16:12:12', '0000-00-00 00:00:00', 1),
