(719, 4420, 'FUNKY MONKEY', 'Funky Monkey was born 28 June 2008, members of the Aziz (MC, Vocal), Andy (Guitar), Ragil (Guitar), Arya (Bass), Coco (drum).  \r\nThe name itself is taken from Funky (stretcher our music and we agree to be a common thread), and Monkey (attractive or energetic), because we\\''re trying to create a work which can give the spirit of every person who hears our songs, and what we make that\\''s what we feel, and sound that is created from pure all our soul, from us to you and for all these songs are created.\r\n\r\nplease check another profile of us: \r\nhttp://www.facebook.com/pages/FUNKY-MONKEY/120113838013151\r\nhttp://www.reverbnation.com/funkymonkeyanthem\r\n', 1, '', 0, 265, '2012-05-02 04:32:31', '0000-00-00 00:00:00', 1),
(720, 4906, 'FIX', 'â€œFIXâ€ berdiri pada tanggal 14 agutus 2008 dan beranggotakan, Alvin (Bass), Jondry (Guitar), Ary (Vocal), Erik (Drum) dengan nama HICMBH (Hari Ini Cuci Motor Besok Hujan) dan memulai perjalanan mereka sebagai band Festival dikotanya. Dengan banyaknya prestasi festival band yang didapat, akhirnya HICMBH memutuskan untuk mengakhiri masanya sebagai band festival dan memulai komitmen sebagai band Cafe bernama All-Size. Namun, karena menyadari kurangnya pertanggung jawaban dalam konsep sebagai band Cafe, All-Size mundur dari komitmen sebagai band Cafe dan akhirnya kembali berkomitmen sebagai band indie dan mulai mengasah karyanya sendiri dengan nama Desize, seiring waktu berjalan, pada akhirnya personil Desize, Erik (Drum) memutuskan untuk mengakhiri komitmennya bersama Desize, dengan banyaknya komitmen dari Desize yang gagal, Tiga dari anggota terakhir Desize memulai komitmen baru dengan merombak segala konsep band, di tambah masuknya Anjas sebagai pengganti Erik hingga datangnya nama â€œFIXâ€ sebagai langkah baru.\r\nDan kemudian Ary di gantikan oleh Reza sebagai vokalis baru.\r\n\r\n\\"FIX\\"\r\n\r\nBerasal dari kata â€œFixâ€ yang artinya perbaikan atau kesepakatan.\r\nNama dari â€œFIXâ€ sebagai simbol untuk menekan betapa pentingnya mempertahankan sebuah â€œkomitmenâ€ yang akan dijalani.\r\n\r\n(Fix your self, before we fix all of us)', 1, '', 0, 358, '2012-05-02 10:39:09', '0000-00-00 00:00:00', 1),
(721, 6677, 'AIRHAD (New Story)', 'Our music is about life, hopes and dreams and make music until we could no longer breath blows ....    \r\nAIRHAD hadir di blantika Musik Indonesia dengan FORMAT :   \r\nDio as Vocal + Rhythm   \r\nAde as Lead Guitar   \r\nSeta (Athez) as Bassist   \r\nEzar Arvi as Drummer   \r\nSemoga dengan Hadirnya AIRHAD bisa menambah warna di dunia musik Indonesia.    \r\nDengan membawa Visi menjadi Band yang berkualitas , AIRHAD akan terus meningkatkan Musicalitas dan Kualitas lagu dalam menciptakan karya-karyanya. ', 1, 'small_94e9d52f1c64cf4e9a2c08ca767087fc.jpg', 0, 207, '2012-05-02 12:18:32', '0000-00-00 00:00:00', 1),
