(723, 6831, 'Pagi Mentari', 'Pagi Mentari adalah Yayan (Vokal), Lalan (Vokal), Uphei (Bass), Kumala Adi (Gitar), Moch. Rasyanda(Gitar), dan Isma Riadi (Drum) mengusung sound yang terdengar lebih akustik dan yang pasti lebih catchy tetapi berenergi. Sebagai benang merah dari minat masing-masing poersonil, mereka banyak terpengaruh musik era 90-an seperti band-band Rilisan Creation Record maupun Sarah Record. \r\n300 Miles adalah salah satu single terbaru mereka yang akan dirlis dalam format EP bersama track lain seperti Hari Esok, Brown Shoes, Hello Tomorrow.', 1, '', 0, 174, '2012-05-02 17:52:06', '0000-00-00 00:00:00', 1),
