(730, 6987, 'TAMAN26', 'TAMAN26 berdiri pada tanggal 12 februari 2010 di kota Palembang, formasi awal personil TAMAN26 yaitu terdiri dari java (vocal), vsex (gitar), tedy (gitar), dhio (drum), dan tommy (bass). secara filosofi makna dari nama \\"TAMAN26\\" sendiri diambil karena memiliki nilai historis, karena pada mula pembentukan masing personil TAMAN26 untuk mengikrarkan pembentukan band ini beridiri di suatu tongkrongan anak-anak TAMAN26 sering berbagi dan berdiskusi yaitu pada sebuah taman kota di kawasan 26 ilir Palembang. \r\nSeiring dalam menjalani proses musikalisasi, TAMAN26 sendiri mengalami reposisi personil diantaranya kini pada posisi gitar digawangi oleh vsex dan pada posisi bass digawangi oleh andika. \r\n \r\nTAMAN26 sendiri hingga kini memiliki sejumlah karya andalan diantaranya : Terus Mencari, Tak Tersisa, Wujud Rasa, Kuyakin, Percayalah, Dia Itu Milikku, Dengarkanlah, Tak Ingin Di Dua, Lupakan, Galau. \r\nDari beberapa single diatas TAMAN26 memiliki sejumlah lagu hits yaitu Terus Mencari, Tak Tersisa, Wujud Rasa, dan Kuyakin... \r\n \r\nDalam partisipasinya TAMAN26 sendiri mengusung genre musik \\"taman pop alternatif\\" genre tersebut kami usung dan kami nilai sebagai genre yang mewakili setiap individu dan karya musik yang kami lahirkan, mencoba untuk jujur/orisinil dalam berkarya dengan tidak mengurangi rasa bahwa TAMAN26 sendiri diantara beberapanya dipengaruhi oleh beberapa band yang ada, namun dalam artian secara luas TAMAN26 tidak ingin membatasi influence musik yang ada untuk dijadikan inspirasi dalam berkarya. \r\n \r\nsemoga hadirnya TAMAN26 dalam industri musik regional pada khususnya dalam dalam industri musik nasional pada umumnya dapat memberika pencerahan dan penyegaran dalam kancah musik yang sangat berkompetensi. \\"selalu berkarya\\" adalah kalimat khas TAMAN26 yang selalu menjadi motivasi untuk terus memberikan karya yang lebih baik dan dapat diterima oleh masyarakat luas... \r\n \r\n\\"SELALU BERKARYA.!!!\\"  \r\n \r\n ', 1, 'small_4577bf5b4d2a9cbc2d1f9da41d0a30e0.jpg', 0, 120, '2012-05-06 03:33:43', '0000-00-00 00:00:00', 1),
(731, 6996, 'Suddenly Offline', 'Suddenly Offline dibentuk pada awal Maret 2009 yang terdiri dari:\r\n\r\nâ€¢ Said sebagai (Vox).\r\nâ€¢ Reza sebagai (troath)\r\nâ€¢ Genta sebagai (gitar)\r\nâ€¢ Yossi  sebagai (gitar).\r\nâ€¢ Noel sebagai (bass).\r\nâ€¢ Fahrul sebagai (drum)\r\n\r\nContact Person: 0857 6609 2302 (Rizanoel)\r\nMyspace: www.myspace.com / suddenlyo\r\ntwitter: www.twitter.com / suddenlyoffline\r\nfacebook: www.facebook / suddenly offline\r\nyahoo: www.suddenlyoffline @ ymail.com\r\n\r\nPada awalnya kami biasa memainkan lagu bergenre â€œmetalcoreâ€ seperti as I lay dying,walls of jericho,dan itu pun tidak berlangsung lama pada kami..akhirnya setelah kami merencanakan beberapa konsep kami sepakat mengganti aliran dengan deathcore.\r\n(death metal/prog/hardcore ) .Suddenly Offline terinfluence oleh BLEED FROM WITHIN,AS BLOOD RUNS BLACK,CARNIFEX dan ROSE FUNERAL\r\nNamun, setelah beberapa kali pergantian personil, kami menambahkan beberapa materi pada lagu kami dan menuangkan melodi-melodi deahtmetal seperti The Black Dahlia Murder.In flames,At The Throne Of Judgement,Arsis(melodic death metal concept),Bleed From Within. Dan sepakat untuk mengusung genre \\"Melodic Deathmetal\\"\r\n', 1, '', 0, 51, '2012-05-06 14:29:16', '0000-00-00 00:00:00', 1),
