(735, 6761, 'ElizabethRhyme', 'ElizabethRhyme pada awal berdirinya bernama B.I.R (Sapaan akrab Bring Into Reality) yang merupakan sebuah band dengan aliran Alternative Screamo yang berasal dari malang, Indonesia. Band yang berdiri sejak tahun 2010 ini di gawangi oleh Andry (Rhythm and Vocal), Caesar (Lead Guitar), Febri (Bass), dan Denies (Drum). Pada tanggal 4 Juli 2012, B.I.R mulai memberikan warna baru dengan hadirnya Prima yang mengisi posisi Vocal dengan menggantikan Andrey yang lebih fokus pada Guitar. \r\nPada tanggal 9 Oktober 2012 Febri resmi keluar dari B.I.R karena beberapa masalah pribadi, sehingga sesuai kesepakatan besama akhirnya B.I.R resmi dibubarkan dan berganti nama menjadi \\"ElizabethRhyme\\". Setelah berganti nama, semua materi dan lagu yang di sajikan mulai berubah dari yang pada awalnya beraliran Screamo (Progresif punk dengan lyric tentang cinta dengan penuh emosional) berubah menjadi Hardcore Punk. ', 1, 'small_377fc620a7ed5c5412bac02958bf2554.jpg', 0, 207, '2012-05-07 16:49:22', '0000-00-00 00:00:00', 1),
(736, 7034, 'FSTVLST', 'formerly know as Jenny, based in Yogyakarta, released debut album Manifesto (2009), single Hujan Mata Pisau (2010) and Hari Terakhir Peradaban.Prolog (2011). now we heading for our next album. ALMOST ROCK BARELY ART. shits about us, go to www.fstvlst-yk.blogspot.com', 1, 'small_434f7ffedb8a70f1a1c05b14ce3c497c.jpg', 0, 265, '2012-05-08 05:09:28', '0000-00-00 00:00:00', 1),
(737, 6792, 'IONIC', 'MENARIK ATOM', 1, '', 0, 260, '2012-05-08 09:30:49', '0000-00-00 00:00:00', 1),
(738, 6876, 'Divand', 'Divand terbentuk pada bulan Maret 2012 di Yogyakarta. Berawal dari sebuah pertemanan sekelompok remaja yang sering berkumpul bersama di sudut-sudut kota jogja untuk sekedar melepas penat di sela-sela kesibukan sebagai mahasiswa. Meski Divand sendiri masih terbilang baru di tengah maraknya band-band indie di Yogjakarta, namun sebenarnya keinginan hati kami untuk bermusik sudah sangat lama. Namun kami baru bisa memantapkan hati untuk membentuk sebuah band yang solid setelah hampir 2 tahun menjalin persahabatan. Institut Seni Indonesia Yogyakarta adalah tempat yang mempersatukan kami berlima. Berbekal dari apa yang kami dapatkan dari dalam kampus maupun dari luar kampus, kami ingin menuangkan ide-ide kami dan menyampaikan isi hati kami lewat musik yang kami suguhkan. Kami memilih musik pop sebagai genre band kami. Meski masing-masing personil berasal dari latar belakang musik yang berbeda, namun musik pop menjadi pilihan yang menurut kami paling tepat untuk menuangkan ide-ide dan isi hati kami. Meski idealis tapi kami tetap realistis.  \r\n.  \r\nNama Divand sendiri tidak memiliki arti yang spesifik. Kami tertarik pada seorang penulis besar William Shakespear yang pernah berkata, â€œApalah arti sebuah namaâ€. Tetapi bukan berarti kami menganggap arti dari sebuah nama itu tidak penting. Kami memilih nama Divand karena nama ini sama sekali belum memiliki arti sebelumnya. Dengan demikian, nama ini akan memiliki arti yang jujur dan sejati yaitu kami dan musik kami.\r\nemail : divandband@gmail.com', 1, '', 0, 265, '2012-05-09 06:56:09', '0000-00-00 00:00:00', 1),
(739, 618, 'EFODY', 'Efody adalah band asal Jakarta yang mengusung musik pop dengan sedikit sentuhan blues dan rock, menonjolkan vocal yang unik di bungkus dengan aransemen musik yang \\"easy listening\\". Berdiri sejak tahun 2006 dengan jumlah 4 personil, dan telah mengikuti berbagai festival musik dan acara musik lokal. telah melahirkan 1 album \\"indie\\", dan masih terus berkarya untuk mewarnai musik tanah air lewat lagu-lagu nya yang easy listening. ', 1, '', 0, 187, '2012-05-10 17:25:35', '0000-00-00 00:00:00', 1),
(740, 7066, 'eyeliner', 'eyeliner adalah eyeliner. Suara musik yang tergabung dalam Eyeliner berasal dari masing-masing personil. Pengaruh genre individu tiap personil seperti, brit pop, brit rock, rock alternatif, grunge, nu metal, garasi, industri, synthpop, eksperimental, gothic, dan banyak lagi, menjadi pengaruh global dan dicampur ke dalam sesuatu yang baru.', 1, 'small_bea0c409e664cd4b8fdac687a13f67dd.jpg', 0, 177, '2012-05-11 03:07:37', '0000-00-00 00:00:00', 1),
