(743, 4570, 'THE POP ', 'THE POP terbentuk pada tanggal 9 Januari 2012 mempunyai karakteristik dalam bermusik aliran pop alternative. Terbentuknya THE POP bukan hanya sekedar hobby melainkan sebuah komitmen yang dijunjung tinggi oleh setiap personilnya \r\n \r\nTHE POP adalah sebuah nama yang diambil dari kata â€œPOPULERâ€. Kami mengambil nama THE POP dengan harapan semua karya yang kami ciptakan dapat populer di masyarakat. \r\n \r\nThe pop are : \r\n \r\ndino _ vocal \r\njordy _gitar \r\nbayu _bass \r\nsilva _drum', 1, '', 0, 193, '2012-05-11 16:30:57', '0000-00-00 00:00:00', 1),
