(745, 6263, 'AKASIA', 'BUKAN BINTANG TAPI AKAN MENJADI BINTANG          \r\n          \r\nCheck Here : http://www.reverbnation.com/sobatakasia    \r\nIni Bro Asal - usul Nama AKASIA :D   \r\nNama AKASIA diambil dari sebuah nama pohon AKASIA :D   \r\nKarna pohon ini banyak dan mudah ditemukan dimana saja :)   \r\ndan akar dan pohonnya yang kuat , kita semua berharap bisa menjadi band profesional yang berada dimana - mana dan kompak slalu bro and sist :)   \r\n   \r\nPersonilnya nih bro and sist :)   \r\n   \r\nYanuar Anaba Wahyuesa 	Drumer   \r\nRegi Agen 	                        Gitaris   \r\nRyan Apriyadi 	                Basiss   \r\nNovianto Alfian Wijanarko 	Vokalis   \r\n   \r\n   \r\nMereka udah punya nama Fans\\''a :) , Kita Sering Menyebutnya dengan BRADIST AKASIA .   \r\nBRADIST itu berasal dari kata Brother and Sister AKASIA nama band kita .   \r\nSo Semangatnya Para BRADIST :)   \r\nSalam Spirit !   \r\n   \r\n    \r\nCP : 087837478227 ( Yanu )', 1, '', 0, 195, '2012-05-13 10:29:52', '0000-00-00 00:00:00', 1),
(746, 5193, 'Oktav', 'Oktav dibentuk pada tahun 2009 di kota Malang Jawa Timur, beranggotakan 5 orang , Rudi (Vocalist), Angga (Guitarist), Glam (Bassist), Pilas (Keyboardist), dan Andre (Drummer). Band ini dibentuk pada Oktober 2009, dan masih Eksis hingga saat ini, bertujuan untuk go-Nasional', 1, 'small_34b96ea8f193095514b58c43413ce4f1.jpg', 0, 207, '2012-05-14 17:36:57', '0000-00-00 00:00:00', 1),
(747, 7160, 'Dnouza', 'Dnouza adalah band britpop asal sukabumi yang mempunyai sentuhan yang khas di setiap lagu - lagunya.  \r\ndengan 5 personilnya  SHORIN(voc), ANKY(guitar), DZ(guitar), ANDI(bass), EQY(drum), mereka menyajikan musik yang easy listening, enerjik, kharismatik, dengan gaya romantis yang catchy. ', 1, '', 0, 171, '2012-05-15 05:54:23', '0000-00-00 00:00:00', 1),
(748, 912, 'LEVEL-2', '\\"bagaikan ksatria kecil yang membawa pedang besar ke medan perang\\" itulah level-2, kami hanyalah beberapa orang yang membentuk band dan masih sangat banyak belajar namun kami membawa amunisi tentang dunia seni dan musik serta semangat yang besar untuk memasuki dan berada di dunia musik nasional..', 1, '', 0, 339, '2012-05-15 10:27:08', '0000-00-00 00:00:00', 1),
(750, 7194, 'Fery Andriansyah', 'Fery Andriansyah yang biasa di panggil fery atau Venom (lahir di Tanjung raja (palembang) 16 mei 1993 umur : 19 tahun) adalah seorang musisi baru yang mulai mengembangkan sayapnya di bumi sriwijaya. fery baru mengeluarkan beberapa single.   \r\n   \r\nKarir   \r\n   \r\nDebutnya bermusiknya sudah di mulai sejak fery berumur 14 tahun. berawal sebagai seorang drumer fery mulai mengasah ilmu bermusiknya. fery pernah memilikki band yang pernah mengeluarkan beberapa single juga tapi karir bandnya tak mulus dan akhirnya bubar.dan setelah dia kelas 2 sma fery merasakan ilmunya kurang dalam bermusik bila hanya bisa memainkan drum fery pun mencoba bernyanyi. sejak sma diapun membentuk band sma sebagai vocalis hingga sekarang.    \r\nFery Andriansyah tidak hanya menyanyi tapi dia juga menciptakan lagunya sendiri. Setelah lulus Sma Fery mulai untuk membuat hal-hal baru di hidupnya dengan membuat projeck solo untuk dirinya sendiri tapi masih format band. dan mengeluarkan singlenya di awal tahun 2012 lalu.   \r\n   \r\nKeluarga   \r\n   \r\nFery Andriansyah adalah anak dari Bpk. El sany dan ibu. Latifah fery adalah anak pertama dan terakhir dari pasangan itu atau biasa di sebut anak tunggal    \r\n   \r\nPendidikan    \r\n   \r\nSaat ini Fery andriansyah kuliah di sekolah tinggi kesehatan di palembang mengambil jurusan perawat  \r\n  \r\nCP :: 085788666466 Email :: Prof.venom@gmail.com', 1, 'small_5ad627ed22fcdfd9a48ea52bc18628da.jpg', 0, 120, '2012-05-16 10:47:43', '0000-00-00 00:00:00', 1),
(751, 7208, 'JESTER', 'tidak mudah membentuk jester .. . ', 1, '', 0, 190, '2012-05-18 01:45:39', '0000-00-00 00:00:00', 1),
(753, 7006, 'BLANK CHORD', 'Blank Chord berdiri pada tahun 2010 dengan 5 orang anggota group yang mengusung genre Pop Alternative. Blank Chord cukup berhasil mencuri perhatian, dengan single lagu pertamanya : â€˜SPIRITâ€™. Kemampuan Blank Chord yang digawangi oleh Taufan (vocal), Farhan (bass), Adam (guitar), Musa (Keyboard) dan Obby (drum) semakin terasah tajam, aransemen musik mereka juga semakin variatif.\r\n\r\nSemua pengalaman yang tak ternilai harganya ini akan sangat membantu Blank Chord untuk terus memperbaiki diri dan membuat karya yang patut dibanggakan bangsa Indonesia. Semoga Blank Chord dapat memberikan semangat dan merangsang generasi berikutnya untuk meningkatkan kesadaran dalam melestarian budaya dan musik Indonesia, yang merupakan bagian penting dari kekayaan negara ini.', 1, '', 0, 184, '2012-05-18 16:25:13', '0000-00-00 00:00:00', 1),
(754, 4317, 'One Good Afternoon', 'One Good Afternoon lahir pada pertengahan bulan November tahun 2011 dan diresmikan pada 10 Januari 2012. Awal ide terbentuknya One Good Afternoon dari pemikiran Sunu dan Dito yang memiliki kesamaan visi dan misi dalam bermusik.\r\nDari sinilah, mereka mulai mencari personil guna melengkapi kemampuannya dalam bermusik. Sunu kemudian mempunyai ide dengan mengajak Athonk teman lama dan patner nge-jamnya dulu. Dito juga sebaliknya dengan mengajak gabung Wawan yang dulu pernah satu band dengannya.\r\nAkhirnya One Good Afternoon menjadi lengkap dengan :\r\n* Sunu : Vocal, Guitar\r\n* Athonk : Guitar\r\n* Wawan : Bass\r\n* Dito : Drum\r\nArti nama One Good Afternoon simpel banget, ketika kita bisa tidur siang hari dan sore hari terbangun maka semua pikiran kita akan menjadi fresh, demikian juga dalam hal bermusik, kita harus memainkan musik dengan fresh dan tenang supaya harmonisasi musik yang di ciptakan menjadi lebih indah.\r\nGenre musik One Good Afternoon sendiri adalah Alternative Pop dengan diberi sentuhan british.', 1, '', 0, 260, '2012-05-19 13:13:42', '0000-00-00 00:00:00', 1),
(755, 7339, 'GEMINI', 'band ini sendiri berdiri 30 september 2011. dengan visi misi, cita-cita dan niat yang sama dipililah nama \\"GEMINI\\" sebagai pelabuhan teakhir untuk menuju semua impian. nama \\"GEMINI\\" sendiri di ambil dari bahasa \\"TURKI\\" yang artinya \\"KAPAL BESAR NAN INDAH....\\" dengan kata lain, kami ingin GEMNI tersebut bisa menjadi kendaraan yang mengantarkan kita menuju pelabuhan terakhir tadi, dimana didalam pelabuhan itu telah menunggu semua impian kami... dan impian tersebut akan kami persembahkan untuk semua orang yang tiap detik, menit, jam, hari, hingga tahun tak pernah berhenti untuk mengucap DOA untuk kesuksesan kami sendiri..... pendewasaan dalam melantunkan sebuah butiran nada sangat dituntut disini....', 1, '', 0, 265, '2012-05-21 21:48:52', '0000-00-00 00:00:00', 1),
(756, 7352, 'VINFAG', 'Vinfag is a Bandung-based Indie Rock band, formed in Jakarta in January 2007. The band consists of Suryo Rudito (guitar / vocals), Ervan Frasteantha (guitar), Irza Aryadiaz (drums), and Dimas Putra (bass guitar). While actually the whole band arose from the suburbs of East Jakarta, they all moved to Bandung in mid-2010 for college.\r\n\r\nSince formed, the band have written a handful of songs to date, with notable sound differences in some songs due to the ever-changing influences from the bandâ€™s high school years, up to the present college days. Despite that, the different sounds can still be concluded in one wide-ass term, indie rock. The major influence for the bandâ€™s sound has always mostly been post-punk revival and indie rock acts from UK and USA, in addition of math rock bands for their later songs.', 1, '', 0, 174, '2012-05-22 12:21:55', '0000-00-00 00:00:00', 1),
(757, 7386, 'Peri-13', 'Peri-13 Are : \r\nBembenk (Vocal) \r\nTengku (Bass) \r\nDedi (Drum) \r\nRobi (Add. Player Guitar) \r\nBayu (Add. Player Syntaizer & Keyboard) \r\n \r\nKami hadir dari jalanan, bersatu dalam persahabatan dan berkarya dalam ketiadaan. Mungkin beberapa dari anda akan mencerca bahkan mungkin menghina keberadaan kami. Tapi dengan bangga kami akan berkata, \\"Itulah adanya kami...\\". Dan semua itu tergambar dari setiap bait dalam lagu kami. Dalam kekecewaan, karena kami tidak pernah bisa \\"Seperti yang anda pinta\\", maka terimalah kami apa adanya. \r\n \r\nBukannya pasrah, tapi cercaan itu pasti akan kami jadikan bekal untuk terus menempa diri menjadi lebih baik dari hari ini. Semua kritikan terhadap kami akan kami jadikan sebagai pelajaran yang berharga untuk tetap berkarya dalam ketidak berdayaan. \r\n \r\nKita semua pasti percaya dengan Tuhan, dan kami yakin biarpun lambat sukses itu Insya Allah akan kami raih. Semua orang menunggu waktu, dan tentu saja kami juga. Marilah sambil menunggu, kita eksplorasi kemampuan yang ada. \r\n \r\nPERI 13 merupakan band yang berasal dari Pekanbaru-Riau. Sebuah band yg solid, dgn menampilkan karya yg memiliki warna musik yg berbeda. Berdiri pada tanggal 25 Desember 1999 dengan nama PERI 13 Band. Banyak yang belum tau, PERI-13 itu apa artinya? PERI-13 bukanlah sama dengan peri dalam arti harfiah yang berarti malaikat. Tetapi PERI-13 artinya: PE = PEKANBARU, RI = RIAU. Sedangkan angka 13 adalah angka yang punya kenangan tersendiri bagi semua personil. Dimana orang lain menganggap 13 adalah angka sial, namun kami ingin membuktikan bahwa angka 13 itu tidaklah selalu sial. (apa iya ya?). \r\n \r\nAwalnya manggung di Millenium Cafe dan Club 168. Kemudian terpilih sebagai 10 group terbaik di Pekanbaru. Sempat vakum dan gonta ganti personil pada tahun 2001. Dan hidup lagi di tahun 2002. \r\n \r\nPengalaman Manggung: \r\nâ€¢Juara 1 Festival Merah-Putih di Black Area Entertaint Pekanbaru pada tahun 2003 \r\nâ€¢Juara 2 Festival Akress 1 di SMAN 11 Pekanbaru pada tahun 2004 \r\nâ€¢Menjadi Dewan Juri pada Festival To da Beat Entertaint di SMAN 1 Pekanbaru pada tahun 2004 \r\nâ€¢Guest Star Di Perpisahan SMAN 6 Pekanbaru pada tahun 2004 \r\nâ€¢Guest Star Di Festival di Darma Wanita Pekanbaru oleh SMAN 7 Pekanbaru pada tahun 2005 \r\nâ€¢Guest Star Di Festival SMAN 10 Pekanbaru pada tahun 2004 \r\nâ€¢Guest Star Di Festival Akress II di SMAN 11 Pekanbaru pada tahun 2005 \r\nâ€¢Guest Star di Festival di SMK Masmur Pekanbaru pada tahun 2005 \r\nâ€¢Guest Star + Dewan Juri di Festival di SMK Hasanah Pekanbaru pada tahun 2005 \r\nâ€¢Guest Star di Perpisahan SMPN 4 Pekanbaru pada tahun 2005 \r\nâ€¢Guest Star di Acara Animasi Music Festival UNRI Panam Pekanbaru Jurusan Administrasi Niaga pada tahun 2005 \r\nâ€¢Live in Konser di Wisata Panorama, Lobang Jepang Bukit Tinggi Sumatera Barat, Sponsor dari Dinas Pariwisata Bukit Tinggi 6 November 2005. Disambut Antusias>> Memory paling berkesan \r\nâ€¢Guest Star di Pujasera 88 `Gong Xi Fa Chai` 27 Januari 2006 \r\nâ€¢Guest Star Soundrenallin 26 Desember 2006 \r\nâ€¢Guest Star Opening Yamaha 7 Desember 2008 \r\nâ€¢Guest Star di RIAU EXPO 2008 \r\nâ€¢Guest Star Opening olet Blue 2008 \r\nâ€¢Guest Star Opening Bank Simpedes \r\nâ€¢Finalis Region Sumatera Tengah Amild Live Wanted 2009 \r\nâ€¢Guest Star di BRI Selat Panjang 2009 \r\n \r\nSemoga PERI 13 BAND mendapatkan kesempatan untuk bisa merecord lagu-lagu yang sudah mereka buat menjadi sebuah album yang dapat dikenang oleh para Peri13. Dan juga bisa diterima di kalangan pendengar khususnya pecinta musik band lokal. \r\n \r\n', 1, '', 0, 1, '2012-05-23 17:37:00', '0000-00-00 00:00:00', 1),
(758, 7385, 'AMEL BAND', 'AMEL adalah sebuah band yang di bentuk oleh sekumpulan mahasiswa jogjakarta yang memiliki tujuan dan impian yang sama dalam bermusic,amel terlahir pada 15 januari 2011, amel sudah mempersiapkan mental untuk masuk dalam industri music indonesia dan meramaikan belantika music indonesia sebagai bukti Amel mempersembahkan karya-karya terbaiknya untuk seluruh pendengar music,nama AMEL di ambil dari singkatan \\"Anak Music Easy Listening\\" sesuai dengan arti dari Amel music kami lebih condong ke easy listening dan memiliki gendre Pop alternativ, Amel di gawangi Tata(vokal),latief(keyboard),dilla(guitar), Adit(drums), yanuar(bass).  \r\nCP : band.camel@yahoo.com  \r\n085643489150', 1, '', 0, 265, '2012-05-24 10:02:56', '0000-00-00 00:00:00', 1),
(759, 7135, 'Astroboy_Band', 'Astroboy Band,band yang di gawangi oleh : \r\n \r\nVocal : Gie  \r\nBass : Endha  \r\nGitaris 1 :Ney  \r\nGitaris 2 : Dave  \r\ndrummer: Gut\\''z \r\n \r\nmenyusung aliran musik easy listening ( pop alternatif ),terbentuk pada tahun 2003,hingga sekarang,di single pertama nya Astroboy Band yang berjudul \\" Kau tinggalkan rasa \\" mencoba ikut meramaikan belantika musik di Indonesia. \r\n \r\nThank\\''s buat Tuhan yang maha esa,ortu kita,manager kita,tmn,AD recording Studio,kk Jimmie,kk ronald,kk indra,kk asok,kk ando,Mr. Big A,kk Argha, Andy Arcybi,Miss Meygha n zee,Matrix studio,99 studio,kk pay, Sma Dharma Bhakti Palembang, n all', 1, '', 0, 120, '2012-05-24 15:13:39', '0000-00-00 00:00:00', 1),
