(761, 2702, 'A.F.F.E.N', 'Affen (Anatomy For Fabulous Emergency Noise) is an experimental project thatâ€™s originated from Bandung, West Java, Indonesia. They are Hariz (Acoustic Guitar, Lead Vocal), Babam (Guitar, Vocal), Elmo (Guitar, Vocal), Ifsan (Bass), Hari (Drums) Ebong (Cello) . This project stems from a desire to exploit its full potential in from the musicality potential of each personnel. Started from a regular meeting of Hariz, Babam and Elmo during events at Beat n Bite Cafe, this project was then formed. After finalizing the concept, they invited Ifsan to fill the bass position and later Hari, on drums and on the mean time Ebong the Cellist from Band Called Nadafiksi interested to join with Affen , because of his own passion for post-rock music.', 1, '', 0, 174, '2012-05-25 13:47:28', '0000-00-00 00:00:00', 1),
(762, 7358, 'PILOTZ ', 'Setelah vakum beberapa tahun dari belantika music Indonesia, Pilot band yang dulu dikenal dengan hits Sepanjang  hidupku dan inikah namanya cinta, kini mencoba untuk kembali mengukir prestasi di ranah music tanah air dengan PILOTZ.  \r\nDigawangi Erzie (vocal), Tara (guitar), Athur (Bass), Chandra (drum) kembali mewarnai music Indonesia dengan single terbaru mereka â€œPasti Kembaliâ€ , dengan harapan semua kesuksesan di masa sebelumnya akan terulang kembali dan mampu mencetak prestasi yang lebih baik serta memberi keyakinan kapada seluruh penggemar pilot terdahulu bahwa Pilotz pasti kembali. \r\nBand yang bergenre Alternative rock ini mengaku optimis dengan genre yang mereka usung tampa harus menjadi  follower  dari trend music yang ada, dengan keyakinan itu pilotz berharap trend music Indonesia bisa menjadi lebih baik. \r\nPilotz band mengaku music mereka banyak di pengaruhi band alternative luar negeri seperti U2, Radiohead, Coldplay, foo fighter, alter bridge, namun tetap dengan ramuan ala pilotz dengan ke khasan warna vocal dan berharap semua nya dapat menginfluence pendengar music Indonesia. \r\n', 1, 'small_5366cb863257b62f309f348e0eeb09d1.jpg', 0, 184, '2012-05-27 16:05:44', '0000-00-00 00:00:00', 1),
(763, 5465, 'Ice Cream', 'Profil Ice_cre@m^^  \r\n  \r\nice cream Band dari desa kecil bernama PRokimal..di kota Lampung utara  \r\nnama ice cream di ambil agar band ice cream ini sendiri dapat menjadi band yg disukai banyak orang pa pun RAS nya n berapapun umurnya,,dan dapat mencair kan suasana yang lagi Bad mud,,,sebagai mana ice cream yg biasanya kita nikmatin,, ^^  \r\nmanis,,asyik,,unik,,n ga ngebosenin...  \r\nrasa2 yg campur aduk dalam sebuah band yang bernama Ice cream ini..  \r\nice cream beranggotakan 5 personil yaitu, mayang(voc), Rangga (guitar), Fidry (lead), Dwi (bass), Fajar (drum)..  \r\nGenre yang ice cream ambil adalah japanese Pop Rock..kami memperpadukan nuansa jepang dengan beat pop rock..lagu kami bisa di dengar di reverbnation.com/icecream1  \r\nIce cream juga menempati posisi 1 dalam chart Pop di Lampung..  \r\n  \r\nLagu yang telah kami sajikan dalam bentuk track telah ada 6 lagu..dengan format Sebagai Berikut:  \r\n  \r\nIce Cream â€“ Jangan,   \r\nIce Cream â€“ Putri Tidur  \r\nIce Cream â€“ Cerita Yang Kusuka  \r\nIce Cream â€“ Masih  \r\nIce Cream â€“ Cinta Yang Sesungguhnya  \r\nIce Cream â€“ Waktu Takkan Kembali  \r\n  \r\nsebenarnya ice cream punya banyak lagu, tapi karna faktor x (biaya) yang membuat kami lom mampu untuk merekam semua lagu yang kami punya..:)  \r\n  \r\nBanyak cerita yang ice cream lewati baik antar personil atau pun para fans yang sangat mendukung ice cream dimana pun dan kami pun.  \r\nKarna itu dengan dukungan dan doa dari fans ataupun teman-teman yang mendukung ice cream kami punya semangat dan impian untuk ikut mewarnai musik indonesia dengan genre yang kami punya.  \r\n  \r\nsahabat ice cream adalah yang utama..bahkan organ tubuh yang takkan terpisahkan..  \r\ntanpa ice cream c0mmunity ice cream bukan apa apa..  \r\nterus berkarya untuk mengapai cita,,^^ terima kasih atas perhatian nya..^^  \r\nBegitu lah singkat cerita about ice cream..^^  \r\n', 1, '', 0, 134, '2012-05-29 10:02:58', '0000-00-00 00:00:00', 1),
