(765, 7366, 'Morgen bis Abend', 'We started this extraordinary journey since three years ago precisely on 14 July 2009 consisting of Nindita Andari & Nindira Andaru (Vocals), Aldi Adrian (Guitar), Syafika Luthfiani (Drum), Akbarry Noor (Bass), Danniswara Adhi (Keyboard), and Yunia Dafitri (Saxophone). We poured the expression of life and love around us into our songs. Based on the name of our band, which means â€œfrom morning until eveningâ€, we meet, we share, and we create songs in our own studio room from morning till evening, and we made this bandâ€™s name with German language without reducing our sense of love for Indonesia', 1, '', 0, 184, '2012-05-30 14:31:39', '0000-00-00 00:00:00', 1),
