(769, 2890, 'The Vivars', '-THE VIVAR\\''S-\r\n\r\nSebuah band yang beraliran popromantic yang memberikan warna baru di belantika musik Indonesia dengan karya-karya cerita cinta mereka yang cerdas. Dimana setiap personil memiliki kisah cinta yang berbeda,dan dituangkan dalam tiap lagu The Vivarâ€™s.\r\n\r\nBand yang berasal dari kota Malang ini memberikan motivasi, semangat cinta yang baru di setiap lirik dan kata-katanya.Sang vokalis lah yang sering terinspirasi oleh orang-orang di sekitarnya dan selalu saja merubahnya menjadi sebuah lagu.\r\nSeperti pada umumnya para personil The Vivarâ€™s adalah pecahan dari band satu ke band yang lain. Dan disaat mereka bertemu menjadi satu, mereka merasakan suatu hal yang berbeda dari band-band yang pernah di bentuk sebelumnya dari tiap-tiap personil.\r\n\r\nBerdiri tanggal 17 Agustus 2007, The Vivarâ€™s resmi terbentuk dan memulai karirnya dengan komposisi personil: Farid (Vocal/lead guitar), Nuno (Bassis), Ijud (Drumer), Alvinoruby (Keyboard/Guitar). Merekalah tulang-tulang dari The Vivarâ€™s.\r\nBermodal semangat dan keyakinan akan karyanya, mereka bisa menghibur para masyarakat khususnya pecinta musik Indonesia.\r\n\r\nâ€˜â€™Esok dan Seterusnya adalah mimpi kami untuk meraihnyaâ€™â€™ inilah motto dari The Vivarâ€™s.\r\nSemoga The Vivarâ€™s bisa memberikan nafas baru di industri musik Indonesia dan dinikmati oleh masyarakat Indonesia khususnya.', 1, '', 0, 207, '2012-06-04 04:15:22', '0000-00-00 00:00:00', 1),
(770, 2952, 'slebor', 'SLEBOR merupakan grup band profesional bergenre rock blues yang dibentuk di Jakarta, Indonesia pada 28 Oktober 2011 bertepatan dengan Hari Sumpah Pemuda. SLEBOR bermula dari pertemanan beberapa musisi yang sudah lama eksis di dunia musik seperti dari grup band SORGA ada Dewey sebagai vokalis utama dan Zizi sebagai gitaris. Enra sebagai gitaris berasal dari band JAVATTA. Wayu sebagai Bassis berasal dari band DEALOVA. Terakhir, Zuki sebagai Drummer berasal dari band INVEST ONE. Dalam perjalanan mereka di masing-masing grup band tersebut mereka membuat project musik bersama.                \r\n                \r\n      \r\nSLEBOR menawarkan konsep idealisme dalam bermusik, menonjolkan karakter rock yang kuat berpadu dengan sentuhan blues. Latar belakang bermusik masing-masing personil SLEBOR menghasilkan ide-ide musik yang segar. Kekuatan musik SLEBOR terletak pada raungan distorsi kolaborasi dua gitaris yang berpadu apik dengan hentakan beat-beat kuat dan suara vokalis yang terdengar â€˜serak-serak gagahâ€™ mewarnai dalam setiap lagu. SLEBOR kini sedang dalam proses pembuatan video klip dari single â€œMati Rasaâ€, sebuah lagu yang bercerita tentang ungkapan kekecewaan atas sakit hati karena kebohongan yang ada dalam sebuah hubungan.                 \r\n', 1, 'small_8c9fe176435beaf42c3239b1a843dec4.jpg', 0, 184, '2012-06-05 15:28:54', '0000-00-00 00:00:00', 1),
(771, 7572, 'RITERIA', 'RITERIA merupakan band yang berasal dari kota Bukittinggi, Sumatra Barat, yang berdiri pada tanggal 10-10-2010. Nama Riteria diambil dari asumsi dua kata â€œRitmeâ€ dan â€œ Ceriaâ€ menjadi RITERIA.\r\n\r\nMeskipun band ini baru terbentuk, namun bukan berarti personil band ini baru berkarir dalam musik. Personil Riteria berasal dari pecahan band yang berbeda beda yang sudah mempunyai cukup prestasi dalam tingkat regional, seperti finalis regional sebuah event nasional pada tahun 2007 sampai sekarang ini, dan menjadi band opening artist di setiap konser yang di adakan di Sumbar dan sekitarnya.\r\n\r\nPersonil Riteria telah menyatukan visi dan misi sejak awal dibentuk dan berharap semua masyarakat Indonesia untuk dapat menerima karya musik dari Riteria .\r\n\r\nBermodalkan pengalaman musikal para personilnya yang memiliki background event-event musik serta skill yang mumpuni, mereka meracik dengan aransemen dan komposisi yang harmonis pada setiap karyanya.\r\n\r\nDebut album perdana mereka yang berjudul â€œPencuri Hatiâ€ dikemas dengan memasukkan unsur beat rythm kedalam genre pop alternative yang menjadikannya sebagai kekuatan yang berkarakter.', 1, '', 0, 174, '2012-06-06 05:44:17', '0000-00-00 00:00:00', 1),
(772, 7598, 'LUGIA', 'LUGIA Terbentuk pada akhir tahun 2008, dan diresmikan pada 11 januari 2009 (pada saat recording pertama kali.. Didirikan oleh Arya (keyboard) dan Wira (guitar), di kampus Stei Rawamangun..\r\n\r\nKami telah mengalami beberapa perubahan personil.. hingga saat ini yang menyatukan Lugia dengan personil tetap : Okta (voc), Wira (gtr-1),Ucim (gtr-2), Ady (bass), Arya (keyboard), dan Fandhi(drum)..\r\n\r\nAsal nama LUGIA adalah diambil dari icon dewa pokemon yang terdapat pada anime jepang \\"pokemon\\".\r\ntidak ada maksud khusus dengan nama tersebut, namun kami membuatnya LUGIA menjadi singkatan dari Lucu Gila dan Asik.. ^_^\r\n\r\nGenre musik kami adalah Pop Rock, namun bagi kami, para penikmat musik yang cerdas adalah tidak membedakan musik berdasarkan genre.. pandangan orang mengenai genre musik berbeda-beda, tapi yang harus dihargai adalah usaha seorang musisi / grup band menghasilkan karya-karyanya untuk dapat dinikmati semua orang dengan niat yang tulus..\r\n\r\nSemoga karya kami dapat diterima pendengar dan menambah warna di belantika musik Indonesia..\r\n\r\nSalam semangat dari kami..\r\nLUGIA kepada Lugi_Lovers..\r\n\r\nTrim\\''s...', 1, '', 0, 187, '2012-06-06 10:07:28', '0000-00-00 00:00:00', 1),
(773, 6904, 'FUNTASTIC', 'Funtasticâ€¦begitulah panggilan band ini. Funtastic adalah band asal kota medan, yang berdiri pada tanggal 17 agustus 2009 yang ber awakan Ari (Vocal) , Kem (gitar) , eik (bass) , W-one (Drum) , Vay (keyboard). Gendre music yang di bawakan oleh funtastic adalah progressive, rock dan pop alternative. Funtastic memulai karirnya berawal dari event-event band  yang ada di sekitar sumatera utara, dan mengawali karirnya mulai dari november 2009 kemudian mengikuti berbagai macam even seperti festival band, pensi sekolah, opening artis, DLL . Kini mulai berkarya dan memilih genre Pop, karna mengingat pop sangat diterima oleh masayarakat.', 1, '', 0, 51, '2012-06-08 11:11:26', '0000-00-00 00:00:00', 1),
