(781, 4467, 'Sub Fever', 'Sub Fever start in the begining of 2011, with complex influences of Randi Otto and Eyo, two friends that are very passionate with sonic sounds. The concept of Sub Fever is making so much sounds and combine it to be dub/dancehall/dubstep/bass music generally. With Danica as vocal, it give new color of Sub Fever music. Sub Fever plays digital dub with simple wobbler and heavy bass lines.\r\nsubfever@rocketmail.com - soundcloud.com/subfever', 1, '', 0, 174, '2012-06-17 08:18:35', '0000-00-00 00:00:00', 1),
(782, 7582, '29th DECEMBER', 'dulu pernah menggunakan nama Pencil Case yang disusun oleh fahen(vokal), pajeek(guitar lead),once(rythm guitar), sandi(bass/voc), dan kiki(drum) namun sempat vakum lalu fahen dan kiki memutuskan untuk keluar , lalu di bentuk lah 29th December ini di ambil dari tanggal kita recording kali pertama tetep dengan 3 personil lama nya @Paanjeek - guitar lead, @onnccee - rythm / voc, @sandsandee - bass/voc, dengan suguhan baru @adityafajaar yg membuat invoasi baru di bagian drum nya. \\"we are bumi sriwijaya powerpoppunk\\"  \r\ntwitter : @29thDecember | \r\n| facebook : http://www.facebook.com/pages/29th-December/137595239688208?ref=hl | \r\n| reverbnation : http://www.reverbnation.com/29thdecember', 1, 'small_9a0cb08870ecdfeeba5929dfcabc6246.jpg', 0, 120, '2012-06-19 10:14:50', '0000-00-00 00:00:00', 1),
(783, 7755, 'BLUEBERRY', '      \r\nEksotika dari pulau Dewata Bali, Band yang terlahir dari kreatifitas & hobby bermusik anak muda Jembrana-Bali ini mempunyai satu warna musik pop Indonesia yang khas. Diujung tombak Rayen (vokalis), Nova (lead guitar), Bagus (bass), Hendi Foxcay (guitar) ,Dedet (drum) terbentuk awal tahun 2010 pada saat akan mengisi salah satu event musik di Bali.      \r\n      \r\nBlueberry nama band ini, sang vokalis Rayen bertutur â€œtidak ada arti tertentu untuk nama Blueberry, hanya saja melambangkan buah yang rasanya manis, yang pastinya hampir semua orang suka sama buah yang rasanya manis heheâ€. Meskipun band ini terbilang baru, namun kemampuan masing-masing personelnya mampu memberikan nuansa musik yang terbilang easy listening, karena masing-masing personel telah lama bermusik dengan band sebelumnya. Terbukti tahun 2010 lalu, prestasi Blueberry di salah satu perhelatan musik yang cukup bergengsi ialah menjadi juara III A Mild Live Wanted Regional Bali.    \r\n    \r\nkunjungi :    \r\nwww.reverbnation.com/blueberrybali', 1, '', 0, 189, '2012-06-20 19:39:27', '0000-00-00 00:00:00', 1),
