(787, 7840, 'THE KIRIN', 'KIRIN adalah band yang mencoba menaruh lead di keyboard. . kirin di bentuk oleh 3 orang yaitu sakti,agung dan andry. .setelah berminggu berlalu band ini mencoba unutk terus erlath wlpun jarang mengikuti acra band2 indi...kemudian kirin bertambah personil yaitu zaenal,fahrul dan wanda....dan sekrang kirin mencoba untuk menjadi band yang bisa di terima masyrakat', 1, '', 0, 226, '2012-06-25 12:15:43', '0000-00-00 00:00:00', 1),
(788, 7025, 'ALPA BAND', 'ALPA BAND dibentuk pada tanggal 17 maret 2010,dimulai dari Rangga yang mengajak adiknya Reka serta temannya ilham dan teman smanya vidi untuk membentuk sebuah band,setelah sepakat memilih jalur pop alternatif yang sesuai dengan aliran musik kami,dipilihlah ALPA sebagai nama band berdasarkan singkatan nama personil ranggA-iLham-v(P)idi-rekA = ALPA.\r\nseiring berjalannya waktu kami pun memutuskan untuk menambah personil untuk mengisi posisi gitar setelah proses akhirnya dipilihlah yuga yang juga merupakan teman sma rangga dan vidi.', 1, 'small_72e2e5944b3c82d1862206ef3b4416b8.jpg', 0, 162, '2012-06-27 05:48:34', '0000-00-00 00:00:00', 1),
(789, 7912, 'Devillito', 'Beranggotakan 3 orang, band ini lahir di Bogor pada bulan Maret 2012, berawal dari mengisi kekosongan / waktu luang, hingga kami bertiga menciptakan beberapa lagu, yang kemudian kami coba rekam di Studio sederhana, dengan tujuan, kami mencari sponsor untuk bisa melenggang pada karir di bidang musik yang lebih tinggi', 1, 'small_f895c354e4fd3c37ebb628e904d69a4b.jpg', 0, 177, '2012-06-30 05:55:19', '0000-00-00 00:00:00', 1),
(790, 7973, 'Sentimental Moods', 'Instrumental ska band based in jakarta formed by Beni Adhiantoro (drums), Daniel Sukotjo (baritone saxophone), Dharmo Soedirman (keyboards), Pardiffa Effrido (bass), Ranando Arliccan (percussions), Taufiq Alkatiri (trumpet), Wirastomo H.W (guitar), and Yurie Fachran (tenor saxophone).', 1, 'small_722c3644f019abecc74d46f00eca6e07.jpg', 0, 1, '2012-07-04 18:38:40', '0000-00-00 00:00:00', 1),
(791, 7979, 'MAGOROA', 'Magoroa ,Band Lokal Medan beraliran Metal Rock ,di bentuk di awal tahun 2011,yang di gawangi ndoenk : vox , Eron : lead guitar , Juff : rhythm Guitar , Roy : Bassist(adp), Jeff : Drummer', 1, '', 0, 51, '2012-07-05 14:07:53', '0000-00-00 00:00:00', 1),
(792, 7928, 'Fauzan Rahman(indonesianewave)', 'musisi solo, spesialis pencipta lagu karna aku gak bisa nyanyi cuma bisa main alat musik. dulu pernah ngeband tapi udah lama sekali.  kalau mau dengerkaryaku silahkan kunjungi www.reverbnation.com/zanrivers', 1, '', 0, 74, '2012-07-08 08:10:50', '0000-00-00 00:00:00', 1),
(793, 7963, 'VAIRIS', 'VAIRIS terbentuk pada tanggal 06 februari 2010 di Palembang. VAIRIS mempunyai arti \\" Lima Pelangi \\", adalah gabungan dari \\" V dan AIRIS \\" .  \\" V \\" berarti 5 (lima) dalam angka Romawi. sedangkan AIRIS adalah singkatan kata dari ARCO IRIS, di ambil dari bahasa Spanyol yang berarti pelangi. VAIRIS terdiri dari 6 orang personil, yaitu:      \r\nMedi : vocal, Surya : bass, Hendri : guitar, Kafi : keyboard, Wildhan : guitar, Iftah : drum ---LIHAT,DENGAR DAN RASAKAN KARYA-KARYA KAMI (VAIRIS)--- Contact Person : Rhandy ( HP : 0821-82477665 / PIN : 26B3C6B7 ) --- PIN VAIRIS ( 24B38656 ) --- email : vairismusic@yahoo.co.id --- twitter : @VAIRIS_MUSIC  --- www.reverbnation.com/vairis   ', 1, '', 0, 120, '2012-07-08 12:43:55', '0000-00-00 00:00:00', 1),
