(795, 7937, 'The electric', 'The Electric terbentuk tahun 2009, berawal dari penyaluran hobby beberapa pegawai salah satu perusahaan BUMN di jayapura untuk bermusik maka dibentuklah band untuk menyalurkan hobby dan mengembangkan bakat musik pegawai. Nama The Electric sendiri diambil dari produk yang dijual oleh perusahaan tersebut dimana perusahaan tersebut menjual listrik kepada masyarakat. Seiring waktu The Electric mulai menciptakan beberapa lagu dan telah direcord untuk dapat dinikmati para pencinta musik di indonesia.', 1, '', 0, 481, '2012-07-09 13:40:17', '0000-00-00 00:00:00', 1),
(796, 8070, 'JUSTJUICE', 'Sepemikiran dengan Nada Blues / Rock nâ€™Roll, kami yang masing â€“ masing personil memiliki band dengan Genre yang berbeda â€“ beda ( metal, rock, blues, other ) memutuskan untuk membuat project band ini sebagai tempat penggabungan beberapa karakter kami yg berbeda â€“ beda ini untuk menghasilkan musik (karya) yang kami rasa menarik walau dengan skill dan teori kami yang seadanya.         \r\n Band ini terbentuk 1 Mei 2012, sesuai dengan nama yang kami usung â€œJUST JUiCEâ€, berharap karya kami dapat memberikani penyegaran dan warna bagi kami dan bagi industri musik / pendengar khususnya.         \r\n Aminâ€¦', 1, '', 0, 51, '2012-07-16 03:04:08', '0000-00-00 00:00:00', 1),
(797, 6436, 'AMRkha', 'ini bukan sebuah band, tapi gw coba bikin sndiri semua arransemennya \r\nbermodalkan soft ware gratis dr forum \r\nsedikit melayu.. \r\nmdh2n dapat diterima', 1, 'small_ede28f7f30123a600252f379fb5a1c1e.jpg', 0, 153, '2012-07-21 08:41:09', '0000-00-00 00:00:00', 1),
(798, 8120, 'ELFROUX16', 'This groove and passionated energy three piece shirt outfit have been together since 16th May 2012, with our music a unique of styles ranging from Swedish Pop and Soul Groove. Our melody recognisable with catchy melodic deep grooves, smooth vocal, and easy swinging rhytm. Here we are, Elfroux16', 1, '', 0, 120, '2012-07-30 05:40:09', '0000-00-00 00:00:00', 1),
(799, 8136, 'SPARKLEAFTERNOON', 'Sparkle Afternoon is an Indonesian band (according to the bandâ€™s own definition) with dreampop ,instrumental, post-rock, shoegaze and ethereal elements. The name is derived from the bright-bright afternoon in 19th December 2007.  \r\nA band from Bandung, Indonesia, with a musical style that is described as a combination of pop and minimalist sound (with shoegaze, post rock and dream pop influences) like Cocteau Twins, Slowdive, Maybeshewill, God Is an Astronaut, Asobi Seksu, Highspire, pg.lost, also Mew \r\n \r\nAnd now we are entering for EP and LP Album after released a split album We Sit Under The Big Bright Yellow Sun in The Sparkle Afternoon in 2010 \r\n  \r\nThe band consists of Ratih Kemala Dewi (vocals), Diki Setiadi (guitar), Warna Kurnia (bass), Yogie Riyanto, Dina (keyboard) and Tedy Wijaya (drums). Original keyboardist Dina left in May 2007. After all we meet Rizka Rahmawaty appointed as Sparkle Afternoon young keyboardist. ', 1, '', 0, 174, '2012-08-02 18:42:07', '0000-00-00 00:00:00', 1),
(801, 2720, 'Under The Big Bright Yellow Sun', 'Under The Big Bright Yellow Sun (UTBBYS) is an instrumental post-rock band which was created since 13th of August, 2007 in Bandung, Indonesia. The journey started since Yadi (Komeng) met Iben in an art gallery of the famous university which is located at the eastern of Bandung. With a same taste of music, they agreed to make an instrumental post-rock band that inspired of famous post-rock band, such as Explosions In The Sky, This Will Destroy You, Sigur Ros, Mogwai, Mono, etc.', 1, 'small_0b5e4e00b442adae9eda15feb60866f4.jpg', 0, 174, '2012-08-06 03:01:24', '0000-00-00 00:00:00', 1),
(802, 8143, '70\\''s Orgasm Club', 'band trio funky bluesy rock yang dimotori oleh penulis lirik/penyanyi/gitaris Anto Arief dan dibantu oleh drummer Bagan Gantira dan bassis Galant.', 1, '', 0, 174, '2012-08-06 03:21:05', '0000-00-00 00:00:00', 1),
