(805, 8154, 'Flyover Band', 'Rock Alternatif yang simple & easy listening..  \r\n  \r\nWe are FlyOver Band, Looking Music Producer!! We were 4 years played music together,  \r\nour music is alternative rock, rock industry  \r\nwe\\''re not yet a famous band but we had many own potential songs to going on music industry,  \r\nMany experienced : played on many places, tracking our song, send a demo song, etc..  \r\nRudi (gitaris), Farhan (bassis) --> 2012  \r\nformer member : Kriz, Buam (vox) & Tommy, Asep (drum)', 1, '', 0, 184, '2012-08-13 04:02:39', '0000-00-00 00:00:00', 1),
