(807, 8178, 'Child\\\\\\\\\\\\\\''s Play', 'Kami adalah sebuah band yang mengusung genre punk/Rock dari Palembang.  \r\nBand ini terbentuk sekitar pertengahan 2010 dengan formasi   \r\n-Kevin (guitar/vocal)  \r\n-Tyo (bass/vocal)  \r\n-Lupi (drum)  \r\n-Benny (guitar) ', 1, 'small_f3f25657f3aef1a65ea6b50e6b762b20.jpg', 0, 120, '2012-08-22 10:59:58', '0000-00-00 00:00:00', 1),
