(812, 8184, 'DEVAURA', 'DEVAURA adalah sebuah grup band baru asal kota Surabaya yang terbentuk di penghujung tahun 2011 yang di gawangi oleh lima personil : Rizal (vokal), Pras (bass), Aris (gitar), Rizky (gitar) dan Eko (drum). Nama DEVAURA sendiri bermakna cahaya hati, cahaya cinta atau cahaya jiwa yang berhubungan dengan pembawaan karakter lagu yang penuh dengan soul dan perasaan dengan harapan tiap lagu yang mereka ciptakan dapat sukses dan menghibur para penikmat musik tanah air.Akhirnya, mereka berlima sepakat untuk menetapkan tanggal 12 November 2011 sebagai hari jadi Band DEVAURA dan Eksis slalu di blantika musik tanah Air. AMIENNNN ^_^', 1, 'small_f27008f49fd0f4e43160e5b4de3df131.jpg', 0, 260, '2012-09-01 08:52:43', '0000-00-00 00:00:00', 1),
(813, 830, 'AW AND The Gank', 'Aw and The Gank,    \r\nAw sebagai penulis lagu,lirik ,serta isian instrument ,menggabungkan hubungan sahabat untuk memberikan warna ,eksplorasi,genre Pop Blues maupun rock terhadap karya yang ada pada masing-masing ...sesuai porsinya ,pas racikan, kalo istilah rasa pada makanan, bumbunya biar pas.', 1, '', 0, 186, '2012-09-04 07:34:11', '0000-00-00 00:00:00', 1),
(814, 146, 'Calculus', 'INTRO:: Calculus, berawal dari Band dengan format Duo, Ipunk (Guitar+Vocal) dan Armand (Drums+Voice) yang secara iseng merekam beberapa lagu dan mengikutsertakan di audisi LA Lights Indiefest pada medio 2007, hanya bermodalkan sebuah track song, foto band 2 personil, selembar lirik dan formulir lengkap Dua personil ini berjudi dengan semangat \\''Nothing to Lose\\'' sengaja melempar CD Audio mereka di Drop Box hajatan tahunan produsen rokok tersebut tanpa pernah berharap berlebih sedikitpun..\r\n\r\nBeberapa bulan berlalu Armand sang drummer mendapat telpon dari pihak LA Lights Indiefest 2007 bahwa CD Audio yang mereka ikut sertakan ternyata lolos ke babak 50 Besar Regional dan berhak perform di Liquid cafe Yogyakarta untuk menunjukkan aksi kebolehannya bermain musik secara live...Walhasil di Stage sebuah cafe dan dihadapan Juri Nasional . Duo [baca: Trio, karena menggunaken jasa Additional Bassist] ini berhasil mengundang aplaus dari juri dan Crowd seisi cafe setelah membawakan sebuah lagu karya sendiri dan sebuah lagu Cover Version \\''Kembali\\'' nya PAS Band yang mereka acak ulang menjadi sebuah lagu semi PunkRock...yeah :)\r\n\r\nSetelah melewati babak Audisi tersebut Duo ini mencoba menulis beberapa lagu lagi dan sempat mampir untuk mengajukan demo ke salah satu label besar di\r\nJakarta...dan dengan hasil tidak sesuai harapan,hmm...akhirnya Duo Gitaris+Drummer ini kembali ke studio latihan dan mengerjakan lagu-lagu mereka berdua...Hingga pada akhir tahun 2008 Duo ini harus vakum dari band dikarenakan kesibukan study dan pekerjaan masing-masing...\r\n\r\nDiawal tahun 2012, setelah Duo ini menemukan banyak luang waktu. Akhirnya mereka sepakat untuk merekam ulang beberapa karya mereka dengan dua personil tambahan yakni: Ryan (Vokal) ex-vokalis band Teknik Sipil UGM dan Iksan (Bass) ex-Bassist The Bikinies Reject dan sepakat manamai diri mereka dengan Calculus, nama yang didapat sang Drummer karena melihat getolnya sang Gitaris Ipung belajar Calculus,hmmm...\r\n\r\nCalculus are::\r\n\r\nRyan/Vocal...born in Tarakan, East kalimantan...Study in Class of Civil, Gadjah Mada university...Frontman ini ter-influence oleh Ipank, Gugun Blues Shelther, OASIS, SaintLoco dll\r\nIpung/Guitar...lahir di Yogyakarta, pendidikan S1 matematika UAD Yogyakarta dan mengidolakan AlterBridge, Andra & The Backbone, Mr. Big dan Tom delonge\r\nTroy/Geetar...lahir di yogyakarta, Guitaris Band TOP40 yang mengidolakan Aerosmith dan semua Blues Guitaris\r\nIksan/Bass...Pekerja Swasta, lahir di yogyakarta, influence:: Thomas GIGI, Bondan Fade2Black, RHCP.\r\nArmand/Drums...terlahir di Yogyakarta, Marketing di DVPROMultimedia...menyukai Wong Aksan, Ronald GIGI, Travis Barker, Chad RHCP...\r\n\r\nSingle:: \\''I Believe\\'' song by Ipung, lyric by: Ipung/Armand...Producer:: Armand for AstheniA Records, Record & Mixed at RMP Studio Yogyakarta during jan-March 2012.\r\n\r\nAchievment::\r\n50 Besar LA Lights Indiefest 2007\r\n\r\nContact:: Jl. Affandi 8 Gejayan Yk, Komplek Lumbung Padi Resto.\r\nMobile:: 081804199119.\r\ncalculusmusic@yahoo.co.id.\r\nfacebook.com/calculus\r\nmyspace.com/calculusband\r\n', 1, '', 0, 265, '2012-09-04 09:01:49', '0000-00-00 00:00:00', 1),
(815, 8218, 'CEMETERY DANCE CLUB', 'At first CDC (cemetery dance club) begin their journey in early 2007. They started with their first formation which is Boki, Abet, Bona,osky, beethoven and widhi. They begin writing songs and playing in many indie music scenes in indonesia. Their music is like metal and dancing mix together with little bit of soul in it or they like to called it trance metal. Now in 2009, CDC started again with ne\r\nw formation : Audrio Susanto: beat the bass Alvin Eka Putra: bang the drum Ivan Victor Lucas: guitar shredder Kazumasa Albert: Guitar goddest Bona Rodriguez: microphone kisser . Their journey now begin to rising up. Theyâ€™re playing in many gigs in every scenes. And theyâ€™re having their hit single called â€œwoundsâ€ and \\"the end is not yet to come', 1, '', 0, 184, '2012-09-04 19:24:23', '0000-00-00 00:00:00', 1),
