(820, 3022, 'Ohaio', 'Ohaio has been around since December 2010. Formed in Depok - Indonesia, they had profound impact on many international music scene, such as Angels and Airwave, Mew, Tokyo Jihen, Blink 182. \r\nThe Band consisting of Magis Prima , Mujibur Rahman , and Manggar Satria. They was met accidentally. Being introduced each other and immediately fond of each other and decided to make a band. \r\nNowadays they\\''re concentrating on their first EP album and hopefully, they can deliver the meaning of their songs through pop genre.', 1, '', 0, 1, '2012-09-06 13:56:04', '0000-00-00 00:00:00', 1),
(821, 3221, 'Relasy Band', 'band relasy terbentuk dari 5 personel. yang di punggawai oleh : fahmi (vocal), daniel(gitar), eko(drum), ivan(bass), deden(keyboard). serta terbentuk pada tanggal 2 bulan juni tahun 2007.', 1, '', 0, 134, '2012-09-07 01:24:18', '0000-00-00 00:00:00', 1),
