(824, 8243, 'ZEEVA', 'Kami berasal dari jakarta , tepatnya di jakarta timur.Zeeva terbentuk sejak tahun 2006 , arti dari nama zeeva adalah cemerlang atau berkilau. Harapan kami semoga Zeeva band dapat di terima di belantika musik indonesia.', 1, '', 0, 187, '2012-09-08 19:04:22', '0000-00-00 00:00:00', 1),
