(826, 5375, 'kanaya band', 'Kanaya berdiri di Depok 11 november 2007.\r\nNama KANAYA sendiri diambil dari\r\nnama kota di jepang, yang di kota tersebut terdapat sungai, yang menjadi daya tarik dan sumber penghidupan bagi masyarakat sekitar. Pencapaian dari nama KANAYA sendiri adalah sebagai musik yg mengalir dan mejadi daya tarik bagi khalayak orang banyak. Didasari keinginan serta visi dan misi yg sama dalam\r\nperjalannanya, KANAYA bertekad memiliki karya musik yg tentunya telah disesuaikan dengan selera dan tren musik yang berkembang di blantika musik Indonesia saat ini.', 1, '', 0, 180, '2012-09-11 10:21:27', '0000-00-00 00:00:00', 1),
(827, 5653, 'OCTOPUZ', 'OCTOPUZ adalah sebuah band yg berasal dari Kota Cirebon (Jawa Barat). \r\nBerdiri pada tanggal 27 Juli 2007. Harapan OCTOPUZ adal bisa menjadi band yang  Onfire Consisten TOP dan focUZ. \r\n \r\nFormasi Awal terdiri dari 4 (Empat) Personil, yaitu Trisna,Hadi,Alan,dan Rahmat. \r\nyg menghasilkan single pertamanya yaitu \\"Teman Biasa\\" \r\nWaktu semakin berlalu terjadilah perubahan formasi, pada maret 2011 sang bassist menyatakan mengundurkan diri dari formasi. \r\n \r\nDi bulan Maret tersebut masuklah Roy (Gitaris merangkap vokalis di am03ba) sebagai basis, ia adalah teman ketika SMP Hadi sang drummer yg membawa warna baru ke dalam band. \r\nLalu pada Agustus roy mengajak sahabatnya Torre (gitaris Symetric) sebagai gitaris.', 1, '', 0, 179, '2012-09-11 17:50:51', '0000-00-00 00:00:00', 1),
(828, 8215, 'SICK STUPID', 'Maret 2007 adalah kelahiran Sick Stupid, sebelumnya band ini bernama SixSickSeek. Semangat ngeband di usia SMA adalah kesamaan masing-masing personil di dalam Sick Stupid.     \r\nPada tahun 2009 mereka mulai menunjukkan eksistensi mereka di ranah musik Kota Palu dengan mengikuti beberapa event festival musik.     \r\nSick Stupid, nama ini digagas oleh Adnan (guitar) dan diamini oleh personel lainnya. Mereka terus menjelajahi berbagai festival musik yang diselenggarakan di Kota Palu karena hanya dengan mengikuti event festival musik Sick Stupid bisa menyalurkan hobi mereka. Kala itu, festival musik adalah satu-satunya fasilitas bagi mereka untuk menampilkan lagu karya sendiri.     \r\nBand ini terus memupuk rasa percaya diri dan selalu berusaha keras bertarung dalam kompetisi festival musik untuk menjadi juara. Namun Sick Stupid tidak terlena begitu saja dalam pengaruh hegemoni festival musik, Sick Stupid selalu menyempatkan waktu untuk menulis dan merekam lagu-lagu karya mereka. Di tahun 2009 mereka berhasil menelurkan lagu â€œMiss You Momâ€ sebagai singel pertama yang dilahirkan dari karya sang vokalis Yuda dan berlanjut \\"Nothing last Forever\\" di tahun 2010.     \r\nAdalah Rock Modern menjadi genre musikal Sick Stupid. Karakter vokal scream yang begitu garang, distorsi dan beat yang rapat menjadi aset Sick Stupid bermusik. Tak ayal, mereka mampu menghipnotis remaja-remaja penikmat musik distorsi di Kota Palu, khususnya remaja usia SMU.     \r\nSick Stupid beranggotakan Yuda (vocal), Rendra (bass), Zul (drum), Adnan (guitar), dan Ojaa (guitar). Mereka bermarkas di Jl. Ahmad Yani No.53 Kota Palu, Sulawesi Tengah.     \r\nInformasi selengkapnya mengenai Sick Stupid, silahkan menghubungi 085398883028 (Icha) dan 085824111988 (Yuda), atau e-mail sickstupid88@musician.org     \r\nFollow @sickstupidtwit dan facebook SICKSTUPID', 1, '', 0, 412, '2012-09-12 07:07:03', '0000-00-00 00:00:00', 1),
