(832, 6038, 'VICTORIA', 'Band ini berdiri dari hobi anak-anak yang ingin menciptakan musik yang berbeda dari musik indie lainnya & band ini terbentuk pada tgl 10 Oktober 2010 dengan formasi Yusfik(Bass),Firman(Lead Gitar),Fardhan(Rythem) serta Malino(Drum).Lalu pada bln 11 2011,Firman(Lead Gitar) hengkang dari Victoria dikarenakan fokus untuk pendidikan,setelah hengkangnya Firman kami mendapatkan pengganti yang juga bernama Firman biasa dipanggil Iman_nemo.Menyadari kalau genre musik yang kami bawakan susah untuk diterima tapi kami mencoba untuk menunjukkan eksistensi kami dalam bermusik agar band ini bisa diterima semua orang. \r\naminnnn', 1, 'small_b99b29181f17670cb75b2b326970166c.jpg', 0, 120, '2012-09-16 02:58:14', '0000-00-00 00:00:00', 1),
