(834, 6973, 'Karikatur band', 'karikatur band terbentuk di akhir november 2009, 29 november mmbentuk sebuah band yg ber aliran pop rock ,dgn konsep2 sederhana yg di padukan dgn lirik2 yg easy listening dan juga berkarya dgn menuangkan ke dalam khidupan masing........... karikatur adalah gambar kartunis yg mnyerupai /mirip dgn ap yg di tirukan dgn yg aslinya ... dgn kt lain karikatur adalah karya yg unik... mka dgn sebab itulah kmi mngambil nama ini sebagai nma band kami... untuk slanjutnya.... silahkan dengar karya lagu2 kami..... salam karikatur...!!', 1, 'small_d5d95a6107279218964a1d07b4962186.jpg', 0, 51, '2012-09-17 06:52:09', '0000-00-00 00:00:00', 1),
