(836, 2860, 'Play-Mates', 'Play-Mates adalah sebuah band beraliran funky rock asal Jakarta. Dimotori oleh 5 personil:  \r\nFara Zachman (vokal) | Ragadipa (bass) | Balum (gitar) | Lalitya Laras (keyboard) | Yudhistira (drum).  \r\n  \r\nTerbentuk pada bulan Oktober 2010 dan mengusung tema \\"Wild & Sexy\\" sejak pertama dibentuk. Lagu-lagu orisinil Play-Mates sendiri terinspirasi dari kehidupan sehari-hari juga kisah cinta dalam nuansa yang lebih dewasa.  \r\nUntuk segala info kegiatan dan update terbaru, follow account twitter Play-Mates : @playmatesmusic  \r\n', 1, 'small_a98667ad7ec40da158f51d56e568969f.jpg', 0, 184, '2012-09-21 06:19:19', '0000-00-00 00:00:00', 1),
