(838, 5631, 'Ansiusdream', 'Nama ansiusdream diambil dari kata anxious (khawatir,bimbang) dan dream (mimpi) jadi ansiusdream adalah mimpi yang penuh dengan kebimbangan. Lagu-lagu ansiusdream terdengar seperti sebuah perayaan kesedihan, kebimbangan, kekhawatiran, kegundahan, dan sebagainya. Perayaan kesedihan bukankah berarti sebuah renungan? Mengalami kesedihan bukan berarti harus terpuruk. Kita masih bisa berbahagia dibalik kesedihan yang menimpa. Ansiusdream mengajak pendengar terbawa menyelami pikiran yang tenang dan menyejukan dibalik kesedihan/kebimbanggan yang sedang dirasa.', 1, '', 0, 174, '2012-09-25 15:27:48', '0000-00-00 00:00:00', 1),
