(848, 8398, 'The Clouds', 'The Clouds - A Beginning\r\n\r\nIt was started from a jam session called â€œMiserablesâ€œ by Aji Wiweko - (guitarist of an old school hardcore band named Empty Message), Agus Marrdian â€“ guitar (Cambridge Revolt ), Aris Widyawisesa â€“ drums (Cambridge Revolt), Wiranata Agung Tyas a,k,a Diaz - bass ( ex.Subrooster\\''s bassist ) ,Rio Vanessa a.k.a Echa (guitarist of Suck Of Society â€“ he was the keyboardist of the band) . They finally changed the name from â€œMiserablesâ€œ into â€œThe Cloudsâ€œ to represent their hallucinative and absurd but real lyrics.. They played pop songs popularized by The Smiths, Morrissey, The Cure, Lightning Seeds, James, Pulp, etc. Unfortunately, in 2001, Aris decided to leave Miserables because of his professional job and he was replaced by Ibam Atmanugraha, a drummer of a jazz band named Protaque .\r\n\r\nIn a cloudy windy night in Ajiâ€™s terrace the dynamic duo (Aji and Marrdian) started to play their sad interlude to interpret one of their poem called â€œSamarâ€œ which inspired from a true story about their best friends, who were trapped in hallucinative and addictive poison and it changed their way of lives a lot. It was a gloom and depressive poetry but it was the breakthrough in Miserablesâ€™ musicography.\r\n\r\nMost of their lyrics told us about the reality in this life. For examples: â€œSisi Yang Hilang (about a grey area in our lives), â€Uncertaintyâ€œ (about boredom in our lives that could kill our feelings, energy and creativity), Prelude for Negative Minor (instrumental track), â€œSepiâ€œ (a description about loneliness and hope-loss that often comes into our days and it tortures our soul), â€œGarden of Edenâ€œ (an imaginative poem about a nowhere lands,an endless heaven that brings us true peacefulness), â€Silusi â€œ (a temporer addiction of hallucinative substance but it could be a deadly poison if we canâ€™t control our self-which written by Andri Mulyana a.k.a Cheppy â€“ guitarist of â€Ten Holesâ€ and a pop band named â€œStrangewaysâ€) and â€œI Wanna Be My Selfâ€œ (an optimistic and egocentric statement in every humanâ€™s character).\r\n\r\nThe Clouds recorded their singles in 2004 in a music studio in the eastern Jakarta and they performed in several indie gigs in the city. Unfortunately, in 2008, three of band members which are Made Widya,Rio Vanessa and Ibam Atmanugraha stated to leave The Clouds, but it didnâ€™t turn Aji, Marrdian and Diaz into hopeless. They kept their spirit and tried to fulfill the vacant positions. They recruited their old friends, Rizal Hands a.k.a Ijal (The Forgotten Fearâ€™s drummer) and they had jam-session with Ahmad Fadholy a.k.a Dolly Plester and Yodham Moux ,a music programmer and a lead singer of Jakarta\\''s Japanese pop band called Junon.\r\n\r\nThey recorded a new single called â€œFor My Soulmate (a love song where The Clouds collaborated with Yodamâ€™s passionate voice) . The Clouds then contacted their old long lost friend named Ipang Bona Drag ( The Firm ) to help them re-record their singles such as Samar, Sepi, and Guide Me To Your Door, Lelah Melangkah, and Silusi and to make their music videos.', 1, 'small_57157073b626a80d74d6d2933e0a1c80.jpg', 0, 187, '2012-10-03 02:52:07', '0000-00-00 00:00:00', 1),
