(856, 4116, 'Tinker Bell', 'Tinker Bell didirikan pada tanggal 1 Januari 2012, pada saat kami berkumpul bersama (vian,wawan,andre,rio,erik) di kediaman erik. Kami sepakat untuk membuat Band yang beraliran Pop British, andre (Vokalis), Vian (gitaris1), Erik (Gitaris2), Wawan (Drummer), Rio (bassis). knp nama Tinker Bell kami pakai untuk nama Band kami, jawabannya adalah karena di rumahnya erik ada jam dinding yang selalu berbunyi pada saat pergantian jam, hehehe, jadi kami selalu mendengar bunyi bell tersebut setiap kami kumpul bersama. Kami suka dengan bunyi Bell tersebut karena bunyinya simple, enak didengar dan selalu mengingatkan waktu, hehe. Kami berharap band kami TINKER BELL dapat dinikmati oleh semua kalangan dan mendapat apresiasi untuk membuat band kami lebih solid dan berkarakter. \\"TINKER BELL\\"', 1, '', 0, 134, '2012-10-05 01:43:24', '0000-00-00 00:00:00', 1),
