(860, 3142, 'Second Episode', '2nd Episode terbentuk pada awal 2010 di Palembang, berawal dari Iqbal (Gitar), Adit (Bass), Judika (drum) yang ingin membentuk sebuah band untuk menyalurkan ide-ide kreatif dan musikalitas mereka, dan mereka akhirnya memberi nama 2nd Episode untuk band ini yang berartikan keluarga kedua dan kami berharap 2nd Episode bukan hanya sebuah band yang di jalankan atas dasar hobi, tapi atas dasar keseriusan dan niat bersama, dan kami mengusung genre rock Blues. Kemudian kami mencari seseorang yang bisa mengisi kekosongan di posisi vokal, akhirnya kami mengundang Rico untuk mengisi posisi vokal tersebut.\r\nSeiring waktu, Rico memutuskan untuk hengkang dari 2nd Episode, karena rasanya tidak ada kompatibilitas dengan karakter vokal Rico. Kami memiliki kekosongan pada posisi vokal kembali. Setelah kebingungan ini disebabkan oleh kekosongan di posisi vokal, akhirnya kami bertemu dengan Putra pada tanggal 7 Juni 2010.\r\nSetelah melewati beberapa proses jamming, kami merasa nyaman dengan karakter vokal Putra dan kami memutuskan untuk mengisi Putra sebagai frontman di 2nd Episode. Dengan formasi baru ini, kami secara otomatis juga mengubah genre yang kami mainkan menjadi lebih matang dan berwarna. Kami mengusung genre Jazzy, Pop, Dance, dan Soul ke dalam satu balutan, yang akhirnya kami menyebut genre kami Pop-Kreatif/Jazzy. Namun, seiring berjalannya waktu, Judika (drum) memutuskan untuk pergi karena ia memiliki kesibukan pribadi. Kami masih menjalankan band ini walaupun tanpa drummer, dan kita mengisi drum dengan additional player sembari kita mencari figur untuk mengisi posisi drummer, belum sempat kami mendapatkan pengganti untuk posisi drum lagi-lagi kami harus kehilangan Adit (Bass) karena dia di sibukan oleh pekerjaan kantor nya. Seiring berjalan nya waktu, kami bertemu Reyhan (Bass) di awal tahun 2012, setelah melewati beberapa kali proses jamming kami memutuskan untuk mengisi Reyhan pada posisi Bass di 2nd Episode. Namun untuk drum kami masih mengisi nya dengan additional player. Dan kini kami sudah melahirkan beberapa single kami sendiri. So, we are 2nd Episode and let\\''s feel some groove with us.', 1, 'small_dfb0c66da758953d25dfaee5374a6a46.jpg', 0, 120, '2012-10-08 08:36:03', '0000-00-00 00:00:00', 1),
