(890, 8497, 'Day Of Emergency (D.O.E)', ' Day Of Emergency atau biasa disebut (D.O.E) adalah band yang bergenre Metal, Day Of Emergency awalnya bernama Lantam dengan genre Screamo, namun karena adanya perbedaan pendapat dan kesibukan personil maka lantam akhirnya vakum. Dan pada akhirnya Galang (vokal), Roy (gitar), Herry (drum), Dan Anton (gitar) memutuskan untuk membentuk band baru dengan aliran yang baru, yaitu Day Of Emergency. Pada awalnya Day Of Emergency belum memiliki Bassist sampai pada event pertama kali mengikuti gigs Day Of Emergency bertemu dengan Salam yang pada saat itu ingin bergabung bersama Day Of Emergency. Setelah beberapa kali mengikuti Event Gigs Day Of Emergency ingin menambahkan instrument Synthesizer agar suasana musiknya lebih berwarna pada saat diatas pentas, dan setelah merundingkan hal tersebut akhirnya salam pun mengenalkan seorang teman yang biasa memainkan Synthesizer kepada semua personil D.O.E pada kesempatan itu pula Day Of Emergency langsung bergegas ke Studio dan ngejam bersama personil barunya juan (Synthesizer) dengan membawakan beberapa lagu-lagu yang biasa dibawakan saat latihan. Setelah beberapa bulan berkarya, akhirnya Day Of Emergency mengeluarkan single pertama yang berjudul \\"Wish You Die\\",disusul dengan lagu kedua \\"payah\\" featuring Ucok Munte dan lagu ketiga berjudul \\"The Darkness Will Come\\". tapi ditengah perjalanan Day Of Emergency menemui sedikit masalah yang berujung keluarnya Anton (gitar).  \r\nhingga pada saat ini Day Of Emergency hanya beranggotakan 5 orang personil :  \r\n- Galang (vokal),  \r\n- Roy (gitar),  \r\n- Salam (bass),  \r\n- Juan (synth),  \r\n- Heri (drum).', 1, 'small_8f8bdbbc393ab01c8e338ace9366e88b.jpg', 0, 51, '2012-10-17 08:13:00', '0000-00-00 00:00:00', 1),
