(901, 8609, 'Weekend 69', 'Terbentuk di bulan Juli tanggal 21 tahun 2001. Ide awal band ini dibentuk oleh teman kami yang bernama Boy. Dia datang dari Jakarta ke Medan untuk kuliah dan tinggal di Medan. Bertemu di Jln. Sutomo, tepatnya di belakang Taman Budaya Medan, kami pun bersepakat untuk membentuk band SKA yang kami beri nama Weekend 69. Karena hanya pada saat akhir pekan (weekend) lah kami dapat berkumpul di Sutomo, dikarenakan pada saat itu semua personilnya bekerja. Dan angka 69 sendiri diambil karena pada tahun 1969 adalah masa keemasan musik SKA di Inggris, dengan harapan kami dapat mengulang kembali masa keemasan tersebut di Medan ini. \r\nInfluence yg paling terlihat dalam setiap musik Weekend 69 adalah THE SPECIALS, MADNESS, BAD MANNERS, dll. \r\nWeekend 69 dengan personil awal : \r\nBoy	: voc 1 \r\nJoey	: voc 2 \r\nPitak	: gitar 1 \r\nKuclok	: gitar 2 \r\nJawex	: drums \r\nAlphan	: bass \r\nSabrina	: keyboard \r\n \r\nSeiring berjalannya waktu, Boy pun akhirnya menyelesaikan kuliahnya dan memutuskan untuk kembali ke Jakarta, dan Weekend 69 pun mengalami masa-masa kritis karena kehilangan Boy. Walaupun berganti-ganti personil, tapi Weekend 69 bisa tetap bertahan sampai sekarang dan bisa tetap membawakan musik yg selalu kami banggakan, SKA. \r\n \r\nPersonil Weekend 69 saat ini adalah : \r\nJoey	: vocal \r\nPoetra	: guitar \r\nAdeck	: bass \r\nDede	: drums \r\nDila	: keyboard \r\nHabibi	: trumpet \r\n \r\nJudul lagu : Love Story dan Vera. \r\n \r\nKeep Calm and Listen to SKA !', 1, '', 0, 51, '2012-10-24 06:34:06', '0000-00-00 00:00:00', 1),
