(903, 3285, 'Black District', 'BLACK DISTRICT initial formation of this band november 2006, in a middle town, Medan, North Sumatra - Indonesia. Because we want to fill the void to fill of activities. Had several times changed names, personnel, and genres of music, in 2006 until mid-2007 brought the genre of metalcore. Until finally in 2008 to change the genre we become POST-HARDCORE music.\r\n\r\nIn starting our first single titled \\"\r\nFight The World\\", then in one after another with his second single titled \\"Heart Distortion\\". We also took the initiative to create an \\"Intro\\" in order to initiate each of us perform. In each perform, we always present the appearance that the character of our band, the attraction on stage.\r\n\r\nOur presence in the indie music industry is expected to give a new color. Music like our music sort of minority. Nevertheless, we believe we can make this music into a music that can be accepted and enjoyed. ENJOY!', 1, 'small_617a69a6ceb29eece095ddbc2c2e0bf1.jpg', 0, 51, '2012-10-24 07:31:21', '0000-00-00 00:00:00', 1),
