(927, 8775, 'Wa.J.I.K', 'Band yang satu ini diusung oleh 4 cowok keren yang menamakan dirinya WA.J.I.K, nama WA.J.I.K sendiri diambil dari nama masing â€“ masing personil band yaitu Wanda (Guitar), Joel (Vokal), Ipang (Drum), Kamil (Bass). group ini memiliki filosofi dengan mengusung warna sendiri, dan mencetuskan musik dengan ide-ide baru.   \r\n   \r\nBand ini berdiri pada tanggal 14 February 2012, menurut penuturan Joel (vocalis) me   \r\nreka mendirikan band ini karena memang mereka suka dan mengerti dengan apa yang mereka mainkan. Mereka sendiri punya rencana membuat album rekaman dan meramaikan pentas musik Indonesia.   \r\n   \r\nGendre WA.J.I.K yaitu Blues, Rock n Roll, dan Psychedelic rock.   \r\nInfluens Band ini rata â€“ rata adalah band â€“ band yang lumayan tua seperti, aerosmith, GNR, Rolling stone, Dan tentunya masih banyak lagi.', 1, '', 0, 120, '2012-11-04 20:25:46', '0000-00-00 00:00:00', 1),
