(932, 8856, 'Resto BR', 'Band ini terbentuk dari hoby kami bertiga yang di bilang masih tetanggaan,yaitu Fitra (guitar,Vocal),Baron (Bass,backing vocal),Reza (Drumer)\r\nband kami berkiblat pada band THE S.I.G.I.T,The White Stripes atau Jet\r\nAwal mula nya band ini adalah Band Punk seperti Superman Is Dead yang Bernama O\\''Punk yang lahir kurang lebih tahun 2009', 1, '', 0, 51, '2012-12-05 05:01:23', '0000-00-00 00:00:00', 1),
(933, 8857, 'A Gift From Anita', '1st Music Video http://bit.ly/AGFA1stMV  | DL : http://bit.ly/AGFA1stSong', 1, '', 0, 148, '2012-12-05 07:50:07', '0000-00-00 00:00:00', 1),
(934, 8863, 'SUNDAY MOURNING', 'Band ini sebenarnya terbentuk di Perth, Australia dimana sang vokalis dan gitaris band ini bertemu. Awal-awalnya iseng, dan akhirnya diniatin. Semoga enjoy aja deh sama musik kita', 1, '', 0, 184, '2012-12-06 10:17:38', '0000-00-00 00:00:00', 1),
(935, 8864, 'BRIGHT PARK', 'Our music is greatly influenced by loads of Asian and European DJs and Producers. We want to create a sound that are relaxing, yet upbeat and you can dance to. We are experimeting with loads of other elements of sounds. Hopefully we got it right ;)', 1, '', 0, 184, '2012-12-06 10:37:29', '0000-00-00 00:00:00', 1),
(936, 8865, 'LITTLE RASCALS', 'Berkarya dan bikin musik enak. itu tujuan kita!', 1, '', 0, 184, '2012-12-06 10:50:52', '0000-00-00 00:00:00', 1),
(937, 8505, 'Stairway To Zinna', 'Stairway to Zinna. Jalan menuju apapun.\r\nYang anda inginkan dan yang tidak anda inginkan.\r\n\r\nYa, kami musisi. Bertemu 3 tahun lalu,\r\nlantas setelah bertemu perasaan tak akan kembali menjadi sama.\r\nSeperti ada sesuatu. Ada innerdrive.\r\nAda suara, entah dari mana asalnya bilang â€œbuat apa diam?â€œ\r\nYa sudah, main musik sajalah.\r\nCarpe Diem.\r\n\r\nApa salahnya O menjadi A, I menjadi segitiga,\r\ndan apa salahnya menjadi salah?\r\nJangan Terlalu Seriuslah...\r\n\r\nJenaka lebih baik ketimbang melankoli,\r\njelek lebih baik ketimbang tidak mencoba,\r\ndan anak-anak selalu lebih baik dari orang dewasa.\r\nOleh sebab itulah kami bermusik dengan bahagia....\r\nKami anak-anak yang terjebak dalam rumah 1001 kaca.\r\nNatural, spontan, adventurous.', 1, '', 0, 184, '2012-12-07 09:05:59', '0000-00-00 00:00:00', 1),
(938, 8871, 'WOLES', 'pokoknya woles bor sm musik kami', 1, '', 0, 184, '2012-12-07 09:24:03', '0000-00-00 00:00:00', 1),
(939, 8872, 'Happy Hour', 'berdiri di tahun 2010', 1, 'small_e78e273ba38703a516c44c4813cd393e.jpg', 0, 120, '2012-12-07 09:37:50', '0000-00-00 00:00:00', 1),
(940, 8873, 'WIZZOW', 'Mungkin memang sudah jarang warna musik kami di antara anak-anak muda sekarang yang ramai dengan post-rock dan folk nya. Namun kesukaan kami dengan musik acid jazz memang jelas mengalahkan jalannya pergerakan musik indie Indonesia. Sejati dengan jiwa, musik kami memberikan karya acid jazz dan mengenalkannya lagi kepada anak-anak muda, khususnya agar industri musik ini senantiasa berwarna.', 1, '', 0, 184, '2012-12-07 09:41:11', '0000-00-00 00:00:00', 1),
(941, 8874, 'Welcome To September', 'easycore band from PALEMBANG-South Sumatera & our squad is, @aditiaguntur @yaseramadhan @aidilsyn @donnytrie @RyoAlvarez \r\n\r\nPalembang, Southern Sumatera! Â· http://www.myspace.com/welcometoseptember ', 1, 'small_aad16abb0c453b5a886c00c121f54ad1.jpg', 0, 120, '2012-12-07 09:45:11', '0000-00-00 00:00:00', 1),
(942, 8868, 'Arthyra', 'Kami band Deathcore asal Medan terbentuk tahun 2012. Mohon supportnya semua :)', 1, '', 0, 51, '2012-12-08 18:03:38', '0000-00-00 00:00:00', 1),
(943, 4515, 'KNOCKDOWN', 'HARDCORE BAND FROM JOGJA', 1, '', 0, 265, '2012-12-10 10:17:54', '0000-00-00 00:00:00', 1),
(944, 8888, 'Lorient cheri', 'Seperti Indonesia, Seperti Anginnya, penggalan yang kompleks dan bisa diinterpretasikan semacam itu. Lorient cheri, sekumpulan anak muda asal Bandung yang terbentuk sekitar tahun 2004, Adi Firmansyah (gitar), Baginda Syah Ali (Drum), Gempita Adrian (Vokal), Sani Subangkit (Bass) masih duduk di bangku Sekolah Menengah Pertama. Setuju dengan mengusung Alternative rock, Beberapa nomor lagu tercipta di masa itu, hanya hitungan jari gigs yang kami rasakan. Sempat merilis demo live di tahun 2007 dengan bekal sound seadanya dan disebarkan secara gratis pada teman-teman terdekatnya. Bonus track berupa lagu cover dari Nicka Costa (Tomorrow), Demo live terakhir yang kami buat, setelah itu vakum kurang lebih 5 Tahun.  \r\n               Sempat melakukan aktifitas kembali pada tahun 2011, merilis sebuah single The Day, Pure & Fine. Disela kesibukan masing-masing dengan bandnya, Adi bersama Dâ€™sona, Baginda bersama Mago Friends, Gempita bersama Suicide maya & Jims Adrian-nya, dan sani bersama band metalnya Starring at the skyline. Diakhir tahun 2012 kami kembali bergabung masih dengan formasi awal, beberapa ide baru terlahir, revisi musik dan lirik, hingga sempat ingin merubah nama. Pada musik kami merevisi secara kontemporer, beberapa macam jenis musik kami selipkan dan digabungkan dengan lirik yang implisit entah menarasikan tentang habitual, nature, dan daily condition. Beberapa gigs mulai kami kunjungi, dan siap untuk memasuki sesi merekam sebuah karya yang akan dikemas secara apik.  \r\n', 1, 'small_f9120877d5b57e33a86ca1e668c7332b.jpg', 0, 174, '2012-12-11 18:53:14', '0000-00-00 00:00:00', 1),
(945, 8889, 'Komandan', 'support your local band!', 1, 'small_4f10b791755fd9dafaf07396ded13e54.jpg', 0, 120, '2012-12-12 07:00:21', '0000-00-00 00:00:00', 1),
(946, 3388, 'Bello', 'Beranggotakan 4 personil inti yang terdiri dari Firmansyah Octaviano (Vokal), Insya Astoni (Gitar), Bismi Ariffadillah (Gitar), dan Wisman Agustian (Drum). Band ini mengusung nama yang berasal dari bahasa Italia, Bello yang berarti \\"cantik\\", dimana harapan agar karya-karya band ini dapat dicerna oleh setiap kalangan yang berdasarkan kualitas yang tidak hanya baik tapi juga cantik.', 1, '', 0, 120, '2012-12-12 09:38:59', '0000-00-00 00:00:00', 1),
(947, 3312, 'eplengs', 'okeh', 1, '', 0, 186, '2012-12-20 05:59:54', '0000-00-00 00:00:00', 1),
